(509, 2, 'BIOMD001 Edelstein1996 - EPSP ACh event', '<div class=\"dc:title\">Edelstein1996 - EPSP ACh event</div>\n        \n          <p>Model of a nicotinic Excitatory Post-Synaptic Potential in a\n  Torpedo electric organ. Acetylcholine is not represented\n  explicitely, but by an event that changes the constants of\n  transition from unliganded to liganded.\n  <br/></p>\n        </div>\n        <div class=\"dc:provenance\">\n          <p>This model has initially been encoded using StochSim.</p>\n        </div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/8983160\" title=\"Access to this publication\">A kinetic mechanism for\n    nicotinic acetylcholine receptors based on multiple allosteric\n    transitions.</a>\n          </div>\n          <div class=\"bibo:authorList\">Edelstein SJ, Schaad O, Henry E,\n  Bertrand D, Changeux JP.</div>\n          <div class=\"bibo:Journal\">Biol Cybern 1996 Nov; 75(5):\n  361-379</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>Nicotinic acetylcholine receptors are transmembrane\n    oligomeric proteins that mediate interconversions between open\n    and closed channel states under the control of\n    neurotransmitters. Fast in vitro chemical kinetics and in vivo\n    electrophysiological recordings are consistent with the\n    following multi-step scheme. Upon binding of agonists, receptor\n    molecules in the closed but activatable resting state (the\n    Basal state, B) undergo rapid transitions to states of higher\n    affinities with either open channels (the Active state, A) or\n    closed channels (the initial Inactivatable and fully\n    Desensitized states, I and D). In order to represent the\n    functional properties of such receptors, we have developed a\n    kinetic model that links conformational interconversion rates\n    to agonist binding and extends the general principles of the\n    Monod-Wyman-Changeux model of allosteric transitions. The\n    crucial assumption is that the linkage is controlled by the\n    position of the interconversion transition states on a\n    hypothetical linear reaction coordinate. Application of the\n    model to the peripheral nicotine acetylcholine receptor (nAChR)\n    accounts for the main properties of ligand-gating, including\n    single-channel events, and several new relationships are\n    predicted. Kinetic simulations reveal errors inherent in using\n    the dose-response analysis, but justify its application under\n    defined conditions. The model predicts that (in order to\n    overcome the intrinsic stability of the B state and to produce\n    the appropriate cooperativity) channel activation is driven by\n    an A state with a Kd in the 50 nM range, hence some 140-fold\n    stronger than the apparent affinity of the open state deduced\n    previously. According to the model, recovery from the\n    desensitized states may occur via rapid transit through the A\n    state with minimal channel opening, thus without necessarily\n    undergoing a distinct recovery pathway, as assumed in the\n    standard \'cycle\' model. Transitions to the desensitized states\n    by low concentration \'pre-pulses\' are predicted to occur\n    without significant channel opening, but equilibrium values of\n    IC50 can be obtained only with long pre-pulse times.\n    Predictions are also made concerning allosteric effectors and\n    their possible role in coincidence detection. In terms of\n    future developments, the analysis presented here provides a\n    physical basis for constructing more biologically realistic\n    models of synaptic modulation that may be applied to artificial\n    neural networks.</p>\n          </div>\n        </div>\n        <div class=\"dc:publisher\">\n          <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000001\">BIOMD0000000001</a>.</p>\n          <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n        </div>\n        <div class=\"dc:license\">\n          <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n        </div>', 0, '2020-02-02'),
(510, 2, 'BIOMD002 Edelstein1996 - EPSP ACh species', '<div class=\"dc:title\">Edelstein1996 - EPSP ACh species</div>\n            \n                </div>\n            <div class=\"dc:provenance\">      <p>This model has initially been encoded using StochSim.</p>\n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/8983160\" title=\"Access to this publication\">A kinetic mechanism for nicotinic acetylcholine receptors based on multiple allosteric transitions.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Edelstein SJ, Schaad O, Henry E, Bertrand D, Changeux JP.</div>\n                <div class=\"bibo:Journal\">Biol. Cybern. 1996 Nov; 75(5):361-79</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>Nicotinic acetylcholine receptors are transmembrane oligomeric proteins that mediate interconversions between open and closed channel states under the control of neurotransmitters. Fast in vitro chemical kinetics and in vivo electrophysiological recordings are consistent with the following multi-step scheme. Upon binding of agonists, receptor molecules in the closed but activatable resting state (the Basal state, B) undergo rapid transitions to states of higher affinities with either open channels (the Active state, A) or closed channels (the initial Inactivatable and fully Desensitized states, I and D). In order to represent the functional properties of such receptors, we have developed a kinetic model that links conformational interconversion rates to agonist binding and extends the general principles of the Monod-Wyman-Changeux model of allosteric transitions. The crucial assumption is that the linkage is controlled by the position of the interconversion transition states on a hypothetical linear reaction coordinate. Application of the model to the peripheral nicotine acetylcholine receptor (nAChR) accounts for the main properties of ligand-gating, including single-channel events, and several new relationships are predicted. Kinetic simulations reveal errors inherent in using the dose-response analysis, but justify its application under defined conditions. The model predicts that (in order to overcome the intrinsic stability of the B state and to produce the appropriate cooperativity) channel activation is driven by an A state with a Kd in the 50 nM range, hence some 140-fold stronger than the apparent affinity of the open state deduced previously. According to the model, recovery from the desensitized states may occur via rapid transit through the A state with minimal channel opening, thus without necessarily undergoing a distinct recovery pathway, as assumed in the standard \'cycle\' model. Transitions to the desensitized states by low concentration \'pre-pulses\' are predicted to occur without significant \nchannel opening, but equilibrium values of IC50 can be obtained only with long pre-pulse times. Predictions are also made concerning allosteric effectors and their possible role in coincidence detection. In terms of future developments, the analysis presented here provides a physical basis for constructing more biologically realistic models of synaptic modulation that may be applied to artificial neural networks.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000002\">BIOMD0000000002</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(511, 2, 'BIOMD003 Goldbeter1991 - Min Mit Oscil', '<div class=\"dc:title\">Goldbeter1991 - Min Mit Oscil</div>\n        \n          <p>Minimal cascade model for the mitotic oscillator involving cyclin and cdc2 kinase.</p>\n        </div>\n        <div class=\"dc:provenance\">\n          <p>This model has been generated by MathSBML 2.4.6 (14-January-2005) 14-January-2005 18:33:39.806932.</p>\n        </div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/1833774\" title=\"Access to this publication\">A minimal cascade model for the mitotic oscillator involving cyclin and cdc2 kinase.</a>\n          </div>\n          <div class=\"bibo:authorList\">Goldbeter A.</div>\n          <div class=\"bibo:Journal\">Proc. Natl. Acad. Sci. U.S.A. 1991; 88(20):9107-11</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>A minimal model for the mitotic oscillator is presented. The model, built on recent experimental advances, is based on the cascade of post-translational modification that modulates the activity of cdc2 kinase during the cell cycle. The model pertains to the situation encountered in early amphibian embryos, where the accumulation of cyclin suffices to trigger the onset of mitosis. In the first cycle of the bicyclic cascade model, cyclin promotes the activation of cdc2 kinase through reversible dephosphorylation, and in the second cycle, cdc2 kinase activates a cyclin protease by reversible phosphorylation. That cyclin activates cdc2 kinase while the kinase triggers the degradation of cyclin has suggested that oscillations may originate from such a negative feedback loop [Flix, M. A., Labb, J. C., Dore, M., Hunt, T. &amp; Karsenti, E. (1990) Nature (London) 346, 379-382]. This conjecture is corroborated by the model, which indicates that sustained oscillations of the limit cycle type can arise in the cascade, provided that a threshold exists in the activation of cdc2 kinase by cyclin and in the activation of cyclin proteolysis by cdc2 kinase. The analysis shows how miototic oscillations may readily arise from time lags associated with these thresholds and from the delayed negative feedback provided by cdc2-induced cyclin degradation. A mechanism for the origin of the thresholds is proposed in terms of the phenomenon of zero-order ultrasensitivity previously described for biochemical systems regulated by covalent modification.</p>\n          </div>\n        </div>\n        <div class=\"dc:publisher\">\n          <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000003\">BIOMD0000000003</a>\n            .        </p>\n          <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n        </div>\n        <div class=\"dc:license\">\n          <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n        </div>', 0, '2020-02-02'),
(512, 2, 'BIOMD004 Goldbeter1991 - Min Mit Oscil, Expl Inact', '<div class=\"dc:title\">Goldbeter1991 - Min Mit Oscil, Expl Inact</div>\n            \n                </div>\n            <div class=\"dc:provenance\">      <p>This model has been generated by MathSBML 2.4.6 (14-January-2005) 14-January-2005 18:37:35.503857.</p>\n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/1833774\" title=\"Access to this publication\">A minimal cascade model for the mitotic oscillator involving cyclin and cdc2 kinase.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Goldbeter A.</div>\n                <div class=\"bibo:Journal\">Proc. Natl. Acad. Sci. USA 1991 Oct; 88(20):9107-11</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>A minimal model for the mitotic oscillator is presented. The model, built on recent experimental advances, is based on the cascade of post-translational modification that modulates the activity of cdc2 kinase during the cell cycle. The model pertains to the situation encountered in early amphibian embryos, where the accumulation of cyclin suffices to trigger the onset of mitosis. In the first cycle ofthe bicyclic cascade model, cyclin promotes the activation of cdc2 kinase through reversible dephosphorylation, and in the second cycle, cdc2 kinase activates a cyclin protease by reversible phosphorylation. That cyclin activates cdc2 kinase while the kinase triggers the degradation of cyclin has suggested that oscillations may originate from such a negative feedback loop [Flix, M. A., Labb, J. C., Dore, M., Hunt, T. &amp; Karsenti, E. (1990) Nature (London) 346, 379-382]. Thisconjecture is corroborated by the model, which indicates that sustained oscillations of the limit cycle type can arise in the cascade, provided that a threshold exists in the activation of cdc2 kinase by cyclin and in the activation of cyclinproteolysis by cdc2 kinase. The analysis shows how miototic oscillations may readily arise from time lags associated with these thresholds and from the delayed negative feedback provided by cdc2-induced cyclin degradation. A mechanism for theorigin of the thresholds is proposed in terms of the phenomenon of zero-order ultrasensitivity previously described for biochemical systems regulated by covalent modification.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000004\">BIOMD0000000004</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(513, 2, 'BIOMD005 Tyson1991 - Cell Cycle 6 var', '<div class=\"dc:title\">Tyson1991 - Cell Cycle 6 var</div>\n        \n          <p>Mathematical model of the interactions of cdc2 and cyclin.</p>\n        </div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/1831270\" title=\"Access to this publication\">Modeling the cell division cycle: cdc2 and cyclin interactions.</a>\n          </div>\n          <div class=\"bibo:authorList\">Tyson JJ.</div>\n          <div class=\"bibo:Journal\">Proc. Natl. Acad. Sci. U.S.A. 1991; 88(16); 7328-32</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>The proteins cdc2 and cyclin form a heterodimer (maturation promoting factor) that controls the major events of the cell cycle. A mathematical model for the interactions of cdc2 and cyclin is constructed. Simulation and analysis of the model show that the control system can operate in three modes: as a steady state with high maturation promoting factor activity, as a spontaneous oscillator, or as an excitable switch. We associate the steady state with metaphase arrest in unfertilized eggs, the spontaneous oscillations with rapid division cycles in early embryos, and the excitable switch with growth-controlled division cycles typical of nonembryonic cells.</p>\n          </div>\n        </div>\n        <div class=\"dc:publisher\">\n          <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000005\">BIOMD0000000005</a>\n            .        </p>\n          <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n        </div>\n        <div class=\"dc:license\">\n          <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n        </div>', 0, '2020-02-02'),
(514, 2, 'BIOMD006 Tyson1991 - Cell Cycle 2 var', '<div class=\"dc:title\">Tyson1991 - Cell Cycle 2 var</div>\n        \n          <p>Mathematical model of the interactions of cdc2 and cyclin.</p>\n        </div>\n        <div class=\"dc:provenance\">\n          \n            at        <a href=\"http://www.cellerator.org/\" title=\"xCellerator: A Mathematica package for biological modeling\">http://www.cellerator.org</a>\n            ).        </p>\n        </div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/1831270\" title=\"Access to this publication\">Modeling the cell division cycle: cdc2 and cyclin interactions.</a>\n          </div>\n          <div class=\"bibo:authorList\">Tyson JJ.</div>\n          <div class=\"bibo:Journal\">Proc. Natl. Acad. Sci. U.S.A. 1991; 88(16); 7328-32</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>The proteins cdc2 and cyclin form a heterodimer (maturation promoting factor) that controls the major events of the cell cycle. A mathematical model for the interactions of cdc2 and cyclin is constructed. Simulation and analysis of the model show that the control system can operate in three modes: as a steady state with high maturation promoting factor activity, as a spontaneous oscillator, or as an excitable switch. We associate the steady state with metaphase arrest in unfertilized eggs, the spontaneous oscillations with rapid division cycles in early embryos, and the excitable switch with growth-controlled division cycles typical of nonembryonic cells.</p>\n          </div>\n        </div>\n        <div class=\"bm:modification\">\n          <p>This is a two variable reduction of the larger 6-variable model published in the same paper. The equations are:</p>\n          <p>u\'= k4(v-u)(alpha+u^2)-k6*u        <br/>\n            v\'=kappa-k6*u        <br/>\n            z= v-u        <br/>\n            with kappa = k1[aa]/[CT]        </p>\n          <p>In the present implementation, an additional variable z is introduced with z = v-u is made, so that the different variables be interpreted as follows:</p>\n          <p>u=[activeMPF]/[CT]        <br/>\n            v=([cyclin]+[preMPF]+[activeMPF])/[CT]        <br/>\n            z=([ cyclin]+[preMPF])/[CT]        <br/>\n            with [CT]=[CDC2]+{CDC2P]+[preMPF]+[aMPF].        </p>\n          <p>The reactions included are only to show the flows between z and u, and do not influence the species, as they all are set to        <em>boundaryCondition=True</em>\n            , meaning, that they are only determined by the rate rules (explicit differential equations) and assignment rules.        </p>\n          <p>If you set        <em>boundaryCondition=False</em>\n            and remove the rate rules for v, u and the the assignment rule for z, you get the more symmetrical, but equivalent, version from the Cellerator repository:        </p>\n          <p>u\'= k4*z*(alpha+u^2)-k6*u        <br/>\n            z\'=kappa-z*(alpha+u^2)        </p>\n        </div>\n        <div class=\"dc:publisher\">\n          <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000006\">BIOMD0000000006</a>\n            .        </p>\n          <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n        </div>\n        <div class=\"dc:license\">\n          <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n        </div>', 0, '2020-02-02'),
(515, 2, 'BIOMD007 Novak1997 - Cell Cycle', '<div class=\"dc:title\">Novak1997 - Cell Cycle</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/9256450\" title=\"Access to this publication\">Modeling the control of DNA replication in fission yeast.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Novak B., Tyson JJ.</div>\n                <div class=\"bibo:Journal\">Proc. Natl. Acad. Sci. U.S.A. 1997:94(17):9147-52</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>A central event in the eukaryotic cell cycle is the decision to commence DNA replication (S phase). Strict controls normally operate to prevent repeated rounds of DNA replication without intervening mitoses (\"endoreplication\") or initiation of mitosis before DNA is fully replicated (\"mitotic catastrophe\"). Some of the genetic interactions involved in these controls have recently been identified in yeast. From this evidence we propose a molecular mechanism of \"Start\" control in Schizosaccharomyces pombe. Using established principles of biochemical kinetics, we compare the properties of this model in detail with the observed behavior of various mutant strains of fission yeast: wee1(-) (size control at Start), cdc13Delta and rum1(OP) (endoreplication), and wee1(-) rum1Delta (rapid division cycles of diminishing cell size). We discuss essential features of the mechanism that are responsible for characteristic properties of Start control in fission yeast, to expose our proposal to crucial experimental tests.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000007\">BIOMD0000000007</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(516, 2, 'BIOMD008 Gardner1998 - Cell Cycle Goldbeter', '<div class=\"dc:title\">Gardner1998 - Cell Cycle Goldbeter</div>\n        \n          <p>Mathematical modeling of cell division cycle (CDC)\n  dynamics.</p>\n        </div>\n        <div class=\"dc:provenance\">\n          <p>The SBML file has been generated by MathSBML 2.6.0.p960929\n  (Prerelease Version of 29-Sept-2006) 1-October-2006\n  15:36:36.076517.</p>\n        </div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/9826676\" title=\"Access to this publication\">A theory for controlling\n    cell cycle dynamics using a reversibly binding inhibitor.</a>\n          </div>\n          <div class=\"bibo:authorList\">Gardner TS, Dolnik M, Collins\n  JJ.</div>\n          <div class=\"bibo:Journal\">Proc. Natl. Acad. Sci. U.S.A. 1998 Nov;\n  95(24): 14190-14195</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>We demonstrate, by using mathematical modeling of cell\n    division cycle (CDC) dynamics, a potential mechanism for\n    precisely controlling the frequency of cell division and\n    regulating the size of a dividing cell. Control of the cell\n    cycle is achieved by artificially expressing a protein that\n    reversibly binds and inactivates any one of the CDC proteins.\n    In the simplest case, such as the checkpoint-free situation\n    encountered in early amphibian embryos, the frequency of CDC\n    oscillations can be increased or decreased by regulating the\n    rate of synthesis, the binding rate, or the equilibrium\n    constant of the binding protein. In a more complex model of\n    cell division, where size-control checkpoints are included, we\n    show that the same reversible binding reaction can alter the\n    mean cell mass in a continuously dividing cell. Because this\n    control scheme is general and requires only the expression of a\n    single protein, it provides a practical means for tuning the\n    characteristics of the cell cycle in vivo.</p>\n          </div>\n        </div>\n        <div class=\"dc:publisher\">\n          <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000008\">BIOMD0000000008</a>.</p>\n          <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n        </div>\n        <div class=\"dc:license\">\n          <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n        </div>', 0, '2020-02-02'),
(517, 2, 'BIOMD009 Huang1996 - Ultrasensitivity in MAPK cascade', '<div class=\"dc:title\">Huang1996 - Ultrasensitivity in MAPK cascade</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/8816754\" title=\"Access to this publication\">Ultrasensitivity in the mitogen-activated protein kinase cascade.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Huang CY, Ferrell JE Jr</div>\n                <div class=\"bibo:Journal\">Proc. Natl. Acad. Sci. U.S.A. 1996:93(19):10078-83</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>The mitogen-activated protein kinase (MAPK) cascade is a highly conserved series of three protein kinases implicated in diverse biological processes. Here we demonstrate that the cascade arrangement has unexpected consequences for the dynamics of MAPK signaling. We solved the rate equations for the cascade numerically and found that MAPK is predicted to behave like a highly cooperative enzyme, even though it was not assumed that any of the enzymes in the cascade were regulated cooperatively. Measurements of MAPK activation in Xenopus oocyte extracts confirmed this prediction. The stimulus/response curve of the MAPK was found to be as steep as that of a cooperative enzyme with a Hill coefficient of 4-5, well in excess of that of the classical allosteric protein hemoglobin. The shape of the MAPK stimulus/ response curve may make the cascade particularly appropriate for mediating processes like mitogenesis, cell fate induction, and oocyte maturation, where a cell switches from one discrete state to another.</p>\n                    </div>\n                </div>\n            <div class=\"bm:curation\">      <p>The species K_PP_norm, KKK_P_norm and KK_PP_norm are the relative concentrations of the active MAPK, MAPKK and MAPKKK, that is the double, or single resp. phophorylated forms divided by the total concentrations of each kinase. For MAPK additionally the also active MAPK divided by the maximal concentration of active MAPK is given by rel_K_PP_max. The parameter K_PP_norm_max, the maximal ratio of active MapK, has to be calculated for each change of parameters.</p>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000009\">BIOMD0000000009</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(518, 2, 'BIOMD010 Kholodenko2000 - Ultrasensitivity and negative feedback bring oscillations in MAPK cascade', '<div class=\"dc:title\">Kholodenko2000 - Ultrasensitivity and negative feedback bring oscillations in MAPK cascade</div>\n        \n          <p>The combination of ultrasensitivity and negative feedback bring sustained oscillations in the mitogen-activated protein kinase cascades.</p>\n        </div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/10712587\" title=\"Access to this publication\">Negative feedback and ultrasensitivity can bring about oscillations in the mitogen-activated protein kinase cascades.</a>\n          </div>\n          <div class=\"bibo:authorList\">Kholodenko BN</div>\n          <div class=\"bibo:Journal\">Eur. J. Biochem. 2000; 267(6):1583-8</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>Functional organization of signal transduction into protein phosphorylation cascades, such as the mitogen-activated protein kinase (MAPK) cascades, greatly enhances the sensitivity of cellular targets to external stimuli. The sensitivity increases multiplicatively with the number of cascade levels, so that a tiny change in a stimulus results in a large change in the response, the phenomenon referred to as ultrasensitivity. In a variety of cell types, the MAPK cascades are imbedded in long feedback loops, positive or negative, depending on whether the terminal kinase stimulates or inhibits the activation of the initial level. Here we demonstrate that a negative feedback loop combined with intrinsic ultrasensitivity of the MAPK cascade can bring about sustained oscillations in MAPK phosphorylation. Based on recent kinetic data on the MAPK cascades, we predict that the period of oscillations can range from minutes to hours. The phosphorylation level can vary between the base level and almost 100% of the total protein. The oscillations of the phosphorylation cascades and slow protein diffusion in the cytoplasm can lead to intracellular waves of phospho-proteins.</p>\n          </div>\n        </div>\n        <div class=\"dc:publisher\">\n          <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000010\">BIOMD0000000010</a>\n            .        </p>\n          <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n        </div>\n        <div class=\"dc:license\">\n          <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n        </div>', 0, '2020-02-02');
INSERT INTO `model` (`id`, `id_user`, `name`, `description`, `repositorytype`, `modified`) VALUES
(519, 2, 'BIOMD011 Levchenko2000_MAPK_noScaffold', '<h1>MAPK cascade in solution (no scaffold)</h1>\n            \n                        </tr>\n                    </thead>\n                <tbody>        <tr>          <td>This model describes a basic 3-\n							stage Mitogen Activated Protein Kinase (MAPK)\n							 cascade in solution. This cascade is typically expressed as RAF=\n							=>MEK==>MAPK (alternative forms are K3==>K2==>\n							K1 and KKK==>KK==>K)\n							. The input signal is RAFK (RAF Kinase)\n							 and the output signal is MAPKpp (\n							doubly phosphorylated form of MAPK)\n							.  RAFK phosphorylates RAF once to RAFp.  RAFp,\n							 the phosphorylated form of RAF induces two phoshporylations of MEK,\n							to MEKp and MEKpp. MEKpp,\n							 the doubly phosphorylated form of MEK,\n							 induces two phosphorylations of MAPK to MAPKp and MAPKpp.</td>\n                        </tr>\n                    </tbody>\n                </table>\n            <table border=\"0\" cellpadding=\"2\" cellspacing=\"0\">      <thead>        <tr>          <th align=\"left\" bgcolor=\"#eeeeee\" valign=\"middle\">Rateconstant</th>\n                        <th align=\"left\" bgcolor=\"#eeeeee\" valign=\"middle\">Reaction</th>\n                        </tr>\n                    </thead>\n                <tbody>        <tr>          <td>a10=5.</td>\n                        <td>MAPKPH+MAPKpp->MAPKppMAPKPH</td>\n                        </tr>\n                    <tr>          <td>a1=1.</td>\n                        <td>RAF+RAFK->RAFRAFK</td>\n                        </tr>\n                    <tr>          <td>a2=0.5</td>\n                        <td>RAFp+RAFPH->RAFpRAFPH</td>\n                        </tr>\n                    <tr>          <td>a3=3.3</td>\n                        <td>MEK+RAFp->MEKRAFp</td>\n                        </tr>\n                    <tr>          <td>a4=10.</td>\n                        <td>MEKp+MEKPH->MEKpMEKPH</td>\n                        </tr>\n                    <tr>          <td>a5=3.3</td>\n                        <td>MEKp+RAFp->MEKpRAFp</td>\n                        </tr>\n                    <tr>          <td>a6=10.</td>\n                        <td>MEKPH+MEKpp->MEKppMEKPH</td>\n                        </tr>\n                    <tr>          <td>a7=20.</td>\n                        <td>MAPK+MEKpp->MAPKMEKpp</td>\n                        </tr>\n                    <tr>          <td>a8=5.</td>\n                        <td>MAPKp+MAPKPH->MAPKpMAPKPH</td>\n                        </tr>\n                    <tr>          <td>a9=20.</td>\n                        <td>MAPKp+MEKpp->MAPKpMEKpp</td>\n                        </tr>\n                    <tr>          <td>d10=0.4</td>\n                        <td>MAPKppMAPKPH->MAPKPH+MAPKpp</td>\n                        </tr>\n                    <tr>          <td>d1=0.4</td>\n                        <td>RAFRAFK->RAF+RAFK</td>\n                        </tr>\n                    <tr>          <td>d2=0.5</td>\n                        <td>RAFpRAFPH->RAFp+RAFPH</td>\n                        </tr>\n                    <tr>          <td>d3=0.42</td>\n                        <td>MEKRAFp->MEK+RAFp</td>\n                        </tr>\n                    <tr>          <td>d4=0.8</td>\n                        <td>MEKpMEKPH->MEKp+MEKPH</td>\n                        </tr>\n                    <tr>          <td>d5=0.4</td>\n                        <td>MEKpRAFp->MEKp+RAFp</td>\n                        </tr>\n                    <tr>          <td>d6=0.8</td>\n                        <td>MEKppMEKPH->MEKPH+MEKpp</td>\n                        </tr>\n                    <tr>          <td>d7=0.6</td>\n                        <td>MAPKMEKpp->MAPK+MEKpp</td>\n                        </tr>\n                    <tr>          <td>d8=0.4</td>\n                        <td>MAPKpMAPKPH->MAPKp+MAPKPH</td>\n                        </tr>\n                    <tr>          <td>d9=0.6</td>\n                        <td>MAPKpMEKpp->MAPKp+MEKpp</td>\n                        </tr>\n                    <tr>          <td>k10=0.1</td>\n                        <td>MAPKppMAPKPH->MAPKp+MAPKPH</td>\n                        </tr>\n                    <tr>          <td>k1=0.1</td>\n                        <td>RAFRAFK->RAFK+RAFp</td>\n                        </tr>\n                    <tr>          <td>k2=0.1</td>\n                        <td>RAFpRAFPH->RAF+RAFPH</td>\n                        </tr>\n                    <tr>          <td>k3=0.1</td>\n                        <td>MEKRAFp->MEKp+RAFp</td>\n                        </tr>\n                    <tr>          <td>k4=0.1</td>\n                        <td>MEKpMEKPH->MEK+MEKPH</td>\n                        </tr>\n                    <tr>          <td>k5=0.1</td>\n                        <td>MEKpRAFp->MEKpp+RAFp</td>\n                        </tr>\n                    <tr>          <td>k6=0.1</td>\n                        <td>MEKppMEKPH->MEKp+MEKPH</td>\n                        </tr>\n                    <tr>          <td>k7=0.1</td>\n                        <td>MAPKMEKpp->MAPKp+MEKpp</td>\n                        </tr>\n                    <tr>          <td>k8=0.1</td>\n                        <td>MAPKpMAPKPH->MAPK+MAPKPH</td>\n                        </tr>\n                    <tr>          <td>k9=0.1</td>\n                        <td>MAPKpMEKpp->MAPKpp+MEKpp</td>\n                        </tr>\n                    </tbody>\n                </table>\n            <table border=\"0\" cellpadding=\"2\" cellspacing=\"0\">      <thead>        <tr>          <th align=\"left\" bgcolor=\"#eeeeee\" valign=\"middle\">Variable</th>\n                        <th align=\"left\" bgcolor=\"#eeeeee\" valign=\"middle\">IC</th>\n                        <th align=\"left\" bgcolor=\"#eeeeee\" valign=\"middle\">ODE</th>\n                        </tr>\n                    </thead>\n                <tbody>        <tr>          <td