                <tr>          <td>MEK</td>\n                        <td>0.2</td>\n                        <td>MEK\'[t]==k4*MEKpMEKPH[t]+d3*MEKRAFp[t]-\n							a3*MEK[t]*RAFp[t]</td>\n                        </tr>\n                    <tr>          <td>MEKp</td>\n                        <td>0</td>\n                        <td>MEKp\'[t]==-(a4*MEKp[t]*MEKPH[t])+d4*MEKpMEKPH[t]\n							+k6*MEKppMEKPH[t]+d5*MEKpRAFp[t]+k3*MEKRAFp[\n							t]-a5*MEKp[t]*RAFp[t]</td>\n                        </tr>\n                    <tr>          <td>MEKPH</td>\n                        <td>0.2</td>\n                        <td>MEKPH\'[t]==-(a4*MEKp[t]*MEKPH[t])+d4*MEKpMEKPH[t]\n							+k4*MEKpMEKPH[t]-a6*MEKPH[t]*MEKpp[t]+d6*\n							MEKppMEKPH[t]+k6*MEKppMEKPH[t]</td>\n                        </tr>\n                    <tr>          <td>MEKpMEKPH</td>\n                        <td>0</td>\n                        <td>MEKpMEKPH\'[t]==a4*MEKp[t]*MEKPH[t]-d4*MEKpMEKPH[t]\n							-k4*MEKpMEKPH[t]</td>\n                        </tr>\n                    <tr>          <td>MEKpp</td>\n                        <td>0</td>\n                        <td>MEKpp\'[t]==d7*MAPKMEKpp[t]+k7*MAPKMEKpp[t]+\n							d9*MAPKpMEKpp[t]+k9*MAPKpMEKpp[t]-a7*MAPK[t]*\n							MEKpp[t]-a9*MAPKp[t]*MEKpp[t]-a6*MEKPH[t]*MEKpp[t]\n							+d6*MEKppMEKPH[t]+k5*MEKpRAFp[t]</td>\n                        </tr>\n                    <tr>          <td>MEKppMEKPH</td>\n                        <td>0</td>\n                        <td>MEKppMEKPH\'[t]==a6*MEKPH[t]*MEKpp[t]-d6*MEKppMEKPH[\n							t]-k6*MEKppMEKPH[t]</td>\n                        </tr>\n                    <tr>          <td>MEKpRAFp</td>\n                        <td>0</td>\n                        <td>MEKpRAFp\'[t]==-(d5*MEKpRAFp[t])-k5*MEKpRAFp[t]\n							+a5*MEKp[t]*RAFp[t]</td>\n                        </tr>\n                    <tr>          <td>MEKRAFp</td>\n                        <td>0</td>\n                        <td>MEKRAFp\'[t]==-(d3*MEKRAFp[t])-k3*MEKRAFp[t]+\n							a3*MEK[t]*RAFp[t]</td>\n                        </tr>\n                    <tr>          <td>RAF</td>\n                        <td>0.4</td>\n                        <td>RAF\'[t]==-(a1*RAF[t]*RAFK[t])+k2*RAFpRAFPH[t]+\n							d1*RAFRAFK[t]</td>\n                        </tr>\n                    <tr>          <td>RAFK</td>\n                        <td>0.1</td>\n                        <td>RAFK\'[t]==-(a1*RAF[t]*RAFK[t])+d1*RAFRAFK[t]+\n							k1*RAFRAFK[t]</td>\n                        </tr>\n                    <tr>          <td>RAFp</td>\n                        <td>0</td>\n                        <td>RAFp\'[t]==d5*MEKpRAFp[t]+k5*MEKpRAFp[t]+\n							d3*MEKRAFp[t]+k3*MEKRAFp[t]-a3*MEK[t]*RAFp[t]\n							-a5*MEKp[t]*RAFp[t]-a2*RAFp[t]*RAFPH[t]+d2*\n							RAFpRAFPH[t]+k1*RAFRAFK[t]</td>\n                        </tr>\n                    <tr>          <td>RAFPH</td>\n                        <td>0.3</td>\n                        <td>RAFPH\'[t]==-(a2*RAFp[t]*RAFPH[t])+d2*RAFpRAFPH[t]\n							+k2*RAFpRAFPH[t]</td>\n                        </tr>\n                    <tr>          <td>RAFpRAFPH</td>\n                        <td>0</td>\n                        <td>RAFpRAFPH\'[t]==a2*RAFp[t]*RAFPH[t]-d2*RAFpRAFPH[t]\n							-k2*RAFpRAFPH[t]</td>\n                        </tr>\n                    <tr>          <td>RAFRAFK</td>\n                        <td>0</td>\n                        <td>RAFRAFK\'[t]==a1*RAF[t]*RAFK[t]-d1*RAFRAFK[t]-\n							k1*RAFRAFK[t]</td>\n                        </tr>\n                    </tbody>\n                </table>\n            <p>Generated by Cellerator Version 1.4.3 (6-March-2004) using Mathematica 5.0 \n				for Mac OS X (November 19, 2003), March 6, 2004 12:18:07, using (PowerMac,\n				PowerPC,Mac OS X,MacOSX,Darwin)</p>\n            <p>author=B.E.Shapiro</p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02');
INSERT INTO `model` (`id`, `id_user`, `name`, `description`, `repositorytype`, `modified`) VALUES
(520, 2, 'BIOMD014 Levchenko2000_MAPK_Scaffold', '<h1>MAPK cascade on a scaffold</h1>\n\n			<table border=\"0\" cellpadding=\"2\" cellspacing=\"0\">\n				<thead>\n					<tr>\n						<th align=\"left\" bgcolor=\"#eeeeee\" valign=\"middle\">Citation</th>\n					</tr>\n				</thead>\n				<tbody>\n					<tr>\n						<td>Levchenko, A., Bruck, J., Sternberg, P.W. (2000)\n							.Scaffold proteins may biphasically affect the levels of mitogen-activated protein kinase signaling and reduce its threshold properties. Proc. Natl. Acad. Sci. USA 97(11):5818-5823.\n						<a href=\"http://www.pnas.org/cgi/content/abstract/97/11/5818\">\n							http://www.pnas.org/cgi/content/abstract/97/11/5818\n						</a>\n</td>\n					</tr>\n				</tbody>\n			</table>\n			\n			<table border=\"0\" cellpadding=\"2\" cellspacing=\"0\">\n				<thead>\n					<tr>\n						\n					</tr>\n				</thead>\n				<tbody>\n					<tr>\n						<td>This model describes a basic 3-stage Mitogen Activated Protein Kinase (MAPK). Kinases in solution are written as  K[3,J], K[2,J], K[1,J] for MAPKKK, MAPKK, and MAPK, respectively, J indicates the phosphorylation level, J=0,1 for K3 and J=0,1,2 for K2 and K1. Scaffolds have three slots, for MAPK, MAPKK, and MAPKKK, respectively. Bound and free scaffold are denoted as S[i,j,k], where i, j, and k indicate the binding of K[1,i], K[2,j] and K[3,k] in their respective slots. Here i,j=-1,0,1,or,2 and k=-1,0,or,1. A value of -1 means the slot is empty, 0 means the unphorphorylated kinase is bound, 1 means the singly phosphorylated kinase is bound, and 2 means the doubly phosphorylated kinase is bound. Thus S[1,-1,2] is a scaffold with K[3,1] bound in the first slot and K[1,2] in the third slot, while the second slot is empty.Note: Indices X[I,J,K] are translated into the unindexed variable X_I_J_K and so forth in the SBML.  Negative indices are translated as mI, etc, thus S[1,-1,2] becomes S_1_m1_2.</td>\n					</tr>\n				</tbody>\n			</table>\n			\n			<table border=\"0\" cellpadding=\"2\" ce