1*S_RAFK[\n							1,1,0][t]</td>\n					</tr>\n					<tr>\n						<td>S_RAFK[1,2,0]</td>\n						<td>0</td>\n						<td>(S_RAFK[1,2,0])\'[t]==k1a*RAFK[t]*S[1,2,\n							0][t]-d1a*S_RAFK[1,2,0][t]-k1*S_RAFK[\n							1,2,0][t]</td>\n					</tr>\n					<tr>\n						<td>S_RAFK[2,-1,0]</td>\n						<td>0</td>\n						<td>(S_RAFK[2,-1,0])\'[t]==k1a*RAFK[t]*S[2,-1,\n							0][t]-d1a*S_RAFK[2,-1,0][t]-k1*S_RAFK[\n							2,-1,0][t]</td>\n					</tr>\n					<tr>\n						<td>S_RAFK[2,0,0]</td>\n						<td>0</td>\n						<td>(S_RAFK[2,0,0])\'[t]==k1a*RAFK[t]*S[2,0,\n							0][t]-d1a*S_RAFK[2,0,0][t]-k1*S_RAFK[\n							2,0,0][t]</td>\n					</tr>\n					<tr>\n						<td>S_RAFK[2,1,0]</td>\n						<td>0</td>\n						<td>(S_RAFK[2,1,0])\'[t]==k1a*RAFK[t]*S[2,1,\n							0][t]-d1a*S_RAFK[2,1,0][t]-k1*S_RAFK[\n							2,1,0][t]</td>\n					</tr>\n					<tr>\n						<td>S_RAFK[2,2,0]</td>\n						<td>0</td>\n						<td>(S_RAFK[2,2,0])\'[t]==k1a*RAFK[t]*S[2,2,\n							0][t]-d1a*S_RAFK[2,2,0][t]-k1*S_RAFK[\n							2,2,0][t]</td>\n					</tr>\n				</tbody>\n			</table>\n			<p>Generated by Cellerator Version 1.0 update 2.1203 using Mathematica 4.2 for \n				Mac OS X (June 4, 2002), December 4, 2002 15:06:10, using (PowerMac,PowerPC,Mac \n				OS X,MacOSX,Darwin)</p>\n			<p>author=B.E.Shapiro</p>', 0, '2020-02-02');
INSERT INTO `model` (`id`, `id_user`, `name`, `description`, `repositorytype`, `modified`) VALUES
(521, 2, 'BIOMD016 Goldbeter1995_CircClock', '<p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(522, 2, 'BIOMD017 Hoefnagel2002_PyruvateBranches', '<p>\n      This a model from the article:\n      <br/>\n        <strong> Metabolic engineering of lactic acid bacteria, the combined approach: kinetic modelling, metabolic control and experimental analysis.\n</strong>\n        <br/>\nHoefnagel MH,  Starrenburg MJ,  Martens DE,  Hugenholtz J,  Kleerebezem M,  Van Swam II,  Bongers R,  Westerhoff HV,  Snoep JL \n      <em>Microbiology</em>2002 Apr; 148(4):1003-13 \n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/11932446\">11932446</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nEveryone who has ever tried to radically change metabolic fluxes knows that it is often harder to determine which enzymes have to be modified than it is to actually implement these changes. In the more traditional genetic engineering approaches bottle-necks are pinpointed using qualitative, intuitive approaches, but the alleviation of suspected rate-limiting steps has not often been successful. Here the authors demonstrate that a model of pyruvate distribution in Lactococcus lactis based on enzyme kinetics in combination with metabolic control analysis clearly indicates the key control points in the flux to acetoin and diacetyl, important flavour compounds. The model presented here (available at http://jjj.biochem.sun.ac.za/wcfs.html) showed that the enzymes with the greatest effect on this flux resided outside the acetolactate synthase branch itself. Experiments confirmed the predictions of the model, i.e. knocking out lactate dehydrogenase and overexpressing NADH oxidase increased the flux through the acetolactate synthase branch from 0 to 75% of measured product formation rates.\n   </p>\n      <p> The paper does not have any figure to be put as a curation figure in the BioModels database. The model does reproduce the fluxes and control-coefficients given in Figure 2 and Table 4. To reproduce the results, the model was changed from the description in the article according to the model on JWS: the parameter Kmpyr was changed to 2.5 from 25. The equillibrium constant for PTA reaction (R4) was changed from 0.0281 to 0.0065. The Km for oxygen in the NOX reaction (R13) was changed from 0.01 to 0.2. Slight deviations between the values in the article and the model results may stem from different algorithms used for finding the steady state.   \n</p>\n      <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n  </p>', 0, '2020-02-02'),
(523, 2, 'BIOMD018 Morrison1989 - Folate Cycle', '<div class=\"dc:title\">Morrison1989 - Folate Cycle</div>\n        The model describes the folate cycle\nkinetics in breast cancer cells.</div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/2732237\" title=\"Access to this publication\">Folate cycle kinetics in\n    human breast cancer cells.</a>\n          </div>\n          <div class=\"bibo:authorList\">Morrison PF, Allegra CJ.</div>\n          <div class=\"bibo:Journal\">J. Biol. Chem. 1989 Jun; 264(18):\n  10552-10566</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>A mathematical description of polyglutamated folate kinetics\n    for human breast carcinoma cells (MCF-7) has been formulated\n    based upon experimental folate, methotrexate (MTX), purine, and\n    pyrimidine pool sizes as well as reaction rate parameters\n    obtained from intact MCF-7 cells and their enzyme isolates. The\n    schema accounts for the interconversion of highly\n    polyglutamated tetrahydrofolate, 5-methyl-FH4, 5-10-CH2FH4,\n    dihydrofolate (FH2), 10-formyl-FH4 (FFH4), and 10-formyl-FH2\n    (FFH2), as well as formation and transport of the MTX\n    polyglutamates. Inhibition mechanisms have been chosen to\n    reproduce all observed non-, un-, and pure competition\n    inhibition patterns. Steady state folate concentrations and\n    thymidylate and purine synthesis rates in drug-free intact\n    cells were used to determine normal folate Vmax values. The\n    resulting average-cell folate model, examined for its ability\n    to predict folate pool behavior following exposure to 1 microM\n    MTX over 21 h, agreed well with the experiment, including a\n    relative preservation of the FFH4 and CH2FH4 pools. The results\n    depend strongly on thymidylate synthase (TS) reaction\n    mechanism, especially the assumption that MTX di- and\n    triglutamates inhibit TS synthesis as greatly in the intact\n    cell as they do with purified enzyme. The effects of cell cycle\n    dependence of TS and dihydrofolate reductase activities were\n    also examined by introducing G- to S-phase activity ratios of\n    these enzymes into the model. For activity ratios down to at\n    least 5%, cell population averaged folate pools were only\n    slightly affected, while CH2FH4 pools in S-phase cells were\n    reduced to as little as 10% of control values. Significantly,\n    these folate pool dynamics were indicated to arise from both\n    direct inhibition by MTX polyglutamates as well as inhibition\n    by elevated levels of polyglutamated FH2 and FFH2.</p>\n          </div>\n        </div>\n        <div class=\"bm:modification\">\n          <p style=\"font-size: 12px;\">\n            <b>Note:</b> two flow BCs were converted into two downstream\n  concentration BCs, thus removing the GAR and dUMP state\n  variables. This dropped the number of ODEs from 21 to 19.</p>\n          </div>\n          <div class=\"dc:publisher\">\n            <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000018\">BIOMD0000000018</a>.</p>\n            <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n          </div>\n          <div class=\"dc:license\">\n            <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n          </div>', 0, '2020-02-02'),
(524, 2, 'BIOMD022 Ueda2001_CircClock', '<p>Bruce Shapiro: Generated by Cellerator Version 1.0 update 3.0303 using Mathematica 4.1 for Microsoft Windows (June 13, 2001), April 2, 2003 16:49:13, using (PC,x86, Microsoft Windows,WindowsNT,Windows)</p>\n            <p>Bruce Shapiro: Corrected 29 March 2005</p>\n            <p>Nicolas Le Novre: Added Dbt and Cyc species, and the corresponding reactions. 23 April 2005</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(525, 2, 'BIOMD023 Rohwer2001_Sucrose', '<p>\n          <a href=\"http://www.sbml.org/\" title=\"SBML\">SBML</a>\n          Level 2 code generated for the JWS Online project by Jacky Snoep using      <a href=\"http://pysces.sourceforge.net/\" title=\"PySCeS\">PySCeS</a>\n          .      </p>\n          <p>Run this model online at      <a href=\"http://jjj.biochem.sun.ac.za/\" title=\"JWS Online\">http://jjj.biochem.sun.ac.za</a>\n          .      </p>\n          <p>To cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004)      <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\" title=\"JWS Online publication (2004)\">Web-based modelling using JWS Online</a>\n          , Bioinformatics, 20:2143-2144.      </p>\n          <br/>\n          <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" title=\"BioModels Database terms of use\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          <br/>\n          To cite BioModels Database, please use      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" title=\"BioModels Database publication (2006)\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a></p>\n          <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n          <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>', 0, '2020-02-02'),
(526, 2, 'BIOMD027 Markevich2004 - MAPK double phosphorylation,  ordered Michaelis-Menton', '<div class=\"dc:title\">Markevich2004 - MAPK double phosphorylation,\nordered Michaelis-Menton</div>\nThe model corresponds to the schemas 1\nand 2 of Markevich et al 2004, as described in the figure 1 and\nmodelled using Michaelis-Menten like kinetics. Phosphorylations and\ndephosphorylations follow distributive ordered kinetics. It\nreproduces figure 3 of the main article.</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/14744999\" title=\"Access to this publication\">Signaling switches and\n    bistability arising from multisite phosphorylation in protein\n    kinase cascades.</a>\n  </div>\n  <div class=\"bibo:authorList\">Markevich NI, Hoek JB, Kholodenko\n  BN.</div>\n  <div class=\"bibo:Journal\">J. Cell Biol. 2004 Feb; 164(3):\n  353-359</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Mitogen-activated protein kinase (MAPK) cascades can operate\n    as bistable switches residing in either of two different stable\n    states. MAPK cascades are often embedded in positive feedback\n    loops, which are considered to be a prerequisite for bistable\n    behavior. Here we demonstrate that in the absence of any\n    imposed feedback regulation, bistability and hysteresis can\n    arise solely from a distributive kinetic mechanism of the\n    two-site MAPK phosphorylation and dephosphorylation.\n    Importantly, the reported kinetic properties of the kinase\n    (MEK) and phosphatase (MKP3) of extracellular signal-regulated\n    kinase (ERK) fulfill the essential requirements for generating\n    a bistable switch at a single MAPK cascade level. Likewise, a\n    cycle where multisite phosphorylations are performed by\n    different kinases, but dephosphorylation reactions are\n    catalyzed by the same phosphatase, can also exhibit bistability\n    and hysteresis. Hence, bistability induced by multisite\n    covalent modification may be a widespread mechanism of the\n    control of protein activity.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000027\">BIOMD0000000027</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(527, 2, 'BIOMD028 Markevich2004_MAPK_phosphoRandomElementary', '<p>The model corresponds to the schema 3 of Markevich et al 2004, as described in the figure 2 and the supplementary table S2. Phosphorylations follow distributive random kinetics, while dephosphorylations follow an ordered mechanism. The phosphorylations are modeled with three elementary reactions:      <br/>\n          E+S&lt;=>ES->E+P      <br/>\n          The dephosphorylations are modeled with five elementary reactions:      <br/>\n          E+S&lt;=>ES->EP&lt;=>E+P      <br/>\n          The model reproduces figure 5 in the main article.      </p>\n            <p>The model is further described in:      <br/>\n                <strong>Signaling switches and bistability arising from multisite phosphorylation in protein kinase cascades.</strong>\n          Markevich NI, Hoek JB, Kholodenko BN. J Cell Biol. 2004 Feb 2;164(3):353-9.      <br/>\n          PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/14744999\">14744999</a>\n          ; DOI:      <a href=\"http://dx.doi.org/10.1083/jcb.200308060\">10.1083/jcb.200308060</a>\n                <br/>\n          Abstract:      <br/>\n          Mitogen-activated protein kinase (MAPK) cascades can operate as bistable switches residing in either of two different stable states. MAPK cascades are often embedded in positive feedback loops, which are considered to be a prerequisite for bistable behavior. Here we demonstrate that in the absence of any imposed feedback regulation, bistability and hysteresis can arise solely from a distributive kinetic mechanism of the two-site MAPK phosphorylation and dephosphorylation. Importantly, the reported kinetic properties of the kinase (MEK) and phosphatase (MKP3) of extracellular signal-regulated kinase (ERK) fulfill the essential requirements for generating a bistable switch at a single MAPK cascade level. Likewise, a cycle where multisite phosphorylations are performed by different kinases, but dephosphorylation reactions are catalyzed by the same phosphatase, can also exhibit bistability and hysteresis. Hence, bistability induced by multisite covalent modification may be a widespread mechanism of the control of protein activity.      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(528, 2, 'BIOMD029 Markevich2004_MAPK_phosphoRandomMM', '<p xmlns=\"http://www.w3.org/1999/xhtml\">\n    The model corresponds to the schema 3 of Markevich et al 2004, as described in the figure 2 and the supplementary table S3, and modelled using Michaelis-Menten like kinetics. Phosphorylations follow distributive random kinetics, while dephosphorylations follow an ordered mechanism.</p>\n      <p xmlns=\"http://www.w3.org/1999/xhtml\">\n    This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2007 The BioModels Team.    <br/>\n        For more information see the    <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\">terms of use</a>\n        .    </p>', 0, '2020-02-02'),
(529, 2, 'BIOMD030 Markevich2004_MAPK_AllRandomElementary', '<p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n                </p>', 0, '2020-02-02'),
(530, 2, 'BIOMD031 Markevich2004_MAPK_orderedMM2kinases', '<p>The model describes the double phosphorylation of MAP kinase by an ordered mechanism using the Michaelis-Menten formalism. Two different enzymes, MAPKK1 and MAPKK2, successively phosphorylate the MAP kinase, but one and the same phosphatase dephosphorylates both sites.      <br/>\n          The model reproduces      <a href=\"http://jcb.rupress.org/content/suppl/2004/01/26/jcb.200308060.DC1/9.html\">figure S9</a>\n          in the supplemental material of the article.      </p>\n            <p>The model is further described in:      <br/>\n                <strong>Signaling switches and bistability arising from multisite phosphorylation in protein kinase cascades.</strong>\n          Markevich NI, Hoek JB, Kholodenko BN. J Cell Biol. 2004 Feb 2;164(3):353-9.      <br/>\n          PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/14744999\">14744999</a>\n          ; DOI:      <a href=\"http://dx.doi.org/10.1083/jcb.200308060\">10.1083/jcb.200308060</a>\n                <br/>\n          Abstract:      <br/>\n          Mitogen-activated protein kinase (MAPK) cascades can operate as bistable switches residing in either of two different stable states. MAPK cascades are often embedded in positive feedback loops, which are considered to be a prerequisite for bistable behavior. Here we demonstrate that in the absence of any imposed feedback regulation, bistability and hysteresis can arise solely from a distributive kinetic mechanism of the two-site MAPK phosphorylation and dephosphorylation. Importantly, the reported kinetic properties of the kinase (MEK) and phosphatase (MKP3) of extracellular signal-regulated kinase (ERK) fulfill the essential requirements for generating a bistable switch at a single MAPK cascade level. Likewise, a cycle where multisite phosphorylations are performed by different kinases, but dephosphorylation reactions are catalyzed by the same phosphatase, can also exhibit bistability and hysteresis. Hence, bistability induced by multisite covalent modification may be a widespread mechanism of the control of protein activity.      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(531, 2, 'BIOMD032 Kofahl2004_PheromonePathway', '<p>\n      This a model from the article:\n      <br/>\n        <strong> Modelling the dynamics of the yeast pheromone pathway.\n</strong>\n        <br/>\nKofahl B, Klipp E \n      <em>Yeast</em>[2004 Jul; Volume: 21 (Issue: 10 )] Page info: 831-50 \n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/15300679\">15300679</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nWe present a mathematical model of the dynamics of the pheromone pathways in haploid yeast cells of mating type MATa after stimulation with pheromone alpha-factor. The model consists of a set of differential equations and describes the dynamics of signal transduction from the receptor via several steps, including a G protein and a scaffold MAP kinase cascade, up to changes in the gene expression after pheromone stimulation in terms of biochemical changes (complex formations, phosphorylations, etc.). The parameters entering the models have been taken from the literature or adapted to observed time courses or behaviour. Using this model we can follow the time course of the various complex formation processes and of the phosphorylation states of the proteins involved. Furthermore, we can explain the phenotype of more than a dozen well-characterized mutants and also the graded response of yeast cells to varying concentrations of the stimulating pheromone. \n   </p>\n        <br/>\n        <p> The model was updated on 21<sup>st</sup> October 2010, by Vijayalakshmi Chelliah.\n<br/>The following changes were made: 1) The model has been converted to SBML l2v4.\n2) The model has been recurated and the curation figure was updated (units are in nanoMolar; but the publication has units in microMolar). Simulations were done using Copasi v4.6 (Build 32).\n3) Notes have been added.\n4) Annotation for one of the species has been corrected (Complex M). </p>\n        <br/>\n        <br/>\n        <p>\n          <font face=\"Arial, Helvetica, sans-serif\">\n            <b>\n              <a href=\"http://www.sbml.org/\">SBML</a> level 2 code generated for the JWS Online project by Jacky Snoep using \n          \n              \n              <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n              <br/>\nRun this model online at \n          \n              \n              <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n              <br/>\nTo cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004) \n          \n              \n              <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \nmodelling using JWS Online</a>, Bioinformatics, 20:2143-2144\n </b>\n            </font>\n          </p>\n          <p>\nThe following are the four major differences between the original publication by Kofahl et al and the model that actually is able to replicate the results as depicted in the publication (those corrections have been made in agreement with the authors):\n      \n          \n          <br/>\n1. Bar1 is the inactive protease present inside the cell but the publication wrongly mentions that Bar1 is also the protease that is present on the extracellular surface. \n      \n          \n          <br/> The model correctly names the protease in it\'s different forms by calling inactive Bar1 within the cell as Bar1, active Bar1 within the cell as Bar1a and extracellular Bar1 as Bar1aex\n      \n          \n          <br/>\n2. The initial amount of Alpha-factor is given as 1000nM but the model uses a value of 100nM.\n      \n          \n          <br/>\n3. The value of the paramenter k8 is given as  0.33 but the model uses a value of 0.033.\n      \n          \n          <br/>\n4. The value of the paramenter k41 is given as 0.002 but the model uses a value of 0.02.\n</p>\n          <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/).(http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n        </p>', 0, '2020-02-02'),
(532, 2, 'BIOMD033 Brown2004 - NGF and EGF signaling', '<div class=\"dc:title\">Brown2004 - NGF and EGF signaling</div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/16204838\" title=\"Access to this publication\">The statistical mechanics of\n    complex signaling networks: nerve growth factor signaling.</a>\n          </div>\n          <div class=\"bibo:authorList\">Brown KS, Hill CC, Calero GA, Myers\n  CR, Lee KH, Sethna JP, Cerione RA.</div>\n          <div class=\"bibo:Journal\">Phys Biol 2004 Dec; 1(3-4):\n  184-195</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>The inherent complexity of cellular signaling networks and\n    their importance to a wide range of cellular functions\n    necessitates the development of modeling methods that can be\n    applied toward making predictions and highlighting the\n    appropriate experiments to test our understanding of how these\n    systems are designed and function. We use methods of\n    statistical mechanics to extract useful predictions for complex\n    cellular signaling networks. A key difficulty with signaling\n    models is that, while significant effort is being made to\n    experimentally measure the rate constants for individual steps\n    in these networks, many of the parameters required to describe\n    their behavior remain unknown or at best represent estimates.\n    To establish the usefulness of our approach, we have applied\n    our methods toward modeling the nerve growth factor\n    (NGF)-induced differentiation of neuronal cells. In particular,\n    we study the actions of NGF and mitogenic epidermal growth\n    factor (EGF) in rat pheochromocytoma (PC12) cells. Through a\n    network of intermediate signaling proteins, each of these\n    growth factors stimulates extracellular regulated kinase (Erk)\n    phosphorylation with distinct dynamical profiles. Using our\n    modeling approach, we are able to predict the influence of\n    specific signaling modules in determining the integrated\n    cellular response to the two growth factors. Our methods also\n    raise some interesting insights into the design and possible\n    evolution of cellular systems, highlighting an inherent\n    property of these systems that we call \'sloppiness.\'</p>\n          </div>\n        </div>\n        <div class=\"bm:curation\">\n          <br/>The figures in the paper show results from computations\nperformed over an ensemble of all parameter sets that fit the\navailable data. This file contains only the best fit parameters.\nThe full ensemble of parameters is available at\nhttp://www.lassp.cornell.edu/sethna/GeneDynamics/PC12DataFiles/\n(Also, the best-fit parameter set produces a curve for DN Rap1 that\nis less \"peakish\" than the ensemble average.)\n<br/>\n          <br/>The conversion factors for EGF and NGF concentrations account\nfor their molecular weights and the density of cells in the culture\ndish. These concentrations are saturating, so the exact values are\nnot critical.\n<br/>\n          <br/>Because the Erk data fit to measure only fold changes in\nactivity, there is no absolute scale for the y-axes. Thus the\ncurves from this file have different magnitudes than those\npublished.\n<br/>\n          <br/>To reproduce the figures from the paper:\n<br/>2a) For EGF stimulation, set the initial concentration of EGF\nto 100 ng/ml * 100020 (molecule/cell)/(ng/ml) = 10002000.\n<br/>For NGF stimulation, set the initial concentration of NGF to\n50 ng/ml * 4560 (molecule/cell)/(ng/ml) = 456000\n<br/>5a) To simulate LY294002 addition, set kPI3KRas and kPI3K to\n0.\n<br/>5b) To simulate a dominant negative Rap1, set kRap1ToBRaf to\n0.\n<br/>To simulate a dominant negative Ras, set kRasToRaf1 and\nkPI3KRas to 0.\n<br/>\n          <br/>Almost all the data fit with this model by the authors are\nfrom Western blots. Given the uncertainties in antibody\neffectiveness and other factors, one can\'t a priori derive a\nconversion between the arbitrary units for a given set of data and\nmolecules per cell. So the authors used an adjustable \"scale\nfactor\" that converts between molecules per cell and Western blot\nunits.\n<br/>\n          <br/>For the EGF stimulation data in figure 2a) the scale factor\nconversion is 1.414e-05 (U/mg)/(molecule/cell). For the NGF\nstimulation data in figure 2a) it is 7.135e-06\n(U/mg)/(molecule/cell).\n<br/>\n          <br/></div>\n          <div class=\"dc:publisher\">\n            <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000033\">BIOMD0000000033</a>.</p>\n            <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n          </div>\n          <div class=\"dc:license\">\n            <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n          </div>', 0, '2020-02-02'),
