(536, 2, 'BIOMD039 Marhl2000_CaOscillations', '<p>In order to reproduce the model, the volume of all compartment is set to 1, and the stoichiometry of CaER and CaM has been set to 0.25, corresponding to betaER/rhoER and betaM/rhoM described in the paper.</p>\n        <br/>\n        <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n      <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n      <br/>\n      <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n  </p>', 0, '2020-02-02'),
(537, 2, 'BIOMD040 Field1974_Oregonator', '<h1>Field-Noyes Model of BZ Reaction</h1>\n            <table border=\"0\" cellpadding=\"2\" cellspacing=\"0\">      <thead>        <tr>          <th align=\"left\" bgcolor=\"#eeeeee\" valign=\"middle\">Citation</th>\n                        </tr>\n                    </thead>\n                <tbody>        <tr>          <td>R.J.Field and R.M.Noyes,J.Chem.Phys.60,1877 (1974)</td>\n                        </tr>\n                    </tbody>\n                </table>\n            \n                        </tr>\n                    </thead>\n                <tbody>        <tr>          <td>Field Noyes Version of Belousov-Zhabotinsky Reaction. BrO3 is held constant; HOBr is typically ignored,\n							 and can be replaced by an empty-set. The stoichiometry f is typically taken as 1/2 or 1.\n							.</td>\n                        </tr>\n                    </tbody>\n                </table>\n            <p>Initially Generated by Cellerator Version 1.0 update 2.1220 using Mathematica 4.2 for \n				Mac OS X (June 4, 2002), December 26, 2002 10:43:53, using (PowerMac,PowerPC,\n				Mac OS X,MacOSX,Darwin). author=B.E.Shapiro</p>\n            <p>Modified with SBMLeditor by Nicolas Le Novre, to fit the original article.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(538, 2, 'BIOMD041 Kongas2007 - Creatine Kinase in energy metabolic signaling in muscle', '<div class=\"dc:title\">Kongas2007 - Creatine Kinase in energy metabolic signaling in muscle</div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/doi/10.1038/npre.2007.1317.1\" title=\"Access to this publication\">Creatine kinase in energy metabolic signaling in muscle</a>\n                    </div>\n                <div class=\"bibo:authorList\">Olav Kongas and Johannes H. G. M. van Beek</div>\n                <div class=\"bibo:Journal\">Available from Nature Precedings</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>There has been much debate on the mechanism of regulation of mitochondrial ATP synthesis to balance ATP consumption during changing cardiac workloads. A key role of creatine kinase (CK) isoenzymes in this regulation of oxidative phosphorylation and in intracellular energy transport had been proposed, but has in the mean time been disputed for many years. It was hypothesized that high-energy phosphorylgroups are obligatorily transferred via CK; this is termed the phosphocreatine shuttle. The other important role ascribed to the CK system is its ability to buffer ADP concentration in cytosol near sites of ATP hydrolysis.</p>\n                    <p>Almost all of the experiments to determine the role of CK had been done in the steady state, but recently the dynamic response of oxidative phosphorylation to quick changes in cytosolic ATP hydrolysis has been assessed at various levels of inhibition of CK. Steady state models of CK function in energy transfer existed but were unable to explain the dynamic response with CK inhibited.</p>\n                    <p>The aim of this study was to explain the mode of functioning of the CK system in heart, and in particular the role of different CK isoenzymes in the dynamic response to workload steps. For this purpose we used a mathematical model of cardiac muscle cell energy metabolism containing the kinetics of the key processes of energy production, consumption and transfer pathways. The model underscores that CK plays indeed a dual role in the cardiac cells. The buffering role of CK system is due to the activity of myofibrillar CK (MMCK) while the energy transfer role depends on the activity of mitochondrial CK (MiCK). We propose that this may lead to the differences in regulation mechanisms and energy transfer modes in species with relatively low MiCK activity such as rabbit in comparison with species with high MiCK activity such as rat.</p>\n                    <p>The model needed modification to explain the new type of experimental data on the dynamic response of the mitochondria. We submit that building a Virtual Muscle Cell is not possible without continuous experimental tests to improve the model. In close interaction with experiments we are developing a model for muscle energy metabolism and transport mediated by the creatine kinase isoforms which now already can explain many different types of experiments.</p>\n                    </div>\n                </div>\n            <div class=\"bm:modification\">      <p>The model has been designed according to the spirit of the paper. The list of rate in the appendix has been corrected as follow:        <ol>          <li>d[ATP]/dt  = (-Vhyd  -Vmmck +Jatp) / Vcyt</li>\n                        <li>d[ADP]/dt  = ( Vhyd  +Vmmck +Jadp) / Vcyt</li>\n                        <li>d[PCr]/dt  = ( Vmmck +Jpcr       ) / Vcyt</li>\n                        <li>d[Cr]/dt   = (-Vmmck +Jpcr       ) / Vcyt</li>\n                        <li>d[Pi]/dt   = ( Vhyd  + Jpi       ) / Vcyt</li>\n                        <li>d[ATPi]/dt = (+Vsyn  -Vmick -Jatp) / Vims</li>\n                        <li>d[ADPi]/dt = (-Vsyn  +Vmick -Jadp) / Vims</li>\n                        <li>d[PCri]/dt = ( Vmick -Jpcr       ) / Vims</li>\n                        <li>d[Cri]/dt  = (-Vmick -Jpcr       ) / Vims</li>\n                        <li>d[Pii]/dt  = (-Vsyn  -Jpi        ) / Vims</li>\n                        </ol>\n                    <br/>\n                    </p>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://www.ebi.ac.uk/biomodels-main/BIOMD0000000041\">BIOMD0000000041</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(539, 2, 'BIOMD042 Nielsen1998_Glycolysis', '<p>This model was automatically converted from model BIOMD0000000042 by using      <a href=\"http://sbml.org/Software/libSBML\" target=\"_blank\">libSBML</a>\n          .      </p>\n      <p>According to the      <a href=\"http://www.ebi.ac.uk/biomodels//legal.html\">BioModels Database terms of use</a>\n          , this generated model is not related with model      <a href=\"http://www.ebi.ac.uk/biomodels/models-main/anno/BIOMD0000000042/BIOMD0000000042.xml\">BIOMD0000000042</a>\n          any more.      </p>', 0, '2020-02-02'),
(540, 2, 'BIOMD043 Borghans1997 - Calcium Oscillation - Model 1', '<div class=\"dc:title\">Borghans1997 - Calcium Oscillation - Model 1</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/17029867\" title=\"Access to this publication\">Complex intracellular calcium oscillations. A theoretical exploration of possible mechanisms.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Borghans JM, Dupont G, Goldbeter A.</div>\n                <div class=\"bibo:Journal\">Biophys. Chem. 1997 May; 66(1): 25-41</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>Intracellular Ca(2+) oscillations are commonly observed in a large number of cell types in response to stimulation by an extracellular agonist. In most cell types the mechanism of regular spiking is well understood and models based on Ca(2+)-induced Ca(2+) release (CICR) can account for many experimental observations. However, cells do not always exhibit simple Ca(2+) oscillations. In response to given agonists, some cells show more complex behaviour in the form of bursting, i.e. trains of Ca(2+) spikes separated by silent phases. Here we develop several theoretical models, based on physiologically plausible assumptions, that could account for complex intracellular Ca(2+) oscillations. The models are all based on one- or two-pool models based on CICR. We extend these models by (i) considering the inhibition of the Ca(2+)-release channel on a unique intracellular store at high cytosolic Ca(2+) concentrations, (ii) taking into account the Ca(2+)-activated degradation of inositol 1,4,5-trisphosphate (IP(3)), or (iii) considering explicity the evolution of the Ca(2+) concentration in two different pools, one sensitive and the other one insensitive to IP(3). Besides simple periodic oscillations, these three models can all account for more complex oscillatory behaviour in the form of bursting. Moreover, the model that takes the kinetics of IP(3) into account shows chaotic behaviour.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL6622689184\">MODEL6622689184</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02');
