(542, 2, 'BIOMD045 Borghans1997 - Calcium Oscillation - Model 3', '<div class=\"dc:title\">Borghans1997 - Calcium Oscillation - Model 3</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/17029867\" title=\"Access to this publication\">Complex intracellular calcium oscillations. A theoretical exploration of possible mechanisms.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Borghans JM, Dupont G, Goldbeter A.</div>\n                <div class=\"bibo:Journal\">Biophys. Chem. 1997 May; 66(1): 25-41</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>Intracellular Ca(2+) oscillations are commonly observed in a large number of cell types in response to stimulation by an extracellular agonist. In most cell types the mechanism of regular spiking is well understood and models based on Ca(2+)-induced Ca(2+) release (CICR) can account for many experimental observations. However, cells do not always exhibit simple Ca(2+) oscillations. In response to given agonists, some cells show more complex behaviour in the form of bursting, i.e. trains of Ca(2+) spikes separated by silent phases. Here we develop several theoretical models, based on physiologically plausible assumptions, that could account for complex intracellular Ca(2+) oscillations. The models are all based on one- or two-pool models based on CICR. We extend these models by (i) considering the inhibition of the Ca(2+)-release channel on a unique intracellular store at high cytosolic Ca(2+) concentrations, (ii) taking into account the Ca(2+)-activated degradation of inositol 1,4,5-trisphosphate (IP(3)), or (iii) considering explicity the evolution of the Ca(2+) concentration in two different pools, one sensitive and the other one insensitive to IP(3). Besides