(543, 2, 'BIOMD046 Olsen2003_peroxidase', '<p>      <strong>Notes of the BioModels curators:</strong>\n                </p>\n            <p>The current model reproduce the figure 7, panel B of the paper. Note that there is a typo in the figure. The ordinates represent the concentration of peroxyde, as stated in the legend, and not of oxygen. The model has been tested in COPASI (http://www.copasi.org/, build 13).</p>\n            <p>      <strong>Notes of the original version of the SBML file:</strong>\n                </p>\n            <p align=\"left\">      <font face=\"Arial, Helvetica, sans-serif\">        <b>          <a href=\"http://www.sbml.org/\">SBML</a>\n              level 2 code generated for the JWS Online project by Jacky Snoep using          <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n                        <br/>\n              Run this model online at          <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n                        <br/>\n              To cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004)          <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \nmodelling using JWS Online</a>\n              , Bioinformatics, 20:2143-2144          </b>\n                    </font>\n                </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(544, 2, 'BIOMD048 Kholodenko1999 - EGFR signaling', '<div class=\"dc:title\">Kholodenko1999 - EGFR signaling</div>\n        \n          <p/>\n        </div>\n        <div class=\"dc:provenance\">\n          <p>This model has been generated by        <font face=\"Arial, Helvetica, sans-serif\">\n            <b>the JWS Online project by Jacky Snoep using            <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n            <br/>\n                Run this model online at            <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n            <br/>\n                To cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004)            <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \n	  modelling using JWS Online</a>\n                , Bioinformatics, 20:2143-2144            </b>\n          </font></p>\n        </div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/10514507\" title=\"Access to this publication\">Quantification of short term signaling by the epidermal growth factor receptor.</a>\n          </div>\n          <div class=\"bibo:authorList\">Kholodenko BN, Demin OV, Moehren G, Hoek JB</div>\n          <div class=\"bibo:Journal\">J. Biol. Chem. 1999 Oct; 274(42): 30169-30181</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>During the past decade, our knowledge of molecular mechanisms involved in growth factor signaling has proliferated almost explosively. However, the kinetics and control of information transfer through signaling networks remain poorly understood. This paper combines experimental kinetic analysis and computational modeling of the short term pattern of cellular responses to epidermal growth factor (EGF) in isolated hepatocytes. The experimental data show transient tyrosine phosphorylation of the EGF receptor (EGFR) and transient or sustained response patterns in multiple signaling proteins targeted by EGFR. Transient responses exhibit pronounced maxima, reached within 15-30 s of EGF stimulation and followed by a decline to relatively low (quasi-steady-state) levels. In contrast to earlier suggestions, we demonstrate that the experimentally observed transients can be accounted for without requiring receptor-mediated activation of specific tyrosine phosphatases, following EGF stimulation. The kinetic model predicts how the cellular response is controlled by the relative levels and activity states of signaling proteins and under what conditions activation patterns are transient or sustained. EGFR signaling patterns appear to be robust with respect to variations in many elemental rate constants within the range of experimentally measured values. On the other hand, we specify which changes in the kinetic scheme, rate constants, and total amounts of molecular factors involved are incompatible with the experimentally observed kinetics of signal transfer. Quantitation of signaling network responses to growth factors allows us to assess how cells process information controlling their growth and differentiation.</p>\n          </div>\n        </div>\n        <div class=\"bm:curation\">\n          <p>The model correctly reproduces all the figures from the paper. The curation has been done using SBMLodeSolver.</p>\n        </div>\n        <div class=\"dc:publisher\">\n          <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000048\">BIOMD0000000048</a>\n            .        </p>\n          <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n        </div>\n        <div class=\"dc:license\">\n          <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n        </div>', 0, '2020-02-02'),
(545, 2, 'BIOMD049 Sasagawa2005_MAPK', '<p>\n      This a model from the article:\n      <br/>\n        <strong>Prediction and validation of the distinct dynamics of transient and sustained ERK activation. \n</strong>\n        <br/>\nSasagawa S, Ozaki Y, Fujita K, Kuroda S \n      <em>Nat. Cell Biol.</em>[2005 Apr; Volume: 7 (Issue: 4 )]: 365-73 \n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/15793571\">15793571</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nTo elucidate the hidden dynamics of extracellular-signal-regulated kinase (ERK) signalling networks, we developed a simulation model of ERK signalling networks by constraining in silico dynamics based on in vivo dynamics in PC12 cells. We predicted and validated that transient ERK activation depends on rapid increases of epidermal growth factor and nerve growth factor (NGF) but not on their final concentrations, whereas sustained ERK activation depends on the final concentration of NGF but not on the temporal rate of increase. These ERK dynamics depend on Ras and Rap1 dynamics, the inactivation processes of which are growth-factor-dependent and -independent, respectively. Therefore, the Ras and Rap1 systems capture the temporal rate and concentration of growth factors, and encode these distinct physical properties into transient and sustained ERK activation, respectively. \n   </p>\n        <p xmlns=\"http://www.w3.org/1999/xhtml\">Dynamics of active Ras, active Rap1 and phosphorylated ERK were correctly reproduced with CellDesigner 3.0</p>\n        <p xmlns=\"http://www.w3.org/1999/xhtml\">This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2012 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(546, 2, 'BIOMD050 Martins2003_AmadoriDegradation', '<p>\n      This a model from the article:\n      <br/>\n        <strong> Kinetic modelling of Amadori N-(1-deoxy-D-fructos-1-yl)-glycine degradation pathways. Part II--kinetic analysis. \n</strong>\n        <br/>\nMartins SI, Van Boekel MA. \n      <em>Carbohydr Res</em>2003 Jul;338(16):1665-78. \n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12873422\">12873422</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nA kinetic model for N-(1-deoxy-Image -fructos-1-yl)-glycine (DFG) thermal decomposition was proposed. Two temperatures (100 and 120 C) and two pHs (5.5 and 6.8) were studied. The measured responses were DFG, 3-deoxyosone, 1-deoxyosone, methylglyoxal, acetic acid, formic acid, glucose, fructose, mannose and melanoidins. For each system the model parameters, the rate constants, were estimated by non-linear regression, via multiresponse modelling. The determinant criterion was used as the statistical fit criterion. Model discrimination was performed by both chemical insight and statistical tests (Posterior Probability and Akaike criterion). Kinetic analysis showed that at lower pH DFG 1,2-enolization is favoured whereas with increasing pH 2,3-enolization becomes a more relevant degradation pathway. The lower amount observed of 1-DG is related with its high reactivity. It was shown that acetic acid, a main degradation product from DFG, was mainly formed through 1-DG degradation. Also from the estimated parameters 3-DG was found to be the main precursor in carbohydrate fragments formation, responsible for colour formation. Some indication was given that as the reaction proceeded other compounds besides DFG become reactants themselves with the formation among others of methylglyoxal. The multiresponse kinetic analysis was shown to be both helpful in deriving relevant kinetic parameters as well as in obtaining insight into the reaction mechanism.\n   </p>\n      <p xmlns=\"http://www.w3.org/1999/xhtml\">Model was intially tested in Jarnac.</p>\n      <p> The model was recently updated on 9th July 2010. The reference publication has reported two models M1 and M2, where the parameter values are given for conditions A) 100<sup>o</sup>C, pH5.5, B) 120<sup>o</sup>C, pH5.5, C) 100<sup>o</sup>C, pH6.8 and D) 120<sup>o</sup>C, pH6.8. </p>\n    <p> This model corresponds to the model M2 with condition 100<sup>o</sup>C, pH6.8 </p>\n  <p> The model reproduces Figure 6 of the reference publication. The curation figure was recently added</p>\n  <p xmlns=\"http://www.w3.org/1999/xhtml\">This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n</p>', 0, '2020-02-02'),
(547, 2, 'BIOMD051 Chassagnole2002_Carbon_Metabolism', '<p align=\"left\">The model reproduces Figures 4,5 and 6 of the publication. The analytical functions for cometabolites Catp, Camp, Cnadph,  and Cnadp slightly differ from the equations given in the paper. These changes were made in consultation with Dr. Christophe Chassagnole and are essential for reproducing the figures.  The dependency of the rate of change of extracellular glucose concentration on the ratio of biomass concentration to specific weight of biomass (Cx*rPTS/Rhox) is taken into account by appropriately adjusting the stoichiometries of the species involved in the phosphotransferase system  (rPTS). The rmax values for the various reactions are obtained from experiments and are not provided in the paper. However, these were personally communicated to the JWS repository. The model has been successfully tested on MathSBML.</p>\n        <p align=\"left\">\n          <font face=\"Arial, Helvetica, sans-serif\">\n            <b>\n              <a href=\"http://www.sbml.org/\">SBML</a>\n              level 2 code generated for the JWS Online project by Jacky Snoep using          <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n              <br/>\n              Run this model online at          <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n              <br/>\n              To cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004)          <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \nmodelling using JWS Online</a>\n              , Bioinformatics, 20:2143-2144          </b>\n          </font>\n        </p>\n        <br/>\n        <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n      <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n      <br/>\n      <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n  </p>', 0, '2020-02-02'),
(548, 2, 'BIOMD052 Brands2002 - Monosaccharide-casein systems', '<div class=\"dc:title\">Brands2002 - Monosaccharide-casein systems</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/12405768\" title=\"Access to this publication\">Kinetic modeling of reactions in heated monosaccharide-casein systems.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Brands CM, van Boekel MA</div>\n                <div class=\"bibo:Journal\">Journal of Agricultural and Food Chemistry. 2002, 50(23):6725-6739</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>In the present study, a kinetic model of the Maillard reaction occurring in heated monosaccharide-casein systems was proposed. Its parameters, the reaction rate constants, were estimated via multiresponse modeling. The determinant criterion was used as the statistical fit criterion instead of the familiar least squares to avoid statistical problems. The kinetic model was extensively tested by varying the reaction conditions. Different sugars (glucose, fructose, galactose, and tagatose) were studied regarding their effect on the reaction kinetics. This study has shown the power of multiresponse modeling for the unraveling of complicated reaction routes as occur in the Maillard reaction. The iterative process of proposing a model, confronting it with experiments, and criticizing the model was passed through four times to arrive at a model that was largely consistent with all results obtained. A striking difference was found between aldose and ketose sugars as suggested by the modeling results: not the ketoses themselves but only their reaction products were found to be reactive in the Maillard reaction.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL8177704759\">MODEL8177704759</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(549, 2, 'BIOMD053 Ferreira2003_CML_generation2', '<p>The model should reproduce the figure 2F of the article.</p>\n        <p>The equation 7 has been split into equations 7a-7c, in order to take into account the different flux rates of Lysine and CML formation from Schiff.</p>\n        <p>The model was tested in Jarnac (SBML L2 V1) and Copasi (SBML L2 V3).</p>\n        <br/>\n        <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n      <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n      <br/>\n      <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n  </p>', 0, '2020-02-02'),
(550, 2, 'BIOMD054 Ataullahkhanov1996_Adenylate', '<p>The model reproduces ion and adenylate pool concentration corresponding to line 2 of Fig 3 of the publication. This model was tested successfully on Jarnac</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(551, 2, 'BIOMD057 Sneyd2002_IP3_Receptor', '<p>This model was successfully tested on Jarnac and MathSBML. The model reproduces the time profile of  \"Open Probability\" of the receptor as shown in Figure 4 of the publication. The value of calcium ion concentration \"c\" in this model is 10 microM.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(552, 2, 'BIOMD058 Bindschadler2001_coupled_Ca_oscillators', '<p>The model reproduces the same amplitude antiphase calcium oscillations of coupled cells depicted in Figure 5B of the publication. This model was successfully tested on Jarnac and MathSBML. The values of  \"h1\" and \"h2\" are not given in the publication, but  the antiphase oscillations are reproduced over a narrow range of values of h1, h2,c1,c2,D and p. The values of D and p are given, while the other values were plugged in, in order to simulate the time profiles shown in the Figure. The time t=0 in the figure may have been fixed after the system was allowed to settle, and hence does not correspond to the t=0 of the simulation.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(553, 2, 'BIOMD061 Hynne2001_Glycolysis', '<p align=\"right\">The model reproduces Fig 6 of the paper. The stoichiometry and rate of reactions involving uptake of metabolites from extracellular medium have been changed corresponding to Yvol (ratio of extracellular volume to cytosolic volume) mentioned in the publication. The extracellular and cytosolic compartments have been set to 1. Concentration of extracellular glucose, GlcX, is set to 6.7 according to the equation for cellular glucose uptake rate in Table 7 of the paper. The model was successfully tested on MathSBML and Jarnac</p>\n        <p align=\"right\">\n          <font color=\"#ffffff\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#ffffff\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#ffffff\">.</font>\n        </p>\n        <p align=\"left\">\n          <font face=\"Arial, Helvetica, sans-serif\">\n            <b>\n              <a href=\"http://www.sbml.org/\">SBML</a>\n              level 2 code generated for the JWS Online project by Jacky Snoep using          <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n              <br/>\n              Run this model online at          <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n              <br/>\n              To cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004)          <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \nmodelling using JWS Online</a>\n              , Bioinformatics, 20:2143-2144          </b>\n          </font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#ffffff\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#ffffff\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#ffffff\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#ffffff\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#ffffff\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#ffffff\">.</font>\n        </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n    </p>', 0, '2020-02-02'),
(554, 2, 'BIOMD062 Bhartiya2003_Tryptophan_operon', '<p>      <a href=\"http://www.sbml.org/\">SBML</a>\n          level 2 code originaly generated for the JWS Online project by Jacky Snoep using      <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n                <br/>\n          Run this model online at      <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n                <br/>\n          To cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004)      <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \nmodelling using JWS Online</a>\n          , Bioinformatics, 20:2143-2144      </p>\n            <p>      <u>BioModels Curation</u>\n          : The model reproduces Fig 3 of the publication. By substituting a value of 1.4 for Tex it is possible to reproduce Fig 3C and 3D(iii), Fig 3A and 3D(i), are obtained by setting Tex=0. Also, note that the tryptophan concentrations have been normalized by 82 micromolar in the figures; the normalized concetrations can be obtained via the parameters To/s/t_norm. The model was successfully tested on MathSBML and Copasi.      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n                </p>', 0, '2020-02-02'),
(555, 2, 'BIOMD063 Galazzo1990_FermentationPathwayKinetics', '<p>\n      This a model from the article:\n      <br/>\n        <strong> \nFermentation pathway kinetics and metabolic flux control in suspended and immobilized Saccharomyces cerevisiae \n</strong>\n        <br/>\nJorge L. Galazzo and James E. Bailey\n      <em>Enzyme and Microbial Technology</em>Volume 12, Issue 3, 1990, Pages 162-172. \n      <br/>\n      DOI:<a href=\"dx.doi.org/10.1016/0141-0229(90)90033-M\">10.1016/0141-0229(90)90033-M</a>\n        <br/>\n        <strong>Abstract:</strong>\n        <br/>\nMeasurements of rates of glucose uptake and of glycerol and ethanol formation combined with knowledge of the metabolic pathways involved in S. cerevisiae were employed to obtain in vivo rates of reaction catalysed by pathway enzymes for suspended and alginate-entrapped cells at pH 4.5 and 5.5. Intracellular concentrations of substrates and effectors for most key pathway enzymes were estimated from in vivo phosphorus-31 nuclear magnetic resonance measurements. These data show the validity in vivo of kinetic models previously proposed for phosphofructokinase and pyruvate kinase based on in vitro studies. Kinetic representations of hexokinase, glycogen synthetase, and glyceraldehyde 3-phosphate dehydrogenase, which incorporate major regulatory properties of these enzymes, are all consistent with the in vivo data. This detailed model of pathway kinetics and these data on intracellular metabolite concentrations allow evaluation of flux-control coefficients for all key enzymes involved in glucose catabolism under the four different cell environments examined. This analysis indicates that alginate entrapment increases the glucose uptake rate and shifts the step most influencing ethanol production from glucose uptake to phosphofructokinase. The rate of ATP utilization in these nongrowing cells strongly limits ethanol production at pH 5.5 but is relatively insignificant at pH 4.5.\n   </p>\n      <p align=\"left\">\n        <font face=\"Arial, Helvetica, sans-serif\">\n          <b>\n            <a href=\"http://www.sbml.org/\">SBML</a> level 2 code generated for the JWS Online project by Jacky Snoep using \n              \n              <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n            <br/>\nRun this model online at \n              <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n            <br/>\nTo cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004) \n              <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \nmodelling using JWS Online</a>, Bioinformatics, 20:2143-2144\n </b>\n        </font>\n      </p>\n      <p align=\"right\">\n        <font color=\"#FFFFFF\">.</font>\n      </p>\n      <p align=\"right\">\n        <font color=\"#FFFFFF\">.</font>\n      </p>\n      <p align=\"right\">\n        <font color=\"#FFFFFF\">.</font>\n      </p>\n      <p align=\"right\">\n        <font color=\"#FFFFFF\">.</font>\n      </p>\n      <p align=\"right\">\n        <font color=\"#FFFFFF\">.</font>\n      </p>\n      <p align=\"right\">\n        <font color=\"#FFFFFF\">.</font>\n      </p>\n      <p>\n        <u> Biomodels Curation:</u> The model reproduces Fig 2 of the paper. However, it appears that the figures are swapped, hence the plot for V/Vmax vs Glucose actually represnts V/Vmax vs ATP and the vice versa is true for the other figure. The rate of hexokinase reaction that is obtained upon simulation of the model is 17.24 mM/min, therefore V/Vmax has a value of 17.24/68.5=0.25. For steady state values of Glucose and ATP (0.038 and 1.213 mM respectively), the V/Vmax values correctly correspond to 0.25, if we were to assume that the figures are swapped. </p>\n      <p>\n        <u> BioModels Curation updated on 25<sup>th</sup> November 2010: </u>  Figure 3 of the reference publication has been reproduced and added as a curation figure for the model.</p>\n    <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n</p>', 0, '2020-02-02'),
(556, 2, 'BIOMD067 Fung2005_Metabolic_Oscillator', '<h1>A Synthetic Gene-Metabolic Oscillator</h1>\n        <b>Reference:</b>\n        <a href=\"http://www.nature.com/nature/journal/v435/n7038/abs/nature03508.html\">\n          <i>Fung et al; Nature (2005) 435:118-122</i>\n        </a>\n        <br/>\n        <table border=\"0\" cellpadding=\"2\" cellspacing=\"0\">\n          <thead>\n            <tr>\n              <th align=\"left\" bgcolor=\"#eeeeee\" valign=\"middle\">Name of kinetic law</th>\n              <th align=\"left\" bgcolor=\"#eeeeee\" valign=\"middle\">Reaction</th>\n            </tr>\n          </thead>\n          <tbody>\n            <tr>\n              <td>Glycolytic flux, V_gly:</td>\n              <td>nil -> AcCoA;</td>\n            </tr>\n            <tr>\n              <td>Flux to TCA cycle/ETOH, V_TCA:</td>\n              <td>AcCoA -> TCA/EtOH;</td>\n            </tr>\n            <tr>\n              <td>HOAc ex/import,reversible,  V_out:</td>\n              <td>HOAc -> HOAc_E</td>\n            </tr>\n            <tr>\n              <td>V_Pta:</td>\n              <td>AcCoA + Pi -> AcP + CoA</td>\n            </tr>\n            <tr>\n              <td>reversible, V_Ack:</td>\n              <td>AcP + ADP -> OAc + ATP</td>\n            </tr>\n            <tr>\n              <td>V_Acs:</td>\n              <td>OAC + ATP -> AcCoA +PPi</td>\n            </tr>\n            <tr>\n              <td>Acetic acid-base equillibrium, reversible, V_Ace:</td>\n              <td>OAC + H -> HOAc</td>\n            </tr>\n            <tr>\n              <td>Expression of LacI, R_LacI:</td>\n              <td>nil -> LacI</td>\n            </tr>\n            <tr>\n              <td>Expression of Acs, R_Acs:</td>\n              <td>nil -> Acs</td>\n            </tr>\n            <tr>\n              <td>Expression of Pta, R_Pta:</td>\n              <td>nil -> Pta</td>\n            </tr>\n            <tr>\n              <td>LacI degradation, R_dLacI:</td>\n              <td>LacI -> nil</td>\n            </tr>\n            <tr>\n              <td>Acs degradation, R_dAcs:</td>\n              <td>Acs -> nil</td>\n            </tr>\n            <tr>\n              <td>Pta degradation, R_dPta:</td>\n              <td>Pta -> nil</td>\n            </tr>\n          </tbody>\n        </table>\n        <p>For this model the differential equation for V_Ace was changed from:      <br/>\n          C*(AcP*H-K_eq*OAC) with C = 100 in the supplemental material      <br/>\n          to C*(OAc*H-K_eq*HOAc) with C = 100, as in      <a href=\"http://www.pnas.org/cgi/content/abstract/101/8/2299\">\n          <i>Bulter et. al; PNAS(2004),101,2299-2304</i>\n        </a>\n          , and a value for K_eq of 5*10^-4 after communication with the authors.      </p>\n      <p>\n        <font size=\"2\">translated to SBML by:        <br/>\n            Lukas Endler(luen at tbi.univie.ac.at), Christoph Flamm (xtof at tbi.univie.ac.at)        </font>\n    </p>\n    <p>\n      <u>Biomodels Curation</u>\n          The model reproduces 3a of the paper for glycolytic flux Vgly = 0.5. The authors have agreed that the values on Y-axis are marked wrong and hence there is a discrepancy between  model simulation results and the figure. Also, note that the values of concentration and time are in dimensionless units. The model was successfully tested on MathSBML and Jarnac.      </p>', 0, '2020-02-02'),
(557, 2, 'BIOMD068 Curien2003_MetThr_synthesis', '<p>This a model from the article:      <br/>\n                <strong>A kinetic model of the branch-point between the methionine and threonine biosynthesis pathways in Arabidopsis thaliana.</strong>\n                <br/>\n          Curien G,  Ravanel S, Dumas R      <em>Eur. J. Biochem.</em>\n          2003 Dec; Volume: 270 (Issue: 23 )]:4615-27      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/14622248\">14622248</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          This work proposes a model of the metabolic branch-point between the methionine and threonine biosynthesis pathways in Arabidopsis thaliana which involves kinetic competition for phosphohomoserine between the allosteric enzyme threonine synthase and the two-substrate enzyme cystathionine gamma-synthase. Threonine synthase is activated by S-adenosylmethionine and inhibited by AMP. Cystathionine gamma-synthase condenses phosphohomoserine to cysteine via a ping-pong mechanism. Reactions are irreversible and inhibited by inorganic phosphate. The modelling procedure included an examination of the kinetic links, the determination of the operating conditions in chloroplasts and the establishment of a computer model using the enzyme rate equations. To test the model, the branch-point was reconstituted with purified enzymes. The computer model showed a partial agreement with the in vitro results. The model was subsequently improved and was then found consistent with flux partition in vitro and in vivo. Under near physiological conditions, S-adenosylmethionine, but not AMP, modulates the partition of a steady-state flux of phosphohomoserine. The computer model indicates a high sensitivity of cystathionine flux to enzyme and S-adenosylmethionine concentrations. Cystathionine flux is sensitive to modulation of threonine flux whereas the reverse is not true. The cystathionine gamma-synthase kinetic mechanism favours a low sensitivity of the fluxes to cysteine. Though sensitivity to inorganic phosphate is low, its concentration conditions the dynamics of the system. Threonine synthase and cystathionine gamma-synthase display similar kinetic efficiencies in the metabolic context considered and are first-order for the phosphohomoserine substrate. Under these conditions outflows are coordinated.      </p>\n            <br/>\n            <p align=\"left\">      <font face=\"Arial, Helvetica, sans-serif\">        <b>          <a href=\"http://www.sbml.org/\">SBML</a>\n              level 2 code generated for the JWS Online project by Jacky Snoep using          <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n                        <br/>\n              Run this model online at          <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n                        <br/>\n              To cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004)          <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \nmodelling using JWS Online</a>\n              , Bioinformatics, 20:2143-2144          </b>\n                    </font>\n                </p>\n            <p>      <u>Biomodels Curation</u>\n          The model simulates the flux for TS and CGS under conditions given in Table 2 and reproduces the dotted lines given in Table 3 of the paper. There is a typo in the equation for the apparent specificity constant for Phser, Kts (equation13). This was changed after communication with the authors to be: Kts = 5.9E-4+6.2E-2*pow(AdoMet,2.9)/(pow(32,2.9)+pow(AdoMet,2.9)). The model was successfully tested on Jarnac and Copasi. Due to a suggestion from Pedro Mendez the parameter AdoMet, TS and CGS where made constant species.      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(558, 2, 'BIOMD069 Fuss2006_MitoticActivation', '<p>\nThe model was curated with XPP. The figure 3 was successfully reproduced.\n</p>', 0, '2020-02-02');
INSERT INTO `model` (`id`, `id_user`, `name`, `description`, `repositorytype`, `modified`) VALUES
(559, 2, 'BIOMD070 Holzhutter2004_Erythrocyte_Metabolism', '<p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p align=\"left\">\n          <font face=\"Arial, Helvetica, sans-serif\">\n            <b>\n              <a href=\"http://www.sbml.org/\">SBML</a> level 2 code generated for the JWS Online project by Jacky Snoep using <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n              <br/>\nRun this model online at <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n              <br/>\nTo cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004) <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \nmodelling using JWS Online</a>, Bioinformatics, 20:2143-2144\n </b>\n          </font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p>\n          <u>Biomodels Curation</u>\nThe model simulates the flux values as given for \"kinetic model\" in Table 1 of the paper. The model was successfully tested on Jarnac.\n</p>', 0, '2020-02-02'),
(560, 2, 'BIOMD071 Bakker2001_Glycolysis', '<p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p align=\"right\">\n          <font color=\"#FFFFFF\">.</font>\n        </p>\n        <p align=\"left\">\n          <font face=\"Arial, Helvetica, sans-serif\">\n            <b>\n              <a href=\"http://www.sbml.org/\">SBML</a>\n              level 2 code generated for the JWS Online project by Jacky Snoep using          <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n              <br/>\n              Run this model online at          <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n              <br/>\n              To cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004)          <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \nmodelling using JWS Online</a>\n              , Bioinformatics, 20:2143-2144          </b>\n            </font>\n          </p>\n          <p align=\"right\">\n            <font color=\"#FFFFFF\">.</font>\n          </p>\n          <p align=\"right\">\n            <font color=\"#FFFFFF\">.</font>\n          </p>\n          <p>\n            <u>Biomodels Curation:</u>\n          The paper refers to the model equations present in Bakker et al\'s \" Glycolysis in bloodstream from Trypanosoma brucei can be understood in terms of the kinetics of glycolytic enzymes\" (Pubmed ID: 9013556), also, the authors claim that some of the modifications in these equations were made based on the experimental results from the paper \"Contribution of glucose transport in the control of glycolytic flux in Trypanosoma brucei\" (Pubmed ID: 10468568). The model reproduces the various flux values in Fig 3 for 100% TPI activity. It also matches with the values provided in Table 2 of the paper. The model was successfully tested with Copasi and SBML ODE Solver.      <br/>\n          The volumes are set to the values containing 1 mg of total protein per microlitre total cell volume. To change the protein concentration use      <em>Vt</em>\n          , the total cell volume in micro litre per mg protein.      <br/>\n          To change the TPI activity use the global parameter      <em>TPIact</em>\n          .      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a></p>', 0, '2020-02-02'),
(561, 2, 'BIOMD072 Yi2003_GproteinCycle', '<p>The paper describes both wild-type and mutant cells of G protein cycle by using different values of G protein deactivation. We chosed the wild-type, k=0.11 s-1.</p>\n            <p>The unit of the concentration for the proteins are numbers of molecules per cell.</p>\n            <p>Figure5(A) was reproduced with COPASI 4.0 (Build 18) and SBML_odeSolver. Figure5(B) was reproduced with COPASI 4.0 (Build 18).</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(562, 2, 'BIOMD077 Blum2000_LHsecretion_1', '<p>\n          <h1>A mathematical model quantifying GnRH-induced LH secretion from gonadotropes by Blum et al (2000)</h1>\n        </p>\n        <p>This paper includes three stages, and the model does not include the third stage. Also an event is included which remove the hormone GnRH at time=5min. Figure 1 and Figure 2 of the paper are reproduced, using SBML odeSolver. We choose to encode the model with the concentration of GnRH equal to 1.0nM.</p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n      </p>', 0, '2020-02-02'),
(563, 2, 'BIOMD084 Hornberg2005_ERKcascade', '<p align=\"right\">      <font face=\"Arial, Helvetica, sans-serif\">        <b>          <a href=\"http://www.sbml.org/\">SBML</a>\n              level 2 code generated for the JWS Online project by Jacky Snoep using          <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n                        <br/>\n              Run this model online at          <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n                        <br/>\n              To cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004)          <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \nmodelling using JWS Online</a>\n              , Bioinformatics, 20:2143-2144          </b>\n                    </font>\n                </p>\n            <p>      <u>Biomodels Curation</u>\n          The model reproduces the time series depicted in Fig 2 of the paper. Also, by varying the values of Vmax for the second kinase (k5) the time series of X3P as shown in Fig3 can be reproduced. The model was successfully tested on MathSBML and Jarnac.      </p>', 0, '2020-02-02'),
(564, 2, 'BIOMD085 Maurya2005_GTPaseCycle_reducedOrder', '<p>This model is according to the paper      <span style=\"font-style: italic;\">Reduced-order modeling of biochemical networks: application to the GTPase-cycle signalling module</span>\n          by Maurya et al 2006.The figure 4c is reproduced by Copasi 4.0.19 (development) .It is three-dimensional logarithmic plots show the output of simulations of Z at various concentrations of R and GAP.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(565, 2, 'BIOMD086 Bornheimer2004_GTPaseCycle', '<p>This model is according to the paper      <i>Computational modeling reveals how interplay between components of a GTPase-cycle module regulates signal transduction</i>\n          by Bornheimer et al 2004.The figure 3 is reproduced by Copasi 4.0.19 (development) .It is three-dimensional logarithmic plots show the output of simulations of Z and v at various concentrations of R and GAP.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(566, 2, 'BIOMD087 Proctor2006_telomere', '<p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n      <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n      <br/>\n      <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n  </p>', 0, '2020-02-02'),
(567, 2, 'BIOMD088 Maeda2006_MyosinPhosphorylation', '<p>The model reproduces Fig 2B, D, F, and 2H. The dynamics correspond to a stimulus of 1 U/ml of thrombin which is equal to 0.01 uM. Phosphorylated MLC is the sum of pMLC (s359) and ppMLC (s360). A slight discrepancy in peak values of species between the figure in the paper and simulation result might be due to different initial conditions in the two sets.  The model was successfully tested on MathSBML. It is possible to simulate the model on other software that do not support \"Events\" at this time by removing the \"listOfEvents\" and substituting a value of 0.01 for thrombin (s2). This does not change the model very much. With the latter format, the model was also successfully tested on Copasi.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(568, 2, 'BIOMD091 Proctor2005 - Actions of chaperones and their role in ageing', '<div class=\"dc:title\">Proctor2005 - Actions of chaperones and their\nrole in ageing</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/15610770\" title=\"Access to this publication\">Modelling the actions of\n    chaperones and their role in ageing.</a>\n  </div>\n  <div class=\"bibo:authorList\">Proctor CJ, Soti C, Boys RJ,\n  Gillespie CS, Shanley DP, Wilkinson DJ, Kirkwood TB.</div>\n  <div class=\"bibo:Journal\">Mech. Ageing Dev. 2005 Jan; 126(1):\n  119-131</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Many molecular chaperones are also known as heat shock\n    proteins because they are synthesised in increased amounts\n    after brief exposure of cells to elevated temperatures. They\n    have many cellular functions and are involved in the folding of\n    nascent proteins, the re-folding of denatured proteins, the\n    prevention of protein aggregation, and assisting the targeting\n    of proteins for degradation by the proteasome and lysosomes.\n    They also have a role in apoptosis and are involved in\n    modulating signals for immune and inflammatory responses.\n    Stress-induced transcription of heat shock proteins requires\n    the activation of heat shock factor (HSF). Under normal\n    conditions, HSF is bound to heat shock proteins resulting in\n    feedback repression. During stress, cellular proteins undergo\n    denaturation and sequester heat shock proteins bound to HSF,\n    which is then able to become transcriptionally active. The\n    induction of heat shock proteins is impaired with age and there\n    is also a decline in chaperone function. Aberrant/damaged\n    proteins accumulate with age and are implicated in several\n    important age-related conditions (e.g. Alzheimer\'s disease,\n    Parkinson\'s disease, and cataract). Therefore, the balance\n    between damaged proteins and available free chaperones may be\n    greatly disturbed during ageing. We have developed a\n    mathematical model to describe the heat shock system. The aim\n    of the model is two-fold: to explore the heat shock system and\n    its implications in ageing; and to demonstrate how to build a\n    model of a biological system using our simulation system\n    (biology of ageing e-science integration and simulation\n    (BASIS)).</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000091\">BIOMD0000000091</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(569, 2, 'BIOMD092 Fuentes2005_ZymogenActivation', '<p align=\"right\">      <font color=\"#ffffff\">.</font>\n                </p>\n            <p align=\"right\">      <font color=\"#ffffff\">.</font>\n                </p>\n            <p align=\"right\">      <font color=\"#ffffff\">.</font>\n                </p>\n            <p align=\"left\">      <font face=\"Arial, Helvetica, sans-serif\">        <b>          <a href=\"http://www.sbml.org/\">SBML</a>\n              level 2 code generated for the JWS Online project by Jacky Snoep using          <a href=\"http://pysces.sourceforge.net/\">PySCeS</a>\n                        <br/>\n              Run this model online at          <a href=\"http://jjj.biochem.sun.ac.za/\">http://jjj.biochem.sun.ac.za</a>\n                        <br/>\n              To cite JWS Online please refer to: Olivier, B.G. and Snoep, J.L. (2004)          <a href=\"http://bioinformatics.oupjournals.org/cgi/content/abstract/20/13/2143\">Web-based \nmodelling using JWS Online</a>\n              , Bioinformatics, 20:2143-2144          </b>\n                    </font>\n                </p>\n            <p align=\"right\">      <font color=\"#ffffff\">.</font>\n                </p>\n            <p align=\"right\">      <font color=\"#ffffff\">.</font>\n                </p>\n            <p align=\"right\">      <font color=\"#ffffff\">.</font>\n                </p>\n            <p align=\"right\">      <font color=\"#ffffff\">.</font>\n                </p>\n            <p align=\"right\">      <font color=\"#ffffff\">.</font>\n                </p>\n            <p align=\"right\">      <font color=\"#ffffff\">.</font>\n                </p>\n            <p>The model reproduces Fig 1A of the paper. The model was successfully tested on MathSBML.</p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2006 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\">terms of use</a>\n          .      </p>', 0, '2020-02-02'),
(570, 2, 'BIOMD093 Yamada2003_JAK_STAT_pathway', '<p>      <u>NCBS Curation Comments</u>\n          This model shows the control mechanism of Jak-Stat pathway, here SOCS1 (Suppressor of cytokine signaling-I) was identified as the negative regulator of Jak and STAT signal transduction pathway. Note: There are a few ambiguities in the paper like initial concentration of IFN and some reactions were missing in the paper that were employed for obtaining the results. The graphs are almost similar to the graphs as shown in the paper but still some ambiguities regarding the concentration are there. Thanks to Dr Satoshi Yamada for clarifying some of those ambiguities and providing the values used in simulations.      </p>\n            <p>      <u>Biomodels Curation Comments</u>\n          The model reproduces Fig 2 (A,C,E,G,I,K,M) of the paper. The set of equations present in the paper are inadequate to reproduce  the figures mentioned . The model appears to have been fine tuned after correspondence between the curators at NCBS and the authors. There is however a slight discrepancy between the simulation results and the plots in the paper. The model was tested on MathSBML.      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2006 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\">terms of use</a>\n          .      </p>', 0, '2020-02-02'),
(571, 2, 'BIOMD094 Yamada2003_JAK_STAT_SOCS1_knockout', '<p>      <u>NCBS Curation Comments:</u>\n          This model shows the control mechanism of Jak-Stat pathway, here SOCS1 (Suppressor of cytokine signaling-I) was identified as the negative regulator of Jak and STAT signal transduction pathway. This is the knockout version of Jak-Stat pathway in this model the SOCS1 has been knocked out i.e it formation is not shown. The graphs are almost similar to the graphs as shown in the paper but STAT1n graph has some ambiguities. Thanks to Dr Satoshi Yamada for clarifying some of those ambiguities and providing the values used in simulations.      </p>\n            <p>      <u>Biomodels Curation Comments:</u>\n          The model reproduces the figures 2 (B,D,F,H,J,L,N) corresponding to JAK/STAT activation in SOCS1 knock out cells. The model was successfully tested on MathSBML      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2006 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\">terms of use</a>\n          .      </p>', 0, '2020-02-02'),
(572, 2, 'BIOMD095 Zeilinger2006_PRR7-PRR9-Y', '<p>The model reproduces the circadian charecteristics as given in Table 1 for the PRR7-PRR9-Y model. The model makes use of the event section to introduce light at 30 hours. The Zeitgeber (ZT) times for species shown in Table 1 can be reproduced by looking at the time it takes for species to reach peak values after the introduction of light. The model was successfully tested on MathSBML.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(573, 2, 'BIOMD096 Zeilinger2006_PRR7-PRR9light-Y', '<p>The model reproduces the time profile of cYm and cTm under light-dark cycles as depicted in Fig 4 and Fig 5  respectively. 12 hour light-dark cycles are accomplished using a simple algorithm in the event section. The model was successfully tested using MathSBML.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(574, 2, 'BIOMD097 Zeilinger2006_PRR7-PRR9light-Yprime', '<p>The model reproduces the time profile of TOC1  and Y mRNA  for a  8:16 cycle as depicted in Fig7A and 7B. A simple algorithm in the event section accomplishes the 8 hour light and 16 hour dark cycle. The model was successfully tested on MathSBML</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(575, 2, 'BIOMD098 Goldbeter1990_CalciumSpike_CICR', '<p xmlns=\"http://www.w3.org/1999/xhtml\"> The model reproduces the time profile of cytosolic and intracellular calcium as depicted in the upper panel of Fig 2 in the paper. The model was successfully tested on MathSBML and Jarnac.</p>\n      <p xmlns=\"http://www.w3.org/1999/xhtml\">This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n    </p>', 0, '2020-02-02'),
(576, 2, 'BIOMD099 Laub1998_SpontaneousOscillations', '<p>This is model according to the paper \"A Molecular Network That Produces Spontaneous Oscillations in Excitalbe Cells of Dictyostelium. Figure 3 has been reproduced by Copasi 4.0.20(development) \". However four of the parameters have been changed , see details in notes.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(577, 2, 'BIOMD100 Rozi2003_GlycogenPhosphorylase_Activation', '<p>The model reproduces the temporal evolution of Glycogen phosphorylase for a vale of Vm5=30 as depicted in Fig 1a of the paper. The model makes use of calcium oscillations from the Borghans model to stimulate the activation of glycogen phosphorylase. Hence, this is a simple extension of the Borghans model. The model was succesfully tested on MathSBML and Jarnac.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" class=\"external\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(578, 2, 'BIOMD101 Vilar2006_TGFbeta', '<p>The model reproduces Fig 5A of the paper. The ligand concentration is increased from 3E-5 to 0.01 at time t=2500 to ensure that the system  reaches steady state. Hence, the time t=0 of the paper corresponds to t=2500 in the model. The peak value of the active ligand receptor complex is off by a value of 1.25, the authors have stated that this discrepancy is due to the fact that the figure in the paper corresponds to a slightly different parameter set. The model was successfully tested on MathSBML.</p>\n        <br/>\n        <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n        <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n        <br/>\n        <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a></p>', 0, '2020-02-02'),
(579, 2, 'BIOMD102 Legewie2006_apoptosis_WT', '<p xmlns=\"http://www.w3.org/1999/xhtml\">\n    The model reproduces active Caspase-3 time profile corresponding to the total Apaf-1 value of 20 nM as depicted in Fig 2-A . The model was successfully tested on MathSBML.</p>', 0, '2020-02-02'),
(580, 2, 'BIOMD103 Legewie2006_apoptosis_NC', '<p>This model represents the non-competitive binding of XIAP to Casapase-3 and Caspase-9. In other words, XIAP mediated feedback is abolished in this model. The authors state that this leads to bistable-reversible behaviour as depicted in Fig 4C. The wild-type model displays a bistable-irreversible profile. This shows that irreversibility requires XIAP mediated feedback. The model was tested on MathSBML. However, please note that the paper does not contain any  figure that corresponds to simulation of the Non-Competitive model.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(581, 2, 'BIOMD104 Klipp2002_MetabolicOptimization_linearPathway(n=2)', '<div class=\"dc:title\">Klipp2002_MetabolicOptimization_linearPathway(n=2)</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/12423338\" title=\"Access to this publication\">Prediction of temporal gene expression. Metabolic opimization by re-distribution of enzyme activities.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Klipp E, Heinrich R, Holzhtter HG.</div>\n                <div class=\"bibo:Journal\">Eur. J. Biochem. 2002 Nov; 269(22): 5406-5413</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>A computational approach is used to analyse temporal gene expression in the context of metabolic regulation. It is based on the assumption that cells developed optimal adaptation strategies to changing environmental conditions. Time- \ndependent enzyme profiles are calculated which optimize the function of a metabolic pathway under the constraint of limited total enzyme amount. For linear model pathways it is   shown that wave-like enzyme profiles are optimal for a rapid substrate turnover. For the central metabolism of yeast cells enzyme profiles are calculated which ensure long-term homeostasis of key metabolites under conditions of a diauxic shift. These enzyme profiles are in close correlation with observed gene expression data. Our results demonstrate that optimality principles help to rationalize observed gene expression profiles.</p>\n                    </div>\n                </div>\n            <div class=\"bm:curation\">      <p>This model is from the paper        <i>Prediction of temporal gene expression metabolic optimization by re-distribution of enzyme activities.</i>\n            The model describes optimal enzyme profiles and metabolite time courses for a simple linear metabolic pathway (n=2). Figure 1 was reproduced using roadRunner. The values of k1 and k2 were not explicitly stated in the publication, but calculations were performed for equal catalytic efficiencies of the enzymes (ki=k), hence the curator assigned k1=k2=1. Also enzyme concentrations are given in units of Etot; times are given in units of 1/(k*Etot) in the papaer, for simplicity , we use defalut units of the SBML to present the concentration and time.        </p>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000104\">MODEL4931762955</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(582, 2, 'BIOMD105 Proctor2007 - Age related decline of proteolysis, ubiquitin-proteome system', '<div class=\"dc:title\">Proctor2007 - Age related decline of proteolysis, ubiquitin-proteome system</div>\n\n  <p style=\"font-size: 12px; color: rgb(0, 0, 0); font-family: helvetica, \'trebuchet MS\', arial, sans-serif;\">This\n  is a stochastic model of the ubiquitin-proteasome system for a\n  generic pool of native proteins (NatP), which have a half-life of\n  about 10 hours under normal conditions. It is assumed that these\n  proteins are only degraded after they have lost their native\n  structure due to a damage event. This is represented in the model\n  by the misfolding reaction which depends on the level of reactive\n  oxygen species (ROS) in the cell. Misfolded proteins (MisP) are\n  first bound by an E3 ubiquitin ligase. Ubiquitin (Ub) is\n  activated by E1 (ubiquitin-activating enzyme) and then passed to\n  E2 (ubiquitin-conjugating enzyme). The E2 enzyme then passes the\n  ubiquitin molecule to the E3/MisP complex with the net effect\n  that the misfolded protein is monoubiquitinated and both E2 and\n  E3 are released. Further ubiquitin molecules are added in a\n  step-wise manner. When the chain of ubiquitin molecules is of\n  length 4 or more, the polyubiquitinated misfolded protein may\n  bind to the proteasome. The model also includes de-ubiquitinating\n  enzymes (DUB) which cleave ubiquitin molecules from the chain in\n  a step-wise manner. They work on chains attached to misfolded\n  proteins both unbound and bound to the proteasomes. Misfolded\n  proteins bound to the proteasome may be degraded releasing\n  ubiquitin. Misfolded proteins including ubiquitinated proteins\n  may also aggregate. Aggregates (AggP) may be sequestered\n  (Seq_AggP) which takes them out of harm\'s way or they may bind to\n  the proteasome (AggP_Proteasome). Proteasomes bound by aggregates\n  are no longer available for protein degradation.</p>\n  <p style=\"font-size: 12px; color: rgb(0, 0, 0); font-family: helvetica, \'trebuchet MS\', arial, sans-serif;\">Figure\n  2 and Figure 3 has been simulated using Gillespie2.</p>\n</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/17408507\" title=\"Access to this publication\">An in silico model of the\n    ubiquitin-proteasome system that incorporates normal\n    homeostasis and age-related decline.</a>\n  </div>\n  <div class=\"bibo:authorList\">Proctor CJ, Tsirigotis M, Gray\n  DA.</div>\n  <div class=\"bibo:Journal\">BMC Syst Biol 2007; 1: 17</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>BACKGROUND: The ubiquitin-proteasome system is responsible\n    for homeostatic degradation of intact protein substrates as\n    well as the elimination of damaged or misfolded proteins that\n    might otherwise aggregate. During ageing there is a decline in\n    proteasome activity and an increase in aggregated proteins.\n    Many neurodegenerative diseases are characterised by the\n    presence of distinctive ubiquitin-positive inclusion bodies in\n    affected regions of the brain. These inclusions consist of\n    insoluble, unfolded, ubiquitinated polypeptides that fail to be\n    targeted and degraded by the proteasome. We are using a systems\n    biology approach to try and determine the primary event in the\n    decline in proteolytic capacity with age and whether there is\n    in fact a vicious cycle of inhibition, with accumulating\n    aggregates further inhibiting proteolysis, prompting\n    accumulation of aggregates and so on. A stochastic model of the\n    ubiquitin-proteasome system has been developed using the\n    Systems Biology Mark-up Language (SBML). Simulations are\n    carried out on the BASIS (Biology of Ageing e-Science\n    Integration and Simulation) system and the model output is\n    compared to experimental data wherein levels of ubiquitin and\n    ubiquitinated substrates are monitored in cultured cells under\n    various conditions. The model can be used to predict the\n    effects of different experimental procedures such as inhibition\n    of the proteasome or shutting down the enzyme cascade\n    responsible for ubiquitin conjugation. RESULTS: The model\n    output shows good agreement with experimental data under a\n    number of different conditions. However, our model predicts\n    that monomeric ubiquitin pools are always depleted under\n    conditions of proteasome inhibition, whereas experimental data\n    show that monomeric pools were depleted in IMR-90 cells but not\n    in ts20 cells, suggesting that cell lines vary in their ability\n    to replenish ubiquitin pools and there is the need to\n    incorporate ubiquitin turnover into the model. Sensitivity\n    analysis of the model revealed which parameters have an\n    important effect on protein turnover and aggregation kinetics.\n    CONCLUSION: We have developed a model of the\n    ubiquitin-proteasome system using an iterative approach of\n    model building and validation against experimental data. Using\n    SBML to encode the model ensures that it can be easily modified\n    and extended as more data become available. Important aspects\n    to be included in subsequent models are details of ubiquitin\n    turnover, models of autophagy, the inclusion of a pool of\n    short-lived proteins and further details of the aggregation\n    process.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000105\">BIOMD0000000105</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(583, 2, 'BIOMD106 Yang2007_ArachidonicAcid', '<p>This model is according to the paper      <i>Dynamic Simulation on the Arachidonic Acid Metabolic Network</i>\n          . Figure 2A has been reproduced by SBML ode solver on line. In the original model, all the reactions are presented as ODE directly. So curator rewrite each reaction according to the semantics of the paper.  In this paper, the authors used quict complex kinetics law to describe the catalysis in the network, curators did not necessarily know all the complete meanings of the paper.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02');
INSERT INTO `model` (`id`, `id_user`, `name`, `description`, `repositorytype`, `modified`) VALUES
(584, 2, 'BIOMD107 Novak1993 - Cell cycle M-phase control', '<div class=\"dc:title\">Novak1993 - Cell cycle M-phase control</div>\n\nThe model reproduces Figure 9 of the paper. Please note that active MPF and cyclin concentrations in the paper are given relative to total cdc2 concentration   (100nM). Active MPF (dimer_p)  is the cyclin-cdc2 complex that is phosphorylated at Thr161. The earlier versions of the model was successfully tested on MathSBML and Jarnac, and the current version was checked in Copasi.\n<br/></div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/8126097\" title=\"Access to this publication\">\n    Numerical analysis of a comprehensive model of M-phase control in Xenopus oocyte extracts and intact embryos. \n    </a>\n  </div>\n  <div class=\"bibo:authorList\"> \n  Novak B, Tyson JJ. \n  </div>\n  <div class=\"bibo:Journal\">J. Cell. Sci. 1993 Dec; 106 ( Pt 4): 1153-1168 </div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>\n    To contribute to a deeper understanding of M-phase control in eukaryotic cells, we have constructed a model based on the biochemistry of M-phase promoting factor (MPF) in Xenopus oocyte extracts, where there is evidence for two positive feedback loops (MPF stimulates its own production by activating Cdc25 and inhibiting Wee1) and a negative feedback loop (MPF stimulates its own destruction by indirectly activating the ubiquitin pathway that degrades its cyclin subunit). To uncover the full dynamical possibilities of the control system, we translate the regulatory network into a set of differential equations and study these equations by graphical techniques and computer simulation. The positive feedback loops in the model account for thresholds and time lags in cyclin-induced and MPF-induced activation of MPF, and the model can be fitted quantitatively to these experimental observations. The negative feedback loop is consistent with observed time lags in MPF-induced cyclin degradation. Furthermore, our model indicates that there are two possible mechanisms for autonomous oscillations. One is driven by the positive feedback loops, resulting in phosphorylation and abrupt dephosphorylation of the Cdc2 subunit at an inhibitory tyrosine residue. These oscillations are typical of oocyte extracts. The other type is driven by the negative feedback loop, involving rapid cyclin turnover and negligible phosphorylation of the tyrosine residue of Cdc2. The early mitotic cycles of intact embryos exhibit such characteristics. In addition, by assuming that unreplicated DNA interferes with M-phase initiation by activating the phosphatases that oppose MPF in the positive feedback loops, we can simulate the effect of addition of sperm nuclei to oocyte extracts, and the lengthening of cycle times at the mid-blastula transition of intact embryos. \n    </p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000107\">BIOMD0000000107</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/25414348\" title=\"Latest BioModels Database publication\">BioModels:\n  ten-year anniversary </a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(585, 2, 'BIOMD108 Kowald2006_SOD', '<p>This model is according to the paper from Axel Kowald      <i>Alternative pathways as mechanism for the negative effects associated with overexpression of superoxide dismutase.</i>\n        <p>Reactions from 1 to 17 are listed in the paper, note that for clarity species whose concentrations are assumed to be constant (e.g.water, oxygen,protons, metal ions) are omitted from the diagram. In the paper, v16 is a fast reaction, but we do not use fast reaction in the model.</p>\n        <p>Figure2 has been reproduced by both SBMLodeSolver and Copasi4.0.20(development) . Figure 3 has been obtained with Copasi4.0.20(development) using parameter scan.</p>\n        <p>The steady-state of [LOO*] a little bit lower than showed on the paper, I guess it may be the simulation method used in the paper use fast reaction and also the reaction (5) listed on Page 831 on the paper is slightly different from equation (2) on Page 832. The rest of them are the quite the same.</p>\n    </p>\n    <br/>\n    <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n  <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n  <br/>\n  <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n</p>', 0, '2020-02-02'),
(586, 2, 'BIOMD109 Haberichter2007_cellcycle', '<p>This model is according to the paper      <i>A systems biology dynamical model of mammalian G1 cell cycle progression.</i>\n          Supplementary Figure 2A has been reproduced by the MathSBML and CellDesigner. All the data of this model are from the set 2 of Supplementary talbe2.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(587, 2, 'BIOMD110 Qu2003_CellCycle', '<p>\n      This model is from the article:\n      <br/>\n        <strong> Dynamics of the cell cycle: checkpoints, sizers, and timers. \n</strong>\n        <br/>\n 	  Qu Z,  MacLellan WR,  Weiss JN \n      <em>Biophys. J.</em>2003 Dec; 85(6): 3600-11 \n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/14645053\">14645053</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nWe have developed a generic mathematical model of a cell cycle signaling network in higher eukaryotes that can be used to simulate both the G1/S and G2/M transitions. In our model, the positive feedback facilitated by CDC25 and wee1 causes bistability in cyclin-dependent kinase activity, whereas the negative feedback facilitated by SKP2 or anaphase-promoting-complex turns this bistable behavior into limit cycle behavior. The cell cycle checkpoint is a Hopf bifurcation point. These behaviors are coordinated by growth and division to maintain normal cell cycle and size homeostasis. This model successfully reproduces sizer, timer, and the restriction point features of the eukaryotic cell cycle, in addition to other experimental findings.\n   </p>\n        <br/>\n        <p> Figure6B has been reproduced by both SBMLodeSolver online and MathSBML. We do not include the synthesis of cyclins is proportional to cell size (Equation 2 in Page3604 of the paper) in this model. The author of the paper keep all the variables and parameters dimensionless. But in the model, we choose to use default units of SBML.</p>\n        <p xmlns=\"http://www.w3.org/1999/xhtml\">This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n      </p>', 0, '2020-02-02'),
(588, 2, 'BIOMD111 Novak2001_FissionYeast_CellCycle', '<p>The model reproduces the time evolution of several species as depicted in Fig 4 of the paper. Events have been used to reset  cell mass when the value of M-phase promoting factor (MPF) decreases through 0.1. The model was successfully tested on Cell Designer.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(589, 2, 'BIOMD113 Dupont1992_Ca_dpt_protein_phospho', '<p>Model reproduces Fig 4 of the paper. For fraction of phosphorylated protein, W_star, the model reproduces panel b in the same figure. Model successfully tested on MathSBML and Jarnac.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(590, 2, 'BIOMD114 Somogyi1990_CaOscillations', '<p>This model encoded according to the paper      <i>Hormone induced Calcium Oscillations in Liver Cells Can Be Explained by a Simple One Pool Model.</i>\n          The values of parameters a and alpha are varioused inorder to simulate results in different situations. For Figure 3A, a=3.5,alpha=1.2 ; Figure 3B, a=3,alpha=5 ; Figure 3C a= 0.95, alpha=1.5; Figure3D, a=1, alpha=5. Keep in mind that the value for the xy axies are arbitrary value. Figures3 in the paper are reproduced by COPASI 4.0.20(development) , and SBMLodeSolver online.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(591, 2, 'BIOMD115 Somogyi1990_CaOscillations_SingleCaSpike', '<p>Another model from      <i>Hormone induced Calcium Oscillations in Liver Cells Can Be Explained by a Simply One Pool Model.</i>\n          Anatomy of a single Ca2+ spike. Figure4A has been simulated by COPASI4.0.20(development). However, the simulated figure is slightly different from the paper, single spike of Ca2+ is around \"6\" time arbitrary units instead \"9\" time arbitrary units displayed in the paper.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(592, 2, 'BIOMD116 McClean2007_CrossTalk', '<p>This model encoded according to the paper      <i>Cross-talk and decision making in MAP kinase pathways.</i>\n          Supplementary Figure 2 has been reproduced by COPASI4.0.20 (development) using parameter scan method. You probably need to uncheck \"always use initial conditions\" in copasi when you simulate for the second run in order to get the figure. S1 scale from 0 to 12. Keep in mind that the y axis is the fractions of  excited X3 and Y3, meaning that X3P and Y3P are normalized by total concentration X3T and Y3T.      </p>\n            <p>The results from modeling the pathway in Supplementary Figure1a, including both activation and inhibition. According to the paper, the value of ka and kd should in the orange region (ka belongs [0,1], kd belongs [1,10]) so assigned ka=0, kd=1.</p>\n            <p>The author made the simplifying assumption that the interactions between the pathways are symmetric. Thus the k12xy=k12yx=ka, k33xy=k33yx=kd.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(593, 2, 'BIOMD122 Fisher2006_Ca_Oscillation_dpdnt_NFAT_dynamics', '<p>The model reproduces the calcium oscillation dependent activation-deactivation kinetics of nuclear factor of activated T cells (NFAT) as depicted in Fig 4a of the paper. A simple algorithm in the events section takes care of the calcium oscillation. The model was successfully tested on MathSBML.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(594, 2, 'BIOMD123 Fisher2006_NFAT_Activation', '<p>The model reproduces the kinetics of the nuclear factor of activated cells (NFAT) as depicted in Figure 3a of the paper. Model was successfully tested on Jarnac and MathSBML</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(595, 2, 'BIOMD140 Hoffmann2002_WT_IkBNFkB_Signaling', '<p>This model corresponds to the IkB-NFkB signaling in wild type cells and reproduces the dynamics of the species as depicted in  Figure 2 F of the paper. The authors mention that the simulation is carried out in three phases, where the steady state values of the species in one phase are fed to the succeding phase. This model captures the simulation dynamics of two phases and makes use of the event section to introduce the stimulus and thereby transition to the next phase. Accordingly, a few terms have been introduced that make this transition possible, this in no way compromises the original model. Also, the simulation plots are not an exact reproduction of the figures in the paper, they do however match the simulation results that the authors shared with us. Model was successfully tested on MathSBML.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(596, 2, 'BIOMD143 Olsen2003_neutrophil_oscillatory_metabolism', '<div class=\"dc:title\">\nOlsen2003_neutrophil_oscillatory_metabolism</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/12524266\" title=\"Access to this publication\">A model of the oscillatory\n    metabolism of activated neutrophils.</a>\n  </div>\n  <div class=\"bibo:authorList\">Olsen LF, Kummer U, Kindzelskii AL,\n  Petty HR.</div>\n  <div class=\"bibo:Journal\">Biophys. J. 2003 Jan; 84(1):\n  69-81</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>We present a two-compartment model to explain the\n    oscillatory behavior observed experimentally in activated\n    neutrophils. Our model is based mainly on the\n    peroxidase-oxidase reaction catalyzed by myeloperoxidase with\n    melatonin as a cofactor and NADPH oxidase, a major protein in\n    the phagosome membrane of the leukocyte. The model predicts\n    that after activation of a neutrophil, an increase in the\n    activity of the hexose monophosphate shunt and the delivery of\n    myeloperoxidase into the phagosome results in oscillations in\n    oxygen and NAD(P)H concentration. The period of oscillation\n    changes from >200 s to 10-30 s. The model is consistent with\n    previously reported oscillations in cell metabolism and oxidant\n    production. Key features and predictions of the model were\n    confirmed experimentally. The requirement of the hexose\n    monophosphate pathway for 10 s oscillations was verified using\n    6-aminonicotinamide and dexamethasone, which are inhibitors of\n    glucose-6-phosphate dehydrogenase. The role of the NADPH\n    oxidase in promoting oscillations was confirmed by\n    dose-response studies of the effect of diphenylene iodonium, an\n    inhibitor of the NADPH oxidase. Moreover, the model predicted\n    an increase in the amplitude of NADPH oscillations in the\n    presence of melatonin, which was confirmed experimentally.\n    Successful computer modeling of complex chemical dynamics\n    within cells and their chemical perturbation will enhance our\n    ability to identify new antiinflammatory compounds.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000143\">BIOMD0000000143</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(597, 2, 'BIOMD144 Calzone2007_CellCycle', '<p>This is the Dynamical model of nuclear division cycles during early embryogenesis of Drosophila, without StringT regulation. so ksstg=kdstg=0. Figure1B has been simulated by MathSBML. Curator changed model from only one compartment into two compartments according to the paper. Detail explaination of the models are in the supplement information of the paper.The author didn\'t specify which compartment Xm, Stgm, Xp are located, we assume that they locate in cytoplasm.</p>\n            <p>Some of the parameter values for the equations are dimensionless parameters.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(598, 2, 'BIOMD145 Wang2007 - ATP induced intracellular Calcium Oscillation', '<div class=\"dc:title\">\n Wang2007 - ATP induced intracellular Calicum Oscillation\n</div>\n\n <p>The model simulate the ATP-induced intracellular Ca<sup>2+</sup> oscillations and the quantitative effect of ATP concentration on the oscillation characteristics such as the duration, peak concentration of intracellular Ca<sup>2+</sup> and average interval. </p>\n</div>\n<div class=\"dc:bibliographicCitation\">\n <p>This model is described in the article:</p>\n <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/17188305\" title=\"Access to this publication\">A quantitative kinetic model for ATP-induced intracellular Ca2+ oscillations.</a></div>\n <div class=\"bibo:authorList\">Wang J, Huang X, Huang W.</div>\n <div class=\"bibo:Journal\">J. Theor. Biol. 2007 Apr; 245(3): 510-519 </div>\n <p>Abstract:</p>\n <div class=\"bibo:abstract\">  \n   <p>A quantitative kinetic model is proposed to simulate the ATP-induced intracellular Ca(2+) oscillations. The quantitative effect of ATP concentration upon the oscillations was successfully simulated. Our simulation results support previous experimental explanations that the Ca(2+) oscillations are mainly due to interaction of Ca(2+) release from the endoplasmic reticulum (ER) and the ATP-dependent Ca(2+) pump back into the ER, and the oscillations are prolonged by extracellular Ca(2+) entry that maintains the constant Ca(2+) supplies to its intracellular stores. The model is also able to simulate the sudden disappearance phenomenon of the Ca(2+) oscillations observed in some cell types by taking into account of the biphasic characteristic of the Ca(2+) release from the endoplasmic reticulum (ER). Moreover, the model simulation results for the Ca(2+) oscillations characteristics such as duration, peak [Ca(2+)](cyt), and average interval, etc., lead to prediction of some possible factors responsible for the variations of Ca(2+) oscillations in different types of cells.</p>\n </div>\n</div>\n<div class=\"dc:publisher\">\n <p>This model is hosted on <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a> and identified\nby: <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000145\">BIOMD0000000145</a>.</p>\n <p>To cite BioModels Database, please use: <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n   <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(599, 2, 'BIOMD146 Hatakeyama2003_MAPK', '<p>Figure4 and Figure5 can be simulated by Copasi. Figure4 can be simulated in MathSBML as well. There are some typos in the paper:K29=234, is it should k_29; Table2, reaction17, is there are \"slash\" missing in between the rate equation; reaction 33,\"Akt-PI-PP\" in the last term of denominator instead of \"AktPI-P\" . For plotting figure4, we create another extra parameter *_percent, and use assignment rule calculate percentage of each species.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(600, 2, 'BIOMD147 ODea2007_IkappaB', '<p class=\"p1\">O\'Dea, E.L., Barken, D., Peralta, R.Q., Tran K.T., Werner, S.L., Kearns, J.D., Levchenko, A., Hoffmann, A. A homeostatic model of IkB metabolism to control constitutive activity. Molecular Systems Biology, 3:111, pp. 1-7. 2007<br/></p>\n        <p class=\"p1\">Questions concerning the paper should be addressed to the corresponding author. Alexander Hoffmann (ahoffmann@ucsd.edu)</p>\n        <hr/>\n        <p class=\"p1\">The original model was written and simulated within MathWorks MatLab 2006a using the ode15s (stiff/NDF) solver. It is highly recommended that those wanting to model this system use the MatLab version which we will freely provide upon request. As always, simulation results vary according to the numerical solver used.</p>\n        <p>Translation to SBML Level 2.1 was performed via reconstruction of the model within MathWorks SimBiology Desktop (version 2.1) followed by an Export to SBML. Please address questions about this SBML model to Jeff Kearns (jkearns@ucsd.edu).</p>\n        <p>BioModels DB curation: The model reproduces the values of diffferent species depicted in Fig 3A and 3B (wt) of the paper corresponding to Model1.1. To depict the the total IkB alpha, beta epsilon species, three additional parameters and their corresponding assignment rules have been introduced in this model by the creator. Model succesfully tested on MathSBML. </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n      </p>', 0, '2020-02-02'),
(601, 2, 'BIOMD148 Komarova2003_BoneRemodeling', '<p>      This a model from the article:      <br/>\n        <strong> Mathematical model predicts a critical role for osteoclast autocrine regulation in the control of bone remodeling.</strong>\n        <br/>Komarova SV, Smith RJ, Dixon SJ, Sims SM, Wahl LM      <em>Bone</em>2003 Aug;33(2):206-15      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/14499354\">14499354</a>,      <br/>\n        <strong>Abstract:</strong>\n        <br/>Bone remodeling occurs asynchronously at multiple sites in the adult skeleton and involves resorption by osteoclasts, followed by formation of new bone by osteoblasts. Disruptions in bone remodeling contribute to the pathogenesis of disorderssuch as osteoporosis, osteoarthritis, and Paget\'s disease. Interactions among cells of osteoblast and osteoclast lineages are critical in the regulation of bone remodeling. We constructed a mathematical model of autocrine and paracrine interactions among osteoblasts and osteoclasts that allowed us to calculate cell population dynamics and changes in bone mass at a discrete site of bone remodeling. Themodel predicted different modes of dynamic behavior: a single remodeling cycle in response to an external stimulus, a series of internally regulated cycles of bone remodeling, or unstable behavior similar to pathological bone remodeling in Paget\'s disease. Parametric analysis demonstrated that the mode of dynamic behaviorin the system depends strongly on the regulation of osteoclasts by autocrine factors, such as transforming growth factor beta. Moreover, simulations demonstratedthat nonlinear dynamics of the system may explain the differing effects of immunosuppressants on bone remodeling in vitro and in vivo. In conclusion, the mathematical model revealed that interactions among osteoblasts and osteoclasts result in complex, nonlinear system behavior, which cannot be deduced from studies of each cell type alone. The model will be useful in future studies assessing the impact of cytokines, growth factors, and potential therapies on the overall process ofremodeling in normal bone and in pathological conditions such as osteoporosis and Paget\'s disease.   </p>\n        <p xmlns=\"http://www.w3.org/1999/xhtml\">The model reproduces Fig 2A and Fig 2B of the paper. Note that the Y-axis scale is not right, the osteoblast steadystate is approximatley 212 and not 0 as depicted in the figure. Also, there is atypo in the equation for x2_bar which has been corrected here. Model successfully tested on MathSBML.</p>\n        <p xmlns=\"http://www.w3.org/1999/xhtml\">This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a></p>', 0, '2020-02-02'),
(602, 2, 'BIOMD149 Kim2007 - Crosstalk between Wnt and ERK pathways', '<div class=\"dc:title\">Kim2007 - Crosstalk between Wnt and ERK pathways</div>\n        \n          <p>Experimental studies have shown that both Wnt and the MAPK pathways are involved in the pathogenesis of various kinds of cancers (eg. colorectal cancer). The crosstalk between the two pathways have also been identified. Here, Kim et al., (2007) have integrated the experimental evidences on crosstalk mechanisms between the two pathways into a pathway model, and have identified the existence of a hidden positive feedback loop and suggest that this positive feedback loop might participate in the pathogenesis of colorectal cancer.</p>\n        </div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/17237813\" title=\"Access to this publication\">A hidden oncogenic positive feedback loop caused by crosstalk between Wnt and ERK pathways.</a>\n          </div>\n          <div class=\"bibo:authorList\">Kim D, Rath O, Kolch W, Cho KH.</div>\n          <div class=\"bibo:Journal\">Oncogene 2007 Jul; 26(31): 4571-4579</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>The Wnt and the extracellular signal regulated-kinase (ERK) pathways are both involved in the pathogenesis of various kinds of cancers. Recently, the existence of crosstalk between Wnt and ERK pathways was reported. Gathering all reported results, we have discovered a positive feedback loop embedded in the crosstalk between the Wnt and ERK pathways. We have developed a plausible model that represents the role of this hidden positive feedback loop in the Wnt/ERK pathway crosstalk based on the integration of experimental reports and employing established basic mathematical models of each pathway. Our analysis shows that the positive feedback loop can generate bistability in both the Wnt and ERK signaling pathways, and this prediction was further validated by experiments. In particular, using the commonly accepted assumption that mutations in signaling proteins contribute to cancerogenesis, we have found two conditions through which mutations could evoke an irreversible response leading to a sustained activation of both pathways. One condition is enhanced production of beta-catenin, the other is a reduction of the velocity of MAP kinase phosphatase(s). This enables that high activities of Wnt and ERK pathways are maintained even without a persistent extracellular signal. Thus, our study adds a novel aspect to the molecular mechanisms of carcinogenesis by showing that mutational changes in individual proteins can cause fundamental functional changes well beyond the pathway they function in by a positive feedback loop embedded in crosstalk. Thus, crosstalk between signaling pathways provides a vehicle through which mutations of individual components can affect properties of the system at a larger scale.</p>\n          </div>\n        </div>\n        <div class=\"bm:curation\">\n          <p>Figure 6 of the reference publication has been reproduced. The model as such reproduces the plots corresponding to the normal conditions. To obtain simulations under 1) beta-cataenin mutation; set V12=0.846 (two-fold of the beta-catenin synthetic rate than the normal system. i.e. 2*0.426), 2) PP2A mutation; set Vmax4=Vmax5=33.75 (three-fourths of the PP2A activity that the normal system. i.e. (3/4)*45). The simulation was performed using Copasi 4.10 (Build 55).</p>\n        </div>\n        <div class=\"dc:publisher\">\n          <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000149\">BIOMD0000000149</a>\n            .        </p>\n          <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n        </div>\n        <div class=\"dc:license\">\n          <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n        </div>', 0, '2020-02-02'),
(603, 2, 'BIOMD150 Morris2002_CellCycle_CDK2Cyclin', '<p>Notes from the original DOCQS curator:      <br/>\n          In this version of the CDK2/Cyclin A complex activation there is discrepancy in the first curve which plots the binding reaction of CDK2 and Cyclin A expressed in E. coli. With the published rate constants the simulation does not match the published graph (Fig.1B) in      <a href=\"http://www.ncbi.nlm.nih.gov/entrez/query.fcgi?cmd=Retrieve&amp;db=pubmed&amp;dopt=Abstract&amp;list_uids=11959850 \">Morris MC. et al. J Biol Chem. 277(26):23847-53</a>\n          .      </p>\n            <p>Notes from BioModels DB curator:      <br/>\n          Although the parameters are those reported in the table I for CDK2/Cyclin A, the total fluorescence follows exactly the curve reported in the paper for CDK2/Cyclin H in figure 1B. Either the plot legend or the table is wrong.      </p>', 0, '2020-02-02'),
(604, 2, 'BIOMD151 Singh2006_IL6_Signal_Transduction', '<p>The model reproduces Fig 2 , Fig3A and Fig 3B of the paper. The ODE for x1(gp180) and x3 (gp 130)  is wrong and the authors have communicated to the curator that the species ought to have a constant value. There are a few other differences from the paper and these were made in consultation with the authors. Model was successfully tested on MathSBML.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(605, 2, 'BIOMD152 Fernandez2006_ModelA', '<p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
