(612, 2, 'BIOMD168 Obeyesekere1999_CellCycle', '<p>The model reproduces the time profiles of the different species depicted in Fig 3a of the paper. Model successfully reproduced using MathSBML.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(613, 2, 'BIOMD173 Schmierer_2008_Smad_Tgfb', '<html xmlns=\"http://www.w3.org/1999/xhtml\">\n        <head/><p> This sbml file describes the RECI model from:\n      \n          \n          \n      \n          \n          \n          <br/>\n	  \"Mathematical modeling identifies Smad nucleocytoplasmic shuttling as a dynamic signal-interpreting system\" by Bernhard Schmierer, Alexander L. Tournier, Paul A. Bates and Caroline S. Hill, Proc Natl Acad Sci U S A. 2008 May 6;105(18):6608-13.\n      \n          \n          \n      \n          \n          \n          <br/>\n	  All parameter and species names are as in Figure S3 of the original publication. The original model was done in copasi.\n      \n          \n          \n      \n          \n          \n          <br/>\nSB-431542 addition to a concentration of 10000 nM is set at 2700 sec. The initial concentration of SB, the time point of addition and the final concentration can be set by altering the parameters \n      \n          \n          \n      \n          \n          \n          <b>SB_0</b>, \n      \n          \n          \n      \n          \n          \n          <b>t_SB</b> and \n      \n          \n          \n      \n          \n          \n          <b>SB_end</b>.\n      \n          \n          \n      \n          \n          \n          <br/>  \nThis model file has been used to reproduce Figures 2D and 5A from the research paper using SBMLodesolver. To get the results for the figures, sum the corresponding concentrations:\n      \n          \n          \n      \n          \n          \n          <br/>\nfig 2D: nuclear EGFP-Smad2 = G_n + pG_n + G2_n + G4_n + 2* GG_n\n      \n          \n          \n      \n          \n          \n          <br/>\nfig 5A (either n or c for nucleus or cytosol):\n      \n          \n          \n      \n          \n          \n          <br/>\nmonomeric Smad2 = S2_n/c + G_n/c\n      \n          \n          \n      \n          \n          \n          <br/>\nmonomeric P-Smad2 = pS2_n/c + pG_n/c\n      \n          \n          \n      \n          \n          \n          <br/>\nSmad2/Smad4 complexes = S24_n/c + G4_n/c\n      \n          \n          \n      \n          \n          \n          <br/>\nSmad2/Smad2 complexes = S22_n/c + G2_n/c + GG_n/c\n      \n          \n          \n      \n          \n          \n          <br/></p>\n          <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.\n          \n          \n          <br/>For more information see the \n          \n          \n          <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.\n          \n          \n          <br/>To cite BioModels Database, please use \n          \n          \n          <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\"> Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n        </p></html>', 0, '2020-02-02'),
(614, 2, 'BIOMD176 Conant2007_WGD_glycolysis_2A3AB', '<p>This a model from the article:      <br/>\n        <strong>Increased glycolytic flux as an outcome of whole-genome duplication in yeast.</strong>\n        <br/>\n          Conant GC, Wolfe KH      <em>Mol. Syst. Biol.</em>\n          [2007 ; Volume: 3 (Issue: )]: 129      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/17667951\">17667951</a>\n          ,      <br/>\n        <strong>Abstract:</strong>\n        <br/>\n          After whole-genome duplication (WGD), deletions return most loci to single copy. However, duplicate loci may survive through selection for increased dosage. Here, we show how the WGD increased copy number of some glycolytic genes could have conferred an almost immediate selective advantage to an ancestor of Saccharomyces cerevisiae, providing a rationale for the success of the WGD. We propose that the loss of other redundant genes throughout the genome resulted in incremental dosage increases for the surviving duplicated glycolytic genes. This increase gave post-WGD yeasts a growth advantage through rapid glucose fermentation; one of this lineage\'s many adaptations to glucose-rich environments. Our hypothesis is supported by data from enzyme kinetics and comparative genomics. Because changes in gene dosage follow directly from post-WGD deletions, dosage selection can confer an almost instantaneous benefit after WGD, unlike neofunctionalization or subfunctionalization, which require specific mutations. We also show theoretically that increased fermentative capacity is of greatest advantage when glucose resources are both large and dense, an observation potentially related to the appearance of angiosperms around the time of WGD.      </p>\n      <br/>\n      <br/>\n      <p>The original model submitted by the authors was slightly altered and now comprises the models originally submitted as MODEL2426780967, MODEL2427021978, MODEL2427095802. It reproduces figures 2A,3A and 3B from the publication.</p>\n      <p>This model uses the glycolysis model from Pritchard and Kell (2002) with an additional parameter,      <b>WGD_E</b>\n          , to adjust for the differing enzyme conzentrations before the  whole genome duplication (WGD) and parameters      <b>fV_xxx</b>\n          that adjust the      <b>Vmax</b>\n          of the different reactions (xxx eg. HXT or PYK).      <br/>\n          Figure 3A from the article can be reproduced by changing the value of the parameters      <b>fV_xxx</b>\n          to 0.9 indiviually, with xxx signifying the different enzymes (HXT, HXK ...)      <br/>\n          Figure 3B from the publication can be reproduced by setting  the parameter      <b>WGD_E</b>\n          to 0.75 and individually setting the parameters      <b>fV_xxx</b>\n          to 1.333.      <br/>\n          To reproduce figure 2A from the article change the parameter      <b>WGD_E</b>\n          in the range between 0.65 and 1.0.      </p>\n    <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2012 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n</p>', 0, '2020-02-02'),
(615, 2, 'BIOMD177 Conant2007_glycolysis_2C', '<p>This a model from the article:      <br/>\n        <strong>Increased glycolytic flux as an outcome of whole-genome duplication in yeast.</strong>\n        <br/>\n          Conant GC, Wolfe KH      <em>Mol. Syst. Biol.</em>\n          [2007 ; Volume: 3 (Issue: )]: 129      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/17667951\">17667951</a>\n          ,      <br/>\n        <strong>Abstract:</strong>\n        <br/>\n          After whole-genome duplication (WGD), deletions return most loci to single copy. However, duplicate loci may survive through selection for increased dosage. Here, we show how the WGD increased copy number of some glycolytic genes could have conferred an almost immediate selective advantage to an ancestor of Saccharomyces cerevisiae, providing a rationale for the success of the WGD. We propose that the loss of other redundant genes throughout the genome resulted in incremental dosage increases for the surviving duplicated glycolytic genes. This increase gave post-WGD yeasts a growth advantage through rapid glucose fermentation; one of this lineage\'s many adaptations to glucose-rich environments. Our hypothesis is supported by data from enzyme kinetics and comparative genomics. Because changes in gene dosage follow directly from post-WGD deletions, dosage selection can confer an almost instantaneous benefit after WGD, unlike neofunctionalization or subfunctionalization, which require specific mutations. We also show theoretically that increased fermentative capacity is of greatest advantage when glucose resources are both large and dense, an observation potentially related to the appearance of angiosperms around the time of WGD.      </p>\n      <br/>\n      <br/>\n      <p>This model reproduces fig. 2C from the      <a href=\"http://dx.doi.org/10.1038/msb.2008.46\">corrigendum</a>\n          to the publication      <br/>\n          The parameter      <b>Vmax_PDH</b>\n          was corrected by a factor 60 from 6.32 mM/min in the publication to 379.2 mM/min in accordance with the authors.      <br/>\n          see the      <a href=\"http://dx.doi.org/10.1038/msb.2008.46\">corrigendum</a>\n          at msb or its      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/18594520\">pubmed entry (pmid:18594520)</a>\n  </p>\n  <p>This model comprises the glycolysis model from Pritchard and Kell (2002) with an extension for the metabolisation of pyruvate in the mitochondria by pyruvate dehydrogenase and an additional parameter,      <b>WGD_E</b>\n          , to adjust for the differing enzyme concentrations before the whole genome duplication (WGD).      <br/>\n          To switch off transport of pyruvate to the mitochondria, set the parameter      <b>t_m</b>\n          = 0.      <br/>\n          Figure 2C from the article can be reproduced by manually changing the value of parameter      <b>WGD_E</b>\n          in the range between 0.65 and 1.0 and calculating the ratios of ratio of      <b>PDC/PDH</b>\n          fluxes in the altered model to the one of the model with      <b>WGD_E</b>\n          = 1.      </p><p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2012 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n</p>', 0, '2020-02-02'),
(616, 2, 'BIOMD178 Lebeda2008 - BoTN Paralysis (4 step model)', '<div class=\"dc:title\">Lebeda2008 - BoTN Paralysis (4 step\nmodel)</div>\n\n  <span style=\"color: rgb(0, 0, 0); font-family: helvetica, \'trebuchet MS\', arial, sans-serif; font-size: 12px;\">The\n  onset of paralysis of skeletal muscles induced by BoNT/A at the\n  isolated rat neuromuscular junction is described in this model.\n  This model is the extended model of</span>\n  <a href=\"http://www.ebi.ac.uk/biomodels/BIOMD0000000267\" style=\"font-family: helvetica, \'trebuchet MS\', arial, sans-serif; font-size: 12px;\">BIOMD0000000267</a>\n  <span style=\"color: rgb(0, 0, 0); font-family: helvetica, \'trebuchet MS\', arial, sans-serif; font-size: 12px;\">,\n  which itself is the reduced form of the model developed by\n  Simpson 1980; PMID</span>\n  <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/6243359\" style=\"font-family: helvetica, \'trebuchet MS\', arial, sans-serif; font-size: 12px;\">6243359</a>\n</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/18551355\" title=\"Access to this publication\">Onset dynamics of type A\n    botulinum neurotoxin-induced paralysis.</a>\n  </div>\n  <div class=\"bibo:authorList\">Lebeda FJ, Adler M, Erickson K,\n  Chushak Y.</div>\n  <div class=\"bibo:Journal\">J Pharmacokinet Pharmacodyn 2008 Jun;\n  35(3): 251-267</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Experimental studies have demonstrated that botulinum\n    neurotoxin serotype A (BoNT/A) causes flaccid paralysis by a\n    multi-step mechanism. Following its binding to specific\n    receptors at peripheral cholinergic nerve endings, BoNT/A is\n    internalized by receptor-mediated endocytosis. Subsequently its\n    zinc-dependent catalytic domain translocates into the\n    neuroplasm where it cleaves a vesicle-docking protein, SNAP-25,\n    to block neurally evoked cholinergic neurotransmission. We\n    tested the hypothesis that mathematical models having a minimal\n    number of reactions and reactants can simulate published data\n    concerning the onset of paralysis of skeletal muscles induced\n    by BoNT/A at the isolated rat neuromuscular junction (NMJ) and\n    in other systems. Experimental data from several laboratories\n    were simulated with two different models that were represented\n    by sets of coupled, first-order differential equations. In this\n    study, the 3-step sequential model developed by Simpson (J\n    Pharmacol Exp Ther 212:16-21,1980) was used to estimate upper\n    limits of the times during which anti-toxins and other\n    impermeable inhibitors of BoNT/A can exert an effect. The\n    experimentally determined binding reaction rate was verified to\n    be consistent with published estimates for the rate constants\n    for BoNT/A binding to and dissociating from its receptors.\n    Because this 3-step model was not designed to reproduce\n    temporal changes in paralysis with different toxin\n    concentrations, a new BoNT/A species and rate (k(S)) were added\n    at the beginning of the reaction sequence to create a 4-step\n    scheme. This unbound initial species is transformed at a rate\n    determined by k(S) to a free species that is capable of\n    binding. By systematically adjusting the values of k(S), the\n    4-step model simulated the rapid decline in NMJ function (k(S)\n    >or= 0.01), the less rapid onset of paralysis in mice\n    following i.m. injections (k (S) = 0.001), and the slow onset\n    of the therapeutic effects of BoNT/A (k(S) &lt; 0.001) in man.\n    This minimal modeling approach was not only verified by\n    simulating experimental results, it helped to quantitatively\n    define the time available for an inhibitor to have some effect\n    (t(inhib)) and the relation between this time and the rate of\n    paralysis onset. The 4-step model predicted that as the rate of\n    paralysis becomes slower, the estimated upper limits of\n    (t(inhib)) for impermeable inhibitors become longer. More\n    generally, this modeling approach may be useful in studying the\n    kinetics of other toxins or viruses that invade host cells by\n    similar mechanisms, e.g., receptor-mediated endocytosis.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000178\">BIOMD0000000178</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(617, 2, 'BIOMD182 Neves2008 - Role of cell shape and size in controlling intracellular signalling', '<div class=\"dc:title\">Neves2008 - Role of cell shape and size in controlling intracellular signalling</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/18485874\" title=\"Access to this publication\">Cell shape and negative links in regulatory motifs together control spatial information flow in signaling networks.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Neves SR, Tsokas P, Sarkar A, Grace EA, Rangamani P, Taubenfeld SM, Alberini CM, Schaff JC, Blitzer RD, Moraru II, Iyengar R</div>\n                <div class=\"bibo:Journal\">Cell. 2008, 133(4):666-680</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>The role of cell size and shape in controlling local intracellular signaling reactions, and how this spatial information originates and is propagated, is not well understood. We have used partial differential equations to model the flow of spatial information from the beta-adrenergic receptor to MAPK1,2 through the cAMP/PKA/B-Raf/MAPK1,2 network in neurons using real geometries. The numerical simulations indicated that cell shape controls the dynamics of local biochemical activity of signal-modulated negative regulators, such as phosphodiesterases and protein phosphatases within regulatory loops to determine the size of microdomains of activated signaling components. The model prediction that negative regulators control the flow of spatial information to downstream components was verified experimentally in rat hippocampal slices. These results suggest a mechanism by which cellular geometry, the presence of regulatory loops with negative regulators, and key reaction rates all together control spatial information transfer and microdomain characteristics within cells.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL8609366518\">MODEL8609366518</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(618, 2, 'BIOMD185 Locke2008_Circadian_Clock', '<p>The model reproduces Fig 2A of the paper. Model successfully reproduced using Jarnac and MathSBML.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(619, 2, 'BIOMD186 Ibrahim2008 - Mitotic Spindle Assembly Checkpoint - Dissociation variant', '<div class=\"dc:title\">Ibrahim2008 - Mitotic Spindle Assembly Checkpoint - Dissociation variant</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/18253502\" title=\"Access to this publication\">In-silico modeling of the mitotic spindle assembly checkpoint.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Ibrahim B, Diekmann S, Schmitt E, Dittrich P</div>\n                <div class=\"bibo:Journal\">PLoS One. 2008 Feb 6;3(2):e1555.</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>BACKGROUND: The Mitotic Spindle Assembly Checkpoint ((M)SAC) is an evolutionary conserved mechanism that ensures the correct segregation of chromosomes by restraining cell cycle progression from entering anaphase until all chromosomes have made proper bipolar attachments to the mitotic spindle. Its malfunction can lead to cancer.</p>\n                    <p>PRINCIPLE FINDINGS: We have constructed and validated for the human (M)SAC mechanism an in silico dynamical model, integrating 11 proteins and complexes. The model incorporates the perspectives of three central control pathways, namely Mad1/Mad2 induced Cdc20 sequestering based on the Template Model, MCC formation, and APC inhibition. Originating from the biochemical reactions for the underlying molecular processes, non-linear ordinary differential equations for the concentrations of 11 proteins and complexes of the (M)SAC are derived. Most of the kinetic constants are taken from literature, the remaining four unknown parameters are derived by an evolutionary optimization procedure for an objective function describing the dynamics of the APC:Cdc20 complex. MCC:APC dissociation is described by two alternatives, namely the \"Dissociation\" and the \"Convey\" model variants. The attachment of the kinetochore to microtubuli is simulated by a switching parameter silencing those reactions which are stopped by the attachment. For both, the Dissociation and the Convey variants, we compare two different scenarios concerning the microtubule attachment dependent control of the dissociation reaction. Our model is validated by simulation of ten perturbation experiments.</p>\n                    <p>CONCLUSION: Only in the controlled case, our models show (M)SAC behaviour at meta- to anaphase transition in agreement with experimental observations. Our simulations revealed that for (M)SAC activation, Cdc20 is not fully sequestered; instead APC is inhibited by MCC binding.</p>\n                    </div>\n                </div>\n            <div class=\"bm:curation\">      <p>This model describes the controlled dissociation variant of the mitotic spindle assembly checkpoint. If the tool you use has problems with events, you can uncomment the assignment rules for u and u_prime and comment out the list of events.</p>\n                </div>\n            <div class=\"bm:modification\">      <p>In accordance with the authors due to typos in the original publication some initial conditions and parameters were slightly changed in the model:        <table cellspacing=\"10\">          <tr>            <th/>\n                            <th>article</th>\n                            <th>model</th>\n                            </tr>\n                        <tr>            <td align=\"left\">              <i>[O-Mad2]</i>\n                                </td>\n                            <td align=\"right\">1.5e-7 M</td>\n                            <td align=\"right\">1.3e-7 M</td>\n                            </tr>\n                        <tr>            <td align=\"left\">              <i>[BubR1:Bub3]</i>\n                                </td>\n                            <td align=\"right\">1.30e-7 M</td>\n                            <td align=\"right\">1.27e-7 M</td>\n                            </tr>\n                        <tr>            <td align=\"left\">              <i>k                <sub>-4</sub>\n                                    </i>\n                                </td>\n                            <td align=\"right\">0.01 M              <sup>-1</sup>\n                  s              <sup>-1</sup>\n                                </td>\n                            <td align=\"right\">0.02 M              <sup>-1</sup>\n                  s              <sup>-1</sup>\n                                </td>\n                            </tr>\n                        <tr>            <td align=\"left\">              <i>k                <sub>-5</sub>\n                                    </i>\n                                </td>\n                            <td align=\"right\">0.1 M              <sup>-1</sup>\n                  s              <sup>-1</sup>\n                                </td>\n                            <td align=\"right\">0.2 M              <sup>-1</sup>\n                  s              <sup>-1</sup>\n                                </td>\n                            </tr>\n                        </table>\n                    </p>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/MODEL6655615431\">MODEL6655615431</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(620, 2, 'BIOMD187 Ibrahim2008 - Mitotic Spindle Assembly Checkpoint - Convey variant', '<div class=\"dc:title\">Ibrahim2008 - Mitotic Spindle Assembly Checkpoint - Convey variant</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/18253502\" title=\"Access to this publication\">In-silico modeling of the mitotic spindle assembly checkpoint.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Ibrahim B, Diekmann S, Schmitt E, Dittrich P</div>\n                <div class=\"bibo:Journal\">PLoS One. 2008 Feb 6;3(2):e1555.</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>BACKGROUND: The Mitotic Spindle Assembly Checkpoint ((M)SAC) is an evolutionary conserved mechanism that ensures the correct segregation of chromosomes by restraining cell cycle progression from entering anaphase until all chromosomes have made proper bipolar attachments to the mitotic spindle. Its malfunction can lead to cancer.</p>\n                    <p>PRINCIPLE FINDINGS: We have constructed and validated for the human (M)SAC mechanism an in silico dynamical model, integrating 11 proteins and complexes. The model incorporates the perspectives of three central control pathways, namely Mad1/Mad2 induced Cdc20 sequestering based on the Template Model, MCC formation, and APC inhibition. Originating from the biochemical reactions for the underlying molecular processes, non-linear ordinary differential equations for the concentrations of 11 proteins and complexes of the (M)SAC are derived. Most of the kinetic constants are taken from literature, the remaining four unknown parameters are derived by an evolutionary optimization procedure for an objective function describing the dynamics of the APC:Cdc20 complex. MCC:APC dissociation is described by two alternatives, namely the \"Dissociation\" and the \"Convey\" model variants. The attachment of the kinetochore to microtubuli is simulated by a switching parameter silencing those reactions which are stopped by the attachment. For both, the Dissociation and the Convey variants, we compare two different scenarios concerning the microtubule attachment dependent control of the dissociation reaction. Our model is validated by simulation of ten perturbation experiments.</p>\n                    <p>CONCLUSION: Only in the controlled case, our models show (M)SAC behaviour at meta- to anaphase transition in agreement with experimental observations. Our simulations revealed that for (M)SAC activation, Cdc20 is not fully sequestered; instead APC is inhibited by MCC binding.</p>\n                    </div>\n                </div>\n            <div class=\"bm:curation\">      <p>This model describes the controlled dissociation variant of the mitotic spindle assembly checkpoint. If the tool you use has problems with events, you can uncomment the assignment rules for u and u_prime and comment out the list of events.</p>\n                </div>\n            <div class=\"bm:modification\">      <p>In accordance with the authors due to typos in the original publication some initial conditions and parameters were slightly changed in the model:        <table cellspacing=\"10\">          <tr>            <th/>\n                            <th>article</th>\n                            <th>model</th>\n                            </tr>\n                        <tr>            <td align=\"left\">              <i>[O-Mad2]</i>\n                                </td>\n                            <td align=\"right\">1.5e-7 M</td>\n                            <td align=\"right\">1.3e-7 M</td>\n                            </tr>\n                        <tr>            <td align=\"left\">              <i>[BubR1:Bub3]</i>\n                                </td>\n                            <td align=\"right\">1.30e-7 M</td>\n                            <td align=\"right\">1.27e-7 M</td>\n                            </tr>\n                        <tr>            <td align=\"left\">              <i>k                <sub>-4</sub>\n                                    </i>\n                                </td>\n                            <td align=\"right\">0.01 M              <sup>-1</sup>\n                  s              <sup>-1</sup>\n                                </td>\n                            <td align=\"right\">0.02 M              <sup>-1</sup>\n                  s              <sup>-1</sup>\n                                </td>\n                            </tr>\n                        <tr>            <td align=\"left\">              <i>k                <sub>-5</sub>\n                                    </i>\n                                </td>\n                            <td align=\"right\">0.1 M              <sup>-1</sup>\n                  s              <sup>-1</sup>\n                                </td>\n                            <td align=\"right\">0.2 M              <sup>-1</sup>\n                  s              <sup>-1</sup>\n                                </td>\n                            </tr>\n                        </table>\n                    </p>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/MODEL6655578762\">MODEL6655578762</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(621, 2, 'BIOMD188 Proctor2008 - p53/Mdm2 circuit - p53 stabilisation by ATM', '<div class=\"dc:title\">Proctor2008 - p53/Mdm2 circuit - p53 stabilisation by ATM</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/18706112\" title=\"Access to this publication\">Explaining oscillations and\n    variability in the p53-Mdm2 system.</a>\n  </div>\n  <div class=\"bibo:authorList\">Proctor CJ, Gray DA.</div>\n  <div class=\"bibo:Journal\">BMC Syst Biol 2008; 2: 75</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>BACKGROUND: In individual living cells p53 has been found to\n    be expressed in a series of discrete pulses after DNA damage.\n    Its negative regulator Mdm2 also demonstrates oscillatory\n    behaviour. Attempts have been made recently to explain this\n    behaviour by mathematical models but these have not addressed\n    explicit molecular mechanisms. We describe two stochastic\n    mechanistic models of the p53/Mdm2 circuit and show that\n    sustained oscillations result directly from the key biological\n    features, without assuming complicated mathematical functions\n    or requiring more than one feedback loop. Each model examines a\n    different mechanism for providing a negative feedback loop\n    which results in p53 activation after DNA damage. The first\n    model (ARF model) looks at the mechanism of p14ARF which\n    sequesters Mdm2 and leads to stabilisation of p53. The second\n    model (ATM model) examines the mechanism of ATM activation\n    which leads to phosphorylation of both p53 and Mdm2 and\n    increased degradation of Mdm2, which again results in p53\n    stabilisation. The models can readily be modified as further\n    information becomes available, and linked to other models of\n    cellular ageing. RESULTS: The ARF model is robust to changes in\n    its parameters and predicts undamped oscillations after DNA\n    damage so long as the signal persists. It also predicts that if\n    there is a gradual accumulation of DNA damage, such as may\n    occur in ageing, oscillations break out once a threshold level\n    of damage is acquired. The ATM model requires an additional\n    step for p53 synthesis for sustained oscillations to develop.\n    The ATM model shows much more variability in the oscillatory\n    behaviour and this variability is observed over a wide range of\n    parameter values. This may account for the large variability\n    seen in the experimental data which so far has examined ARF\n    negative cells. CONCLUSION: The models predict more regular\n    oscillations if ARF is present and suggest the need for further\n    experiments in ARF positive cells to test these predictions.\n    Our work illustrates the importance of systems biology\n    approaches to understanding the complex role of p53 in both\n    ageing and cancer.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000188\">BIOMD0000000188</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(622, 2, 'BIOMD189 Proctor2008 - p53/Mdm2 circuit - p53 stablisation by p14ARF', '<div class=\"dc:title\">Proctor2008 - p53/Mdm2 circuit - p53 stabilisation by p14ARF</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/18706112\" title=\"Access to this publication\">Explaining oscillations and\n    variability in the p53-Mdm2 system.</a>\n  </div>\n  <div class=\"bibo:authorList\">Proctor CJ, Gray DA.</div>\n  <div class=\"bibo:Journal\">BMC Syst Biol 2008; 2: 75</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>BACKGROUND: In individual living cells p53 has been found to\n    be expressed in a series of discrete pulses after DNA damage.\n    Its negative regulator Mdm2 also demonstrates oscillatory\n    behaviour. Attempts have been made recently to explain this\n    behaviour by mathematical models but these have not addressed\n    explicit molecular mechanisms. We describe two stochastic\n    mechanistic models of the p53/Mdm2 circuit and show that\n    sustained oscillations result directly from the key biological\n    features, without assuming complicated mathematical functions\n    or requiring more than one feedback loop. Each model examines a\n    different mechanism for providing a negative feedback loop\n    which results in p53 activation after DNA damage. The first\n    model (ARF model) looks at the mechanism of p14ARF which\n    sequesters Mdm2 and leads to stabilisation of p53. The second\n    model (ATM model) examines the mechanism of ATM activation\n    which leads to phosphorylation of both p53 and Mdm2 and\n    increased degradation of Mdm2, which again results in p53\n    stabilisation. The models can readily be modified as further\n    information becomes available, and linked to other models of\n    cellular ageing. RESULTS: The ARF model is robust to changes in\n    its parameters and predicts undamped oscillations after DNA\n    damage so long as the signal persists. It also predicts that if\n    there is a gradual accumulation of DNA damage, such as may\n    occur in ageing, oscillations break out once a threshold level\n    of damage is acquired. The ATM model requires an additional\n    step for p53 synthesis for sustained oscillations to develop.\n    The ATM model shows much more variability in the oscillatory\n    behaviour and this variability is observed over a wide range of\n    parameter values. This may account for the large variability\n    seen in the experimental data which so far has examined ARF\n    negative cells. CONCLUSION: The models predict more regular\n    oscillations if ARF is present and suggest the need for further\n    experiments in ARF positive cells to test these predictions.\n    Our work illustrates the importance of systems biology\n    approaches to understanding the complex role of p53 in both\n    ageing and cancer.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000188\">BIOMD0000000188</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02');
