(623, 2, 'BIOMD190 Rodriguez-Caso2006_Polyamine_Metabolism', '<p>\n          <span style=\"font-weight: 600;\">SBML creators: Armando Reyes-Palomares * , Carlos Rodrguez-Caso +, Raul Montaez * , Marta Cascante $, Francisca Snchez-Jimnez * , Miguel A. Medina *</span>\n        </p>\n        <p>\n          <span style=\"font-weight: 600;\">* ProCel Group, Department of Molecular Biology and Biochemistry, Faculty of Sciences, Campus de Teatinos, University of Malaga and CIBER de Enfermedades Raras (CIBER-ER). + Complex Systems Lab (ICREA-UPF), Barcelona Biomedical Research Park (PRBB-GRIB). $ Department of Biochemistry and Molecular Biology, Faculty of Biology, Universitat de Barcelona.</span>\n        </p>\n        <p>\n          <span style=\"font-weight: 600;\">http://asp.uma.es</span>\n        </p>\n        <p>\n          <span style=\"font-weight: 600;\">Metabolic modeling of polyamine metabolism in mammals.</span>\n          <br/>\n          <span style=\"font-style: italic;\">Rodrguez-Caso,C et al.: J Biol Chem 2006 : 281:21799-812.</span>\n          <br/>\n          The model reproduces the dynamical behavior of the polyamine metabolism in mammals. In this model there are some additions and corrections to the publication. All perturbations and analysis have produced results very close to the published experiments. The model was successfully tested on CoPaSi v.4.4 (build 26).      </p>\n        <p>Parameters not included in the publication:</p>\n        <p>1. Parameters for SSAT kinetic constants:</p>\n        <p>KmAcCoA = 1.5 M</p>\n        <p>KmCoA = 40 M</p>\n        <p>2. Parameters for equation MAT (table 1):</p>\n        <p>Vmax_MAT = 0.45 M/min</p>\n        <p>Km_MAT = 41 M</p>\n        <p>Ki_MET_MAT = 50 M</p>\n        <p>3. Erratum.: The corrected ODE for time-dependent variable Antz is:</p>\n        <p>KsANTZ*(1-1/(1+Keq*0.01*([D]+[S])))-KdANTZ*[Antz]</p>\n        <p>According to these modifications the new steady-state analysis results are:</p>\n        <p>Metabolites:</p>\n        <p>[P]= 104.681 M</p>\n        <p>[D]= 76.7492 M</p>\n        <p>[S]= 58.0135 M</p>\n        <p>[SAM]= 52.327 M</p>\n        <p>[A]= 0.0101962 M</p>\n        <p>[aS]= 0.0245375 M</p>\n        <p>[aD]= 0.832236 M</p>\n        <p>Time-dependent global parameters:</p>\n        <p>[Antz] = 0.574038 M</p>\n        <p>Vmaxodc = 1.28315 M/min</p>\n        <p>Vmaxssat = 0.673814 M/min</p>\n        <p>Vmaxsamdc = 0.36829 M/min</p>\n        <br/>\n        <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n      <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n      <br/>\n      <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n  </p>', 0, '2020-02-02'),
(624, 2, 'BIOMD191 Montaez2008_Arginine_catabolism', '<p>      <span style=\"font-weight:600\">SBML creators: Armando Reyes-Palomares * , Raul Montaez *, Carlos Rodriguez-Caso +, Francisca Sanchez-Jimenez * , Miguel A. Medina *</span>\n                </p>\n            <p>      <span style=\"font-weight:600\">* ProCel Group, Department of Molecular Biology and Biochemistry, Faculty of Sciences, Campus de Teatinos, University of Malaga and CIBER de Enfermedades Raras (CIBER-ER). + Complex Systems Lab (ICREA-UPF), Barcelona Biomedical Research Park (PRBB-GRIB).</span>\n                </p>\n            <p>      <span style=\"font-weight:600\">http://asp.uma.es</span>\n                </p>\n            <p>      <span style=\"font-weight:600\">In silico analysis of arginine catabolism as a source of nitric oxide or polyamines in endothelial cells.</span>\n                <br/>\n                <span style=\"font-style:italic\">Montaez, R et al.: Amino Acids. 2008 Feb;34(2):223-9.</span>\n                <br/>\n          The model reproduces the dynamical behavior of the arginine catabolism and transport in relation to the nitric oxide production. In this model there are some additions and corrections to the publication. All perturbations and analysis have produced results very close to the published experiments. The model was successfully tested on CoPaSi v.4.4 (build 26).      </p>\n            <p>Erratum: parameters values modificated respect to the publication to reach the steady-state:</p>\n            <p>Kmodc=90 M (60 M in the paper)</p>\n            <p>Kiornhat (is equivalent to the parameter Kmefflhat Eq ) = 360 M (380 M in the paper)</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(625, 2, 'BIOMD192 Grlich2003_RanGTP_gradient', 'This model represents a concentration gradient of RanGTP across the nuclear envelope. This gradient is generated by distribution of regulators of RanGTPase. We have taken a log linear plot of graphs generated by GENESIS and compared with the experimental graphs. \n      \n      <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2008 The BioModels Team.\n  \n      \n      <br/> For more information see the \n  \n      \n      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\">terms of use</a>.</p>', 0, '2020-02-02'),
(626, 2, 'BIOMD193 Ibrahim2008_MCC_assembly_model_KDM', '<i>BioSystems (2007), doi:10.1016/j.biosystems.2008.06.007</i>\n            <h1>      <i>In-silico</i>\n          study of kinetochore control, amplification, and inhibition effects in MCC assembly      </h1>\n            <br/>\n        Bashar Ibrahim, Eberhard Schmitt, Peter Dittrich, Stephan Diekmann    <br/>\n        This is the kinetochore dependent MCC model (KDM) from the article. For the kinetochore independent MCC model (KIM) replace    <i>u*k4f</i>\n        in    <i>R4</i>\n        by    <i>k4f</i>\n        and    <i>u*k5f</i>\n        in    <i>R5</i>\n        by    <i>k5f</i>\n        .    <br/>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n                </p>', 0, '2020-02-02'),
(627, 2, 'BIOMD194 Ibrahim2008_Cdc20_Sequestring_Template_Model', '<i>Biophysical Chemistry 134 (2008) 93-100</i>\n            <h1>Mad2 binding is not sufficient for complete Cdc20 sequestering in mitotic transition control (an      <i>in silico</i>\n          study)      </h1>\n            <br/>\n        Bashar Ibrahim, Peter Dittrich, Stephan Diekmann, Eberhard Schmitt    <br/>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n                </p>', 0, '2020-02-02'),
(628, 2, 'BIOMD198 Stone1996 - activation of soluble guanylate cyclase by nitric oxide', '<div class=\"dc:title\">Stone1996 - activation of soluble guanylate\ncyclase by nitric oxide</div>\nThis features the two step binding of\nNO to soluble Guanylyl Cyclase as proposed by \n<a href=\"http://www.ncbi.nlm.nih.gov/entrez/query.fcgi?cmd=Retrieve&amp;db=pubmed&amp;dopt=Abstract&amp;list_uids=8573563\">Stone\nJR, Marletta MA. Biochemistry (1996) 35(4):1093-9</a> . There is a\nfast step binding scheme and a slow step binding scheme. The\ndifference lies in the binding of a NO to a non-heme site on sGC,\nwhich may not necessarily be the same site of binding during the\ninitial binding. The rates have been directly used models.</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/8573563\" title=\"Access to this publication\">Spectral and kinetic studies\n    on the activation of soluble guanylate cyclase by nitric\n    oxide.</a>\n  </div>\n  <div class=\"bibo:authorList\">Stone JR, Marletta MA.</div>\n  <div class=\"bibo:Journal\">Biochemistry 1996 Jan; 35(4):\n  1093-1099</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>The soluble form of guanylate cyclase (sGC) is the only\n    definitive receptor for the signaling agent nitric oxide (.NO).\n    The enzyme is a heterodimer of homologous subunits in which\n    each subunit binds 1 equiv of 5-coordinate high-spin heme. .NO\n    increases the Vmax of sGC up to 400-fold and has previously\n    been shown to bind to the heme to form a 5-coordinate complex.\n    Using stopped-flow spectrophotometry, it is demonstrated that\n    the binding of .NO to the heme of sGC is a complex process. .NO\n    first binds to the heme to form a 6-coordinate nitrosyl\n    complex, which then converts to a 5-coordinate nitrosyl complex\n    through one of two ways. For 28 +/- 4% of the heme, the\n    6-coordinate nitrosyl complex rapidly (approximately 20 s-1)\n    converts to the 5-coordinate complex. For the remaining 72 +/-\n    4% of the heme, the conversion of the 6-coordinate nitrosyl\n    complex to a 5-coordinate nitrosyl complex is slow (0.1-1.0\n    s-1) and is dependent upon the interaction of .NO with an\n    unidentified non-heme site on the protein. The heme (200 nM)\n    was completely converted to the 5-coordinate state with as\n    little as 500 nM .NO, and the equilibrium dissociation constant\n    of .NO for activating the enzyme was determined to be &lt; or =\n    250 nM. Gel-filtration analysis indicates that the binding of\n    .NO to the heme has no effect on the native molecular mass of\n    the protein. Correlation of electronic absorption spectra with\n    activity measurements indicates that the 5-coordinate nitrosyl\n    form of the enzyme is activated relative to the resting\n    5-coordinate ferrous form of the enzyme.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000198\">BIOMD0000000198</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(629, 2, 'BIOMD199 Santolini2001_nNOS_Mechanism_Regulation', 'This is a model of neuronal Nitric Oxide Synthase expressed in Escherichia coli based on \n      \n      \n      <a href=\"http://www.ncbi.nlm.nih.gov/entrez/query.fcgi?cmd=Retrieve&amp;db=pubmed&amp;dopt=Abstract&amp;list_uids=11038356\"> Santolini J. et al. J Biol Chem. (2001) 276(2):1233-43</a>.\n      \n      \n      <br/>\nDiffering from the article, oxygen explicitly included in the reaction 2, 5 and 10 (numbers as in scheme 1 in the article). In the article the assumed oxygen concentration of 140 uM was included in the pseudo first order rate constant.\n      \n      \n      <br/>\nFig 2E in the article shows different time courses for citrulline and NO than the ones produced by this model. Dr. Santolini, one of the authors of the article, wrote that the legends in fig. 2E might be mixed up and should rather denote NO and NO3 instead of citrulline and NO.\n      \n      \n      <br/>\n      <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.\n      \n      \n      \n      <br/>For more information see the \n      \n      \n      \n      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.\n      \n      \n      \n      <br/>To cite BioModels Database, please use \n      \n      \n      \n      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\"> Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n  </p>', 0, '2020-02-02'),
(630, 2, 'BIOMD200 Bray1995_chemotaxis_receptorlinkedcomplex', '<p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n      </p>', 0, '2020-02-02'),
(631, 2, 'BIOMD201 Goldbeter2008_Somite_Segmentation_Clock_Notch_Wnt_FGF', '<p>This is a model of the coupled Natch, Wnt and FGF modules as described in:      <br/>\n                <b>A. Goldbeter and O. Pourqui</b>\n          ,      <em>Modeling the segmentation clock as a network of coupled oscillations in the Notch, Wnt and FGF signaling pathways.</em>\n          J Theor Biol. 2008 Jun 7;252(3):574-85, pubmed ID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/18308339\">18308339</a>\n                <br/>\n          To uncouple the modules remove the reaction      <em>MAx_trans_Xa</em>\n          and set      <em>vsFK=vsF</em>\n          .      <br/>\n          The SBML version of the model was converted from the CellML      <a href=\"http://www.cellml.org/models/goldbeter_pourquie_2008_version02\">version</a>\n          by Catherine Lloyd for the      <a href=\"http://www.cellml.org/models\">CellML repository</a>\n          .      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" class=\"external\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(632, 2, 'BIOMD202 ChenXF2008_CICR', '<p xmlns=\"http://www.w3.org/1999/xhtml\">The model reproduces the plots in Figures 1 and 2. Note that the units of the time scale \"A\" are not right in the paper, it was corrected by the curator. Model successfully tested on MathSBML.</p>', 0, '2020-02-02'),
(633, 2, 'BIOMD203 Chickarmane2006 - Stem cell switch reversible', '<div class=\"dc:title\">Chickarmane2006 - Stem cell switch reversible</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                \n                    </div>\n                <div class=\"bibo:authorList\">Chickarmane V, Troein C, Nuber UA, Sauro HM, Peterson C</div>\n                <div class=\"bibo:Journal\">PLoS Computational Biology. 2006; 2(9):e123</div>\n                <p>Abstract:</p>\n                \n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/MODEL7957907314\">MODEL7957907314</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(634, 2, 'BIOMD204 Chickarmane2006 - Stem cell switch irreversible', '<div class=\"dc:title\">Chickarmane2006 - Stem cell switch irreversible</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                \n                    </div>\n                <div class=\"bibo:authorList\">Chickarmane V, Troein C, Nuber UA, Sauro HM, Peterson C</div>\n                <div class=\"bibo:Journal\">PLoS Computational Biology. 2006; 2(9):e123</div>\n                <p>Abstract:</p>\n                \n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/MODEL7957942740\">MODEL7957942740</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(635, 2, 'BIOMD205 Ung2008_EGFR_Endocytosis', '<p xmlns=\"http://www.w3.org/1999/xhtml\">Model reproduces the various plots in the publication for \"Control\" concentrations.  Model successfully tested on MathSBML.</p>', 0, '2020-02-02'),
(636, 2, 'BIOMD206 Wolf2000_Glycolytic_Oscillations', '<p>Model reproduces the dynamics of ATP and NADH as depicted in Fig 4 of the paper.  Model successfully tested on Jarnac and MathSBML.</p>\n        <br/>\n        <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n      <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n      <br/>\n      <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n  </p>', 0, '2020-02-02'),
(637, 2, 'BIOMD207 Romond1999_CellCycle', '<p>The model reproduces Fig 3 of the paper. Model successfully reproduced using MathSBML and Jarnac.</p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(638, 2, 'BIOMD210 Chickarmane2008 - Stem cell lineage - NANOG GATA-6 switch', '<div class=\"dc:title\">Chickarmane2008 - Stem cell lineage - NANOG GATA-6 switch</div>\n            In this work, a dynamical model of lineage\n determination based upon a minimal circuit, as discussed in PMID:        <a href=\"http://identifiers.org/pubmed/18941526\">17215298</a>\n            , which contains the Oct4/Sox2/Nanog core as well its interaction\n with a few other key genes is discussed.        </p>\n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/18941526\" title=\"Access to this publication\">A computational model for understanding stem cell, trophectoderm and endoderm lineage determination.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Chickarmane V, Peterson C</div>\n                <div class=\"bibo:Journal\">PloS one. 2008, 3(10):e3478</div>\n                <p>Abstract:</p>\n                \n                    <p>PRINCIPAL FINDINGS: We construct a dynamical model of a minimalistic network, extracted from ChIP-on-chip and microarray data as well as literature studies. The model is based upon differential equations and makes two plausible assumptions; activation of Gata-6 by Oct4 and repression of Nanog by an Oct4-Gata-6 heterodimer. With these assumptions, the results of simulations successfully describe the biphasic behavior as well as lineage commitment. The model also predicts that reprogramming the network from a differentiated state, in particular the endoderm state, into a stem cell state, is best achieved by over-expressing Nanog, rather than by suppression of differentiation genes such as Gata-6.</p>\n                    <p>CONCLUSIONS: The computational model provides a mechanistic understanding of how different lineages arise from the dynamics of the underlying regulatory network. It provides a framework to explore strategies of reprogramming a cell from a differentiated state to a stem cell state through directed perturbations. Such an approach is highly relevant to regenerative medicine since it allows for a rapid search over the host of possibilities for reprogramming to a stem cell state.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL8389825246\">MODEL8389825246</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(639, 2, 'BIOMD213 Nijhout2004_Folate_Cycle', '<p>This is an SBML version of the folate cycle model model from:      <br/>\n                <b>A mathematical model of the folate cycle: new insights into folate homeostasis.</b>\n                <br/>\n                <em>Nijhout HF, Reed MC, Budu P, Ulrich CM</em>\n          J. Biol. Chem.,2004,      <b>279</b>\n          (53),55008-16      <br/>\n          pubmedID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/15496403\">15496403</a>\n                <br/>\n          Abstract:      <br/>\n          A mathematical model is developed for the folate cycle based on standard biochemical kinetics. We use the model to provide new insights into several different mechanisms of folate homeostasis. The model reproduces the known pool sizes of folate substrates and the fluxes through each of the loops of the folate cycle and has the qualitative behavior observed in a variety of experimental studies. Vitamin B(12) deficiency, modeled as a reduction in the V(max) of the methionine synthase reaction, results in a secondary folate deficiency via the accumulation of folate as 5-methyltetrahydrofolate (the \"methyl trap\"). One form of homeostasis is revealed by the fact that a 100-fold up-regulation of thymidylate synthase and dihydrofolate reductase (known to occur at the G(1)/S transition) dramatically increases pyrimidine production without affecting the other reactions of the folate cycle. The model also predicts that an almost total inhibition of dihydrofolate reductase is required to significantly inhibit the thymidylate synthase reaction, consistent with experimental and clinical studies on the effects of methotrexate. Sensitivity to variation in enzymatic parameters tends to be local in the cycle and inversely proportional to the number of reactions that interconvert two folate substrates. Another form of homeostasis is a consequence of the nonenzymatic binding of folate substrates to folate enzymes. Without folate binding, the velocities of the reactions decrease approximately linearly as total folate is decreased. In the presence of folate binding and allosteric inhibition, the velocities show a remarkable constancy as total folate is decreased.      <br/>\n          This model was encoded by Michal Galdzicki from a MatLab file send to him by Prof. Michael Reed. There some differences in this model compared to the one described in the article, possible due to typos in the publication:      <br/>\n          1) reaction NE (THF + H2CO &lt;=> 5,10-CH2-THF) in the article has H2C=O as a\nreactant and is mentioned to display pseudo first order mass action\nkinetics, while in the matlab file formic acid, also used in reaction FTS, is included in the rate law for the forward reaction.      <br/>\n          2) the reaction MS is modeled after Reed et al. 2004, which is not\nexplicitly mentioned in the article, although Kd and the parameters\nfrom Reed et al. 2004 are given.      <br/>\n          3) in the kinetic law of the SHTM reaction (THF + Ser &lt;=>\n5,10-CH2-THF + Gly), there are separate values given for Km,Gly\nand Km,5,10-CH2-THF in the article. in the matlab file and the SBML\nmodel Km,Ser and Km,THF are used instead of Km,Gly and Km,5,10-CH2-THF\nfor the backwards reaction.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(640, 2, 'BIOMD218 Singh2006_TCA_mtu_model2', '<p>This a model from the article:      <br/>\n                <strong>Kinetic modeling of tricarboxylic acid cycle and glyoxylate bypass in Mycobacterium tuberculosis, and its application to assessment of drug targets.</strong>\n                <br/>\n          Singh VK  ,  Ghosh I      <em>Theor Biol Med Model</em>\n          2006 Aug 3;3:27      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/16887020\">16887020</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          BACKGROUND: Targeting persistent tubercule bacilli has become an important challenge in the development of anti-tuberculous drugs. As the glyoxylate bypass is essential for persistent bacilli, interference with it holds the potential for designing new antibacterial drugs. We have developed kinetic models of the tricarboxylic acid cycle and glyoxylate bypass in Escherichia coli and Mycobacterium tuberculosis, and studied the effects of inhibition of various enzymes in the M. tuberculosis model. RESULTS: We used E. coli to validate the pathway-modeling protocol and showed that changes in metabolic flux can be estimated from gene expression data. The M. tuberculosis model reproduced the observation that deletion of one ofthe two isocitrate lyase genes has little effect on bacterial growth in macrophages, but deletion of both genes leads to the elimination of the bacilli from the lungs. It also substantiated the inhibition of isocitrate lyases by 3-nitropropionate. On the basis of our simulation studies, we propose that: (i) fractional inactivation of both isocitrate dehydrogenase 1 and isocitrate dehydrogenase 2 is required for a flux through the glyoxylate bypass in persistent mycobacteria; and (ii) increasing the amount of active isocitrate dehydrogenases can stop the flux through the glyoxylate bypass, so the kinase that inactivates isocitrate dehydrogenase 1 and/or the proposed inactivator of isocitrate dehydrogenase 2 is a potential target for drugs against persistent mycobacteria. In addition, competitive inhibition of isocitrate lyases along with a reduction in the inactivation of isocitrate dehydrogenases appears to be a feasible strategy for targeting persistent mycobacteria. CONCLUSION: We used kinetic modeling of biochemical pathways to assess various potential anti-tuberculous drug targets that interfere with the glyoxylate bypass flux, and indicated the type of inhibition needed to eliminate the pathogen. The advantage of such an approach to the assessment of drug targets is that it facilitates the study of systemic effect(s) of the modulation of the target enzyme(s) in the cellular environment.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(641, 2, 'BIOMD219 Singh2006_TCA_mtu_model1', '<p>This a model from the article:      <br/>\n                <strong>Kinetic modeling of tricarboxylic acid cycle and glyoxylate bypass in Mycobacterium tuberculosis, and its application to assessment of drug targets.</strong>\n                <br/>\n          Singh VK  ,  Ghosh I      <em>Theor Biol Med Model</em>\n          2006 Aug 3;3:27      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/16887020\">16887020</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          BACKGROUND: Targeting persistent tubercule bacilli has become an important challenge in the development of anti-tuberculous drugs. As the glyoxylate bypass is essential for persistent bacilli, interference with it holds the potential for designing new antibacterial drugs. We have developed kinetic models of the tricarboxylic acid cycle and glyoxylate bypass in Escherichia coli and Mycobacterium tuberculosis, and studied the effects of inhibition of various enzymes in the M. tuberculosis model. RESULTS: We used E. coli to validate the pathway-modeling protocol and showed that changes in metabolic flux can be estimated from gene expression data. The M. tuberculosis model reproduced the observation that deletion of one of the two isocitrate lyase genes has little effect on bacterial growth in macrophages, but deletion of both genes leads to the elimination of the bacilli from the lungs. It also substantiated the inhibition of isocitrate lyases by 3-nitropropionate. On the basis of our simulation studies, we propose that: (i) fractional inactivation of both isocitrate dehydrogenase 1 and isocitrate dehydrogenase 2 is required for a flux through the glyoxylate bypass in persistent mycobacteria; and (ii) increasing the amount of active isocitrate dehydrogenases can stop the flux through the glyoxylate bypass, so the kinase that inactivates isocitrate dehydrogenase 1 and/or the proposed inactivator of isocitrate dehydrogenase 2 is a potential target for drugs against persistent mycobacteria. In addition, competitive inhibition of isocitrate lyases along with a reduction in the inactivation of isocitrate dehydrogenases appears to be a feasible strategy for targeting persistent mycobacteria. CONCLUSION: We used kinetic modeling of biochemical pathways to assess various potential anti-tuberculous drug targets that interfere with the glyoxylate bypass flux, and indicated the type of inhibition needed to eliminate the pathogen. The advantage of such an approach to the assessment of drug targets is that it facilitates the study of systemic effect(s) of the modulation of the target enzyme(s) in the cellular environment.      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(642, 2, 'BIOMD220 Albeck2008_extrinsic_apoptosis', '<p>This the model used in the article:      <br/>\n                <strong>Quantitative analysis of pathways controlling extrinsic apoptosis in single cells.</strong>\n                <br/>\n          Albeck JG, Burke JM, Aldridge BB, Zhang M, Lauffenburger DA, Sorger PK.      <em>Mol Cell.</em>\n          2008 Apr 11;30(1):11-25.\n      PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/18406323\">18406323</a>\n          , doi:      <a href=\"http://dx.doi.org/10.1016/j.molcel.2008.02.012\">10.1016/j.molcel.2008.02.012</a>\n                <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          Apoptosis in response to TRAIL or TNF requires the activation of initiator\n	caspases, which then activate the effector caspases that dismantle\n	cells and cause death. However, little is known about the dynamics\n	and regulatory logic linking initiators and effectors. Using a combination\n	of live-cell reporters, flow cytometry, and immunoblotting, we find\n	that initiator caspases are active during the long and variable delay\n	that precedes mitochondrial outer membrane permeabilization (MOMP)\n	and effector caspase activation. When combined with a mathematical\n	model of core apoptosis pathways, experimental perturbation of regulatory\n	links between initiator and effector caspases reveals that XIAP and\n	proteasome-dependent degradation of effector caspases are important\n	in restraining activity during the pre-MOMP delay. We identify conditions\n	in which restraint is impaired, creating a physiologically indeterminate\n	state of partial cell death with the potential to generate genomic\n	instability. Together, these findings provide a quantitative picture\n	of caspase regulatory networks and their failure modes.      <br/>\n          The mitochondrial compartment is just added as a logical partition and its volume is not used in the mathematical formulas, to stick closer to the expressions used in the matlab files distributed with the original publication. There only the rate constants for bimolecular reactions are adapted by division by      <em>v</em>\n          , the ration of the volumes of the mitochondrial compartment and the total cell.      <br/>\n          For BCL2 overexpression in figure 5, the initial BCL2 amount was increased by a factor 12 to 2.4*10      <sup>5</sup>\n          . For siRNA downregulation of XIAP its amount was multiplied by  0.13 to 1.3*10      <sup>4</sup>\n          .      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(643, 2, 'BIOMD221 Singh2006_TCA_Ecoli_acetate', '<p>This a model from the article:      <br/>\n                <strong>Kinetic modeling of tricarboxylic acid cycle and glyoxylate bypass in Mycobacterium tuberculosis, and its application to assessment of drug targets.</strong>\n                <br/>\n          Singh VK  ,  Ghosh I      <em>Theor Biol Med Model</em>\n          2006 Aug 3;3:27      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/16887020\">16887020</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          BACKGROUND: Targeting persistent tubercule bacilli has become an important challenge in the development of anti-tuberculous drugs. As the glyoxylate bypass is essential for persistent bacilli, interference with it holds the potential for designing new antibacterial drugs. We have developed kinetic models of the tricarboxylic acid cycle and glyoxylate bypass in Escherichia coli and Mycobacterium tuberculosis, and studied the effects of inhibition of various enzymes in the M. tuberculosis model. RESULTS: We used E. coli to validate the pathway-modeling protocol and showed that changes in metabolic flux can be estimated from gene expression data. The M. tuberculosis model reproduced the observation that deletion of one ofthe two isocitrate lyase genes has little effect on bacterial growth in macrophages, but deletion of both genes leads to the elimination of the bacilli from the lungs. It also substantiated the inhibition of isocitrate lyases by 3-nitropropionate. On the basis of our simulation studies, we propose that: (i) fractional inactivation of both isocitrate dehydrogenase 1 and isocitrate dehydrogenase 2 is required for a flux through the glyoxylate bypass in persistent mycobacteria; and (ii) increasing the amount of active isocitrate dehydrogenases can stop the flux through the glyoxylate bypass, so the kinase that inactivates isocitrate dehydrogenase 1 and/or the proposed inactivator of isocitrate dehydrogenase 2 is a potential target for drugs against persistent mycobacteria. In addition, competitive inhibition of isocitrate lyases along with a reduction in the inactivation of isocitrate dehydrogenases appears to be a feasible strategy for targeting persistent mycobacteria. CONCLUSION: We used kinetic modeling of biochemical pathways to assess various potential anti-tuberculous drug targets that interfere with the glyoxylate bypass flux, and indicated the type of inhibition needed to eliminate the pathogen. The advantage of such an approach to the assessment of drug targets is that it facilitates the study of systemic effect(s) of the modulation of the target enzyme(s) in the cellular environment.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02');
