(644, 2, 'BIOMD222 Singh2006_TCA_Ecoli_glucose', '<p>This a model from the article:      <br/>\n                <strong>Kinetic modeling of tricarboxylic acid cycle and glyoxylate bypass in Mycobacterium tuberculosis, and its application to assessment of drugtargets.</strong>\n                <br/>\n          Singh VK  ,  Ghosh I      <em>Theor Biol Med Model</em>\n          2006 Aug 3;3:27      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/16887020\">16887020</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          BACKGROUND: Targeting persistent tubercule bacilli has become an important challenge in the development of anti-tuberculous drugs. As the glyoxylate bypass is essential for persistent bacilli, interference with it holds the potential for designing new antibacterial drugs. We have developed kinetic models of the tricarboxylic acid cycle and glyoxylate bypass in Escherichia coli and Mycobacterium tuberculosis, and studied the effects of inhibition of various enzymes in the M. tuberculosis model. RESULTS: We used E. coli to validate the pathway-modeling protocol and showed that changes in metabolic flux can be estimated from gene expression data. The M. tuberculosis model reproduced the observation that deletion of one of the two isocitrate lyase genes has little effect on bacterial growth in macrophages, but deletion of both genes leads to the elimination of the bacilli from the lungs. It also substantiated the inhibition of isocitrate lyases by 3-nitropropionate. On the basis of our simulation studies, we propose that: (i) fractional inactivation of both isocitrate dehydrogenase 1 and isocitrate dehydrogenase 2 is required for a flux through the glyoxylate bypass in persistent mycobacteria; and (ii) increasing the amountof active isocitrate dehydrogenases can stop the flux through the glyoxylate bypass, so the kinase that inactivates isocitrate dehydrogenase 1 and/or the proposed inactivator of isocitrate dehydrogenase 2 is a potential target for drugs against persistent mycobacteria. In addition, competitive inhibition of isocitrate lyases along with a reduction in the inactivation of isocitrate dehydrogenases appears to be a feasible strategy for targeting persistent mycobacteria. CONCLUSION: We used kinetic modeling of biochemical pathways to assess various potential anti-tuberculous drug targets that interfere with the glyoxylate bypass flux, and indicated the type of inhibition needed to eliminate the pathogen. The advantage of such an approach to the assessment of drug targets is that it facilitates the study of systemic effect(s) of the modulation of the target enzyme(s) in the cellular environment.      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(645, 2, 'BIOMD223 Borisov2009_EGF_Insulin_Crosstalk', '<p> \n	  described in: <b>Systems-level interactions between insulin-EGF networks amplify mitogenic signaling.</b>\n        <br/>       \n	  Borisov N, Aksamitiene E, Kiyatkin A, Legewie S, Berkhout J, Maiwald T, Kaimachnikov NP, Timmer J, Hoek JB, Kholodenko BN.;<em>Mol Syst Biol.</em> 2009;5:256. Epub 2009 Apr 7. PMID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/19357636\">19357636</a>; doi:<a href=\"http://dx.doi.org/10.1038/msb.2009.19\">10.1038/msb.2009.19</a>\n        <br/>\n        <b>Abstract:</b>\n        <br/>\n	  Crosstalk mechanisms have not been studied as thoroughly as individual signaling pathways. We exploit experimental and computational approaches to reveal how a concordant interplay between the insulin and epidermal growth factor (EGF) signaling networks can potentiate mitogenic signaling. In HEK293 cells, insulin is a poor activator of the Ras/ERK (extracellular signal-regulated kinase) cascade, yet it enhances ERK activation by low EGF doses. We find that major crosstalk mechanisms that amplify ERK signaling are localized upstream of Ras and at the Ras/Raf level. Computational modeling unveils how critical network nodes, the adaptor proteins GAB1 and insulin receptor substrate (IRS), Src kinase, and phosphatase SHP2, convert insulin-induced increase in the phosphatidylinositol-3,4,5-triphosphate (PIP(3)) concentration into enhanced Ras/ERK activity. The model predicts and experiments confirm that insulin-induced amplification of mitogenic signaling is abolished by disrupting PIP(3)-mediated positive feedback via GAB1 and IRS. We demonstrate that GAB1 behaves as a non-linear amplifier of mitogenic responses and insulin endows EGF signaling with robustness to GAB1 suppression. Our results show the feasibility of using computational models to identify key target combinations and predict complex cellular responses to a mixture of external cues.       \n	</p>\n        <p>\n	  An extracellular compartment with 34 times the volume of the cell was added and the association rate as well as the dissociation constants for Insulin and EGF binding were altered (k<sub>on</sub>\'=34*k<sub>on</sub>, K<sub>D</sub>\'=K<sub>D</sub>/34). This was done to allow using the concentrations for those species given in the article and retaining the same dynamics and Ligand depletion as in the matlab file the SBML file was exported from.  \n	</p>\n        <p>SBML model exported from PottersWheel on 2008-10-14 16:26:44.</p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(646, 2, 'BIOMD224 Meyer1991_CalciumSpike_ICC', '<p>\n      This a model from the article:\n      <br/>\n        <strong> Calcium spiking. \n</strong>\n        <br/>\nMeyer T, Stryer L \n      <em>Annu Rev Biophys Biophys Chem</em>1991:20:153-74 \n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/1867714\">1867714</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nNo Abstract Available\n<p>The IP3-Ca2+ Crosscoupling Model (ICC) is reviewed by Meyer and Stryer in 1991, originally from Meyer and Stryer, 1988. PMID - <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/2455890\">2455890</a> \nParameters refer to figures 5 and 6 of the article which were reproduced by using Copasi 4.5 (Build 30).\nSpecies CaI and IP3 are buffered to 1% and 50% percent, respectively.</p>\n  </p>\n  <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n</p>', 0, '2020-02-02'),
(647, 2, 'BIOMD225 Westermark2003_Pancreatic_GlycOsc_basic', '<p>\n      This is the basic model described in eq. 1 of the article: <br/>\n        <strong>A model of phosphofructokinase and glycolytic oscillations in the pancreatic beta-cell. </strong>\n        <br/>Westermark PO and Lansner A. <em>Biophys J.</em> 2003 Jul;85(1):126-39. PMID: \n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12829470\">12829470</a>, doi:<a href=\"http://dx.doi.org/10.1016/S0006-3495(03)74460-9\">10.1016/S0006-3495(03)74460-9</a>\n        <br/>\n        <strong>Abstract:</strong>\n        <br/>\nWe have constructed a model of the upper part of the glycolysis in the pancreatic beta-cell. The model comprises the enzymatic reactions from glucokinase to glyceraldehyde-3-phosphate dehydrogenase (GAPD). Our results show, for a substantial part of the parameter space, an oscillatory behavior of the glycolysis for a large range of glucose concentrations. We show how the occurrence of oscillations depends on glucokinase, aldolase and/or GAPD activities, and how the oscillation period depends on the phosphofructokinase activity. We propose that the ratio of glucokinase and aldolase and/or GAPD activities are adequate as characteristics of the glucose responsiveness, rather than only the glucokinase activity. We also propose that the rapid equilibrium between different oligomeric forms of phosphofructokinase may reduce the oscillation period sensitivity to phosphofructokinase activity. Methodologically, we show that a satisfying description of phosphofructokinase kinetics can be achieved using the irreversible Hill equation with allosteric modifiers. We emphasize the use of parameter ranges rather than fixed values, and the use of operationally well-defined parameters in order for this methodology to be feasible. The theoretical results presented in this study apply to the study of insulin secretion mechanisms, since glycolytic oscillations have been proposed as a cause of oscillations in the ATP/ADP ratio which is linked to insulin secretion.\n      </p>\n      <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n  </p>', 0, '2020-02-02'),
(648, 2, 'BIOMD226 Radulescu2008_NFkB_hierarchy_M_14_25_28_Lipniacky', '<html xmlns=\"http://www.w3.org/1999/xhtml\"><h1>NFkB model M(14,25,28) - Lipniacky\'s NFkB model</h1>\n          <p>This is a model of NFkB pathway functioning \nfrom hierarchy of models of decreasing complexity,\ncreated to demonstrate application of model reduction methods \nproposed in </p>\n          <p>\n      This a model from the article:\n      <br/>\n          <strong>Robust simplifications of multiscale biochemical networks. \n</strong>\n          <br/>\nRadulescu O, Gorban A., Zinovyev A., Lilienbaum. A.\n      <em>BMC Syst Biol</em>2008:2:86 \n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/18854041\">18854041</a>,\n      <br/>\n          <strong>Abstract:</strong>\n          <br/>\nBACKGROUND: Cellular processes such as metabolism, decision making in development and differentiation, signalling, etc., can be modeled as large networks of biochemical reactions. In order to understand the functioning of these systems, there is a strong need for general model reduction techniques allowing to simplify models without loosing their main properties. In systems biology we also need to compare models or to couple them as parts of larger models. In these situations reduction to a common level of complexity is needed. RESULTS: We propose a systematic treatment of model reduction of multiscale biochemical networks. First, we consider linear kinetic models, which appear as \"pseudo-monomolecular\" subsystems of multiscale nonlinear reaction networks. For such linear models, we propose a reduction algorithm which is based on a generalized theory of the limiting step that we have developed in 1. Second, for non-linear systems we develop an algorithm based on dominant solutions of quasi-stationarity equations. For oscillating systems, quasi-stationarity and averaging are combined to eliminate time scales much faster and much slower than the period of the oscillations. In all cases, we obtain robust simplifications and also identify the critical parameters of the model. The methods are demonstrated for simple examples and for a more complex model of NF-kappaB pathway. CONCLUSION: Our approach allows critical parameter identification and produces hierarchies of models. Hierarchical modeling is important in \"middle-out\" approaches when there is need to zoom in and out several levels of complexity. Critical parameter identification is an important issue in systems biology with potential applications to biological control and therapeutics. Our approach also deals naturally with the presence of multiple time scales, which is a general property of systems biology models.\n   </p>\n          <p> This model is originally proposed by Lipniacki 2004 (Lipniacki T, Paszek P, Brasier AR, Luxon B, Kimmel M.(2004). Mathematical model of NF-kappaB regulatory module.  J. Theor. Biol. 228 (2): 195-215. <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/15094015\">15094015</a>\n        </p>\n        <p>The models are provided in CellDesigner v3.5\nformat. The name of the model M(x,y,z) should be\ndeciphered as following: </p>\n        <p>x - number of species\ny - number of reactions\nz - number of parameters</p>\n        <p>Simulation protocol:\nThe model can be simulated in CellDesigner\ndirectly, or in any simulator supporting\nevents. The simulation period should be\nset up in 20 hours (t=72000 sec). This model reproduces Figure 3b (M(14,25,28)) of the publication. </p>\n        <p>For additional information please contact\nAndrei.Zinovyev at curie.fr   </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n      </p></html>', 0, '2020-02-02'),
(649, 2, 'BIOMD227 Radulescu2008_NFkB_hierarchy_M_39_65_90', '<html xmlns=\"http://www.w3.org/1999/xhtml\"><h1>NFkB model M(39,65,90) - most complex model</h1>\n          <p>This is a model of NFkB pathway functioning \nfrom hierarchy of models of decreasing complexity,\ncreated to demonstrate application of model reduction methods \nproposed in</p>\n          <p>\n            <strong>Robust simplifications of multiscale biochemical networks.\n</strong>\n            <br/>\nRadulescu O, Gorban A., Zinovyev A., Lilienbaum. A.\n      <em>BMC Syst Biol</em>2008:2:86\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/18854041\">18854041</a>,\n      <br/>\n            <strong>Abstract:</strong>\n            <br/>\nBACKGROUND: Cellular processes such as metabolism, decision making in development and differentiation, signalling, etc., can be modeled as large networks of biochemical reactions. In order to understand the functioning of these systems, there is a strong need for general model reduction techniques allowing to simplify models without loosing their main properties. In systems biology we also need to compare models or to couple them as parts of larger models. In these situations reduction to a common level of complexity is needed. RESULTS: We propose a systematic treatment of model reduction of multiscale biochemical networks. First, we consider linear kinetic models, which appear as \"pseudo-monomolecular\" subsystems of multiscale nonlinear reaction networks. For such linear models, we propose a reduction algorithm which is based on a generalized theory of the limiting step that we have developed in 1. Second, for non-linear systems we develop an algorithm based on dominant solutions of quasi-stationarity equations. For oscillating systems, quasi-stationarity and averaging are combined to eliminate time scales much faster and much slower than the period of the oscillations. In all cases, we obtain robust simplifications and also identify the critical parameters of the model. The methods are demonstrated for simple examples and for a more complex model of NF-kappaB pathway. CONCLUSION: Our approach allows critical parameter identification and produces hierarchies of models. Hierarchical modeling is important in \"middle-out\" approaches when there is need to zoom in and out several levels of complexity. Critical parameter identification is an important issue in systems biology withpotential applications to biological control and therapeutics. Our approach also deals naturally with the presence of multiple time scales, which is a general property of systems biology models.\n   </p>\n            <p>The models are provided in CellDesigner v3.5\nformat. The name of the model M(x,y,z) should be\ndeciphered as following:</p>\n            <p>x - number of species\ny - number of reactions\nz - number of parameters</p>\n            <p>Simulation protocol:\nThe model can be simulated in CellDesigner\ndirectly, or in any simulator supporting\nevents. The simulation period should be\nset up in 40 hours (t=144000 sec).\nThe \'signal\' event applies signal to the\npathway at the moment t=20 hours=72000 sec. This model reproduces Figure 7c (M(39,65,90)) of the publication. </p>\n            <p>For additional information please contact\nAndrei.Zinovyev at curie.fr </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n          </p></html>', 0, '2020-02-02'),
(650, 2, 'BIOMD228 Swat2004_Mammalian_G1_S_Transition', '<p>This is the extended model described the article:      <br/>\n                <strong>Bifurcation analysis of the regulatory modules of the mammalian G1/S transition.</strong>\n                <br/>\n          Swat M, Kel A, Herzel H.      <em>Bioinformatics</em>\n          2004 Jul 10;20(10):1506-11. PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/15231543\">15231543</a>\n          , doi:      <a href=\"http://dx.doi.org/10.1093/bioinformatics/bth110\">10.1093/bioinformatics/bth110</a>\n                <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          MOTIVATION: Mathematical models of the cell cycle can contribute to an understanding of its basic mechanisms. Modern simulation tools make the analysis of key components and their interactions very effective. This paper focuses on the role of small modules and feedbacks in the gene-protein network governing the G1/S transition in mammalian cells. Mutations in this network may lead to uncontrolled cell proliferation. Bifurcation analysis helps to identify the key components of this extremely complex interaction network.      <br/>\n          RESULTS: We identify various positive and negative feedback loops in the network controlling the G1/S transition. It is shown that the positive feedback regulation of E2F1 and a double activator-inhibitor module can lead to bistability. Extensions of the core module preserve the essential features such as bistability. The complete model exhibits a transcritical bifurcation in addition to bistability. We relate these bifurcations to the cell cycle checkpoint and the G1/S phase transition point. Thus, core modules can explain major features of the complex G1/S network and have a robust decision taking function.      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.      <br/>\n          To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not..      <br/>\n                <br/>\n          To cite BioModels Database, please use      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n                </p>', 0, '2020-02-02'),
(651, 2, 'BIOMD229 Ma2002_cAMP_oscillations', '<p>\n      This a model from the article:\n      <br/>\n        <strong> Quantifying robustness of biochemical network models.\n</strong>\n        <br/>\nMa L, Iglesias PA.\n      <em>BMC Bioinformatics.</em>2002 Dec 13;3:38.\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12482327\">12482327</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nBACKGROUND: Robustness of mathematical models of biochemical networks is important for validation purposes and can be used as a means of selecting between different competing models. Tools for quantifying parametric robustness are needed. RESULTS: Two techniques for describing quantitatively the robustness of an oscillatory model were presented and contrasted. Single-parameter bifurcation analysis was used to evaluate the stability robustness of the limit cycle oscillation as well as the frequency and amplitude of oscillations. A tool from control engineering--the structural singular value (SSV)--was used to quantify robust stability of the limit cycle. Using SSV analysis, we find very poor robustness when the model\'s parameters are allowed to vary. CONCLUSION: The results show the usefulness of incorporating SSV analysis to single parameter sensitivity analysis to quantify robustness.\n   </p>\n        <br/>\n        <p> This model is originally proposed by Laub and Loomis (1998).[Laub MT, Loomis WF (1998). A molecular network that produces spontaneous oscillations in excitable cells of Dictyostelium.  Mol Biol Cell. 9(12):3521-32. PubMED: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12482327\">12482327</a>.\n<br/>\nThe parameters used in this model (Ma and Iglesias, 2002), are different from that used in the original model (Laub and Loomis, 1998), because of the typographical errors in the original paper. The parameters used in the model presented by Ma and Iglesias, are obtained directly from the authors of original publication (Laub and Loomis, 1998). These parameters are also used in the website for the Laub-Loomis model, <a href=\"http://www-biology.ucsd.edu/labs/loomis/network/laubloomis.html\">http://www-biology.ucsd.edu/labs/loomis/network/laubloomis.html</a>.  \n<br/>\nBy using this model, Kim et al., 2006 [Kim J, Bates DG, Postlethwaite I, Ma L, Iglesias PA. (2006) Robustness analysis of biochemical network models. Syst Biol (Stevenage). 153(3):96-104. PubMED: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/16984084\">16984084</a>], validate and extend the analysis approach proposed by Ma and Iglesias (2002), by showing how hybrid optimisation can be used to compute worst-case parameter combinations in the model.\n</p>\n        <br/>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n      </p>', 0, '2020-02-02'),
(652, 2, 'BIOMD230 Ihekwaba2004_NFkB_Sensitivity', '<p>This a model from the article:      <br/>\n                <strong>Sensitivity analysis of parameters controlling oscillatory signalling in the NF-kappaB pathway: the roles of IKK and IkappaBalpha.</strong>\n                <br/>\n          Ihekwaba AE, Broomhead DS, Grimley RL, Benson N, Kell DB      <em>Syst Biol (Stevenage)</em>\n          [2004 Jun;1(1):93-103      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/17052119\">17052119</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          Analysis of cellular signalling interactions is expected to create an enormous informatics challenge, perhaps even greater than that of analysing the genome. A key step in the evolution towards a more quantitative understanding of signalling is to specify explicitly the kinetics of all chemical reaction steps in a pathway. We have reconstructed a model of the nuclear factor, kappaB (NF-kappaB) signalling pathway, containing 64 parameters and 26 variables, including steps in which the activation of the NF-kappaB transcription factor is intimately associated with the phosphorylation and ubiquitination of its inhibitor kappaB by a membrane-associated kinase, and its translocation from the cytoplasm to the nucleus. We apply sensitivity analysis to the model. This identifies those parameters in this (IkappaB)/NF-kappaB signalling system (containing only induced IkappaBalpha isoform) that most affect the oscillatory concentration of nuclear NF-kappaB (in terms of both period and amplitude). The intention is to provide guidance on which proteins are likely to be most significant as drug targets or should be exploited for further, more detailed experiments. The sensitivity coefficients were found to be strongly dependent upon the magnitude of the parameter change studied, indicating the highly non-linear nature of the system. Of the 64 parameters in the model, only eight to nine exerted a major control on nuclear NF-kappaB oscillations, and each of these involved as reaction participants either the IkappaB kinase (IKK) or IkappaBalpha, directly. This means that the dominant dynamics of the pathway can be reflected, in addition to that of nuclear NF-kappaB itself, by just two of the other pathway variables. This is conveniently observed in a phase-plane plot.      </p>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(653, 2, 'BIOMD231 Valero2006_Adenine_TernaryCycle', '<p>This a model from the article:      <br/>\n                <strong>A kinetic study of a ternary cycle between adenine nucleotides.</strong>\n                <br/>\n          Valero E, Varn R, Garca-Carmona F      <em>FEBS J.</em>\n          [2006 Aug;273(15):3598-613      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/16884499\">16884499</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          In the present paper, a kinetic study is made of the behavior of a moiety-conserved ternary cycle between the adenine nucleotides. The system contains the enzymes S-acetyl coenzyme A synthetase, adenylate kinase and pyruvate kinase, and converts ATP into AMP, then into ADP and finally back to ATP. L-Lactate dehydrogenase is added to the system to enable continuous monitoring of the progress of the reaction. The cycle cannot work when the only recycling substrate in the reaction medium is AMP. A mathematical model is proposed whose kinetic behavior has been analyzed both numerically by integration of the nonlinear differential equations describing the kinetics of the reactions involved, and analytically under steady-state conditions, with good agreement with the experimental results being obtained. The data obtained showed that there is a threshold value of the S-acetyl coenzyme A synthetase/adenylate kinase ratio, above which the cycle stops because all the recycling substrate has been accumulated as AMP, never reaching the steady state. In addition, the concept of adenylate energy charge has been applied to the system, obtaining the enabled values of the rate constants for a fixed adenylate energy charge value and vice versa.      </p>', 0, '2020-02-02'),
(654, 2, 'BIOMD233 Wilhelm2009_BistableReaction', '<p>\n      This a model from the article:\n      <br/>\n        <strong> The smallest chemical reaction system with bistability\n</strong>\n        <br/>\nThomas Wilhelm\n      <em>BMC Systems Biology</em>2009;Sep 8;3:90.\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/19737387\">19737387</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nBackground\n\n      <br/>\nBistability underlies basic biological phenomena, such as cell division, differentiation, cancer onset, and apoptosis. So far biologists identified two necessary conditions for bistability: positive feedback and ultrasensitivity.\n<br/>\nResults\n<br/>\nBiological systems are based upon elementary mono- and bimolecular chemical reactions. In order to definitely clarify all necessary conditions for bistability we here present the corresponding minimal system. According to our definition, it contains the minimal number of (i) reactants, (ii) reactions, and (iii) terms in the corresponding ordinary differential equations (decreasing importance from i-iii). The minimal bistable system contains two reactants and four irreversible reactions (three bimolecular, one monomolecular).\n\nWe discuss the roles of the reactions with respect to the necessary conditions for bistability: two reactions comprise the positive feedback loop, a third reaction filters out small stimuli thus enabling a stable \'off\' state, and the fourth reaction prevents explosions. We argue that prevention of explosion is a third general necessary condition for bistability, which is so far lacking discussion in the literature.\n\nMoreover, in addition to proving that in two-component systems three steady states are necessary for bistability (five for tristability, etc.), we also present a simple general method to design such systems: one just needs one production and three different degradation mechanisms (one production, five degradations for tristability, etc.). This helps modelling multistable systems and it is important for corresponding synthetic biology projects.\n<br/> \nConclusion\n<br/> \nThe presented minimal bistable system finally clarifies the often discussed question for the necessary conditions for bistability. The three necessary conditions are: positive feedback, a mechanism to filter out small stimuli and a mechanism to prevent explosions. This is important for modelling bistability with simple systems and for synthetically designing new bistable systems. Our simple model system is also well suited for corresponding teaching purposes.\n   </p>\n        <br/>\n        <p style=\"font-size:x-small;\">This is a Systems Biology Markup Language (SBML) file, generated by MathSBML 2.9.0 [8-Oct-2008] 30-Jun-2009 17:26:58(GMT+00:59). SBML is a form of XML, and most XML files will not display properly in an internet browser. To view the contents of an XML file use the \"Page Source\" or equivalent button on you browser.</p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2012 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(655, 2, 'BIOMD236 Westermark2003_Pancreatic_GlycOsc_extended', '<p>\n      This is the extended model described in eq. 2 of the article: <br/>\n        <strong>A model of phosphofructokinase and glycolytic oscillations in the pancreatic beta-cell. </strong>\n        <br/>Westermark PO and Lansner A. <em>Biophys J.</em> 2003 Jul;85(1):126-39. PMID: \n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12829470\">12829470</a>, doi:<a href=\"http://dx.doi.org/10.1016/S0006-3495(03)74460-9\">10.1016/S0006-3495(03)74460-9</a>\n        <br/>\n        <strong>Abstract:</strong>\n        <br/>\nWe have constructed a model of the upper part of the glycolysis in the pancreatic beta-cell. The model comprises the enzymatic reactions from glucokinase to glyceraldehyde-3-phosphate dehydrogenase (GAPD). Our results show, for a substantial part of the parameter space, an oscillatory behavior of the glycolysis for a large range of glucose concentrations. We show how the occurrence of oscillations depends on glucokinase, aldolase and/or GAPD activities, and how the oscillation period depends on the phosphofructokinase activity. We propose that the ratio of glucokinase and aldolase and/or GAPD activities are adequate as characteristics of the glucose responsiveness, rather than only the glucokinase activity. We also propose that the rapid equilibrium between different oligomeric forms of phosphofructokinase may reduce the oscillation period sensitivity to phosphofructokinase activity. Methodologically, we show that a satisfying description of phosphofructokinase kinetics can be achieved using the irreversible Hill equation with allosteric modifiers. We emphasize the use of parameter ranges rather than fixed values, and the use of operationally well-defined parameters in order for this methodology to be feasible. The theoretical results presented in this study apply to the study of insulin secretion mechanisms, since glycolytic oscillations have been proposed as a cause of oscillations in the ATP/ADP ratio which is linked to insulin secretion.\n      </p>\n      <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n  </p>', 0, '2020-02-02'),
(656, 2, 'BIOMD240 Veening2008_DegU_Regulation', '<p>\n      This a model from the article:\n      <br/>\n        <strong> Transient heterogeneity in extracellular protease production by Bacillus subtilis.\n</strong>\n        <br/>\nVeening JW, Igoshin OA, Eijlander RT, Nijland R, Hamoen LW, Kuipers OP\n      <em>Mol. Syst. Biol.</em> 2008 ; Volume: 4 : 184\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/18414485\">18414485</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nThe most sophisticated survival strategy Bacillus subtilis employs is the differentiation of a subpopulation of cells into highly resistant endospores. To examine the expression patterns of non-sporulating cells within heterogeneous populations, we used buoyant density centrifugation to separate vegetative cells from endospore-containing cells and compared the transcriptome profiles of both subpopulations. This demonstrated the differential expression of various regulons. Subsequent single-cell analyses using promoter-gfp fusions confirmed our microarray results. Surprisingly, only part of the vegetative subpopulation highly and transiently expresses genes encoding the extracellular proteases Bpr (bacillopeptidase) and AprE (subtilisin), both of which are under the control of the DegU transcriptional regulator. As these proteases and their degradation products freely diffuse within the liquid growth medium, all cells within the clonal population are expected to benefit from their activities, suggesting that B. subtilis employs cooperative or even altruistic behavior. To unravel the mechanisms by which protease production heterogeneity within the non-sporulating subpopulation is established, we performed a series of genetic experiments combined with mathematical modeling. Simulations with our model yield valuable insights into how population heterogeneity may arise by the relatively long and variable response times within the DegU autoactivating pathway.\n   </p>\n        <br/>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2009 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n      </p>', 0, '2020-02-02'),
(657, 2, 'BIOMD244 Kotte2010_Ecoli_Metabolic_Adaption', '<p>\n	 This is the model described in: <b>Bacterial adaptation through distributed sensing of metabolic fluxes</b>\n        <br/>       \n	Oliver Kotte, Judith B Zaugg  and  Matthias Heinemann;<em>Mol Sys Biol</em>2010;<b>6</b>:355.   doi:<a href=\"http://dx.doi.org/10.1038/msb.2010.10\">10.1038/msb.2010.10</a>; \n\n        <br/>\n        <b>Abstract:</b>\n        <br/>\n	 The recognition of carbon sources and the regulatory adjustments to recognized changes are of particular importance for bacterial survival in fluctuating environments. Despite a thorough knowledge base of Escherichia coli\'s central metabolism and its regulation, fundamental aspects of the employed sensing and regulatory adjustment mechanisms remain unclear. In this paper, using a differential equation model that couples enzymatic and transcriptional regulation of E. coli\'s central metabolism, we show that the interplay of known interactions explains in molecular-level detail the system-wide adjustments of metabolic operation between glycolytic and gluconeogenic carbon sources. We show that these adaptations are enabled by an indirect recognition of carbon sources through a mechanism we termed distributed sensing of intracellular metabolic fluxes. This mechanism uses two general motifs to establish flux-signaling metabolites, whose bindings to transcription factors form flux sensors. As these sensors are embedded in global feedback loop architectures, closed-loop self-regulation can emerge within metabolism itself and therefore, metabolic operation may adapt itself autonomously (not requiring upstream sensing and signaling) to fluctuating carbon sources.\n	</p>\n      <p>\nIn its current form this SBML model is parametrized for the glucose to acetate transition and to simulate the extended diauxic shift as shown in figure 3 and scenario 6 of the attached matlab file. In this scenario the cells first are grown from an OD600 (BM) of 0.03 with a starting glucose concentration of 0.5 g/l for 8.15 h (29340 sec). Then a medium containing 5 g/l acetate is inoculated with these cells to an OD600 of 0.03 and grown for another 19.7 hours (70920 sec). Finally the cells are shifted to a medium containing both glucose and acetate at a concentration of 3 g/l with a starting OD600 of 0.0005.<br/>\nThe shifts where implemented using events triggering at the times determined by the parameters <em>shift1</em> and <em>shift2</em> (in hours). To simulate other scenarios the initial conditions need to be changed as described in the supplemental materials (<a href=\"http://www.nature.com/msb/journal/v6/n1/extref/msb201010-s1.pdf\">supplement 1</a>)<br/> \nThe original SBML model and the MATLAB file used for the calculations can be down loaded as supplementary materials of the publication from the MSB website. (<a href=\"http://www.nature.com/msb/journal/v6/n1/extref/msb201010-s2.zip\">supplement 2</a>).\n</p>\n    <p>\nThe units of the external metabolites are in [g/l], those of the biomass in optical density,OD<sub>600</sub>, taken as dimensionless, and [micromole/(gramm dry weight)] for all intracellular metabolites. As the latter cannot be implemented in SBML, it was chosen to be micromole only and the units of the parameters are left mostly undefined.   \n</p>\n  <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n</p>', 0, '2020-02-02'),
(658, 2, 'BIOMD247 Ralser2007_Carbohydrate_Rerouting_ROS', '<p>This is the model with      <em>unfitted</em>\n          parameters described in the article      <br/>\n        <b>Dynamic rerouting of the carbohydrate flux is key to counteracting oxidative stress</b>\n        <br/>\n          Markus Ralser, Mirjam M Wamelink, Axel Kowald, Birgit Gerisch, Gino Heeren, Eduard A Struys, Edda Klipp, Cornelis Jakobs, Michael Breitenbach, Hans Lehrach and Sylvia Krobitsch,      <em>J Biol</em>\n          2007 6(4):10; PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/18154684\">18154684</a>\n          , doi:      <a href=\"http://dx.doi.org/10.1186/jbiol61\">10.1186/jbiol61</a>\n        <br/>\n          Abstract:      <br/>\n          BACKGROUND: Eukaryotic cells have evolved various response mechanisms to counteract the deleterious consequences of oxidative stress. Among these processes, metabolic alterations seem to play an important role.      <br/>\n          RESULTS: We recently discovered that yeast cells with reduced activity of the key glycolytic enzyme triosephosphate isomerase exhibit an increased resistance to the thiol-oxidizing reagent diamide. Here we show that this phenotype is conserved in Caenorhabditis elegans and that the underlying mechanism is based on a redirection of the metabolic flux from glycolysis to the pentose phosphate pathway, altering the redox equilibrium of the cytoplasmic NADP(H) pool. Remarkably, another key glycolytic enzyme, glyceraldehyde-3-phosphate dehydrogenase (GAPDH), is known to be inactivated in response to various oxidant treatments, and we show that this provokes a similar redirection of the metabolic flux.      <br/>\n          CONCLUSION: The naturally occurring inactivation of GAPDH functions as a metabolic switch for rerouting the carbohydrate flux to counteract oxidative stress. As a consequence, altering the homoeostasis of cytoplasmic metabolites is a fundamental mechanism for balancing the redox state of eukaryotic cells under stress conditions.      </p>\n      <p>Different realtive enzyme velocities can be simulated by varying the parameters      <b>k_rel_TPI</b>\n          and      <b>k_rel_GAPDH</b>\n          .      </p>\n    <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n</p>', 0, '2020-02-02');
