(659, 2, 'BIOMD253 Teusink1998_Glycolysis_TurboDesign', '<p>This is the model described in the article:      <br/>\n                <strong>The danger of metabolic pathways with turbo design</strong>\n                <br/>\n          Teusink B, Walsh MC, van Dam K, Westerhoff HV      <em>Trends Biochem. Sci.</em>\n          1998 May; Volume: 23 (Issue: 5 ): 162-9      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/9612078\">9612078</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          Many catabolic pathways begin with an ATP-requiring activation step, after which further metabolism yields a surplus of ATP. Such a \'turbo\' principle is useful but also contains an inherent risk. This is illustrated by a detailed kinetic analysis of a paradoxical Saccharomyces cerevisiae mutant; the mutant fails to grow on glucose because of overactive initial enzymes of glycolysis, but is defective only in an enzyme (trehalose 6-phosphate synthase) that appears to have little relevance to glycolysis. The ubiquity of pathways that possess an initial activation step, suggests that there might be many more genes that, when deleted, cause rather paradoxical regulation phenotypes (i.e. growth defects caused by enhanced utilization of growth substrate).      </p>\n            <p>The model represents the wild-type cell: \'guarded\' glycolysis, which is the inhibition of the HK module by hexose monophosphate. The model reproduces figures 3c and 3d of the reference publication.</p>\n            <p>To reproduce unguarded glycolysis, set parameter wild_type to \'0\'.</p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(660, 2, 'BIOMD258 Ortega2006 - bistability from double phosphorylation in signal transduction', '<div class=\"dc:title\">Ortega2006 - bistability from double\nphosphorylation in signal transduction</div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/16934033\" title=\"Access to this publication\">Bistability from double\n    phosphorylation in signal transduction. Kinetic and structural\n    requirements.</a>\n          </div>\n          <div class=\"bibo:authorList\">Ortega F, Garcs JL, Mas F,\n  Kholodenko BN, Cascante M.</div>\n          <div class=\"bibo:Journal\">FEBS J. 2006 Sep; 273(17):\n  3915-3926</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>Previous studies have suggested that positive feedback loops\n    and ultrasensitivity are prerequisites for bistability in\n    covalent modification cascades. However, it was recently shown\n    that bistability and hysteresis can also arise solely from\n    multisite phosphorylation. Here we analytically demonstrate\n    that double phosphorylation of a protein (or other covalent\n    modification) generates bistability only if: (a) the two\n    phosphorylation (or the two dephosphorylation) reactions are\n    catalyzed by the same enzyme; (b) the kinetics operate at least\n    partly in the zero-order region; and (c) the ratio of the\n    catalytic constants of the phosphorylation and\n    dephosphorylation steps in the first modification cycle is less\n    than this ratio in the second cycle. We also show that\n    multisite phosphorylation enlarges the region of kinetic\n    parameter values in which bistability appears, but does not\n    generate multistability. In addition, we conclude that a\n    cascade of phosphorylation/dephosphorylation cycles generates\n    multiple steady states in the absence of feedback or\n    feedforward loops. Our results show that bistable behavior in\n    covalent modification cascades relies not only on the structure\n    and regulatory pattern of feedback/feedforward loops, but also\n    on the kinetic characteristics of their component proteins.</p>\n          </div>\n        </div>\n        <div class=\"dc:publisher\">\n          <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000258\">BIOMD0000000258</a>.</p>\n        <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n    </div>\n    <div class=\"dc:license\">\n      <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n  </div>', 0, '2020-02-02'),
(661, 2, 'BIOMD259 Tiago2010_FeMetabolism_FeDeficient', '<p>\n      This a model from the article:\n      <br/>\n        <strong> Systems analysis of iron metabolism: the network of iron pools and fluxes\n</strong>\n        <br/>\nTiago JS Lopes, Tatyana Luganskaja, Maja Vujic-Spasic, Matthias W Hentze, Martina U Muckenthaler, K\nlaus Schumann and Jens G Reich\n      <em>BMC Systems Biology</em>2010, Aug 13;4(1):112.\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20704761\">20704761</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nBackground\n      <br/>\nEvery cell of the mammalian organism needs iron in numerous oxido-reductive processes as well as fo\nr transport and storage of oxygen. The versatility of ionic iron makes it a toxic entity which can\ncatalyze the production of radicals that damage vital membranous and macromolecular assemblies in t\nhe cell. The mammalian organism maintains therefore a complex regulatory network of iron uptake, ex\ncretion and intra-body distribution. Intracellular regulation in different cell types is intertwine\nd with a global hormonal signaling structure. Iron deficiency as well as excess of iron are frequen\nt and serious human disorders. They can affect every cell, but also the organism as a whole.\n      <br/>\nResults\n      <br/>\nHere, we present a kinematic model of the dynamic system of iron pools and fluxes. It is based on f\nerrokinetic data and chemical measurements in C57BL6 wild-type mice maintained on iron-deficient, i\nron-adequate, or iron-loaded diet. The tracer iron levels in major tissues and organs (16 compartme\nnt) were followed for 28 days. The evaluation resulted in a whole-body model of fractional clearanc\ne rates. The analysis permits calculation of absolute flux rates in the steady-state, of iron distr\nibution into different organs, of tracer-accessible pool sizes and of residence times of iron in th\ne different compartments in response to three states of iron-repletion induced by the dietary regim\ne.\n      <br/>\nConclusions\n      <br/>\nThis mathematical model presents a comprehensive physiological picture of mice under three differen\nt diets with varying iron contents. The quantitative results reflect systemic properties of iron me\ntabolism: dynamic closedness, hierarchy of time scales, switch-over response and dynamics of iron s\ntorage in parenchymal organs. Therefore, we could assess which parameters will change under dietary\n perturbations and study in quantitative terms when those changes take place.\n   </p>\n      <p>\n        <strong> This model corresponds to the Iron Deficient condition - Mice </strong>\n      </p>\n      <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n  </p>', 0, '2020-02-02'),
(662, 2, 'BIOMD260 Tiago2010_FeMetabolism_FeAdequate', '<p>\n      This a model from the article:\n      <br/>\n        <strong> Systems analysis of iron metabolism: the network of iron pools and fluxes\n</strong>\n        <br/>\nTiago JS Lopes, Tatyana Luganskaja, Maja Vujic-Spasic, Matthias W Hentze, Martina U Muckenthaler, K\nlaus Schumann and Jens G Reich\n      <em>BMC Systems Biology</em>2010, Aug 13;4(1):112.\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20704761\">20704761</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nBackground\n      <br/>\nEvery cell of the mammalian organism needs iron in numerous oxido-reductive processes as well as fo\nr transport and storage of oxygen. The versatility of ionic iron makes it a toxic entity which can\ncatalyze the production of radicals that damage vital membranous and macromolecular assemblies in t\nhe cell. The mammalian organism maintains therefore a complex regulatory network of iron uptake, ex\ncretion and intra-body distribution. Intracellular regulation in different cell types is intertwine\nd with a global hormonal signaling structure. Iron deficiency as well as excess of iron are frequen\nt and serious human disorders. They can affect every cell, but also the organism as a whole.\n      <br/>\nResults\n      <br/>\nHere, we present a kinematic model of the dynamic system of iron pools and fluxes. It is based on f\nerrokinetic data and chemical measurements in C57BL6 wild-type mice maintained on iron-deficient, i\nron-adequate, or iron-loaded diet. The tracer iron levels in major tissues and organs (16 compartme\nnt) were followed for 28 days. The evaluation resulted in a whole-body model of fractional clearanc\ne rates. The analysis permits calculation of absolute flux rates in the steady-state, of iron distr\nibution into different organs, of tracer-accessible pool sizes and of residence times of iron in th\ne different compartments in response to three states of iron-repletion induced by the dietary regim\ne.\n      <br/>\nConclusions\n      <br/>\nThis mathematical model presents a comprehensive physiological picture of mice under three differen\nt diets with varying iron contents. The quantitative results reflect systemic properties of iron me\ntabolism: dynamic closedness, hierarchy of time scales, switch-over response and dynamics of iron s\ntorage in parenchymal organs. Therefore, we could assess which parameters will change under dietary\n perturbations and study in quantitative terms when those changes take place.\n   </p>\n      <p>\n        <strong> This model corresponds to the Iron Adequate condition - Mice </strong>\n      </p>\n      <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n  </p>', 0, '2020-02-02'),
(663, 2, 'BIOMD261 Tiago2010_FeMetabolism_FeLoaded', '<p>\n      This a model from the article:\n      <br/>\n        <strong> Systems analysis of iron metabolism: the network of iron pools and fluxes\n</strong>\n        <br/>\nTiago JS Lopes, Tatyana Luganskaja, Maja Vujic-Spasic, Matthias W Hentze, Martina U Muckenthaler, Klaus Schumann and Jens G Reich\n      <em>BMC Systems Biology</em>2010, Aug 13;4(1):112. \n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20704761\">20704761</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nBackground\n      <br/>\nEvery cell of the mammalian organism needs iron in numerous oxido-reductive processes as well as for transport and storage of oxygen. The versatility of ionic iron makes it a toxic entity which can catalyze the production of radicals that damage vital membranous and macromolecular assemblies in the cell. The mammalian organism maintains therefore a complex regulatory network of iron uptake, excretion and intra-body distribution. Intracellular regulation in different cell types is intertwined with a global hormonal signaling structure. Iron deficiency as well as excess of iron are frequent and serious human disorders. They can affect every cell, but also the organism as a whole.\n      <br/>\nResults\n      <br/>\nHere, we present a kinematic model of the dynamic system of iron pools and fluxes. It is based on ferrokinetic data and chemical measurements in C57BL6 wild-type mice maintained on iron-deficient, iron-adequate, or iron-loaded diet. The tracer iron levels in major tissues and organs (16 compartment) were followed for 28 days. The evaluation resulted in a whole-body model of fractional clearance rates. The analysis permits calculation of absolute flux rates in the steady-state, of iron distribution into different organs, of tracer-accessible pool sizes and of residence times of iron in the different compartments in response to three states of iron-repletion induced by the dietary regime.\n      <br/>\nConclusions\n      <br/>\nThis mathematical model presents a comprehensive physiological picture of mice under three different diets with varying iron contents. The quantitative results reflect systemic properties of iron metabolism: dynamic closedness, hierarchy of time scales, switch-over response and dynamics of iron storage in parenchymal organs. Therefore, we could assess which parameters will change under dietary perturbations and study in quantitative terms when those changes take place.\n   </p>\n      <p>\n        <strong> This model corresponds to the Iron Loaded condition - Mice </strong>\n      </p>\n      <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n  </p>', 0, '2020-02-02'),
(664, 2, 'BIOMD262 Fujita2010_Akt_Signalling_EGF', '<p>      <span style=\"font-size: 16pt;\">EGF dependent Akt pathway model</span>\n                </p>\n            <p>      <span style=\"font-size: 8pt;\">made by Kazuhiro A. Fujita.</span>\n                </p>\n            <p>This is the EGF dependent Akt pathway model described in:      <br/>\n                <strong>Decoupling of receptor and downstream signals in the Akt pathway by its low-pass filter characteristics.</strong>\n                <br/>\n          Fujita KA, Toyoshima Y, Uda S, Ozaki Y, Kubota H, and Kuroda S.      <em>Sci Signal.</em>\n          2010 Jul 27;3(132):ra56. PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20664065\">20664065</a>\n          ; DOI:      <a href=\"http://dx.doi.org/10.1126/scisignal.2000810\">10.1126/scisignal.2000810</a>\n                <br/>\n          Abstract:      <br/>\n          In cellular signal transduction, the information in an external stimulus is encoded in temporal patterns in the activities of signaling molecules; for example, pulses of a stimulus may produce an increasing response or may produce pulsatile responses in the signaling molecules. Here, we show how the Akt pathway, which is involved in cell growth, specifically transmits temporal information contained in upstream signals to downstream effectors. We modeled the epidermal growth factor (EGF)dependent Akt pathway in PC12 cells on the basis of experimental results. We obtained counterintuitive results indicating that the sizes of the peak amplitudes of receptor and downstream effector phosphorylation were decoupled; weak, sustained EGF receptor (EGFR) phosphorylation, rather than strong, transient phosphorylation, strongly induced phosphorylation of the ribosomal protein S6, a molecule downstream of Akt. Using frequency response analysis, we found that a three-component Akt pathway exhibited the property of a low-pass filter and that this property could explain decoupling of the peak amplitudes of receptor phosphorylation and that of downstream effectors. Furthermore, we found that lapatinib, an EGFR inhibitor used as an anticancer drug, converted strong, transient Akt phosphorylation into weak, sustained Akt phosphorylation, and, because of the low-pass filter characteristics of the Akt pathway, this led to stronger S6 phosphorylation than occurred in the absence of the inhibitor. Thus, an EGFR inhibitor can potentially act as a downstream activator of some effectors.      </p>\n            <p>The different versions of input, step, pulse and ramp, can be simulated using the parameters      <em>EGF_conc_pulse</em>\n          ,      <em>EGF_conc_step</em>\n          and      <em>EGF_conc_ramp</em>\n          . Depending on which one is set unequal to 0, either a continous pulse with value      <em>EGF_conc_pulse</em>\n          , a 60 second step with      <em>EGF_conc_step</em>\n          or a signal increasing from 0 to      <em>EGF_conc_pulse</em>\n          over a time periode of 3600 seconds are used as input. In case more than one parameter are set to values greater than 0 these input profiles are added to each other.  The pulse time and the time over which the ramp input increases can be set by      <em>pulse_time</em>\n          and      <em>ramp_time</em>\n          .      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n                </p>', 0, '2020-02-02'),
(665, 2, 'BIOMD263 Fujita2010_Akt_Signalling_NGF', '<p>      <span style=\"font-size:16pt\">NGF dependent Akt pathway model</span>\n                </p>\n            <p>      <span style=\"font-size:8pt\">made by Kazuhiro A. Fujita.</span>\n                </p>\n            <p>This is the      <strong>NGF</strong>\n          dependent Akt pathway model described in:      <br/>\n                <strong>Decoupling of receptor and downstream signals in the Akt pathway by its low-pass filter characteristics.</strong>\n                <br/>\n          Fujita KA, Toyoshima Y, Uda S, Ozaki Y, Kubota H, and Kuroda S.      <em>Sci Signal.</em>\n          2010 Jul 27;3(132):ra56. PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20664065\">20664065</a>\n          ; DOI:      <a href=\"http://dx.doi.org/10.1126/scisignal.2000810\">10.1126/scisignal.2000810</a>\n                <br/>\n          Abstract:      <br/>\n          In cellular signal transduction, the information in an external stimulus is encoded in temporal patterns in the activities of signaling molecules; for example, pulses of a stimulus may produce an increasing response or may produce pulsatile responses in the signaling molecules. Here, we show how the Akt pathway, which is involved in cell growth, specifically transmits temporal information contained in upstream signals to downstream effectors. We modeled the epidermal growth factor (EGF)dependent Akt pathway in PC12 cells on the basis of experimental results. We obtained counterintuitive results indicating that the sizes of the peak amplitudes of receptor and downstream effector phosphorylation were decoupled; weak, sustained EGF receptor (EGFR) phosphorylation, rather than strong, transient phosphorylation, strongly induced phosphorylation of the ribosomal protein S6, a molecule downstream of Akt. Using frequency response analysis, we found that a three-component Akt pathway exhibited the property of a low-pass filter and that this property could explain decoupling of the peak amplitudes of receptor phosphorylation and that of downstream effectors. Furthermore, we found that lapatinib, an EGFR inhibitor used as an anticancer drug, converted strong, transient Akt phosphorylation into weak, sustained Akt phosphorylation, and, because of the low-pass filter characteristics of the Akt pathway, this led to stronger S6 phosphorylation than occurred in the absence of the inhibitor. Thus, an EGFR inhibitor can potentially act as a downstream activator of some effectors.      </p>\n            <p>The different versions of input, step, pulse and ramp, can be simulated using the parameters      <em>NGF_conc_pulse</em>\n          ,      <em>NGF_conc_step</em>\n          and      <em>NGF_conc_ramp</em>\n          . Depending on which one is set unequal to 0, either a continous pulse with value      <em>NGF_conc_pulse</em>\n          , a 60 second step with      <em>NGF_conc_step</em>\n          or a signal increasing from 0 to      <em>NGF_conc_pulse</em>\n          over a time periode of 3600 seconds are used as input. In case more than one parameter is set to values greater than 0 these input profiles are added to each other.  The pulse time and the time over which the ramp input increases can be set by      <em>pulse_time</em>\n          and      <em>ramp_time</em>\n          .      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n                </p>', 0, '2020-02-02'),
(666, 2, 'BIOMD264 Fujita2010_Akt_Signalling_EGFRinhib', '<p>      <span style=\"font-size:16pt\">Akt pathway model with EGFR inhibitor</span>\n                </p>\n            <p>      <span style=\"font-size:8pt\">made by Kazuhiro A. Fujita.</span>\n                </p>\n            <p/>\n            <p>This is the Akt pathway model with an EGFR inhibitor described in:      <br/>\n                <strong>Decoupling of receptor and downstream signals in the Akt pathway by its low-pass filter characteristics.</strong>\n                <br/>\n          Fujita KA, Toyoshima Y, Uda S, Ozaki Y, Kubota H, and Kuroda S.      <em>Sci Signal.</em>\n          2010 Jul 27;3(132):ra56. PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20664065\">20664065</a>\n          ; DOI:      <a href=\"http://dx.doi.org/10.1126/scisignal.2000810\">10.1126/scisignal.2000810</a>\n                <br/>\n          Abstract:      <br/>\n          In cellular signal transduction, the information in an external stimulus is encoded in temporal patterns in the activities of signaling molecules; for example, pulses of a stimulus may produce an increasing response or may produce pulsatile responses in the signaling molecules. Here, we show how the Akt pathway, which is involved in cell growth, specifically transmits temporal information contained in upstream signals to downstream effectors. We modeled the epidermal growth factor (EGF)dependent Akt pathway in PC12 cells on the basis of experimental results. We obtained counterintuitive results indicating that the sizes of the peak amplitudes of receptor and downstream effector phosphorylation were decoupled; weak, sustained EGF receptor (EGFR) phosphorylation, rather than strong, transient phosphorylation, strongly induced phosphorylation of the ribosomal protein S6, a molecule downstream of Akt. Using frequency response analysis, we found that a three-component Akt pathway exhibited the property of a low-pass filter and that this property could explain decoupling of the peak amplitudes of receptor phosphorylation and that of downstream effectors. Furthermore, we found that lapatinib, an EGFR inhibitor used as an anticancer drug, converted strong, transient Akt phosphorylation into weak, sustained Akt phosphorylation, and, because of the low-pass filter characteristics of the Akt pathway, this led to stronger S6 phosphorylation than occurred in the absence of the inhibitor. Thus, an EGFR inhibitor can potentially act as a downstream activator of some effectors.      </p>\n            <p>The different versions of input, step, pulse and ramp, can be simulated using the parameters      <em>EGF_conc_pulse</em>\n          ,      <em>EGF_conc_step</em>\n          and      <em>EGF_conc_ramp</em>\n          . Depending on which one is set unequal to 0, either a continous pulse with value      <em>EGF_conc_pulse</em>\n          , a 60 second step with      <em>EGF_conc_step</em>\n          or a signal increasing from 0 to      <em>EGF_conc_pulse</em>\n          over a time periode of 3600 seconds are used as input. In case more than one parameter are set to values greater than 0 these input profiles are added to each other.  The pulse time and the time over which the ramp input increases can be set by      <em>pulse_time</em>\n          and      <em>ramp_time</em>\n          .      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use      <a href=\"http://www.pubmedcentral.nih.gov/articlerender.fcgi?tool=pubmed&amp;pubmedid=16381960\" target=\"_blank\">Le Novre N., Bornstein B., Broicher A., Courtot M., Donizelli M., Dharuri H., Li L., Sauro H., Schilstra M., Shapiro B., Snoep J.L., Hucka M. (2006) BioModels Database: A Free, Centralized Database of Curated, Published, Quantitative Kinetic Models of Biochemical and Cellular Systems Nucleic Acids Res., 34: D689-D691.</a>\n                </p>', 0, '2020-02-02'),
(667, 2, 'BIOMD265 Conradie2010_RPControl_CellCycle', '<p>\n      This model is from the article:\n      <br/>\n        <strong> Restriction point control of the mammalian cell cycle via the cyclin E/Cdk2:p27 complex. \n</strong>\n        <br/>\nConradie R, Bruggeman FJ, Ciliberto A, Csiksz-Nagy A, Novk B, Westerhoff HV, Snoep JL\n      <em>FEBS J.</em>2010 Jan; 277(2): 357-67 \n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20015233\">20015233</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nNumerous top-down kinetic models have been constructed to describe the cell cycle. These models have typically been constructed, validated and analyzed using model species (molecular intermediates and proteins) and phenotypic observations, and therefore do not focus on the individual model processes (reaction steps). We have developed a method to: (a) quantify the importance of each of the reaction steps in a kinetic model for the positioning of a switch point [i.e. the restriction point (RP)]; (b) relate this control of reaction steps to their effects on molecular species, using sensitivity and co-control analysis; and thereby (c) go beyond a correlation towards a causal relationship between molecular species and effects. The method is generic and can be applied to responses of any type, but is most useful for the analysis of dynamic and emergent responses such as switch points in the cell cycle. The strength of the analysis is illustrated for an existing mammalian cell cycle model focusing on the RP [Novak B, Tyson J (2004) J Theor Biol230, 563-579]. The reactions in the model with the highest RP control were those involved in: (a) the interplay between retinoblastoma protein and E2F transcription factor; (b) those synthesizing the delayed response genes and cyclin D/Cdk4 in response to growth signals; (c) the E2F-dependent cyclin E/Cdk2 synthesis reaction; as well as (d) p27 formation reactions. Nine of the 23 intermediates were shown to have a good correlation between their concentration control and RP control. Sensitivity and co-control analysis indicated that the strongest control of the RP is mediated via the cyclin E/Cdk2:p27 complex concentration. Any perturbation of the RP could be related to a change in the concentration of this complex; apparent effects of other molecular species were indirect and always worked through cyclin E/Cdk2:p27, indicating a causal relationship between this complex and the positioning of the RP.\n   </p>\n        <p>The rate constants presented in the paper have units [per tenth of an hour] and have been changed here to [per hour] (e.g. k16 = 0.25 not 0.025); for further confirmation of the correctness of this change, see the original model (Novak, J Theor Biol 2004 230:563).</p>', 0, '2020-02-02'),
(668, 2, 'BIOMD267 Lebeda2008 - BoNT paralysis (3 step model)', '<div class=\"dc:title\">Lebeda2008 - BoNT paralysis (3 step model)</div>\n\n  <span style=\"color: rgb(0, 0, 0); font-family: helvetica, \'trebuchet MS\', arial, sans-serif; font-size: 12px;\">The\n  onset of paralysis of skeletal muscles induced by BoNT/A at the\n  isolated rat neuromuscular junction is describing in the model.\n  This is the 3-step model described in the paper. This model is\n  the reduced form of the model developed my Simpson 1980;\n  PMID:</span>\n  <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/6243359\" style=\"font-family: helvetica, \'trebuchet MS\', arial, sans-serif; font-size: 12px;\">6243359</a>\n  <font color=\"#000000\" face=\"helvetica, trebuchet MS, arial, sans-serif\">\n    <span style=\"font-size: 12px;\">, i.e., it omits three\n    unknown parameters that represents the binding sites for each\n    species of the toxin. The extension to this model,i.e.\n    the 4-step model described in the paper is \n    <a href=\"http://www.ebi.ac.uk/biomodels-main/BIOMD0000000178\">BIOMD0000000178</a>.</span>\n  </font>\n</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/18551355\" title=\"Access to this publication\">Onset dynamics of type A\n    botulinum neurotoxin-induced paralysis.</a>\n  </div>\n  <div class=\"bibo:authorList\">Lebeda FJ, Adler M, Erickson K,\n  Chushak Y.</div>\n  <div class=\"bibo:Journal\">J Pharmacokinet Pharmacodyn 2008 Jun;\n  35(3): 251-267</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Experimental studies have demonstrated that botulinum\n    neurotoxin serotype A (BoNT/A) causes flaccid paralysis by a\n    multi-step mechanism. Following its binding to specific\n    receptors at peripheral cholinergic nerve endings, BoNT/A is\n    internalized by receptor-mediated endocytosis. Subsequently its\n    zinc-dependent catalytic domain translocates into the\n    neuroplasm where it cleaves a vesicle-docking protein, SNAP-25,\n    to block neurally evoked cholinergic neurotransmission. We\n    tested the hypothesis that mathematical models having a minimal\n    number of reactions and reactants can simulate published data\n    concerning the onset of paralysis of skeletal muscles induced\n    by BoNT/A at the isolated rat neuromuscular junction (NMJ) and\n    in other systems. Experimental data from several laboratories\n    were simulated with two different models that were represented\n    by sets of coupled, first-order differential equations. In this\n    study, the 3-step sequential model developed by Simpson (J\n    Pharmacol Exp Ther 212:16-21,1980) was used to estimate upper\n    limits of the times during which anti-toxins and other\n    impermeable inhibitors of BoNT/A can exert an effect. The\n    experimentally determined binding reaction rate was verified to\n    be consistent with published estimates for the rate constants\n    for BoNT/A binding to and dissociating from its receptors.\n    Because this 3-step model was not designed to reproduce\n    temporal changes in paralysis with different toxin\n    concentrations, a new BoNT/A species and rate (k(S)) were added\n    at the beginning of the reaction sequence to create a 4-step\n    scheme. This unbound initial species is transformed at a rate\n    determined by k(S) to a free species that is capable of\n    binding. By systematically adjusting the values of k(S), the\n    4-step model simulated the rapid decline in NMJ function (k(S)\n    >or= 0.01), the less rapid onset of paralysis in mice\n    following i.m. injections (k (S) = 0.001), and the slow onset\n    of the therapeutic effects of BoNT/A (k(S) &lt; 0.001) in man.\n    This minimal modeling approach was not only verified by\n    simulating experimental results, it helped to quantitatively\n    define the time available for an inhibitor to have some effect\n    (t(inhib)) and the relation between this time and the rate of\n    paralysis onset. The 4-step model predicted that as the rate of\n    paralysis becomes slower, the estimated upper limits of\n    (t(inhib)) for impermeable inhibitors become longer. More\n    generally, this modeling approach may be useful in studying the\n    kinetics of other toxins or viruses that invade host cells by\n    similar mechanisms, e.g., receptor-mediated endocytosis.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000267\">BIOMD0000000267</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(669, 2, 'BIOMD271 Becker2010_EpoR_CoreModel', '<p>This is the core model described in the article:      <br/>\n                <strong>Covering a Broad Dynamic Range: Information Processing at the Erythropoietin Receptor</strong>\n                <br/>\n          Verena Becker, Marcel Schilling, Julie Bachmann, Ute Baumann, Andreas Raue, Thomas Maiwald, Jens Timmer and Ursula Klingmller;      <em>Science</em>\n          Published Online May 20, 2010; DOI:      <a href=\"http://dx.doi.org/10.1126/science.1184913\">10.1126/science.1184913</a>\n          PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20488988\">20488988</a>\n                <br/>\n          Abstract:      <br/>\n          Cell surface receptors convert extracellular cues into receptor activation, thereby triggering intracellular signaling networks and controlling cellular decisions. A major unresolved issue is the identification of receptor properties that critically determine processing of ligand-encoded information. We show by mathematical modeling of quantitative data and experimental validation that rapid ligand depletion and replenishment of cell surface receptor are characteristic features of the erythropoietin (Epo) receptor (EpoR). The amount of Epo-EpoR complexes and EpoR activation integrated over time corresponds linearly to ligand input, covering a broad range of ligand concentrations. This relation solely depends on EpoR turnover independent of ligand binding, suggesting an essential role of large intracellular receptor pools. These receptor properties enable the system to cope with basal and acute demand in the hematopoietic system.      </p>\n            <p>SBML model exported from PottersWheel.</p>\n            <pre>% PottersWheel model definition file\n\nfunction m = BeckerSchilling2010_EpoR_CoreModel()\n\nm             = pwGetEmptyModel();\n\n%% Meta information\n\nm.ID          = \'BeckerSchilling2010_EpoR_CoreModel\';\nm.name        = \'BeckerSchilling2010_EpoR_CoreModel\';\nm.description = \'BeckerSchilling2010_EpoR_CoreModel\';\nm.authors     = {\'Verena Becker\',\' Marcel Schilling\'};\nm.dates       = {\'2010\'};\nm.type        = \'PW-2-0-42\';\n\n%% X: Dynamic variables\n% m = pwAddX(m, ID, startValue, type, minValue, maxValue, unit, compartment, name, description, typeOfStartValue)\n\nm = pwAddX(m, \'EpoR\'     ,     516, \'fix\'   ,    0, 10000,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'Epo\'      , 2030.19, \'global\', 1890,  2310,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'Epo_EpoR\' ,       0, \'fix\'   ,    0, 10000,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'Epo_EpoRi\',       0, \'fix\'   ,    0, 10000,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'dEpoi\'    ,       0, \'fix\'   ,    0, 10000,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'dEpoe\'    ,       0, \'fix\'   ,    0, 10000,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\n\n\n%% R: Reactions\n% m = pwAddR(m, reactants, products, modifiers, type, options, rateSignature, parameters, description, ID, name, fast, compartments, parameterTrunks, designerPropsR, stoichiometry, reversible)\n\nm = pwAddR(m, {            }, {\'EpoR\'      }, {  }, \'C\' , [] , \'k1*k2\', {\'kt\',\'Bmax\'}, [], \'reaction0001\');\nm = pwAddR(m, {\'EpoR\'      }, {            }, {  }, \'MA\', [] , []     , {\'kt\'       }, [], \'reaction0002\');\nm = pwAddR(m, {\'Epo\',\'EpoR\'}, {\'Epo_EpoR\'  }, {  }, \'MA\', [] , []     , {\'kon\'      }, [], \'reaction0003\');\nm = pwAddR(m, {\'Epo_EpoR\'  }, {\'Epo\',\'EpoR\'}, {  }, \'MA\', [] , []     , {\'koff\'     }, [], \'reaction0004\');\nm = pwAddR(m, {\'Epo_EpoR\'  }, {\'Epo_EpoRi\' }, {  }, \'MA\', [] , []     , {\'ke\'       }, [], \'reaction0005\');\nm = pwAddR(m, {\'Epo_EpoRi\' }, {\'Epo\',\'EpoR\'}, {  }, \'MA\', [] , []     , {\'kex\'      }, [], \'reaction0006\');\nm = pwAddR(m, {\'Epo_EpoRi\' }, {\'dEpoi\'     }, {  }, \'MA\', [] , []     , {\'kdi\'      }, [], \'reaction0007\');\nm = pwAddR(m, {\'Epo_EpoRi\' }, {\'dEpoe\'     }, {  }, \'MA\', [] , []     , {\'kde\'      }, [], \'reaction0008\');\n\n\n\n%% C: Compartments\n% m = pwAddC(m, ID, size,  outside, spatialDimensions, name, unit, constant)\n\nm = pwAddC(m, \'cell\', 1);\n\n\n%% K: Dynamical parameters\n% m = pwAddK(m, ID, value, type, minValue, maxValue, unit, name, description)\n\nm = pwAddK(m, \'kt\'  , 0.0329366 , \'global\', 1e-007, 1000);\nm = pwAddK(m, \'Bmax\', 516       , \'fix\'   , 492   , 540 );\nm = pwAddK(m, \'kon\' , 0.00010496, \'global\', 1e-007, 1000);\nm = pwAddK(m, \'koff\', 0.0172135 , \'global\', 1e-007, 1000);\nm = pwAddK(m, \'ke\'  , 0.0748267 , \'global\', 1e-007, 1000);\nm = pwAddK(m, \'kex\' , 0.00993805, \'global\', 1e-007, 1000);\nm = pwAddK(m, \'kdi\' , 0.00317871, \'global\', 1e-007, 1000);\nm = pwAddK(m, \'kde\' , 0.0164042 , \'global\', 1e-007, 1000);\n\n\n%% Default sampling time points\nm.t = 0:3:99;\n\n\n%% Y: Observables\n% m = pwAddY(m, rhs, ID, scalingParameter, errorModel, noiseType, unit, name, description, alternativeIDs, designerProps)\n\nm = pwAddY(m, \'Epo + dEpoe\'      , \'Epo_extracellular_obs\');\nm = pwAddY(m, \'Epo_EpoR\'         , \'Epo_cellsurface_obs\'  );\nm = pwAddY(m, \'Epo_EpoRi + dEpoi\', \'Epo_intracellular_obs\');\n\n\n%% S: Scaling parameters\n% m = pwAddS(m, ID, value, type, minValue, maxValue, unit, name, description)\n\nm = pwAddS(m, \'scale_Epo_extracellular_obs\', 1, \'fix\', 0, 100);\nm = pwAddS(m, \'scale_Epo_cellsurface_obs\'  , 1, \'fix\', 0, 100);\nm = pwAddS(m, \'scale_Epo_intracellular_obs\', 1, \'fix\', 0, 100);\n\n\n%% Designer properties (do not modify)\nm.designerPropsM = [1 1 1 0 0 0 400 250 600 400 1 1 1 0 0 0 0];</pre>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02');
INSERT INTO `model` (`id`, `id_user`, `name`, `description`, `repositorytype`, `modified`) VALUES
(670, 2, 'BIOMD272 Becker2010_EpoR_AuxiliaryModel', '<p>This is the auxiliary model described in the article:      <br/>\n                <strong>Covering a Broad Dynamic Range: Information Processing at the Erythropoietin Receptor</strong>\n                <br/>\n          Verena Becker, Marcel Schilling, Julie Bachmann, Ute Baumann, Andreas Raue, Thomas Maiwald, Jens Timmer and Ursula Klingmller;      <em>Science</em>\n          Published Online May 20, 2010; DOI:      <a href=\"http://dx.doi.org/10.1126/science.1184913\">10.1126/science.1184913</a>\n          PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20488988\">20488988</a>\n                <br/>\n          Abstract:      <br/>\n          Cell surface receptors convert extracellular cues into receptor activation, thereby triggering intracellular signaling networks and controlling cellular decisions. A major unresolved issue is the identification of receptor properties that critically determine processing of ligand-encoded information. We show by mathematical modeling of quantitative data and experimental validation that rapid ligand depletion and replenishment of cell surface receptor are characteristic features of the erythropoietin (Epo) receptor (EpoR). The amount of Epo-EpoR complexes and EpoR activation integrated over time corresponds linearly to ligand input, covering a broad range of ligand concentrations. This relation solely depends on EpoR turnover independent of ligand binding, suggesting an essential role of large intracellular receptor pools. These receptor properties enable the system to cope with basal and acute demand in the hematopoietic system.      </p>\n            <p>SBML model exported from PottersWheel.</p>\n            <pre>% PottersWheel model definition file\n\nfunction m = BeckerSchilling2010_EpoR_AuxiliaryMode()\n\nm             = pwGetEmptyModel();\n\n%% Meta information\n\nm.ID          = \'BeckerSchilling2010_EpoR_AuxiliaryMode\';\nm.name        = \'BeckerSchilling2010_EpoR_AuxiliaryModel\';\nm.description = \'BeckerSchilling2010_EpoR_AuxiliaryModel\';\nm.authors     = {\'Verena Becker\',\' Marcel Schilling\'};\nm.dates       = {\'2010\'};\nm.type        = \'PW-2-0-42\';\n\n%% X: Dynamic variables\n% m = pwAddX(m, ID, startValue, type, minValue, maxValue, unit, compartment, name, description, typeOfStartValue)\n\nm = pwAddX(m, \'EpoR\'     ,      76, \'fix\'   ,   0, 10000,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'SAv\'      , 999.293, \'global\', 900,  1100,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'SAv_EpoR\' ,       0, \'fix\'   ,   0, 10000,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'SAv_EpoRi\',       0, \'fix\'   ,   0, 10000,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'dSAvi\'    ,       0, \'fix\'   ,   0, 10000,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'dSAve\'    ,       0, \'fix\'   ,   0, 10000,   [], \'cell\', []  , []  , []             , []  , \'protein.generic\');\n\n\n%% R: Reactions\n% m = pwAddR(m, reactants, products, modifiers, type, options, rateSignature, parameters, description, ID, name, fast, compartments, parameterTrunks, designerPropsR, stoichiometry, reversible)\n\nm = pwAddR(m, {            }, {\'EpoR\'      }, {  }, \'C\' , [] , \'k1*k2\', {\'kt\',\'Bmax_SAv\'}, [], \'reaction0001\');\nm = pwAddR(m, {\'EpoR\'      }, {            }, {  }, \'MA\', [] , []     , {\'kt\'           }, [], \'reaction0002\');\nm = pwAddR(m, {\'SAv\',\'EpoR\'}, {\'SAv_EpoR\'  }, {  }, \'MA\', [] , []     , {\'kon_SAv\'      }, [], \'reaction0003\');\nm = pwAddR(m, {\'SAv_EpoR\'  }, {\'SAv\',\'EpoR\'}, {  }, \'MA\', [] , []     , {\'koff_SAv\'     }, [], \'reaction0004\');\nm = pwAddR(m, {\'SAv_EpoR\'  }, {\'SAv_EpoRi\' }, {  }, \'MA\', [] , []     , {\'kt\'           }, [], \'reaction0005\');\nm = pwAddR(m, {\'SAv_EpoRi\' }, {\'SAv\'       }, {  }, \'MA\', [] , []     , {\'kex_SAv\'      }, [], \'reaction0006\');\nm = pwAddR(m, {\'SAv_EpoRi\' }, {\'dSAvi\'     }, {  }, \'MA\', [] , []     , {\'kdi\'          }, [], \'reaction0007\');\nm = pwAddR(m, {\'SAv_EpoRi\' }, {\'dSAve\'     }, {  }, \'MA\', [] , []     , {\'kde\'          }, [], \'reaction0008\');\n\n\n\n%% C: Compartments\n% m = pwAddC(m, ID, size,  outside, spatialDimensions, name, unit, constant)\n\nm = pwAddC(m, \'cell\', 1);\n\n\n%% K: Dynamical parameters\n% m = pwAddK(m, ID, value, type, minValue, maxValue, unit, name, description)\n\nm = pwAddK(m, \'kt\'      , 0.0329366   , \'global\', 1e-007, 1000);\nm = pwAddK(m, \'Bmax_SAv\', 76          , \'fix\'   , 61    , 91  );\nm = pwAddK(m, \'kon_SAv\' , 2.29402e-006, \'global\', 1e-007, 1000);\nm = pwAddK(m, \'koff_SAv\', 0.00679946  , \'global\', 1e-007, 1000);\nm = pwAddK(m, \'kex_SAv\' , 0.01101     , \'global\', 1e-007, 1000);\nm = pwAddK(m, \'kdi\'     , 0.00317871  , \'global\', 1e-007, 1000);\nm = pwAddK(m, \'kde\'     , 0.0164042   , \'global\', 1e-007, 1000);\n\n\n%% Default sampling time points\nm.t = 0:3:99;\n\n\n%% Y: Observables\n% m = pwAddY(m, rhs, ID, scalingParameter, errorModel, noiseType, unit, name, description, alternativeIDs, designerProps)\n\nm = pwAddY(m, \'SAv + dSAve\'      , \'SAv_extracellular_obs\');\nm = pwAddY(m, \'SAv_EpoR\'         , \'SAv_cellsurface_obs\'  );\nm = pwAddY(m, \'SAv_EpoRi + dSAvi\', \'SAv_intracellular_obs\');\n\n\n%% S: Scaling parameters\n% m = pwAddS(m, ID, value, type, minValue, maxValue, unit, name, description)\n\nm = pwAddS(m, \'scale_SAv_extracellular_obs\', 1, \'fix\', 0, 100);\nm = pwAddS(m, \'scale_SAv_cellsurface_obs\'  , 1, \'fix\', 0, 100);\nm = pwAddS(m, \'scale_SAv_intracellular_obs\', 1, \'fix\', 0, 100);\n\n\n%% Designer properties (do not modify)\nm.designerPropsM = [1 1 1 0 0 0 400 250 600 400 1 1 1 0 0 0 0];</pre>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models. It is copyright (c) 2005-2010 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(671, 2, 'BIOMD281 Chance1960_Glycolysis_Respiration', '<p>This model is described inthe article:      <br/>\n                <b>Metabolic control mechanisms. 5. A solution for the equations representing interaction between glycolysis and respiration in ascites tumor cells.</b>\n                <br/>\n          Britton Chance, David Garfinkel, Joseph Higgins and Benno Hess,      <em>J Biol Chem.</em>\n          1960 35:2426-2439. PubmedID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/13692276\">13692276</a>\n                <br/>\n          Abstract:      <br/>\n          The other papers of this series present experimental\nevidence for possible relationships between the kinetics of oxygen,\nglucose, adenosine diphosphate, adenosine triphosphate, and\nphosphate and those of the cytochromes and pyridine nucleotides\nof the ascites tumor cell. From these general experiments we\nare able to formulate, under the law of mass action, a minimum\nhypothesis under which the four metabolic regulations previously\ndescribed can be observed. In brief, the system can be represented by the known enzyme systems, a relatively higher ADP affinity in respiration than in glycolysis, the mitochondrial membrane, a segregation of ATP into two compartments, and an ATP-utilizing system that is responsive to small decreases of the intracellular ADP level. The chemical equations for the pathway from glucose to oxygen are solved by a digital computer method so that the responses of the chemical equations and of the living cell can be accurately compared.      <br/>\n          For reasons already described, we greatly prefer a com-\nputer representation based upon a physical or chemical law\nrepresenting the action of the system to a model simulating the\noperation of the chemical system but not based upon funda-\nmental laws for the reactions involved; such a representation\nwould not adequately represent the kinetics of the system, as in\nan electric circuit network or in some types of hydraulic ana-\nlogues.      </p>\n            <p>The model gives solutions of the reaction kinetics for three types of metabolism:      <ol>        <li>0 - 64s, metabolism of endogenous substrate</li>\n                    <li>64s - 119s, metabolism of added glucose, illustrating the activated and inhibited aspects of glucose metabolism</li>\n                    <li>119s - 153s, relief of glucose and oxygen inhibition by the addition of an uncoupling agent</li>\n                    </ol>\n                </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(672, 2, 'BIOMD282 Chance1952_Catalase_Mechanism', '<p>This model is described in the article:<br/>\n        <b>The mechanism of catalase action. II. Electric analog computer studies.</b>\n        <br/>\nBritton Chance, David S Greenstein, Joseph Higgins, CC Yang, <em>Arch Biochem.</em> 1952 37:322-39. PubmedID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/14953444\">14953444</a>\n        <br/>\nSummary:<br/>\nAn electric analog computer has been constructed for a study of the kinetics of catalase action. This computer gives results for the formation and disappearance of the catalase-hydrogen peroxide complex that are in good agreement with the experimental data. The computer study verifies an approximate method for the computation of the velocity constant for the combination of hydrogen peroxide and catalase and justifies the simple formula used previously to compute the velocity constant for the reaction of the catalase-hydrogen peroxide complex with donor molecules. Finally, the computer data show that the binding of peroxide to catalase is a practically irreversible reaction.\n</p>\n        <p>The reaction of the enzyme-substrate complex, p, with the electron donor, a, is bimolecular, although in the article, as a is assumed to be constant, it is  modelled using an apparent rate constant consisting of the product of the rate constant, k4, and the concentration of a. In this implementation, the concentration of a is set to 1 and the value of k4 just adapted so that the product equals the values given for k4*a in the article. The specific parameter values are taken from Fig 3. The graphs do not exactly match those in the paper, this <i>may</i> be due to the different simulators used.</p>', 0, '2020-02-02'),
(673, 2, 'BIOMD283 Chance1943_Peroxidase_ES_Kinetics', '<p>Default parameter values are those in the right hand panel of Fig 12. The other panels may be obtained by setting X to 1, 2 or 4, and K3 to 0, 1/2 or 1.</p>\n        <p>This model is described in:<br/>\n        <b>The kinetics of the enzyme-substrate compound of peroxidase.</b>\n        <br/>Britton Chance, <em>Journal of Biological Chemistry</em>, 151, 553-577, 1943. <a href=\"http://www.jbc.org/content/151/2/553\">PDF at JBC</a>\n        <br/> \nreprinted in: <em>Adv Enzymol Relat Areas Mol Biol.</em> 1999;73:3-23. PubmedID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/10218104\">10218104</a>&gt;<br/>\nAbstract:<br/>\nUnder the narrow range of experimental conditions, and at a temperature of approximately 25 degrees, the following data were obtained. 1. The equilibrium constant of peroxidase and hydrogen peroxide has a minimum value of 2 x 10(-8). 2. The velocity constant for the formation of peroxidase-H2O2 Complex I is 1.2 x 10(7) liter mole-1 sec.-1, +/- 0.4 x 10(7). 3. The velocity constant for the reversible breakdown of peroxidase-H2O2 Complex I is a negligible factor in the enzyme-substrate kinetics and is calculated to be less than 0.2 sec.-1. 4. The velocity constant, k3, for the enzymatic breakdown of peroxidase-H2O2 Complex I varies from nearly zero to higher than 5 sec.-1, depending upon the acceptor and its concentration. The quotient of k3 and the leucomalachite green concentration is 3.0 x 10(4) liter mole-1 sec.-1. For ascorbic acid this has a value of 1.8 x 10(5) liter mole-1 sec.-1. 5. For a particular acceptor concentration, k3 is determined solely from the enzyme-substrate kinetics and is found to be 4.2 sec.-1. 6. For the same conditions, k3 is determined from a simple relationship derived from mathematical solutions of the Michaelis theory and is found to be 5.2 sec.-1. 7. For the same conditions, k3 is determined from the over-all enzyme action and is found to be 5.1 sec.-1. 8. The Michaelis constant determined from kinetic data alone is found to be 0.44 x 10(-6). 9. The Michaelis constant determined from steady state measurements is found to be 0.41 x 10(-6). 10. The Michaelis constant determined from measurement of the overall enzyme reaction is found to be 0.50 x 10(-6). 11. The kinetics of the enzyme-substrate compound closely agree with mathematical solutions of an extension of the Michaelis theory obtained for experimental values of concentrations and reaction velocity constants. 12. The adequacy of the criteria by which experiment and theory were correlated has been examined critically and the mathematical solutions have been found to be sensitive to variations in the experimental conditions. 13. The critical features of the enzyme-substrate kinetics are Pmax, and curve shape, rather than t1/2. t1/2 serves as a simple measure of dx/dt. 14. A second order combination of enzyme and substrate to form the enzyme-substrate compound, followed by a first order breakdown of the compound, describes the activity of peroxidase for a particular acceptor concentration. 15. The kinetic data indicate a bimolecular combination of acceptor and enzyme-substrate compound.\n</p>\n        <p>\nThis model is the one described in the appendix of the article. It reproduces, amongst others, figure 12. The parameters and concentrations used are rescaled as stated in the article. K2 and K3 stand for k2 and k3, respectively, divided by k1.\n</p>', 0, '2020-02-02'),
(674, 2, 'BIOMD284 Hofmeyer1986_SeqFb_Proc_AA_Synthesis', '<p>This model is the reaction sequence SEQFB, a model pathway of a branched system with sequential feedback interactions found in bacterial amino acid synthesis. Its steady state is presented in Fig 4.</p>\n            <p>The model is described in:      <br/>\n                <b>METAMOD: software for steady-state modelling and control analysis of metabolic pathways on the BBC microcomputer.</b>\n                <br/>\n          JHS Hofmeyr and KJ van der Merwe,      <em>Comput Appl Biosci</em>\n          1986 2:243-9; PubmedID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/3450367\">3450367</a>\n                <br/>\n          Abstract:      <br/>\n          METAMOD, a BBC microcomputer-based software package for steady-state modelling and control analysis of model metabolic pathways, is described, The package consists of two programs. METADEF allows the user to define the pathway in terms of reactions, rate equations and initial concentrations of metabolites. METACAL uses one of two algorithms to calculate the steady-state concentrations and fluxes. One algorithm uses the current ratio of production and consumption rates of variable metabolites to adjust iteratively their concentrations in such a way that they converge towards the steady state. The other algorithm solves the roots of the system equations by means of a quasi-Newtonian procedure. Control analysis allows the calculation of elasticity, control and response coefficients, by means of finite difference approximation. METAMOD is interactive and easy to use, and suitable for teaching and research purposes.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novere N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(675, 2, 'BIOMD285 Tang2010_PolyGlutamate', '<p>\n      This a model from the article:\n      <br/>\n        <strong> Experimental and computational analysis of polyglutamine-mediated cytotoxicity.\n</strong>\n        <br/>\nTang MY, Proctor CJ, Woulfe J, Gray DA.\n      <em>PLoS Comput Biol.</em>2010 Sep 23;6(9).\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20885783\">20885783</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nExpanded polyglutamine (polyQ) proteins are known to be the causative agents of a number of human neurodegenerative diseases but the molecular basis of their cytoxicity is still poorly understood. PolyQ tracts may impede the activity of the proteasome, and evidence from single cell imaging suggests that the sequestration of polyQ into inclusion bodies can reduce the proteasomal burden and promote cell survival, at least in the short term. The presence of misfolded protein also leads to activation of stress kinases such as p38MAPK, which can be cytotoxic. The relationships of these systems are not well understood. We have used fluorescent reporter systems imaged in living cells, and stochastic computer modeling to explore the relationships of polyQ, p38MAPK activation, generation of reactive oxygen species (ROS), proteasome inhibition, and inclusion body formation. In cells expressing a polyQ protein inclusion, body formation was preceded by proteasome inhibition but cytotoxicity was greatly reduced by administration of a p38MAPK inhibitor. Computer simulations suggested that without the generation of ROS, the proteasome inhibition and activation of p38MAPK would have significantly reduced toxicity. Our data suggest a vicious cycle of stress kinase activation and proteasome inhibition that is ultimately lethal to cells. There was close agreement between experimental data and the predictions of a stochastic computer model, supporting a central role for proteasome inhibition and p38MAPK activation in inclusion body formation and ROS-mediated cell death.\n   </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(676, 2, 'BIOMD286 Proctor2010 - a link between GSK3 and p53 in Alzheimer\'s Disease', '<p>This is the  model described the article:      <br/>\n                <strong>GSK3 and p53 - is there a link in Alzheimer\'s disease?</strong>\n                <br/>\n          Carole J Proctor and Douglas A Gray      <em>Molecular Neurodegeneration</em>\n          2010, 5:7;  \n doi:      <a href=\"http: //dx.doi.org/10.1186/1750-1326-5-7\">10.1186/1750-1326-5-7</a>\n                <br/>\n                <strong>Abstract:</strong>\n                <br/>\n                <strong>Background:</strong>\n          Recent evidence suggests that glycogen synthase kinase-3beta (GSK3beta) is implicated in both sporadic and familial forms of Alzheimer\'s disease. The transcription factor, p53 also plays a role and has been linked to an increase in tau hyperphosphorylation although the effect is indirect. There is also evidence that GSK3beta and p53 interact and that the activity of both proteins is increased as a result of this interaction. Under normal cellular conditions, p53 is kept at low levels by Mdm2 but when cells are stressed, p53 is stabilised and may then interact with GSK3beta. We propose that this interaction has an important contribution to cellular outcomes and to test this hypothesis we developed a stochastic simulation model.      <br/>\n                <strong>Results:</strong>\n          The model predicts that high levels of DNA damage leads to increased activity of p53 and GSK3beta and low levels of aggregation but if DNA damage is repaired, the aggregates are eventually cleared. The model also shows that over long periods of time, aggregates may start to form due to stochastic events leading to increased levels of ROS and damaged DNA. This is followed by increased activity of p53 and GSK3beta and a vicious cycle ensues.      <br/>\n                <strong>Conclusions:</strong>\n          Since p53 and GSK3beta are both involved in the apoptotic pathway, and GSK3beta overactivity leads to increased levels of plaques and tangles, our model might explain the link between protein aggregation and neuronal loss in neurodegeneration.      </p>\n            <br/>\n            <p>      <strong>Notes:</strong>\n          The original model submitted by the author had events in it. Since, this model is intended for Stochastic Simulation run and Copasi cannot handle events in Stochastic run, I have replaced the events with piecewise assignment rule. -Viji      </p>\n            <p>This model is an extension of Proctor_p53_Mdm2_ATM (      <a href=\"http://www.ebi.ac.uk/biomodels-main/BIOMD0000000188\">BIOMD0000000188</a>\n          ).      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(677, 2, 'BIOMD287 Passos2010_DNAdamage_CellularSenescence', '<p>\n	 This is the model described in: <b>Feedback between p21 and reactive oxygen production is necessary for cell senescence.</b>\n        <br/>       \n	Passos JF, Nelson G, Wang C, Richter T, Simillion C, Proctor CJ, Miwa S, Olijslagers S, Hallinan J, Wipat A, Saretzki G, Rudolph KL, Kirkwood TB, von Zglinicki T. ;<em>Mol Sys Biol</em>2010;6:347. Epub 2010 Feb 16.  PMID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20160708\">20160708</a> doi:<a href=\"http://dx.doi.org/10.1038/msb.2010.5\">10.1038/msb.2010.5</a>; \n\n        <br/>\n        <b>Abstract:</b>\n        <br/>\n	 Cellular senescence--the permanent arrest of cycling in normally proliferating cells such as fibroblasts--contributes both to age-related loss of mammalian tissue homeostasis and acts as a tumour suppressor mechanism. The pathways leading to establishment of senescence are proving to be more complex than was previously envisaged. Combining in-silico interactome analysis and functional target gene inhibition, stochastic modelling and live cell microscopy, we show here that there exists a dynamic feedback loop that is triggered by a DNA damage response (DDR) and, which after a delay of several days, locks the cell into an actively maintained state of \'deep\' cellular senescence. The essential feature of the loop is that long-term activation of the checkpoint gene CDKN1A (p21) induces mitochondrial dysfunction and production of reactive oxygen species (ROS) through serial signalling through GADD45-MAPK14(p38MAPK)-GRB2-TGFBR2-TGFbeta. These ROS in turn replenish short-lived DNA damage foci and maintain an ongoing DDR. We show that this loop is both necessary and sufficient for the stability of growth arrest during the establishment of the senescent phenotype. \n	</p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.<br/>For more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>To cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(678, 2, 'BIOMD288 Wang2009 - PI3K Ras Crosstalk', '<p>This model is from the article:      <br/>\n                <strong>PI3K-dependent cross-talk interactions converge with Ras as quantifiable inputs integrated by Erk.</strong>\n                <br/>\n          Wang CC, Cirit M, Haugh JM      <em>Mol. Syst. Biol.</em>\n          2009;5:246.      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/19225459\">19225459</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          Although it is appreciated that canonical signal-transduction pathways represent dominant modes of regulation embedded in larger interaction networks, relatively little has been done to quantify pathway cross-talk in such networks. Through quantitative measurements that systematically canvas an array of stimulation and molecular perturbation conditions, together with computational modeling and analysis, we have elucidated cross-talk mechanisms in the platelet-derived growth factor (PDGF) receptor signaling network, in which phosphoinositide 3-kinase (PI3K) and Ras/extracellular signal-regulated kinase (Erk) pathways are prominently activated. We show that, while PI3K signaling is insulated from cross-talk, PI3K enhances Erk activation at points both upstream and downstream of Ras. The magnitudes of these effects depend strongly on the stimulation conditions, subject to saturation effects in the respective pathways and negative feedback loops. Motivated by those dynamics, a kinetic model of the network was formulated and used to precisely quantify the relative contributions of PI3K-dependent and -independent modes of Ras/Erk activation.      </p>\n            <br/>\n            <p>This model is parameterized with the median of the estimated parameters given in the supplementary material of the original publication\'s (doi:      <a href=\"http://dx.doi.org/10.1038/msb.2009.4\">10.1038/msb.2009.4</a>\n          )      <a href=\"http://www.nature.com/msb/journal/v5/n1/extref/msb20094-s1.pdf\">supplement</a>\n          on pages 8 and 9.      </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2010 The BioModels.net Team.      <br/>\n          To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not..      <br/>\n                <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(679, 2, 'BIOMD289 Alexander2010_Tcell_Regulation_Sys1', '<p>\n          This is system 1, the model with linear antigen uptake by pAPCs, described in the article:<br/>\n        <strong>Self-tolerance and Autoimmunity in a Regulatory T Cell Model.\n          </strong>\n        <br/>\n        Alexander HK, Wahl LM.\n          <em>Bull Math Biol.</em> 2010 Mar 2.\n          PMID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20195912\">20195912</a>, doi:<a href=\"http://dx.doi.org/10.1007/s11538-010-9519-2\">10.1007/s11538-010-9519-2</a>;<br/>\n        <strong>Abstract:</strong>\n        <br/>\nThe class of immunosuppressive lymphocytes known as regulatory T cells (Tregs) has been identified as a key component in preventing autoimmune diseases. Although Tregs have been incorporated previously in mathematical models of autoimmunity, we take a novel approach which emphasizes the importance of professional antigen presenting cells (pAPCs). We examine three possible mechanisms of Treg action (each in isolation) through ordinary differential equation (ODE) models. The immune response against a particular autoantigen is suppressed both by Tregs specific for that antigen and by Tregs of arbitrary specificities, through their action on either maturing or already mature pAPCs or on autoreactive effector T cells. In this deterministic approach, we find that qualitative long-term behaviour is predicted by the basic reproductive ratio R (0) for each system. When R (0) &lt; 1, only the trivial equilibrium exists and is stable; when R (0)>1, this equilibrium loses its stability and a stable non-trivial equilibrium appears. We interpret the absence of self-damaging populations at the trivial equilibrium to imply a state of self-tolerance, and their presence at the non-trivial equilibrium to imply a state of chronic autoimmunity. Irrespective of mechanism, our model predicts that Tregs specific for the autoantigen in question play no role in the system\'s qualitative long-term behaviour, but have quantitative effects that could potentially reduce an autoimmune response to sub-clinical levels. Our results also suggest an important role for Tregs of arbitrary specificities in modulating the qualitative outcome. A stochastic treatment of the same model demonstrates that the probability of developing a chronic autoimmune response increases with the initial exposure to self antigen or autoreactive effector T cells. The three different mechanisms we consider, while leading to a number of similar predictions, also exhibit key differences in both transient dynamics (ODE approach) and the probability of chronic autoimmunity (stochastic approach).\n</p>\n        <p> Originally created by libAntimony v1.4 (using libSBML 3.4.1) </p>', 0, '2020-02-02'),
(680, 2, 'BIOMD290 Alexander2010_Tcell_Regulation_Sys2', '<p>This is system 2, the model with Michelis Menten type antigen uptake by pAPCs, described in the article:      <br/>\n                <strong>Self-tolerance and Autoimmunity in a Regulatory T Cell Model.</strong>\n                <br/>\n          Alexander HK, Wahl LM.      <em>Bull Math Biol.</em>\n          2010 Mar 2.\n          PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20195912\">20195912</a>\n          , doi:      <a href=\"http://dx.doi.org/10.1007/s11538-010-9519-2\">10.1007/s11538-010-9519-2</a>\n          ;      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          The class of immunosuppressive lymphocytes known as regulatory T cells (Tregs) has been identified as a key component in preventing autoimmune diseases. Although Tregs have been incorporated previously in mathematical models of autoimmunity, we take a novel approach which emphasizes the importance of professional antigen presenting cells (pAPCs). We examine three possible mechanisms of Treg action (each in isolation) through ordinary differential equation (ODE) models. The immune response against a particular autoantigen is suppressed both by Tregs specific for that antigen and by Tregs of arbitrary specificities, through their action on either maturing or already mature pAPCs or on autoreactive effector T cells. In this deterministic approach, we find that qualitative long-term behaviour is predicted by the basic reproductive ratio R (0) for each system. When R (0) &lt; 1, only the trivial equilibrium exists and is stable; when R (0)>1, this equilibrium loses its stability and a stable non-trivial equilibrium appears. We interpret the absence of self-damaging populations at the trivial equilibrium to imply a state of self-tolerance, and their presence at the non-trivial equilibrium to imply a state of chronic autoimmunity. Irrespective of mechanism, our model predicts that Tregs specific for the autoantigen in question play no role in the system\'s qualitative long-term behaviour, but have quantitative effects that could potentially reduce an autoimmune response to sub-clinical levels. Our results also suggest an important role for Tregs of arbitrary specificities in modulating the qualitative outcome. A stochastic treatment of the same model demonstrates that the probability of developing a chronic autoimmune response increases with the initial exposure to self antigen or autoreactive effector T cells. The three different mechanisms we consider, while leading to a number of similar predictions, also exhibit key differences in both transient dynamics (ODE approach) and the probability of chronic autoimmunity (stochastic approach).      </p>\n            <p>Originally created by libAntimony v1.4 (using libSBML 3.4.1)</p>', 0, '2020-02-02'),
(681, 2, 'BIOMD292 Rovers1995_Photsynthetic_Oscillations', '<p>This is the model described in the article:      <br/>\n                <b>Photosynthetic oscillations and the interdependence of photophosphorylation and electron transport as studied by a mathematical model.</b>\n                <br/>\n          Rovers W, Giersch C. Biosystems. 1995;35(1):63-73. PMID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/7772723\">7772723</a>\n                <br/>\n          Abstract:      <br/>\n          A simple mathematical model of photosynthetic carbon metabolism as driven by ATP and NADPH has been formulated to analyse photosynthetic oscillations. Two essential assumptions of this model are: (i) reduction of 3-phosphoglycerate to triosephosphate in the Clavin cycle is limited by ATP, not by NADPH, and (ii) photophosphorylation is affected by the availability of both ADP and NADP, while electron transport is limited by NADP only. The model produces oscillations of observed damping and period in ATP and NADP concentrations which are about 180 degrees out of phase, while three alternative proposals regarding coupling of electron transport and photophosphorylation do not produce oscillatory model solutions. The phases of ATP and NADPH are in reasonable agreement with the available experimental data. The model (which assumes that redox control of photophosphorylation is part of the oscillatory mechanism) is compared with an alternative proposal (that oscillations are due to interdependence of turnover of adenylates and Calvin cycle intermediates). From the similarity of the mathematical structures of both models it is inviting to speculate that both models are partial aspects of the oscillatory mechanism.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" class=\"external\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(682, 2, 'BIOMD293 Proctor2010 - UCHL1 Protein Aggregation', '<p>This a model from the article:      <br/>\n                <strong>Modelling the Role of UCH-L1 on Protein Aggregation in\nAge-Related Neurodegeneration.</strong>\n                <br/>\n          Proctor CJ, Tangeman PJ, Ardley HC.      <em>PLoS One.</em>\n          2010 Oct 6;5(10):e13175      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20949132\">20949132</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          Overexpression of the de-ubiquitinating enzyme UCH-L1 leads to inclusion formation in response to proteasome impairment. These inclusions contain components of the ubiquitin-proteasome system and ?-synuclein confirming that the ubiquitin-proteasome system plays an important role in protein aggregation. The processes involved are very complex and so we have chosen to take a systems biology approach to examine the system whereby we combine mathematical modelling with experiments in an iterative process. The experiments show that cells are very heterogeneous with respect to inclusion formation and so we use stochastic simulation. The model shows that the variability is partly due to stochastic effects but also depends on protein expression levels of UCH-L1 within cells. The model also indicates that the aggregation process can start even before any proteasome inhibition is present, but that proteasome inhibition greatly accelerates aggregation progression. This leads to less efficient protein degradation and hence more aggregation suggesting that there is a vicious cycle. However, proteasome inhibition may not necessarily be the initiating event. Our combined modelling and experimental approach show that stochastic effects play an important role in the aggregation process and could explain the variability in the age of disease onset. Furthermore, our model provides a valuable tool, as it can be easily modified and extended to incorporate new experimental data, test hypotheses and make testable predictions.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" class=\"external\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(683, 2, 'BIOMD294 Restif2007 - Vaccination invasion', '<div class=\"dc:title\">Restif2007 - Vaccination invasion</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/17210532\" title=\"Access to this publication\">Vaccination and the dynamics\n    of immune evasion.</a>\n  </div>\n  <div class=\"bibo:authorList\">Restif O, Grenfell BT.</div>\n  <div class=\"bibo:Journal\">J R Soc Interface 2007 Feb; 4(12):\n  143-153</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Vaccines exert strong selective pressures on pathogens,\n    favouring the spread of antigenic variants. We propose a simple\n    mathematical model to investigate the dynamics of a novel\n    pathogenic strain that emerges in a population where a previous\n    strain is maintained at low endemic level by a vaccine. We\n    compare three methods to assess the ability of the novel strain\n    to invade and persist: algebraic rate of invasion;\n    deterministic dynamics; and stochastic dynamics. These three\n    techniques provide complementary predictions on the fate of the\n    system. In particular, we emphasize the importance of\n    stochastic simulations, which account for the possibility of\n    extinctions of either strain. More specifically, our model\n    suggests that the probability of persistence of an invasive\n    strain (i) can be minimized for intermediate levels of vaccine\n    cross-protection (i.e. immune protection against the novel\n    strain) and (ii) is lower if cross-immunity acts through a\n    reduced infectious period rather than through reduced\n    susceptibility.</p>\n  </div>\n</div>\n<div class=\"bm:curation\">\n  <p style=\"font-size: 12px; color: rgb(0, 0, 0); font-family: helvetica, \'trebuchet MS\', arial, sans-serif;\">This\n  version of the model can be used for both the stochastic and the\n  deterministic simulations described in the article. For\n  deterministic interpretations with infinite population sizes, set\n  the population size\n  <em>N</em>= 1. The model does reproduces the deterministic\n  time course. The initial values are set to the steady state\n  values for a latent infection with strain 1 with an invading\n  infection of strain 2 (I2=1e-06), 100 percent vaccination with a\n  susceptibility reduction ?=0.7 at birth (p=1), and all other\n  parameters as in figure 3 of the publication.</p>\n  <p style=\"font-size: 12px; color: rgb(0, 0, 0); font-family: helvetica, \'trebuchet MS\', arial, sans-serif;\">To\n  be compatible with older software tools, the english letter names\n  instead of the greek symbols were used for parameter names:\n  <br/></p>\n  <table style=\"color: rgb(0, 0, 0); font-family: helvetica, \'trebuchet MS\', arial, sans-serif; font-size: 12px;\">\n    <tbody>\n      <tr>\n        <th>parameter</th>\n        <th>symbol</th>\n        <th>name</th>\n      </tr>\n      <tr>\n        <td>transmission rate</td>\n        <td>?</td>\n        <td>beta</td>\n      </tr>\n      <tr>\n        <td>recovery rate</td>\n        <td>?</td>\n        <td>gamma</td>\n      </tr>\n      <tr>\n        <td>birth/death rate</td>\n        <td>?</td>\n        <td>mu</td>\n      </tr>\n      <tr>\n        <td>rate of loss of natural immunity</td>\n        <td>?</td>\n        <td>sigma</td>\n      </tr>\n      <tr>\n        <td>rate of loss of vaccine immunity</td>\n        <td>?\n        <sub>v</sub></td>\n        <td>sigmaV</td>\n      </tr>\n      <tr>\n        <td>reduction of susceptibility by primary infection</td>\n        <td>?</td>\n        <td>theta</td>\n      </tr>\n      <tr>\n        <td>reduction of infection period by primary infection</td>\n        <td>?</td>\n        <td>nu</td>\n      </tr>\n      <tr>\n        <td>reduction of susceptibility by vaccination</td>\n        <td>?</td>\n        <td>tau</td>\n      </tr>\n      <tr>\n        <td>reduction of infection period by vaccination</td>\n        <td>?</td>\n        <td>eta</td>\n      </tr>\n    </tbody>\n  </table>\n  <p style=\"font-size: 12px; color: rgb(0, 0, 0); font-family: helvetica, \'trebuchet MS\', arial, sans-serif;\">Originally\n  created by libAntimony v1.4 (using libSBML 3.4.1)</p>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000294\">BIOMD0000000294</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(684, 2, 'BIOMD296 Balagadd2008_E_coli_Predator_Prey', '<p>This is the reduced model described in the article:<br/>\n        <b>A synthetic Escherichia coli predatorprey ecosystem</b>\n        <br/>\nBalagadd FK, Song H, Ozaki J, Collins CH, Barnet M, Arnold FH, Quake SR, You L.<em>Mol Syst Biol.</em> 2008;4:187. Epub 2008 Apr 15. PMID: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/18414488\">18414488</a>; DOI:<a href=\"http://dx.doi.org/10.1038/msb.2008.24\">10.1038/msb.2008.24</a>\n      </p>\n      <p>\nAbstract:<br/>\nWe have constructed a synthetic ecosystem consisting of two Escherichia coli populations, which communicate bi-directionally through quorum sensing and regulate each other\'s gene expression and survival via engineered gene circuits. Our synthetic ecosystem resembles canonical predatorprey systems in terms of logic and dynamics. The predator cells kill the prey by inducing expression of a killer protein in the prey, while the prey rescue the predators by eliciting expression of an antidote protein in the predator. Extinction, coexistence and oscillatory dynamics of the predator and prey populations are possible depending on the operating conditions as experimentally validated by long-term culturing of the system in microchemostats. A simple mathematical model is developed to capture these system dynamics. Coherent interplay between experiments and mathematical analysis enables exploration of the dynamics of interacting populations in a predictable manner.\n</p>\n      <p>\nIn the article the cell density is given in per 10<sup>3</sup> cells per microlitre. To evade a conversion factor in the SBML implementation, the unit for the cell densities was just left the same as for the AHLs A and A2 (nM).   \n</p>\n      <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2012 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n    </p>', 0, '2020-02-02');
INSERT INTO `model` (`id`, `id_user`, `name`, `description`, `repositorytype`, `modified`) VALUES
(685, 2, 'BIOMD297 Ciliberto2003_Morphogenesis_Checkpoint', '<p>This a model from the article:      <br/>\n                <strong>Mathematical model of the morphogenesis checkpoint in budding yeast.</strong>\n                <br/>\n          Ciliberto A, Novak B, Tyson JJ      <em>J. Cell Biol.</em>\n          [2003 Dec; Volume: 163 (Issue: 6 )]    Page info: 1243-54      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/14691135\">14691135</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          The morphogenesis checkpoint in budding yeast delays progression through the cell cycle in response to stimuli that prevent bud formation. Central to the checkpoint mechanism is Swe1 kinase: normally inactive, its activation halts cell cycle progression in G2. We propose a molecular network for Swe1 control, based on published observations of budding yeast and analogous control signals in fission yeast. The proposed Swe1 network is merged with a model of cyclin-dependent kinase regulation, converted into a set of differential equations and studied by numerical simulation. The simulations accurately reproduce the phenotypes of a dozen checkpoint mutants. Among other predictions, the model attributes a new role to Hsl1, a kinase known to play a role in Swe1 degradation: Hsl1 must also be indirectly responsible for potent inhibition of Swe1 activity. The model supports the idea that the morphogenesis checkpoint, like other checkpoints, raises the cell size threshold for progression from one phase of the cell cycle to the next.      </p>\n            <p xmlns=\"http://www.w3.org/1999/xhtml\">\n      The model reproduces Fig 3 of the paper.</p>\n            <p xmlns=\"http://www.w3.org/1999/xhtml\">\n      This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(686, 2, 'BIOMD307 Tyson2003_Substrate_Depletion_Osc', '<p>This is an SBML implementation the model of the substrate depletion oscillator (figure 2c) described in the article:<br/>\n        <b>Sniffers, buzzers, toggles and blinkers: dynamics of regulatory and signaling pathways in the cell.</b>\n        <br/>\nTyson JJ, Chen KC, Novak B. <em>Curr Opin Cell Biol.</em> 2003 Apr;15(2):221-31. PubmedID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12648679\">12648679</a>; DOI:<a href=\"http://dx.doi.org/10.1016/S0955-0674(03)00017-6\">10.1016/S0955-0674(03)00017-6</a>;<br/></p>\n        <p>Abstract:<br/>\nThe physiological responses of cells to external and internal stimuli are governed by genes and proteins interacting in complex networks whose dynamical properties are impossible to understand by intuitive reasoning alone. Recent advances by theoretical biologists have demonstrated that molecular regulatory networks can be accurately modeled in mathematical terms. These models shed light on the design principles of biological control systems and make predictions that have been verified experimentally.\n</p>\n        <p> Originally created by libAntimony v1.4 (using libSBML 3.4.1) </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(687, 2, 'BIOMD308 Tyson2003_NegFB_Oscillator', '<p> Originally created by libAntimony v1.4 (using libSBML 3.4.1) </p>\n        <p>This is an SBML implementation the model of negative feedback oscillator  (figure 2a) described in the article:<br/>\n        <b>Sniffers, buzzers, toggles and blinkers: dynamics of regulatory and signaling pathways in the cell.</b>\n        <br/>\nTyson JJ, Chen KC, Novak B. <em>Curr Opin Cell Biol.</em> 2003 Apr;15(2):221-31. PubmedID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12648679\">12648679</a>; DOI:<a href=\"http://dx.doi.org/10.1016/S0955-0674(03)00017-6\">10.1016/S0955-0674(03)00017-6</a>;<br/></p>\n        <p>Abstract:<br/>\nThe physiological responses of cells to external and internal stimuli are governed by genes and proteins interacting in complex networks whose dynamical properties are impossible to understand by intuitive reasoning alone. Recent advances by theoretical biologists have demonstrated that molecular regulatory networks can be accurately modeled in mathematical terms. These models shed light on the design principles of biological control systems and make predictions that have been verified experimentally.\n</p>\n        <p> Originally created by libAntimony v1.4 (using libSBML 3.4.1) </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(688, 2, 'BIOMD309 Tyson2003_NegFB_Homeostasis', '<p>This is an SBML implementation the model of homeostastis by negative feedback (figure 1g) described in the article:<br/>\n        <b>Sniffers, buzzers, toggles and blinkers: dynamics of regulatory and signaling pathways in the cell.</b>\n        <br/>\nTyson JJ, Chen KC, Novak B. <em>Curr Opin Cell Biol.</em> 2003 Apr;15(2):221-31. PubmedID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12648679\">12648679</a>; DOI:<a href=\"http://dx.doi.org/10.1016/S0955-0674(03)00017-6\">10.1016/S0955-0674(03)00017-6</a>;<br/></p>\n        <p>Abstract:<br/>\nThe physiological responses of cells to external and internal stimuli are governed by genes and proteins interacting in complex networks whose dynamical properties are impossible to understand by intuitive reasoning alone. Recent advances by theoretical biologists have demonstrated that molecular regulatory networks can be accurately modeled in mathematical terms. These models shed light on the design principles of biological control systems and make predictions that have been verified experimentally.\n</p>\n        <p> Originally created by libAntimony v1.4 (using libSBML 3.4.1) </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(689, 2, 'BIOMD310 Tyson2003_Mutual_Inhibition', '<p>This is an SBML implementation the model of mutual inhibition (figure 1f) described in the article:<br/>\n        <b>Sniffers, buzzers, toggles and blinkers: dynamics of regulatory and signaling pathways in the cell.</b>\n        <br/>\nTyson JJ, Chen KC, Novak B. <em>Curr Opin Cell Biol.</em> 2003 Apr;15(2):221-31. PubmedID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12648679\">12648679</a>; DOI:<a href=\"http://dx.doi.org/10.1016/S0955-0674(03)00017-6\">10.1016/S0955-0674(03)00017-6</a>;<br/></p>\n        <p>Abstract:<br/>\nThe physiological responses of cells to external and internal stimuli are governed by genes and proteins interacting in complex networks whose dynamical properties are impossible to understand by intuitive reasoning alone. Recent advances by theoretical biologists have demonstrated that molecular regulatory networks can be accurately modeled in mathematical terms. These models shed light on the design principles of biological control systems and make predictions that have been verified experimentally.\n</p>\n        <p> Originally created by libAntimony v1.4 (using libSBML 3.4.1) </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(690, 2, 'BIOMD311 Tyson2003_Mutual_Activation', '<p>This is an SBML implementation the model of mutual activation (figure 1e) described in the article:<br/>\n        <b>Sniffers, buzzers, toggles and blinkers: dynamics of regulatory and signaling pathways in the cell.</b>\n        <br/>\nTyson JJ, Chen KC, Novak B. <em>Curr Opin Cell Biol.</em> 2003 Apr;15(2):221-31. PubmedID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12648679\">12648679</a>; DOI:<a href=\"http://dx.doi.org/10.1016/S0955-0674(03)00017-6\">10.1016/S0955-0674(03)00017-6</a>;<br/></p>\n        <p>Abstract:<br/>\nThe physiological responses of cells to external and internal stimuli are governed by genes and proteins interacting in complex networks whose dynamical properties are impossible to understand by intuitive reasoning alone. Recent advances by theoretical biologists have demonstrated that molecular regulatory networks can be accurately modeled in mathematical terms. These models shed light on the design principles of biological control systems and make predictions that have been verified experimentally.\n</p>\n        <p>The article has a typo: the expression k2*X*R most likely should be k2*R </p>\n        <p> Originally created by libAntimony v1.4 (using libSBML 3.4.1) </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(691, 2, 'BIOMD312 Tyson2003_Perfect_Adaption', '<p>This is an SBML implementation the model of the perfect adaptor (figure 1d) described in the article:<br/>\n        <b>Sniffers, buzzers, toggles and blinkers: dynamics of regulatory and signaling pathways in the cell.</b>\n        <br/>\nTyson JJ, Chen KC, Novak B. <em>Curr Opin Cell Biol.</em> 2003 Apr;15(2):221-31. PubmedID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12648679\">12648679</a>; DOI:<a href=\"http://dx.doi.org/10.1016/S0955-0674(03)00017-6\">10.1016/S0955-0674(03)00017-6</a>;<br/></p>\n        <p>Abstract:<br/>\nThe physiological responses of cells to external and internal stimuli are governed by genes and proteins interacting in complex networks whose dynamical properties are impossible to understand by intuitive reasoning alone. Recent advances by theoretical biologists have demonstrated that molecular regulatory networks can be accurately modeled in mathematical terms. These models shed light on the design principles of biological control systems and make predictions that have been verified experimentally.\n</p>\n        <p> Originally created by libAntimony v1.4 (using libSBML 3.4.1) </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(692, 2, 'BIOMD313 Raia2010 - IL13 Signalling MedB1', '<p>This is the model of IL13 induced signalling in MedB-1 cell described in the article:<br/>\n        <b>Dynamic Mathematical Modeling of IL13-Induced Signaling in Hodgkin and Primary Mediastinal B-Cell Lymphoma Allows Prediction of Therapeutic Targets.</b>\n        <br/>\nRaia V, Schilling M, Bhm M, Hahn B, Kowarsch A, Raue A, Sticht C, Bohl S, Saile M, Mller P, Gretz N, Timmer J, Theis F, Lehmann WD, Lichter P and Klingmller U. Cancer Res. 2011 Feb 1;71(3):693-704. PubmedID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/21127196\">21127196</a>; DOI:<a href=\"http://dx.doi.org/10.1158/0008-5472.CAN-10-2987\">10.1158/0008-5472.CAN-10-2987</a>\n        <br/>\nAbstract:<br/>\nPrimary mediastinal B-cell lymphoma (PMBL) and classical Hodgkin lymphoma (cHL) share a frequent constitutive activation of JAK (Janus kinase)/STAT signaling pathway. Because of complex, nonlinear relations within the pathway, key dynamic properties remained to be identified to predict possible strategies for intervention. We report the development of dynamic pathway models based on quantitative data collected on signaling components of JAK/STAT pathway in two lymphoma-derived cell lines, MedB-1 and L1236, representative of PMBL and cHL, respectively. We show that the amounts of STAT5 and STAT6 are higher whereas those of SHP1 are lower in the two lymphoma cell lines than in normal B cells. Distinctively, L1236 cells harbor more JAK2 and less SHP1 molecules per cell than MedB-1 or control cells. In both lymphoma cell lines, we observe interleukin-13 (IL13)-induced activation of IL4 receptor ?, JAK2, and STAT5, but not of STAT6. Genome-wide, 11 early and 16 sustained genes are upregulated by IL13 in both lymphoma cell lines. Specifically, the known STAT-inducible negative regulators CISH and SOCS3 are upregulated within 2 hours in MedB-1 but not in L1236 cells. On the basis of this detailed quantitative information, we established two mathematical models, MedB-1 and L1236 model, able to describe the respective experimental data. Most of the model parameters are identifiable and therefore the models are predictive. Sensitivity analysis of the model identifies six possible therapeutic targets able to reduce gene expression levels in L1236 cells and three in MedB-1. We experimentally confirm reduction in target gene expression in response to inhibition of STAT5 phosphorylation, thereby validating one of the predicted targets.\n</p>\n        <p>All concentrations in the model, apart from IL13, are in molecules/cell. IL13 is given in ng/ml. As the cell volume is not explicitely given in the article, it is just approximately derived from the MW of IL13 () and the conversion factor 2.265 molecules IL13/cell = 1 ng/ml   to be around 60 fl.</p>\n        <p>SBML model exported from PottersWheel on 2010-08-10 12:14:57.<br/>\nInline follows the original matlab code:</p>\n        <pre>\n% PottersWheel model definition file\n\nfunction m = Raia2010_IL13_MedB1()\n\nm             = pwGetEmptyModel();\n\n%% Meta information\n\nm.ID          = \'Raia2010_IL13_MedB1\';\nm.name        = \'Raia2010_IL13_MedB1\';\nm.description = \'\';\nm.authors     = {\'Raia et al\'};\nm.dates       = {\'2010\'};\nm.type        = \'PW-2-0-47\';\n\n%% X: Dynamic variables\n% m = pwAddX(m, ID, startValue, type, minValue, maxValue, unit, compartment, name, description, typeOfStartValue)\n\nm = pwAddX(m, \'Rec\'         ,              1.3, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'Rec_i\'       , 113.193916718733, \'global\',  0.001, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'IL13_Rec\'    ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'p_IL13_Rec\'  ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'p_IL13_Rec_i\',                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'JAK2\'        ,              2.8, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'pJAK2\'       ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'SHP1\'        ,               91, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'STAT5\'       ,              165, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'pSTAT5\'      ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'SOCS3mRNA\'   ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'DecoyR\'      ,             0.34, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'IL13_DecoyR\' ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'SOCS3\'       ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'CD274mRNA\'   ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\n\n\n%% R: Reactions\n% m = pwAddR(m, reactants, products, modifiers, type, options, rateSignature, parameters, description, ID, name, fast, compartments, parameterTrunks, designerPropsR, stoichiometry, reversible)\n\nm = pwAddR(m, {\'Rec\'         }, {\'IL13_Rec\'    }, {\'IL13stimulation\'   }, \'C\' , [] , \'k1 * m1 * r1 * 2.265\'        , {\'Kon_IL13Rec\'                             });\nm = pwAddR(m, {\'Rec\'         }, {\'Rec_i\'       }, {                    }, \'MA\', [] , []                            , {\'Rec_intern\'                              });\nm = pwAddR(m, {\'Rec_i\'       }, {\'Rec\'         }, {                    }, \'MA\', [] , []                            , {\'Rec_recycle\'                             });\nm = pwAddR(m, {\'IL13_Rec\'    }, {\'p_IL13_Rec\'  }, {\'pJAK2\'             }, \'E\' , [] , []                            , {\'Rec_phosphorylation\'                     });\nm = pwAddR(m, {\'JAK2\'        }, {\'pJAK2\'       }, {\'IL13_Rec\',\'SOCS3\'  }, \'C\' , [] , \'k1 * m1 * r1 / (1 + k2 * m2)\', {\'JAK2_phosphorylation\',\'JAK2_p_inhibition\'});\nm = pwAddR(m, {\'JAK2\'        }, {\'pJAK2\'       }, {\'p_IL13_Rec\',\'SOCS3\'}, \'C\' , [] , \'k1 * m1 * r1 / (1 + k2 * m2)\', {\'JAK2_phosphorylation\',\'JAK2_p_inhibition\'});\nm = pwAddR(m, {\'p_IL13_Rec\'  }, {\'p_IL13_Rec_i\'}, {                    }, \'MA\', [] , []                            , {\'pRec_intern\'                             });\nm = pwAddR(m, {\'p_IL13_Rec_i\'}, {              }, {                    }, \'MA\', [] , []                            , {\'pRec_degradation\'                        });\nm = pwAddR(m, {\'pJAK2\'       }, {\'JAK2\'        }, {\'SHP1\'              }, \'E\' , [] , []                            , {\'pJAK2_dephosphorylation\'                 });\nm = pwAddR(m, {\'STAT5\'       }, {\'pSTAT5\'      }, {\'pJAK2\'             }, \'E\' , [] , []                            , {\'STAT5_phosphorylation\'                   });\nm = pwAddR(m, {\'pSTAT5\'      }, {\'STAT5\'       }, {\'SHP1\'              }, \'E\' , [] , []                            , {\'pSTAT5_dephosphorylation\'                });\nm = pwAddR(m, {\'DecoyR\'      }, {\'IL13_DecoyR\' }, {\'IL13stimulation\'   }, \'C\' , [] , \'k1 * m1 * r1 * 2.265\'        , {\'DecoyR_binding\'                          });\nm = pwAddR(m, {              }, {\'SOCS3mRNA\'   }, {\'pSTAT5\'            }, \'C\' , [] , \'m1*k1\'                       , {\'SOCS3mRNA_production\'                    });\nm = pwAddR(m, {              }, {\'SOCS3\'       }, {\'SOCS3mRNA\'         }, \'C\' , [] , \'m1*k1/(k2+m1)\'               , {\'SOCS3_translation\',\'SOCS3_accumulation\'  });\nm = pwAddR(m, {\'SOCS3\'       }, {              }, {                    }, \'MA\', [] , []                            , {\'SOCS3_degradation\'                       });\nm = pwAddR(m, {              }, {\'CD274mRNA\'   }, {\'pSTAT5\'            }, \'C\' , [] , \'m1*k1\'                       , {\'CD274mRNA_production\'                    });\n\n\n\n%% C: Compartments\n% m = pwAddC(m, ID, size,  outside, spatialDimensions, name, unit, constant)\n\nm = pwAddC(m, \'cell\', 1);\n\n\n%% K: Dynamical parameters\n% m = pwAddK(m, ID, value, type, minValue, maxValue, unit, name, description)\n\nm = pwAddK(m, \'Kon_IL13Rec\'             , 0.00341992477561527  , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'Rec_phosphorylation\'     , 999.630699390459     , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'pRec_intern\'             , 0.152540135862128    , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'pRec_degradation\'        , 0.17292753960894     , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'Rec_intern\'              , 0.103345784175639    , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'Rec_recycle\'             , 0.00135598001330518  , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'JAK2_phosphorylation\'    , 0.157057142470047    , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'pJAK2_dephosphorylation\' , 0.000621906059346898 , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'STAT5_phosphorylation\'   , 0.0382596267705733   , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'pSTAT5_dephosphorylation\', 0.000343391620492938 , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'SOCS3mRNA_production\'    , 0.00215826062955433  , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'DecoyR_binding\'          , 0.000124391087466499 , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'JAK2_p_inhibition\'       , 0.0168267797836881   , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'SOCS3_translation\'       , 11.9086462945188     , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'SOCS3_accumulation\'      , 3.70803336415341     , \'global\', 1     , 1000);\nm = pwAddK(m, \'SOCS3_degradation\'       , 0.0429185935645562   , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'CD274mRNA_production\'    , 8.21752278733562e-005, \'global\', 1e-009, 1000);\n\n\n%% U: Driving input\n% m = pwAddU(m, ID, uType, uTimes, uValues, compartment, name, description, u2Values, alternativeIDs, designerProps)\n\nm = pwAddU(m, \'IL13stimulation\', \'steps\', [-100 0]  , [0 1]  , [], [], [], [], {}, [], \'protein.generic\');\n\n\n%% Default sampling time points\nm.t = 0:1:120;\n\n\n%% Y: Observables\n% m = pwAddY(m, rhs, ID, scalingParameter, errorModel, noiseType, unit, name, description, alternativeIDs, designerProps)\n\nm = pwAddY(m, \'Rec + IL13_Rec + p_IL13_Rec\'                       , \'RecSurf_obs\'  , \'scale_RecSurf\'  , \'0.10 * y + 0.1 * max(y)\');\nm = pwAddY(m, \'IL13_Rec + p_IL13_Rec + p_IL13_Rec_i + IL13_DecoyR\', \'IL13-cell_obs\', \'scale_IL13-cell\', \'0.15 * y + 0.05 * max(y)\');\nm = pwAddY(m, \'p_IL13_Rec + p_IL13_Rec_i\'                         , \'pIL4Ra_obs\'   , \'scale_pIL4Ra\'   , \'0.1 * y + 0.15 * max(y)\');\nm = pwAddY(m, \'pJAK2\'                                             , \'pJAK2_obs\'    , \'scale_pJAK2\'    , \'0.15 * y + 0.1 * max(y)\');\nm = pwAddY(m, \'SOCS3mRNA\'                                         , \'SOCS3mRNA_obs\', \'scale_SOCS3mRNA\', \'0.1 * y + 0.1 * max(y)\');\nm = pwAddY(m, \'CD274mRNA\'                                         , \'CD274mRNA_obs\', \'scale_CD274mRNA\', \'0.1 * y + 0.1 * max(y)\');\nm = pwAddY(m, \'SOCS3\'                                             , \'SOCS3_obs\'    , \'scale_SOCS3\'    , \'0.1 * y + 0.15 * max(y)\');\nm = pwAddY(m, \'pSTAT5\'                                            , \'pSTAT5_obs\'   , \'scale_pSTAT5\'   , \'0.15 * y + 0.1 * max(y)\');\n\n\n%% S: Scaling parameters\n% m = pwAddS(m, ID, value, type, minValue, maxValue, unit, name, description)\n\nm = pwAddS(m, \'scale_pJAK2\'    , 1.39039557075997, \'global\', 0.001, 10000);\nm = pwAddS(m, \'scale_pIL4Ra\'   , 1.88700484471494, \'global\', 0.001, 10000);\nm = pwAddS(m, \'scale_RecSurf\'  ,                1,    \'fix\', 0.001, 10000);\nm = pwAddS(m, \'scale_IL13-cell\', 5.56750251420935, \'global\', 0.001, 10000);\nm = pwAddS(m, \'scale_SOCS3mRNA\', 17.6699101927908, \'global\', 0.001, 10000);\nm = pwAddS(m, \'scale_CD274mRNA\', 2.48547378765387, \'global\', 0.001, 10000);\nm = pwAddS(m, \'scale_pSTAT5\'   ,                1,    \'fix\', 0.001, 10000);\nm = pwAddS(m, \'scale_SOCS3\'    ,                1,    \'fix\', 0.001, 10000);\n\n\n%% Designer properties (do not modify)\nm.designerPropsM = [1 1 1 0 0 0 400 250 600 400 1 1 1 0 0 0 0];\n</pre>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Nov??re N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(693, 2, 'BIOMD314 Raia2011 - IL13 L1236', '<p>This is the model of IL13 induced signalling in L1236 cells described in the article:      <br/>\n                <b>Dynamic Mathematical Modeling of IL13-Induced Signaling in Hodgkin and Primary Mediastinal B-Cell Lymphoma Allows Prediction of Therapeutic Targets.</b>\n                <br/>\n          Raia V, Schilling M, Bhm M, Hahn B, Kowarsch A, Raue A, Sticht C, Bohl S, Saile M, Mller P, Gretz N, Timmer J, Theis F, Lehmann WD, Lichter P and Klingmller U. Cancer Res. 2011 Feb 1;71(3):693-704. PubmedID:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/21127196\">21127196</a>\n          ; DOI:      <a href=\"http://dx.doi.org/10.1158/0008-5472.CAN-10-2987\">10.1158/0008-5472.CAN-10-2987</a>\n                <br/>\n          Abstract:      <br/>\n          Primary mediastinal B-cell lymphoma (PMBL) and classical Hodgkin lymphoma (cHL) share a frequent constitutive activation of JAK (Janus kinase)/STAT signaling pathway. Because of complex, nonlinear relations within the pathway, key dynamic properties remained to be identified to predict possible strategies for intervention. We report the development of dynamic pathway models based on quantitative data collected on signaling components of JAK/STAT pathway in two lymphoma-derived cell lines, MedB-1 and L1236, representative of PMBL and cHL, respectively. We show that the amounts of STAT5 and STAT6 are higher whereas those of SHP1 are lower in the two lymphoma cell lines than in normal B cells. Distinctively, L1236 cells harbor more JAK2 and less SHP1 molecules per cell than MedB-1 or control cells. In both lymphoma cell lines, we observe interleukin-13 (IL13)-induced activation of IL4 receptor ?, JAK2, and STAT5, but not of STAT6. Genome-wide, 11 early and 16 sustained genes are upregulated by IL13 in both lymphoma cell lines. Specifically, the known STAT-inducible negative regulators CISH and SOCS3 are upregulated within 2 hours in MedB-1 but not in L1236 cells. On the basis of this detailed quantitative information, we established two mathematical models, MedB-1 and L1236 model, able to describe the respective experimental data. Most of the model parameters are identifiable and therefore the models are predictive. Sensitivity analysis of the model identifies six possible therapeutic targets able to reduce gene expression levels in L1236 cells and three in MedB-1. We experimentally confirm reduction in target gene expression in response to inhibition of STAT5 phosphorylation, thereby validating one of the predicted targets.      </p>\n            <p>All concentrations in the model, apart from IL13, are in molecules/cell. IL13 is given in ng/ml. As the cell volume is not explicitely given in the article, it is just approximately derived from the MW of IL13 (15.8 kDa) and the conversion factor 3.776 molecules IL13/cell = 1 ng/ml to be around 100 fl.</p>\n            <p>SBML model exported from PottersWheel on 2010-08-10 12:14:57.      <br/>\n          Inline follows the original matlab code:      </p>\n            <pre>% PottersWheel model definition file\n\nfunction m = Raia2010_IL13_L1236()\n\nm             = pwGetEmptyModel();\n\n%% Meta information\n\nm.ID          = \'Raia2010_IL13_L1236\';\nm.name        = \'Raia2010_IL13_L1236\';\nm.description = \'\';\nm.authors     = {\'Raia et al\'};\nm.dates       = {\'2010\'};\nm.type        = \'PW-2-0-47\';\n\n%% X: Dynamic variables\n% m = pwAddX(m, ID, startValue, type, minValue, maxValue, unit, compartment, name, description, typeOfStartValue)\n\nm = pwAddX(m, \'Rec\'         ,              1.8, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'Rec_i\'       , 118.598421286338, \'global\',  0.001, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'IL13_Rec\'    ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'p_IL13_Rec\'  ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'p_IL13_Rec_i\',                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'JAK2\'        ,               24, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'pJAK2\'       ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'SHP1\'        ,              9.4, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'STAT5\'       ,              209, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'pSTAT5\'      ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\nm = pwAddX(m, \'CD274mRNA\'   ,                0, \'fix\'   , 1e-006, 10000, \'molecules/cell (x 1000)\', \'cell\', []  , []  , []             , []  , \'protein.generic\');\n\n\n%% R: Reactions\n% m = pwAddR(m, reactants, products, modifiers, type, options, rateSignature, parameters, description, ID, name, fast, compartments, parameterTrunks, designerPropsR, stoichiometry, reversible)\n\nm = pwAddR(m, {\'Rec\'         }, {\'IL13_Rec\'    }, {\'IL13stimulation\'}, \'C\' , [] , \'k1 * m1 * r1 * 3.776\', {\'Kon_IL13Rec\'             });\nm = pwAddR(m, {\'Rec\'         }, {\'Rec_i\'       }, {                 }, \'MA\', [] , []                    , {\'Rec_intern\'              });\nm = pwAddR(m, {\'Rec_i\'       }, {\'Rec\'         }, {                 }, \'MA\', [] , []                    , {\'Rec_recycle\'             });\nm = pwAddR(m, {\'IL13_Rec\'    }, {\'p_IL13_Rec\'  }, {\'pJAK2\'          }, \'E\' , [] , []                    , {\'Rec_phosphorylation\'     });\nm = pwAddR(m, {\'JAK2\'        }, {\'pJAK2\'       }, {\'IL13_Rec\'       }, \'E\' , [] , []                    , {\'JAK2_phosphorylation\'    });\nm = pwAddR(m, {\'JAK2\'        }, {\'pJAK2\'       }, {\'p_IL13_Rec\'     }, \'E\' , [] , []                    , {\'JAK2_phosphorylation\'    });\nm = pwAddR(m, {\'p_IL13_Rec\'  }, {\'p_IL13_Rec_i\'}, {                 }, \'MA\', [] , []                    , {\'pRec_intern\'             });\nm = pwAddR(m, {\'p_IL13_Rec_i\'}, {              }, {                 }, \'MA\', [] , []                    , {\'pRec_degradation\'        });\nm = pwAddR(m, {\'pJAK2\'       }, {\'JAK2\'        }, {\'SHP1\'           }, \'E\' , [] , []                    , {\'pJAK2_dephosphorylation\' });\nm = pwAddR(m, {\'STAT5\'       }, {\'pSTAT5\'      }, {\'pJAK2\'          }, \'E\' , [] , []                    , {\'STAT5_phosphorylation\'   });\nm = pwAddR(m, {\'pSTAT5\'      }, {\'STAT5\'       }, {\'SHP1\'           }, \'E\' , [] , []                    , {\'pSTAT5_dephosphorylation\'});\nm = pwAddR(m, {              }, {\'CD274mRNA\'   }, {\'pSTAT5\'         }, \'C\' , [] , \'m1*k1\'               , {\'CD274mRNA_production\'    });\n\n\n\n%% C: Compartments\n% m = pwAddC(m, ID, size,  outside, spatialDimensions, name, unit, constant)\n\nm = pwAddC(m, \'cell\', 1);\n\n\n%% K: Dynamical parameters\n% m = pwAddK(m, ID, value, type, minValue, maxValue, unit, name, description)\n\nm = pwAddK(m, \'Kon_IL13Rec\'             , 0.00174086832237195, \'global\', 1e-009, 1000);\nm = pwAddK(m, \'Rec_phosphorylation\'     , 9.07540737285078   , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'pRec_intern\'             , 0.324132341358502  , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'pRec_degradation\'        , 0.417538218767296  , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'Rec_intern\'              , 0.259685756311325  , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'Rec_recycle\'             , 0.00392430355501153, \'global\', 1e-009, 1000);\nm = pwAddK(m, \'JAK2_phosphorylation\'    , 0.300019047540849  , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'pJAK2_dephosphorylation\' , 0.0981610557569751 , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'STAT5_phosphorylation\'   , 0.00426766529531612, \'global\', 1e-009, 1000);\nm = pwAddK(m, \'pSTAT5_dephosphorylation\', 0.0116388587580445 , \'global\', 1e-009, 1000);\nm = pwAddK(m, \'CD274mRNA_production\'    , 0.0115927572109515 , \'global\', 1e-009, 1000);\n\n\n%% U: Driving input\n% m = pwAddU(m, ID, uType, uTimes, uValues, compartment, name, description, u2Values, alternativeIDs, designerProps)\n\nm = pwAddU(m, \'IL13stimulation\', \'steps\', [-100 0]  , [0 1]  , [], [], [], [], {}, [], \'protein.generic\');\n\n\n%% Default sampling time points\nm.t = 0:1:120;\n\n\n%% Y: Observables\n% m = pwAddY(m, rhs, ID, scalingParameter, errorModel, noiseType, unit, name, description, alternativeIDs, designerProps)\n\nm = pwAddY(m, \'Rec + IL13_Rec + p_IL13_Rec\'         , \'RecSurf_obs\'  , \'scale_RecSurf\'  , \'0.1 * y + 0.1 * max(y)\');\nm = pwAddY(m, \'IL13_Rec + p_IL13_Rec + p_IL13_Rec_i\', \'IL13-cell_obs\', \'scale_IL13-cell\', \'0.15 * y + 0.05 * max(y)\');\nm = pwAddY(m, \'p_IL13_Rec + p_IL13_Rec_i\'           , \'pIL4Ra_obs\'   , \'scale_pIL4Ra\'   , \'0.10 * y + 0.15 * max(y)\');\nm = pwAddY(m, \'pJAK2\'                               , \'pJAK2_obs\'    , \'scale_pJAK2\'    , \'0.1 * y + 0.1 * max(y)\');\nm = pwAddY(m, \'CD274mRNA\'                           , \'CD274mRNA_obs\', \'scale_CD274mRNA\', \'0.1 * y + 0.1 * max(y)\');\nm = pwAddY(m, \'pSTAT5\'                              , \'pSTAT5_obs\'   , \'scale_pSTAT5\'   , \'0.1 * y + 0.1 * max(y)\');\n\n\n%% S: Scaling parameters\n% m = pwAddS(m, ID, value, type, minValue, maxValue, unit, name, description)\n\nm = pwAddS(m, \'scale_pJAK2\'    , 0.469836894150194, \'global\',  0.001, 10000);\nm = pwAddS(m, \'scale_pIL4Ra\'   ,  1.80002942264669, \'global\',  0.001, 10000);\nm = pwAddS(m, \'scale_RecSurf\'  ,                 1,    \'fix\', 0.0001, 10000);\nm = pwAddS(m, \'scale_IL13-cell\',  174.726805005048, \'global\',  0.001, 10000);\nm = pwAddS(m, \'scale_CD274mRNA\', 0.110568221201943, \'global\',  0.001, 10000);\nm = pwAddS(m, \'scale_pSTAT5\'   ,                 1,    \'fix\',  0.001, 10000);\n\n\n%% Designer properties (do not modify)\nm.designerPropsM = [1 1 1 0 0 0 400 250 600 400 1 1 1 0 0 0 0];</pre>', 0, '2020-02-02'),
(694, 2, 'BIOMD315 Montagne2011_Oligator_optimised', '<p>This is the model of the in vitro DNA oscillator called oligator with the optmized set of parameters described in the article:<br/>\n        <b>Programming an in vitro DNA oscillator using a molecular networking strategy.</b>\n        <br/>\nMontagne K, Plasson R, Sakai Y, Fujii T, Rondelez Y. Mol Syst Biol. 2011 Feb 1;7:466. PubmedID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/21283142\">21283142</a>, Doi:<a href=\"http://dx.doi.org/10.1038/msb.2010.120\">10.1038/msb.2010.120</a>\n      </p>\n      <p>Abstract:<br/>\nLiving organisms perform and control complex behaviours by using webs of chemical reactions organized in precise networks. This powerful system concept, which is at the very core of biology, has recently become a new foundation for bioengineering. Remarkably, however, it is still extremely difficult to rationally create such network architectures in artificial, non-living and well-controlled settings. We introduce here a method for such a purpose, on the basis of standard DNA biochemistry. This approach is demonstrated by assembling de novo an efficient chemical oscillator: we encode the wiring of the corresponding network in the sequence of small DNA templates and obtain the predicted dynamics. Our results show that the rational cascading of standard elements opens the possibility to implement complex behaviours in vitro. Because of the simple and well-controlled environment, the corresponding chemical network is easily amenable to quantitative mathematical analysis. These synthetic systems may thus accelerate our understanding of the underlying principles of biological dynamic modules.\n</p>\n      <p>The model reproduces the time courses in fig 2B. The parameter identifiers of the reaction constants are not the same as in the supplemental material, but are just called kXd and kXr for the forward and backwards constant of reaction X respectively. </p>\n      <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n    </p>', 0, '2020-02-02'),
(695, 2, 'BIOMD319 Decroly1982_Enzymatic_Oscillator', '<p>This is the scaled model described in the article:<br/>\n        <b>Birhythmicity, chaos, and other patterns of temporal self-organization in a multiply regulated biochemical system</b>\n        <br/>Olivier Decroly, Albert Goldbeter, <i>Proc Natl Acad Sci USA</i> 1982 79:6917-6921; PMID:<a href=\"http://www.ncbi.nlm.nih.gov/pubmed/6960354\">6960354</a>;</p>\n        <p>\nAbstract:<br/>\nWe analyze on a model biochemical system the effect of a coupling between two instability-generating mechanisms. The system considered is that of two allosteric enzymes coupled in series and activated by their respective products. In addition to simple periodic oscillations, the system can exhibit a variety of new modes of dynamic behavior; coexistence between two stable periodic regimes (birhythmicity), random oscillations (chaos), and coexistence of a stable periodic regime with a stable steady state (hard excitation) or with chaos. The relationship between these patterns of temporal self-organization is analyzed as a function of the control parameters of the model. Chaos and birhythmicity appear to be rare events in comparison with simple periodic behavior. We discuss the relevance of these results with respect to the regularity of most biological rhythms.\n</p>\n        <p>The parameters q1 = 50 and q2 = 0.02 are explicitely included as the stoichiometric coefficients of beta and gamma in the reactions r2 and r3, respectively. Parameter values and initial conditions [ks=1.99/sec, alpha(0)=29.19988, beta(0)=188.8, gamma(0)=0.3367] are for the chaotic regime presented in the upper-curve of Figure 3b.</p>', 0, '2020-02-02'),
(696, 2, 'BIOMD320 Grange2001 - PK interaction of L-dopa and benserazide', '<div class=\"dc:title\">Grange2001 - PK interaction of L-dopa and benserazide</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/11587490\" title=\"Access to this publication\">A pharmacokinetic model to predict the PK interaction of L-dopa and benserazide in rats.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Grange S, Holford NH, Guentert TW</div>\n                <div class=\"bibo:Journal\">Pharmaceutical Research [2001, 18(8):1174-1184]</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>          <b>PURPOSE:</b>\n              To study the PK interaction of L-dopa/benserazide in rats. METHODS: Male rats received a single oral dose of 80 mg/kg L-dopa or 20 mg/kg benserazide or 80/20 mg/kg L-dopa/benserazide. Based on plasma concentrations the kinetics of L-dopa, 3-O-methyldopa (3-OMD), benserazide, and its metabolite Ro 04-5127 were characterized by noncompartmental analysis and a compartmental model where total L-dopa clearance was the sum of the clearances mediated by amino-acid-decarboxylase (AADC), catechol-O-methyltransferase and other enzymes. In the model Ro 04-5127 inhibited competitively the L-dopa clearance by AADC.          </p>\n                    <p>          <b>RESULTS:</b>\n              The coadministration of L-dopa/benserazide resulted in a major increase in systemic exposure to L-dopa and 3-OMD and a decrease in L-dopa clearance. The compartmental model allowed an adequate description of the observed L-dopa and 3-OMD concentrations in the absence and presence of benserazide. It had an advantage over noncompartmental analysis because it could describe the temporal change of inhibition and recovery of AADC.          </p>\n                    <p>          <b>CONCLUSIONS:</b>\n              Our study is the first investigation where the kinetics of benserazide and Ro 04-5127 have been described by a compartmental model. The L-dopa/benserazide model allowed a mechanism-based view of the L-dopa/benserazide interaction and supports the hypothesis that Ro 04-5127 is the primary active metabolite of benserazide.          </p>\n                    </div>\n                </div>\n            <div class=\"bm:curation\">      <p>The volumes and variables in this model are taken for a rat with 0.25 kg. The inital dose for L_Dopa (L_Dopa_per_kg_rat) and Benserazide (Benserazide_per_kg_rat) are to be given in umole per kg. 80 mg/kg L-Dopa correspond to 404 umol/kg, 20 mg/kg benserazide to 78 umol/kg. To change the model to a different mass of rat the compartment volumes, and the parameters rat_body_mass and Q have to changed accordingly.</p>\n                <p>The model has three species (A-dopa, A_B, A_M) whose initial concentrations are calculated from a        <i>listOfInitialAssignments</i>\n            . While running for the first time the time-course (24hrs) for this model in COPASI (up to version 4.6, Build 33), the resulting graph displays only straight lines for all the species. Any subsequent runs should provide proper plots (i.e. without making any change to the model, just by clicking the \"run\" button again).        </p>\n                <p>The above issue is caused by some initial assignments which are not calculated when COPASI imports the file. This issue should not be present in newer releases of COPASI.</p>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/MODEL0910130001\">MODEL0910130001</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02');
INSERT INTO `model` (`id`, `id_user`, `name`, `description`, `repositorytype`, `modified`) VALUES
(697, 2, 'BIOMD321 Grange2001 - L Dopa PK model', '<div class=\"dc:title\">Grange2001 - L-dopa PK model</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/11587490\" title=\"Access to this publication\">A pharmacokinetic model to predict the PK interaction of L-dopa and benserazide in rats.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Grange S, Holford NH, Guentert TW</div>\n                <div class=\"bibo:Journal\">Pharmaceutical Research [2001, 18(8):1174-1184]</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>          <b>PURPOSE:</b>\n              To study the PK interaction of L-dopa/benserazide in rats. METHODS: Male rats received a single oral dose of 80 mg/kg L-dopa or 20 mg/kg benserazide or 80/20 mg/kg L-dopa/benserazide. Based on plasma concentrations the kinetics of L-dopa, 3-O-methyldopa (3-OMD), benserazide, and its metabolite Ro 04-5127 were characterized by noncompartmental analysis and a compartmental model where total L-dopa clearance was the sum of the clearances mediated by amino-acid-decarboxylase (AADC), catechol-O-methyltransferase and other enzymes. In the model Ro 04-5127 inhibited competitively the L-dopa clearance by AADC.          </p>\n                    <p>          <b>RESULTS:</b>\n              The coadministration of L-dopa/benserazide resulted in a major increase in systemic exposure to L-dopa and 3-OMD and a decrease in L-dopa clearance. The compartmental model allowed an adequate description of the observed L-dopa and 3-OMD concentrations in the absence and presence of benserazide. It had an advantage over noncompartmental analysis because it could describe the temporal change of inhibition and recovery of AADC.          </p>\n                    <p>          <b>CONCLUSIONS:</b>\n              Our study is the first investigation where the kinetics of benserazide and Ro 04-5127 have been described by a compartmental model. The L-dopa/benserazide model allowed a mechanism-based view of the L-dopa/benserazide interaction and supports the hypothesis that Ro 04-5127 is the primary active metabolite of benserazide.          </p>\n                    </div>\n                </div>\n            <div class=\"bm:curation\">      <p>The model has a species (A-dopa) whose initial concentration is calculated from a        <i>listOfInitialAssignments</i>\n            . While running for the first time the time-course (24hrs) for this model in COPASI (up to version 4.6, Build 33), the resulting graph displays only straight lines for all the species. Any subsequent runs should provide proper plots (i.e. without making any change to the model, just by clicking the \"run\" button again).        </p>\n                <p>The above issue is caused by some initial assignments which are not calculated when COPASI imports the file. This issue should not be present in newer releases of COPASI.</p>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/MODEL1103250000\">MODEL1103250000</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(698, 2, 'BIOMD332 Bungay2006_Plasma', '<p>\n      This model is from the article:\n      <br/>\n        <strong> Modelling thrombin generation in human ovarian follicular fluid\n      </strong>\n        <br/>\nBungay Sharene D., Gentry Patricia A., Gentry Rodney D.\n      <em>Bulletin of Mathematical Biology</em>Volume 68, Issue 8, 12 July 2006, Pages 2283-302\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/16838084\">16838084</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nA mathematical model is constructed to study thrombin production in human ovarian follicular fluid. The model results show that the amount of thrombin that can be produced in ovarian follicular fluid is much lower than that in blood plasma, failing to reach the level required for fibrin formation, and thereby supporting the hypothesis that in follicular fluid thrombin functions to initiate cellular activities via intracellular signalling receptors. It is also concluded that the absence of the amplification pathway to thrombin production in follicular fluid is a major factor in restricting the amount of thrombin that can be produced. Titration of the initial concentrations of the various reactants in the model lead to predictions for the amount of tissue factor and phospholipid that is required to maintain thrombin production in the follicle, as well as to the conclusion that tissue factor pathway inhibitor has little effect on the time that thrombin generation is sustained. Numerical experiments to determine the effect of factor V, which is at a much reduced level in follicular fluid compared to plasma, and thrombomodulin, illustrate the importance for further experimental work to determine values for several parameters that have yet to be reported in the literature.\n      </p>', 0, '2020-02-02'),
(699, 2, 'BIOMD333 Bungay2006_FollicularFluid', '<p>\n      This model is from the article:\n      <br/>\n        <strong> Modelling thrombin generation in human ovarian follicular fluid\n      </strong>\n        <br/>\nBungay Sharene D., Gentry Patricia A., Gentry Rodney D.\n      <em>Bulletin of Mathematical Biology</em>Volume 68, Issue 8, 12 July 2006, Pages 2283-302\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/16838084\">16838084</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nA mathematical model is constructed to study thrombin production in human ovarian follicular fluid. The model results show that the amount of thrombin that can be produced in ovarian follicular fluid is much lower than that in blood plasma, failing to reach the level required for fibrin formation, and thereby supporting the hypothesis that in follicular fluid thrombin functions to initiate cellular activities via intracellular signalling receptors. It is also concluded that the absence of the amplification pathway to thrombin production in follicular fluid is a major factor in restricting the amount of thrombin that can be produced. Titration of the initial concentrations of the various reactants in the model lead to predictions for the amount of tissue factor and phospholipid that is required to maintain thrombin production in the follicle, as well as to the conclusion that tissue factor pathway inhibitor has little effect on the time that thrombin generation is sustained. Numerical experiments to determine the effect of factor V, which is at a much reduced level in follicular fluid compared to plasma, and thrombomodulin, illustrate the importance for further experimental work to determine values for several parameters that have yet to be reported in the literature.\n      </p>', 0, '2020-02-02'),
(700, 2, 'BIOMD334 Bungay2003_Thrombin_Generation', '<p>\n      This model is from the article:\n      <br/>\n        <strong> A mathematical model of lipid-mediated thrombin generation\n      </strong>\n        <br/>\nBungay Sharene D., Gentry Patricia A., Gentry Rodney D.\n      <em>Mathematical Medicine and Biology</em>Volume 20, Issue 1, 1 March 2003, Pages 105-29\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12974500\">12974500</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nThrombin is an enzyme that is generated in both vascular and non-vascular systems. In blood coagulation, a fundamental process in all species, thrombin induces the formation of a fibrin clot. A dynamical model of thrombin generation in the presence of lipid surfaces is presented. This model also includes the self-regulating thrombin feedback reactions, the thrombomodulin-protein C-protein S inhibitory system, tissue factor pathway inhibitor (TFPI), and the inhibitor, antithrombin (AT). The dynamics of this complex system were found to be highly lipid dependent, as would be expected from experimental studies. Simulations of this model indicate that a threshold lipid level is required to generate physiologically relevant amounts of thrombin. The dependence of the onset, the peak levels, and the duration of thrombin generation on lipid was saturable. The lipid concentration affects the way in which the inhibitors modulate thrombin production. A novel feature of this model is the inclusion of the dynamical protein C pathway, initiated by thrombin feedback. This inhibitory system exerts its effects on the lipid surface, where its substrates are formed. The maximum impact of TFPI occurs at intermediate vesicle concentrations. Inhibition by AT is only indirectly affected by the lipid since AT irreversibly binds only to solution phase proteins. In a system with normal plasma concentrations of the proteins involved in thrombin formation, the combination of these three inhibitors is sufficient both to effectively stop thrombin generation prior to the exhaustion of its precursor, prothrombin, and to inhibit all thrombin formed. This model can be used to predict thrombin generation under extreme lipid conditions that are difficult to implement experimentally and to examine thrombin generation in non-vascular systems.\n      </p>\n        <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.<br/>\nFor more information see the <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>.<br/>\nTo cite BioModels Database, please use: <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n      </p>', 0, '2020-02-02'),
(701, 2, 'BIOMD335 Hockin2002_BloodCoagulation', '<p>\n      This model is from the article:\n      <br/>\n        <strong> A model for the stoichiometric regulation of blood coagulation.\n      </strong>\n        <br/>\nHockin MF, Jones KC, Everse SJ, Mann KG.\n      <em>Journal of Biological Chemistry</em>Volume 277, Issue 21, 24 May 2002, Pages 18322 -18333\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/11893748\">11893748</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nWe have developed a model of the extrinsic blood coagulation system that includes the stoichiometric anticoagulants. The model accounts for the formation, expression, and propagation of the vitamin K-dependent procoagulant complexes and extends our previous model by including: (a) the tissue factor pathway inhibitor (TFPI)-mediated inactivation of tissue factor (TF).VIIa and its product complexes; (b) the antithrombin-III (AT-III)-mediated inactivation of IIa, mIIa, factor VIIa, factor IXa, and factor Xa; (c) the initial activation of factor V and factor VIII by thrombin generated by factor Xa-membrane; (d) factor VIIIa dissociation/activity loss; (e) the binding competition and kinetic activation steps that exist between TF and factors VII and VIIa; and (f) the activation of factor VII by IIa, factor Xa, and factor IXa. These additions to our earlier model generate a model consisting of 34 differential equations with 42 rate constants that together describe the 27 independent equilibrium expressions, which describe the fates of 34 species. Simulations are initiated by \"exposing\" picomolar concentrations of TF to an electronic milieu consisting of factors II, IX, X, VII, VIIa, V, and VIIII, and the anticoagulants TFPI and AT-III at concentrations found in normal plasma or associated with coagulation pathology. The reaction followed in terms of thrombin generation, proceeds through phases that can be operationally defined as initiation, propagation, and termination. The generation of thrombin displays a nonlinear dependence upon TF, AT-III, and TFPI and the combination of these latter inhibitors displays kinetic thresholds. At subthreshold TF, thrombin production/expression is suppressed by the combination of TFPI and AT-III; for concentrations above the TF threshold, the bolus of thrombin produced is quantitatively equivalent. A comparison of the model with empirical laboratory data illustrates that most experimentally observable parameters are captured, and the pathology that results in enhanced or deficient thrombin generation is accurately described.\n      </p>', 0, '2020-02-02'),
(702, 2, 'BIOMD344 Proctor2011_ProteinHomeostasis_NormalCondition', '<p>\n      This model is from the article:\n      <br/>\n        <strong> Modelling the Role of the Hsp70/Hsp90 System in the Maintenance of Protein Homeostasis\n</strong>\n        <br/>\nProctor CJ,  Lorimer IAJ\n      <em>PLoS ONE</em>2011; 6(7): e22038.\n      <a href=\"http://www.plosone.org/article/info%3Adoi%2F10.1371%2Fjournal.pone.0022038\">doi:10.1371/journal.pone.0022038</a>,\n      <br/>\n        <strong>Abstract:</strong>\n        <br/>\nNeurodegeneration is an age-related disorder which is characterised by the accumulation of aggregated protein and neuronal cell death. There are many different neurodegenerative diseases which are classified according to the specific proteins involved and the regions of the brain which are affected. Despite individual differences, there are common mechanisms at the sub-cellular level leading to loss of protein homeostasis. The two central systems in protein homeostasis are the chaperone system, which promotes correct protein folding, and the cellular proteolytic system, which degrades misfolded or damaged proteins. Since these systems and their interactions are very complex, we use mathematical modelling to aid understanding of the processes involved. The model developed in this study focuses on the role of Hsp70 (IPR00103) and Hsp90 (IPR001404) chaperones in preventing both protein aggregation and cell death. Simulations were performed under three different conditions: no stress; transient stress due to an increase in reactive oxygen species; and high stress due to sustained increases in reactive oxygen species. The model predicts that protein homeostasis can be maintained during short periods of stress. However, under long periods of stress, the chaperone system becomes overwhelmed and the probability of cell death pathways being activated increases. Simulations were also run in which cell death mediated by the JNK (P45983) and p38 (Q16539) pathways was inhibited. The model predicts that inhibiting either or both of these pathways may delay cell death but does not stop the aggregation process and that eventually cells die due to aggregated protein inhibiting proteasomal function. This problem can be overcome if the sequestration of aggregated protein into inclusion bodies is enhanced. This model predicts responses to reactive oxygen species-mediated stress that are consistent with currently available experimental data. The model can be used to assess specific interventions to reduce cell death due to impaired protein homeostasis.\n   </p>\n        <p>\n          <b>Note:</b>\n        </p>\n        <p> Simulations were performed under three different conditions: 1) normal condition (no stress), 2) moderate stress due to an increase in reactive oxygen species (ROS) i.e. ROS levels were increased by a factor of 4 at time=4hours for a period of 1 hour (not 2 hours as mentioned in the figure 5 legend of the reference publication. This is a typo in the paper and is clarified by the author) and 3) high stress due to sustained increase in reactive oxygen species (ROS) (here ROS increases with time).</p>\n        <p> The model that corresponds to the normal condition is submitted as a main model in the BioModels Database. The other two models, that corresponds to the moderate stress conditions and high stress conditions are available in SBML format as supporting files [go to Curation tab].</p>\n        <p> Supplementary figures S3 (normal condition), S4 (moderate stress condition) and S6 (high stress condition) are reproduced here. </p>', 0, '2020-02-02'),
(703, 2, 'BIOMD347 Bachmann2011_JAK2-STAT5_FeedbackControl', '<p>This model is from the article:      <br/>\n                <strong>Division of labor by dual feedback regulators controls JAK2/STAT5 signaling over broad ligand range.</strong>\n                <br/>\n          Bachmann J, Raue A, Schilling M, Bhm ME, Kreutz C, Kaschek D, Busch H, Gretz N, Lehmann WD, Timmer J, Klingmller U.      <em>Mol Syst Biol.</em>\n          2011 Jul 19;7:516.      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/21772264\">21772264</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          Cellular signal transduction is governed by multiple feedback mechanisms to elicit robust cellular decisions. The specific contributions of individual feedback regulators, however, remain unclear. Based on extensive time-resolved data sets in primary erythroid progenitor cells, we established a dynamic pathway model to dissect the roles of the two transcriptional negative feedback regulators of the suppressor of cytokine signaling (SOCS) family, CIS and SOCS3, in JAK2/STAT5 signaling. Facilitated by the model, we calculated the STAT5 response for experimentally unobservable Epo concentrations and provide a quantitative link between cell survival and the integrated response of STAT5 in the nucleus. Model predictions show that the two feedbacks CIS and SOCS3 are most effective at different ligand concentration ranges due to their distinct inhibitory mechanisms. This divided function of dual feedback regulation enables control of STAT5 responses for Epo concentrations that can vary 1000-fold in vivo. Our modeling approach reveals dose-dependent feedback control as key property to regulate STAT5-mediated survival decisions over a broad range of ligand concentrations.      </p>', 0, '2020-02-02'),
(704, 2, 'BIOMD352 Vernoux2011_AuxinSignaling_AuxinFluctuating', '<p>This model is from the article:      <br/>\n                <strong>The auxin signalling network translates dynamic input into robust patterning at the shoot apex.</strong>\n                <br/>\n          Vernoux T, Brunoud G, Farcot E, Morin V, Van den Daele H, Legrand J, Oliva M, Das P, Larrieu A, Wells D, Gudon Y, Armitage L, Picard F, Guyomarc\'h S, Cellier C, Parry G, Koumproglou R, Doonan JH, Estelle M, Godin C, Kepinski S, Bennett M, De Veylder L, Traas J.      <em>Mol Syst Biol.</em>\n          2011 Jul 5;7:508.      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/21734647\">21734647</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          The plant hormone auxin is thought to provide positional information for patterning during development. It is still unclear, however, precisely how auxin is distributed across tissues and how the hormone is sensed in space and time. The control of gene expression in response to auxin involves a complex network of over 50 potentially interacting transcriptional activators and repressors, the auxin response factors (ARFs) and Aux/IAAs. Here, we perform a large-scale analysis of the Aux/IAA-ARF pathway in the shoot apex of Arabidopsis, where dynamic auxin-based patterning controls organogenesis. A comprehensive expression map and full interactome uncovered an unexpectedly simple distribution and structure of this pathway in the shoot apex. A mathematical model of the Aux/IAA-ARF network predicted a strong buffering capacity along with spatial differences in auxin sensitivity. We then tested and confirmed these predictions using a novel auxin signalling sensor that reports input into the signalling pathway, in conjunction with the published DR5 transcriptional output reporter. Our results provide evidence that the auxin signalling network is essential to create robust patterns at the shoot apex.      <p>        <b>Note:</b>\n                    </p>\n                <p>Figure 4 of the supplementary material of the reference article has been reproduced here. In this model, the fluctuations of auxin level is represented using sinux function. Time evolution of the variables AUX/IAA (I) and mRNA (R) are plotted, under the influence of fluctuations of auxin level. pi_A is varied between 0 and 2 by steps of 0.1.</p>\n                </p>\n            <p>This model originates from BioModels Database: A Database of Annotated Published Models (http://www.ebi.ac.uk/biomodels/). It is copyright (c) 2005-2011 The BioModels.net Team.      <br/>\n          For more information see the      <a href=\"http://www.ebi.ac.uk/biomodels/legal.html\" target=\"_blank\">terms of use</a>\n          .      <br/>\n          To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" target=\"_blank\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(705, 2, 'BIOMD355 Abell2011_CalciumSignaling_WithAdaptation', '<p>This model is from the article:      <br/>\n        <strong>Parallel adaptive feedback enhances reliability of the Ca2+ signaling system.</strong>\n        <br/>\n          Abell E, Ahrends R, Bandara S, Park BO, Teruel MN.      <em>Proc Natl Acad Sci U S A.</em>\n          2011 Aug 15.      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/21844332\">21844332</a>\n          ,      <br/>\n        <strong>Abstract:</strong>\n        <br/>\n          Despite large cell-to-cell variations in the concentrations of individual signaling proteins, cells transmit signals correctly. This phenomenon raises the question of what signaling systems do to prevent a predicted high failure rate. Here we combine quantitative modeling, RNA interference, and targeted selective reaction monitoring (SRM) mass spectrometry, and we show for the ubiquitous and fundamental calcium signaling system that cells monitor cytosolic and endoplasmic reticulum (ER) Ca(2+) levels and adjust in parallel the concentrations of the store-operated Ca(2+) influx mediator stromal interaction molecule (STIM), the plasma membrane Ca(2+) pump plasma membrane Ca-ATPase (PMCA), and the ER Ca(2+) pump sarco/ER Ca(2+)-ATPase (SERCA). Model calculations show that this combined parallel regulation in protein expression levels effectively stabilizes basal cytosolic and ER Ca(2+) levels and preserves receptor signaling. Our results demonstrate that, rather than directly controlling the relative level of signaling proteins in a forward regulation strategy, cells prevent transmission failure by sensing the state of the signaling pathway and using multiple parallel adaptive feedbacks.      </p>\n      <p>\n        <b>Note:</b>\n      </p>\n      <p>There are two models described in the paper to simulate basal and receptor stimulated Ca      <sup>2+</sup>\n          signaling. 1) No adaptive feedback (MODEL1108050000) and 2) with three slow adaptive feedback loops (this model: MODEL1108050001).      </p>', 0, '2020-02-02'),
