(713, 2, 'BIOMD395 Sivakumar2011 - Hedgehog Signaling Pathway', '<div class=\"dc:title\">\n	  Sivakumar2011 - Hedgehog Signaling Pathway\n	</div>\n	\n	 <p>This is the current model for the Hedgehog signaling pathway. The best data for mechanism of signaling has been worked out in Drosophila, so this model is based largely on Drosophila data. Hedgehog target genes vary from tissue to tissue, so the identities of individual target genes have not been listed. The main difference between the Drosophila and mammalian Hedgehog signaling pathways is the fact that there are three mammalian homologs of Cubitus interruptus, Gli1 Gli2 and Gli3. Some or all of the mammalian homologs may be proteolytically processed, but the data are controversial. There are two mammalian Ptc genes and three mammalian Hedgehog genes as well. The pathway for Sonic Hedgehog appears to be most similar to the Drosophila hedgehog pathway.</p>\n         <p>References:</p>\n         <ul>\n          <li>\n              <a href=\"http://identifiers.org/pubmed/11731473\">Hedgehog signaling in animal development: paradigms and principles.</a></li>\n          <li>\n              <a href=\"http://identifiers.org/pubmed/11861165\">Sonic hedgehog in the nervous system: functions, modifications and mechanisms.</a></li>\n          <li>\n              <a href=\"http://identifiers.org/pubmed/12200154\">Hedgehog signal transduction: recent findings.</a></li>\n          <li>\n              <a href=\"http://identifiers.org/pubmed/14738752\">Hedgehog signaling: Costal-2 bridges the transduction gap.</a></li>\n         </ul>\n	</div>\n	<div class=\"dc:bibliographicCitation\">\n	 <p>This model is described in the article:</p>\n	 <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/21978399\" title=\"Access to this publication\">A systems biology approach to model neural stem cell regulation by notch, shh, wnt, and EGF signaling pathways.</a></div>\n	 <div class=\"bibo:authorList\">Sivakumar KC, Dhanesh SB, Shobana S, James J, Mundayoor S.</div>\n	 <div class=\"bibo:Journal\">Omics: a Journal of Integrative Biology. 2011; 15(10):729-737</div>\n	 <p>Abstract:</p>\n	 <div class=\"bibo:abstract\">  \n	   <p>The Notch, Sonic Hedgehog (Shh), Wnt, and EGF pathways have long been known to influence cell fate specification in the developing nervous system. Here we attempted to evaluate the contemporary knowledge about neural stem cell differentiation promoted by various drug-based regulations through a systems biology approach. Our model showed the phenomenon of DAPT-mediated antagonism of Enhancer of split [E(spl)] genes and enhancement of Shh target genes by a SAG agonist that were effectively demonstrated computationally and were consistent with experimental studies. However, in the case of model simulation of Wnt and EGF pathways, the model network did not supply any concurrent results with experimental data despite the fact that drugs were added at the appropriate positions. This paves insight into the potential of crosstalks between pathways considered in our study. Therefore, we manually developed a map of signaling crosstalk, which included the species connected by representatives from Notch, Shh, Wnt, and EGF pathways and highlighted the regulation of a single target gene, Hes-1, based on drug-induced simulations. These simulations provided results that matched with experimental studies. Therefore, these signaling crosstalk models complement as a tool toward the discovery of novel regulatory processes involved in neural stem cell maintenance, proliferation, and differentiation during mammalian central nervous system development. To our knowledge, this is the first report of a simple crosstalk map that highlights the differential regulation of neural stem cell differentiation and underscores the flow of positive and negative regulatory signals modulated by drugs.</p>\n	 </div>\n	</div>\n	<div class=\"dc:publisher\">\n	 <p>This model is hosted on <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a> and identified by: <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000395\">BIOMD0000000395</a>.</p>\n	 <p>To cite BioModels Database, please use: <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>.</p>\n	</div>\n	<div class=\"dc:license\">\n	   <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a> for more information.</p>\n	</div>', 0, '2020-02-02'),
(714, 2, 'BIOMD396 Sivakumar2011 - Notch Signaling Pathway', '<div class=\"dc:title\">\n	  Sivakumar2011 - Notch Signaling Pathway\n	</div>\n	\n	 <p>Notch is a transmembrane receptor that mediates local cell-cell communication and coordinates a signaling cascade. It plays a key role in modulating cell fate decisions throughout the development of invertebrate and vertebrate species and the misregulation leads to a number of human diseases.</p>\n         <p>References:</p>\n         <ul>\n          <li>\n              <a href=\"http://identifiers.org/pubmed/11112321\">Notch signaling: from the outside in.</a></li>\n          <li>\n              <a href=\"http://identifiers.org/pubmed/12366684\">Notch signaling in hematopoiesis and early lymphocyte development.</a></li>\n          <li>\n              <a href=\"http://identifiers.org/pubmed/12651094\">An overview of the Notch signalling pathway.</a></li>\n          <li>\n              <a href=\"http://identifiers.org/pubmed/12676578\">Notch and cancer: best to avoid the ups and downs.</a></li>\n          <li>\n              <a href=\"http://identifiers.org/pubmed/14973298\">Notch signaling: control of cell communication and cell fate.</a></li>\n         </ul>\n	</div>\n	<div class=\"dc:bibliographicCitation\">\n	 <p>This model is described in the article:</p>\n	 <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/pubmed/21978399\" title=\"Access to this publication\">A systems biology approach to model neural stem cell regulation by notch, shh, wnt, and EGF signaling pathways.</a></div>\n	 <div class=\"bibo:authorList\">Sivakumar KC, Dhanesh SB, Shobana S, James J, Mundayoor S.</div>\n	 <div class=\"bibo:Journal\">Omics: a Journal of Integrative Biology. 2011; 15(10):729-737</div>\n	 <p>Abstract:</p>\n	 <div class=\"bibo:abstract\">  \n	   <p>The Notch, Sonic Hedgehog (Shh), Wnt, and EGF pathways have long been known to influence cell fate specification in the developing nervous system. Here we attempted to evaluate the contemporary knowledge about neural stem cell differentiation promoted by various drug-based regulations through a systems biology approach. Our model showed the phenomenon of DAPT-mediated antagonism of Enhancer of split [E(spl)] genes and enhancement of Shh target genes by a SAG agonist that were effectively demonstrated computationally and were consistent with experimental studies. However, in the case of model simulation of Wnt and EGF pathways, the model network did not supply any concurrent results with experimental data despite the fact that drugs were added at the appropriate positions. This paves insight into the potential of crosstalks between pathways considered in our study. Therefore, we manually developed a map of signaling crosstalk, which included the species connected by representatives from Notch, Shh, Wnt, and EGF pathways and highlighted the regulation of a single target gene, Hes-1, based on drug-induced simulations. These simulations provided results that matched with experimental studies. Therefore, these signaling crosstalk models complement as a tool toward the discovery of novel regulatory processes involved in neural stem cell maintenance, proliferation, and differentiation during mammalian central nervous system development. To our knowledge, this is the first report of a simple crosstalk map that highlights the differential regulation of neural stem cell differentiation and underscores the flow of positive and negative regulatory signals modulated by drugs.</p>\n	 </div>\n	</div>\n	<div class=\"dc:publisher\">\n	 <p>This model is hosted on <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a> and identified by: <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000396\">BIOMD0000000396</a>.</p>\n	 <p>To cite BioModels Database, please use: <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>.</p>\n	</div>\n	<div class=\"dc:license\">\n	   <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a> for more information.</p>\n	</div>', 0, '2020-02-02'),
(715, 2, 'BIOMD397 Sivakumar2011_WntSignalingPathway', '<div class=\"dc:title\">Sivakumar2011_WntSignalingPathway</div>\nThe secreted protein Wnt activates the\nheptahelical receptor Frizzled on nieghboring cells. Activation of\nFrizzled causes the recruitment of additional membrane proteins\nwhich in turn result in 1) the activation of the protein\nDishevelled via phosphorylation and 2) the activation of a\nheterotrimeric G protein of unknown type. Activation of Dishevelled\nresults in the down-regulation of the Beta-Catenin destruction\ncomplex which causes ubiquitination of Beta-Catenin and its\nultimate degradation via the proteasome. Inhibition of the\nBeta-Catenin destruction complex yields a higher cytosolic\nconcentration of Beta-Catenin, which enters the nucleus, binds\nvarious transcriptional regulatory molecules including the TCF/LEF\nclass of proteins, and results in the transcription of TCF/LEF\ntarget genes. Activation of the heterotrimeric G-protein pathway in\nturn activates Phospholipase C which in turn catalyzes the\ncatalysis of PI(4,5)P2 into DAG and IP3.\n<br/>\n<br/>Reference:\n<br/>\n<ul>\n  <li>\n    <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12356903\">The Wnt\n    signalling pathway.</a>\n  </li>\n  <li>\n    <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/12573432\">You Wnt\n    some, you lose some: oncogenes in the Wnt signaling\n    pathway.</a>\n  </li>\n  <li>\n    <a href=\"http://www.biocarta.com/pathfiles/h_wntPathway.asp\">Wnt\n    signaling pathway.</a>\n  </li>\n</ul>\n<br/></div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/21978399\" title=\"Access to this publication\">A systems biology approach\n    to model neural stem cell regulation by notch, shh, wnt, and\n    EGF signaling pathways.</a>\n  </div>\n  <div class=\"bibo:authorList\">Sivakumar KC, Dhanesh SB, Shobana S,\n  James J, Mundayoor S.</div>\n  <div class=\"bibo:Journal\">OMICS 2011 Oct; 15(10): 729-737</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>The Notch, Sonic Hedgehog (Shh), Wnt, and EGF pathways have\n    long been known to influence cell fate specification in the\n    developing nervous system. Here we attempted to evaluate the\n    contemporary knowledge about neural stem cell differentiation\n    promoted by various drug-based regulations through a systems\n    biology approach. Our model showed the phenomenon of\n    DAPT-mediated antagonism of Enhancer of split [E(spl)] genes\n    and enhancement of Shh target genes by a SAG agonist that were\n    effectively demonstrated computationally and were consistent\n    with experimental studies. However, in the case of model\n    simulation of Wnt and EGF pathways, the model network did not\n    supply any concurrent results with experimental data despite\n    the fact that drugs were added at the appropriate positions.\n    This paves insight into the potential of crosstalks between\n    pathways considered in our study. Therefore, we manually\n    developed a map of signaling crosstalk, which included the\n    species connected by representatives from Notch, Shh, Wnt, and\n    EGF pathways and highlighted the regulation of a single target\n    gene, Hes-1, based on drug-induced simulations. These\n    simulations provided results that matched with experimental\n    studies. Therefore, these signaling crosstalk models complement\n    as a tool toward the discovery of novel regulatory processes\n    involved in neural stem cell maintenance, proliferation, and\n    differentiation during mammalian central nervous system\n    development. To our knowledge, this is the first report of a\n    simple crosstalk map that highlights the differential\n    regulation of neural stem cell differentiation and underscores\n    the flow of positive and negative regulatory signals modulated\n    by drugs.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000397\">BIOMD0000000397</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(716, 2, 'BIOMD398 Sivakumar2011_NeuralStemCellDifferentiation_Crosstalk', '<div class=\"dc:title\">\nSivakumar2011_NeuralStemCellDifferentiation_Crosstalk</div>\nThis model is generated by integrating \n<a href=\"http://www.ebi.ac.uk/biomodels-main/BIOMD0000000394\">BIOMD0000000394</a>\n(EGFR), \n<a href=\"http://www.ebi.ac.uk/biomodels-main/BIOMD0000000395\">BIOMD0000000395</a>\n(Hedgehog), \n<a href=\"http://www.ebi.ac.uk/biomodels-main/BIOMD0000000396\">BIOMD0000000396</a>\n(Notch) and \n<a href=\"http://www.ebi.ac.uk/biomodels-main/BIOMD0000000397\">BIOMD0000000397</a>\n(Wnt), to investigate the signalling crosstalk between the four\npathways.\n<br/></div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/21978399\" title=\"Access to this publication\">A systems biology approach\n    to model neural stem cell regulation by notch, shh, wnt, and\n    EGF signaling pathways.</a>\n  </div>\n  <div class=\"bibo:authorList\">Sivakumar KC, Dhanesh SB, Shobana S,\n  James J, Mundayoor S.</div>\n  <div class=\"bibo:Journal\">OMICS 2011 Oct; 15(10): 729-737</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>The Notch, Sonic Hedgehog (Shh), Wnt, and EGF pathways have\n    long been known to influence cell fate specification in the\n    developing nervous system. Here we attempted to evaluate the\n    contemporary knowledge about neural stem cell differentiation\n    promoted by various drug-based regulations through a systems\n    biology approach. Our model showed the phenomenon of\n    DAPT-mediated antagonism of Enhancer of split [E(spl)] genes\n    and enhancement of Shh target genes by a SAG agonist that were\n    effectively demonstrated computationally and were consistent\n    with experimental studies. However, in the case of model\n    simulation of Wnt and EGF pathways, the model network did not\n    supply any concurrent results with experimental data despite\n    the fact that drugs were added at the appropriate positions.\n    This paves insight into the potential of crosstalks between\n    pathways considered in our study. Therefore, we manually\n    developed a map of signaling crosstalk, which included the\n    species connected by representatives from Notch, Shh, Wnt, and\n    EGF pathways and highlighted the regulation of a single target\n    gene, Hes-1, based on drug-induced simulations. These\n    simulations provided results that matched with experimental\n    studies. Therefore, these signaling crosstalk models complement\n    as a tool toward the discovery of novel regulatory processes\n    involved in neural stem cell maintenance, proliferation, and\n    differentiation during mammalian central nervous system\n    development. To our knowledge, this is the first report of a\n    simple crosstalk map that highlights the differential\n    regulation of neural stem cell differentiation and underscores\n    the flow of positive and negative regulatory signals modulated\n    by drugs.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000398\">BIOMD0000000398</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(717, 2, 'BIOMD407 Schliemann2011_TNF_ProAntiApoptosis', '<p>This model is from the article:      <br/>\n                <strong>Heterogeneity Reduces Sensitivity of Cell Death for TNF-Stimuli</strong>\n                <br/>\n          Schliemann M, Bullinger E, Borchers S, Allgower F, Findeisen R, Scheurich P.      <em>BMC Syst Biol.</em>\n          2011 Dec 28;5(1):204.      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/22204418\">22204418</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          BACKGROUND:\n\nApoptosis is a form of programmed cell death essential for the maintenance of homeostasis and the removal of potentially damaged cells in multicellular organisms. By binding its cognate membrane receptor, TNF receptor type 1 (TNF-R1), the proinflammatory cytokine Tumor Necrosis Factor (TNF) activates pro-apoptotic signaling via caspase activation, but at the same time also stimulates nuclear factor kappaB (NF-kappaB)-mediated survival pathways. Differential dose-response relationships of these two major TNF signaling pathways have been described experimentally and using mathematical modeling. However, the quantitative analysis of the complex interplay between pro- and anti-apoptotic signaling pathways is an open question as it is challenging for several reasons: the overall signaling network is complex, various time scales are present, and cells respond quantitatively and qualitatively in a heterogeneous manner.\nRESULTS:\n\nThis study analyzes the complex interplay of the crosstalk of TNF-R1 induced pro- and anti-apoptotic signaling pathways based on an experimentally validated mathematical model. The mathematical model describes the temporal responses on both the single cell level as well as the level of a heterogeneous cell population, as observed in the respective quantitative experiments using TNF-R1 stimuli of different strengths and durations. Global sensitivity of the heterogeneous population was quantified by measuring the average gradient of time of death versus each population parameter. This global sensitivity analysis uncovers the concentrations of Caspase-8 and Caspase-3, and their respective inhibitors BAR and XIAP, as key elements for deciding the cell\'s fate. A simulated knockout of the NF-kappaB-mediated anti-apoptotic signaling reveals the importance of this pathway for delaying the time of death, reducing the death rate in the case of pulse stimulation and significantly increasing cell-to-cell variability.\nCONCLUSIONS:\n\nCell ensemble modeling of a heterogeneous cell population including a global sensitivity analysis presented here allowed us to illuminate the role of the different elements and parameters on apoptotic signaling. The receptors serve to transmit the external stimulus; procaspases and their inhibitors control the switching from life to death, while NF-kappaB enhances the heterogeneity of the cell population. The global sensitivity analysis of the cell population model further revealed an unexpected impact of heterogeneity, i.e. the reduction of parametric sensitivity.      </p>\n            <p>      <b>Note:</b>\n          SBML model generated from Matlab system description\n            on 12-July-2011 21:08:15 by \n            exportSBML Copyright Eric Bullinger 2007-2011      </p>', 0, '2020-02-02');
