(718, 2, 'BIOMD414 Band2012_DII-Venus_ReducedModel', '<p>\n                  This model is from the article:\n                        <br/>\n        <strong> Root gravitropism is regulated by a transient lateral auxin gradient controlled by a tipping-point mechanism.\n                              </strong>\n        <br/>\n                                    Band LR, Wells DM, Larrieu A, Sun J, Middleton AM, French AP, Brunoud G, Sato EM, Wilson MH, Pret B, Oliva M, Swarup R, Sairanen I, Parry G, Ljung K, Beeckman T, Garibaldi JM, Estelle M, Owen MR, Vissenberg K, Hodgman TC, Pridmore TP, King JR, Vernoux T, Bennett MJ.\n                                          <em>Proc Natl Acad Sci U S A.</em>2012 Mar 20;109(12):4668-73\n                                                <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/22393022\">22393022</a>,\n                                                      <br/>\n        <strong>Abstract:</strong>\n        <br/>\n                                                                  Gravity profoundly influences plant growth and development. Plants respond to changes in orientation by using gravitropic responses to modify their growth. Cholodny and Went hypothesized over 80 years ago that plants bend in response to a gravity stimulus by generating a lateral gradient of a growth regulator at an organ\'s apex, later found to be auxin. Auxin regulates root growth by targeting Aux/IAA repressor proteins for degradation. We used an Aux/IAA-based reporter, domain II (DII)-VENUS, in conjunction with a mathematical model to quantify auxin redistribution following a gravity stimulus. Our multidisciplinary approach revealed that auxin is rapidly redistributed to the lower side of the root within minutes of a 90 gravity stimulus. Unexpectedly, auxin asymmetry was rapidly lost as bending root tips reached an angle of 40 to the horizontal. We hypothesize roots use a \"tipping point\" mechanism that operates to reverse the asymmetric auxin flow at the midpoint of root bending. These mechanistic insights illustrate the scientific value of developing quantitative reporters such as DII-VENUS in conjunction with parameterized mathematical models to provide high-resolution kinetics of hormone redistribution.\n                                                                     </p>\n        <p>\n                                                                     This model corresponds to the simplified model described in the article. It is assumed that, on the timescale of DII-VENUS degradation, the concentrations of auxin, TIR1/AFB, and their complexes can be approximated by quasi-steady-state expressions. This reduced the full model to a single ODE that describes how the DII-VENUS dynamics depend on the auxin influx and four parameter groupings. </p>', 0, '2020-02-02'),
(719, 2, 'BIOMD417 Ratushny2012_NF', '<p>This model is from the article:      <br/>\n                <strong>Asymmetric positive feedback loops reliably control biological responses</strong>\n                <br/>\n          Alexander V Ratushny, Ramsey A Saleem, Katherine Sitko, Stephen A Ramsey &amp; John D Aitchison      <em>Mol Syst Biol.</em>\n          2012 Apr 24;8:577.      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/22531117\">22531117</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          Positive feedback is a common mechanism enabling biological systems to respond to stimuli in a switch-like manner. Such systems are often characterized by the requisite formation of a heterodimer where only one of the pair is subject to feedback. This ASymmetric Self-UpREgulation (ASSURE) motif is central to many biological systems, including cholesterol homeostasis (LXR?/RXR?), adipocyte differentiation (PPAR?/RXR?), development and differentiation (RAR/RXR), myogenesis (MyoD/E12) and cellular antiviral defense (IRF3/IRF7). To understand why this motif is so prevalent, we examined its properties in an evolutionarily conserved transcriptional regulatory network in yeast (Oaf1p/Pip2p). We demonstrate that the asymmetry in positive feedback confers a competitive advantage and allows the system to robustly increase its responsiveness while precisely tuning the response to a consistent level in the presence of varying stimuli. This study reveals evolutionary advantages for the ASSURE motif, and mechanisms for control, that are relevant to pharmacologic intervention and synthetic biology applications.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" class=\"external\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
