(722, 2, 'BIOMD420 Ratushny2012_ASSURE_I', '<p>This model is from the article:      <br/>\n                <strong>Asymmetric positive feedback loops reliably control biological responses</strong>\n                <br/>\n          Alexander V Ratushny, Ramsey A Saleem, Katherine Sitko, Stephen A Ramsey &amp; John D Aitchison      <em>Mol Syst Biol.</em>\n          2012 Apr 24;8:577.      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/22531117\">22531117</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          Positive feedback is a common mechanism enabling biological systems to respond to stimuli in a switch-like manner. Such systems are often characterized by the requisite formation of a heterodimer where only one of the pair is subject to feedback. This ASymmetric Self-UpREgulation (ASSURE) motif is central to many biological systems, including cholesterol homeostasis (LXR?/RXR?), adipocyte differentiation (PPAR?/RXR?), development and differentiation (RAR/RXR), myogenesis (MyoD/E12) and cellular antiviral defense (IRF3/IRF7). To understand why this motif is so prevalent, we examined its properties in an evolutionarily conserved transcriptional regulatory network in yeast (Oaf1p/Pip2p). We demonstrate that the asymmetry in positive feedback confers a competitive advantage and allows the system to robustly increase its responsiveness while precisely tuning the response to a consistent level in the presence of varying stimuli. This study reveals evolutionary advantages for the ASSURE motif, and mechanisms for control, that are relevant to pharmacologic intervention and synthetic biology applications.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Publ