(723, 2, 'BIOMD421 Ratushny2012_ASSURE_II', '<p>This model is from the article:      <br/>\n                <strong>Asymmetric positive feedback loops reliably control biological responses</strong>\n                <br/>\n          Alexander V Ratushny, Ramsey A Saleem, Katherine Sitko, Stephen A Ramsey &amp; John D Aitchison      <em>Mol Syst Biol.</em>\n          2012 Apr 24;8:577.      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/22531117\">22531117</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          Positive feedback is a common mechanism enabling biological systems to respond to stimuli in a switch-like manner. Such systems are often characterized by the requisite formation of a heterodimer where only one of the pair is subject to feedback. This ASymmetric Self-UpREgulation (ASSURE) motif is central to many biological systems, including cholesterol homeostasis (LXR?/RXR?), adipocyte differentiation (PPAR?/RXR?), development and differentiation (RAR/RXR), myogenesis (MyoD/E12) and cellular antiviral defense (IRF3/IRF7). To understand why this motif is so prevalent, we examined its properties in an evolutionarily conserved transcriptional regulatory network in yeast (Oaf1p/Pip2p). We demonstrate that the asymmetry in positive feedback confers a competitive advantage and allows the system to robustly increase its responsiveness while precisely tuning the response to a consistent level in the presence of varying stimuli. This study reveals evolutionary advantages for the ASSURE motif, and mechanisms for control, that are relevant to pharmacologic intervention and synthetic biology applications.      </p>\n            <br/>\n            <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to      <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Creative Commons CC0\">CC0 Public Domain Dedication</a>\n          for more information.      </p>\n            <p>In summary, you are entitled to use this encoded model in absolutely any manner you deem suitable, verbatim, or with modification, alone or embedded it in a larger context, redistribute it, commercially or not, in a restricted way or not.</p>\n            <br/>\n            <p>To cite BioModels Database, please use:      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/20587024\" class=\"external\">Li C, Donizelli M, Rodriguez N, Dharuri H, Endler L, Chelliah V, Li L, He E, Henry A, Stefan MI, Snoep JL, Hucka M, Le Novre N, Laibe C (2010) BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. BMC Syst Biol., 4:92.</a>\n                </p>', 0, '2020-02-02'),
(724, 2, 'BIOMD422 Middleton2012_GibberellinSignalling', '<p>This model is from the article:      <br/>\n                \n                <br/>\n          Middleton AM , beda-Toms S , Griffiths J , Holman T , Hedden P , Thomas SG , Phillips AL , Holdsworth MJ , Bennett MJ , King JR, Owen MR      <em>Proc. Natl. Acad. Sci. U.S.A.</em>\n          2012 May; 109(19): 7571-6      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/22523240\">22523240</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          The hormone gibberellin (GA) is a key regulator of plant growth. Many of the components of the gibberellin signal transduction [e.g., GIBBERELLIN INSENSITIVE DWARF 1 (GID1) and DELLA], biosynthesis [e.g., GA 20-oxidase (GA20ox) and GA3ox], and deactivation pathways have been identified. Gibberellin binds its receptor, GID1, to form a complex that mediates the degradation of DELLA proteins. In this way, gibberellin relieves DELLA-dependent growth repression. However, gibberellin regulates expression of GID1, GA20ox, and GA3ox, and there is also evidence that it regulates DELLA expression. In this paper, we use integrated mathematical modeling and experiments to understand how these feedback loops interact to control gibberellin signaling. Model simulations are in good agreement with in vitro data on the signal transduction and biosynthesis pathways and in vivo data on the expression levels of gibberellin-responsive genes. We find that GA-GID1 interactions are characterized by two timescales (because of a lid on GID1 that can open and close slowly relative to GA-GID1 binding and dissociation). Furthermore, the model accurately predicts the response to exogenous gibberellin after a number of chemical and genetic perturbations. Finally, we investigate the role of the various feedback loops in gibberellin signaling. We find that regulation of GA20ox transcription plays a significant role in both modulating the level of endogenous gibberellin and generating overshoots after the removal of exogenous gibberellin. Moreover, although the contribution of other individual feedback loops seems relatively small, GID1 and DELLA transcriptional regulation acts synergistically with GA20ox feedback.      </p>', 0, '2020-02-02'),
(725, 2, 'BIOMD423 Nyman2012_InsulinSignalling', '<p>This model is from the article:      <br/>\n                <strong>Mechanistic explanations for counter-intuitive phosphorylation dynamics of the insulin receptor and insulin receptor substrate-1 in response to insulin in murine adipocytes.</strong>\n                <br/>\n          Nyman E, Fagerholm S, Jullesson D, Strlfors P, Cedersund G.      <em>FEBS J.</em>\n          2012 Jan 16.      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/22248283\">22248283</a>\n          ,      <br/>\n                <strong>Abstract:</strong>\n                <br/>\n          Insulin signaling through insulin receptor (IR) and insulin receptor substrate-1 (IRS1) is important for insulin control of target cells. We have previously demonstrated a rapid and simultaneous overshoot behavior in the phosphorylation dynamics of IR and IRS1 in human adipocytes. Herein, we demonstrate that in murine adipocytes a similar overshoot behavior is not simultaneous for IR and IRS1. The peak of IRS1 phosphorylation, which is a direct consequence of the phosphorylation and the activation of IR, occurs earlier than the peak of IR phosphorylation. We used a conclusive modeling framework to unravel the mechanisms behind this counter-intuitive order of phosphorylation. Through a number of rejections, we demonstrate that two fundamentally different mechanisms may create the reversed order of peaks: (i) two pools of phosphorylated IR, where a large pool of internalized IR peaks late, but phosphorylation of IRS1 is governed by a small plasma membrane-localized pool of IR with an early peak, or (ii) inhibition of the IR-catalyzed phosphorylation of IRS1 by negative feedback. Although (i) may explain the reversed order, this two-pool hypothesis alone requires extensive internalization of IR, which is not supported by experimental data. However, with the additional assumption of limiting concentrations of IRS1, (i) can explain all data. Also, (ii) can explain all available data. Our findings illustrate how modeling can potentiate reasoning, to help draw nontrivial conclusions regarding competing mechanisms in signaling networks. Our work also reveals new differences between human and murine insulin signaling. Database The mathematical model described here has been submitted to the Online Cellular Systems Modelling Database and can be accessed at http://jjj.biochem.sun.ac.za/database/nyman/index.html free of charge.      </p>', 0, '2020-02-02'),
(726, 2, 'BIOMD424 Faratian2009 - Role of PTEN in Trastuzumab resistance', '<div class=\"dc:title\">Faratian2009 - Role of PTEN in Trastuzumab\nresistance</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a title=\"Access to this publication\" href=\"http://identifiers.org/pubmed/19638581\">Systems biology\n    reveals new strategies for personalizing cancer medicine and\n    confirms the role of PTEN in resistance to trastuzumab.</a>\n  </div>\n  <div class=\"bibo:authorList\">Faratian D, Goltsov A, Lebedeva G,\n  Sorokin A, Moodie S, Mullen P, Kay C, Um IH, Langdon S, Goryanin\n  I, Harrison DJ.</div>\n  <div class=\"bibo:Journal\">Cancer Res. 2009 Aug; 69(16):\n  6713-6720</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Resistance to targeted cancer therapies such as trastuzumab\n    is a frequent clinical problem not solely because of\n    insufficient expression of HER2 receptor but also because of\n    the overriding activation states of cell signaling pathways.\n    Systems biology approaches lend themselves to rapid in silico\n    testing of factors, which may confer resistance to targeted\n    therapies. Inthis study, we aimed to develop a new kinetic\n    model that could be interrogated to predict resistance to\n    receptor tyrosine kinase (RTK) inhibitor therapies and directly\n    test predictions in vitro and in clinical samples. The new\n    mathematical model included RTK inhibitor antibody binding,\n    HER2/HER3 dimerization and inhibition, AKT/mitogen-activated\n    protein kinase cross-talk, and the regulatory properties of\n    PTEN. The model was parameterized using quantitative\n    phosphoprotein expression data from cancer cell lines using\n    reverse-phase protein microarrays. Quantitative PTEN protein\n    expression was found to be the key determinant of resistance to\n    anti-HER2 therapy in silico, which was predictive of unseen\n    experiments in vitro using the PTEN inhibitor bp(V). When\n    measured in cancer cell lines, PTEN expression predicts\n    sensitivity to anti-HER2 therapy; furthermore, this\n    quantitative measurement is more predictive of response\n    (relative risk, 3.0; 95% confidence interval, 1.6-5.5; P &lt;\n    0.0001) than other pathway components taken in isolation and\n    when tested by multivariate analysis in a cohort of 122 breast\n    cancers treated with trastuzumab. For the first time, a systems\n    biology approach has successfully been used to stratify\n    patients for personalized therapy in cancer and is further\n    compelling evidence that PTEN, appropriately measured in the\n    clinical setting, refines clinical decision making in patients\n    treated with anti-HER2 therapies.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000424\">BIOMD0000000424</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a title=\"Latest BioModels Database publication\" href=\"http://identifiers.org/pubmed/20587024\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\" href=\"http://creativecommons.org/publicdomain/zero/1.0/\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(727, 2, 'BIOMD425 Tan2012 - Antibiotic Treatment, Inoculum Effect', '<div class=\"dc:title\">Tan2012 - Antibiotic Treatment, Inoculum Effect</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/23047527\" title=\"Access to this publication\">The inoculum effect and band-pass bacterial response to periodic antibiotic treatment.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Tan C, Phillip Smith R, Srimani JK, Riccione KA, Prasada S, Kuehn M, You L.</div>\n                <div class=\"bibo:Journal\">Mol Syst Biol. 2012 Oct 9; 8:617</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>The inoculum effect (IE) refers to the decreasing efficacy of an antibiotic with increasing bacterial density. It represents a unique strategy of antibiotic tolerance and it can complicate design of effective antibiotic treatment of bacterial infections. To gain insight into this phenomenon, we have analyzed responses of a lab strain of Escherichia coli to antibiotics that target the ribosome. We show that the IE can be explained by bistable inhibition of bacterial growth. A critical requirement for this bistability is sufficiently fast degradation of ribosomes, which can result from antibiotic-induced heat-shock response. Furthermore, antibiotics that elicit the IE can lead to \'band-pass\' response of bacterial growth to periodic antibiotic treatment: the treatment efficacy drastically diminishes at intermediate frequencies of treatment. Our proposed mechanism for the IE may be generally applicable to other bacterial species treated with antibiotics targeting the ribosomes.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/MODEL1208300000\">MODEL1208300000</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(728, 2, 'BIOMD431 Sarma2012 - Interaction topologies of MAPK cascade (M4_K2_PSEQ)', '<div class=\"dc:title\">Sarma2012 - Interaction topologies of MAPK cascade (M4_K2_PSEQ)</div>\n            \n            .        </p>\n                <p>Models that correspond to type M4 with mass-action kinetics K2, in four condition 1) USEQ [        <a href=\"http://identifiers.org/biomodels.db/MODEL1204280020\">MODEL1204280020</a>\n            - M4_K2_USEQ], 2) PSEQ [        <a href=\"http://identifiers.org/biomodels.db/MODEL1204280024\">MODEL1204280024</a>\n            - M4_K2_PSEQ], 3) QSS_USEQ [        <a href=\"http://identifiers.org/biomodels.db/MODEL1204280036\">MODEL1204280036</a>\n            - M4_K2_QSS_USEQ] and 4) QSS_PSEQ [        <a href=\"http://identifiers.org/biomodels.db/MODEL1204280040\">MODEL1204280040</a>\n            - M4_K2_QSS_PSEQ] are available from the curated branch. The remaining 36 models can be accessed from the non-curated branch.        </p>\n                <p>This model [        <a href=\"http://identifiers.org/biomodels.db/MODEL1204280024\">MODEL1204280024</a>\n            - M4_K2_PSEQ] correspond to type M4 with mass-action kinetics K2, in PSEQ (sequestrated ) condition.\n            .        </p>\n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/22748295\" title=\"Access to this publication\">Different designs of kinase-phosphatase interactions and phosphatase sequestration shapes the robustness and signal flow in the MAPK cascade.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Sarma U, Ghosh I.</div>\n                <div class=\"bibo:Journal\">BMC Syst Biol. 2012 Jul 2;6(1):82.</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>BACKGROUND: The three layer mitogen activated protein kinase (MAPK) signaling cascade exhibits different designs of interactions between its kinases and phosphatases. While the sequential interactions between the three kinases of the cascade are tightly preserved, the phosphatases of the cascade, such as MKP3 and PP2A, exhibit relatively diverse interactions with their substrate kinases. Additionally, the kinases of the MAPK cascade can also sequester their phosphatases. Thus, each topologically distinct interaction design of kinases and phosphatases could exhibit unique signal processing characteristics, and the presence of phosphatase sequestration may lead to further fine tuning of the propagated signal.</p>\n                    <p>RESULTS: We have built four models of the MAPK cascade, each model with identical kinase-kinase interactions but unique kinases-phosphatases interactions. Our simulations unravelled that MAPK cascade\'s robustness to external perturbations is a function of nature of interaction between its kinases and phosphatases. The cascade\'s output robustness was enhanced when phosphatases were sequestrated by their target kinases. We uncovered a novel implicit/hidden negative feedback loop from the phosphatase MKP3 to its upstream kinase Raf-1, in a cascade resembling the B cell MAPK cascade. Notably, strength of the feedback loop was reciprocal to the strength of phosphatases\' sequestration and stronger sequestration abolished the feedback loop completely. An experimental method to verify the presence of the feedback loop is also proposed. We further showed, when the models were activated by transient signal, memory (total time taken by the cascade output to reach its unstimulated level after removal of signal) of a cascade was determined by the specific designs of interaction among its kinases and phosphatases.</p>\n                    <p>CONCLUSIONS: Differences in interaction designs among the kinases and phosphatases can differentially shape the robustness and signal response behaviour of the MAPK cascade and phosphatase sequestration dramatically enhances the robustness to perturbations in each of the cascade. An implicit negative feedback loop was uncovered from our analysis and we found that strength of the negative feedback loop is reciprocally related to the strength of phosphatase sequestration. Duration of output phosphorylation in response to a transient signal was also found to be determined by the individual cascade\'s kinase-phosphatase interaction design.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/MODEL1204280024\">MODEL1204280024</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(729, 2, 'BIOMD438 Saeidi2012 - Quorum sensing device that produces GFP', '<div class=\"dc:title\">Saeidi2012 - Quorum sensing device that produces GFP</div>\n            \n            (2012) has modelled a quorum sensing device that produces green fluorescent protein (GFP) as reporter in the presence of Acyl Homoserine Lactone (AHL).        </p>\n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/doi/10.1016/j.ces.2012.12.016\" title=\"Access to this publication\">Characterization of a quorum sensing device for synthetic biology design: Experimental and modeling validation</a>\n                    </div>\n                <div class=\"bibo:authorList\">Nazanin Saeidi, Mohamed Arshath, Matthew Wook Chang, Chueh Loo Poh</div>\n                <div class=\"bibo:Journal\">Chemical Engineering Science. December 2012.</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>Modeling of biological parts is of crucial importance as it enables the in silico study of synthetic biological systems prior to the actual construction of genetic circuits, which can be time consuming and costly. Because standard biological parts are utilized to build the synthetic systems, it is important that each of these standard parts is well characterized and has a corresponding mathematical model that could simulate the characteristics of the part. These models could be used in computer aided design (CAD) tools during the design stage to facilitate the building of the model of biological systems. This paper describes the development of a mathematical model that is able to simulate both the dynamic and static performance of a biological device created using standard parts. We modeled an example quorum sensing device that produces green fluorescent protein (GFP) as reporter in the presence of Acyl Homoserine Lactone (AHL). The parameters of the model were estimated using experimental results. The simulation results show that the model was able to simulate behavior similar to experimental results. Since it is important that these models and the content in the models can be searchable and readable by machines, standard SBML (system biology markup language) format was used to store the models. All parts and reactions are fully annotated to enable easy searching, and the models follow the Minimum Information Requested In the Annotation of Models (MIRIAM) compliance as well as the Minimum Information About a Simulation Experiment (MIASE).</p>\n                    </div>\n                </div>\n            <div class=\"bm:curation\">      <p>Figure 4a of the reference publication has been reproduced as curation figure. The plot shows the performance of the model at different concentrations of the inducer (3OC12HSL=5E-10, 5E-07, 5E-07).</p>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL1301110000\">MODEL1301110000</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(730, 2, 'BIOMD439 Smith2009 - RGS mediated GTP hydrolysis', '<div class=\"dc:title\">Smith2009 - RGS mediated GTP hydrolysis</div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/19285552\" title=\"Access to this publication\">Dual positive and negative regulation of GPCR signaling by GTP hydrolysis.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Smith B, Hill C, Godfrey EL, Rand D, van den Berg H, Thornton S, Hodgkin M, Davey J, Ladds G.</div>\n                <div class=\"bibo:Journal\">Cell Signal. 2009 Jul;21(7):1151-60.</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>G protein-coupled receptors (GPCRs) regulate a variety of intracellular pathways through their ability to promote the binding of GTP to heterotrimeric G proteins. Regulator of G protein signaling (RGS) proteins increases the intrinsic GTPase activity of Galpha-subunits and are widely regarded as negative regulators of G protein signaling. Using yeast we demonstrate that GTP hydrolysis is not only required for desensitization, but is essential for achieving a high maximal (saturated level) response. Thus RGS-mediated GTP hydrolysis acts as both a negative (low stimulation) and positive (high stimulation) regulator of signaling. To account for this we generated a new kinetic model of the G protein cycle where Galpha(GTP) enters an inactive GTP-bound state following effector activation. Furthermore, in vivo and in silico experimentation demonstrates that maximum signaling output first increases and then decreases with RGS concentration. This unimodal, non-monotone dependence on RGS concentration is novel. Analysis of the kinetic model has revealed a dynamic network motif that shows precisely how inclusion of the inactive GTP-bound state for the Galpha produces this unimodal relationship.</p>\n                    </div>\n                </div>\n            <div class=\"bm:curation\">      <p>To reproduce dose-response plots in the publication, the model is simulated with 12 different concentrations (see parameter Ligand_conc). For each concentration, a single value must be obtained from the integral of the trajectory of species z3 from time=0 to time=30. These values are then used to build a dose-response plot (authors used GraphPad Prism). Mutant strains are simulated with alternative parameter values or initial conditions in Table S3.</p>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels\">BioModels Database</a>\n            and identified by:        <a href=\"http://www.ebi.ac.uk/biomodels/MODEL1212040001\">MODEL1212040001</a>\n            .        </p>\n                <p>To cite BioModels Database, please use: BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models. PMID:        <a href=\"http://identifiers.org/pubmed/20587024\">20587024</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(731, 2, 'BIOMD449 Brnnmark2013 - Insulin signalling in human adipocytes (diabetic condition)', '<div class=\"dc:title\">Brnnmark2013 - Insulin signalling in human adipocytes (diabetic condition)</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/23400783\" title=\"Access to this publication\">Insulin Signaling in Type 2 Diabetes: EXPERIMENTAL AND MODELING ANALYSES REVEAL MECHANISMS OF INSULIN RESISTANCE IN HUMAN ADIPOCYTES.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Brnnmark C, Nyman E, Fagerholm S, Bergenholm L, Ekstrand EM, Cedersund G, Strlfors P.</div>\n                <div class=\"bibo:Journal\">J Biol Chem. 2013 Apr 5;288(14):9867-80.</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>Type 2 diabetes originates in an expanding adipose tissue that for unknown reasons becomes insulin resistant. Insulin resistance reflects impairments in insulin signaling, but mechanisms involved are unclear because current research is fragmented. We report a systems level mechanistic understanding of insulin resistance, using systems wide and internally consistent data from human adipocytes. Based on quantitative steady-state and dynamic time course data on signaling intermediaries, normally and in diabetes, we developed a dynamic mathematical model of insulin signaling. The model structure and parameters are identical in the normal and diabetic states of the model, except for three parameters that change in diabetes: (i) reduced concentration of insulin receptor, (ii) reduced concentration of insulin-regulated glucose transporter GLUT4, and (iii) changed feedback from mammalian target of rapamycin in complex with raptor (mTORC1). Modeling reveals that at the core of insulin resistance in human adipocytes is attenuation of a positive feedback from mTORC1 to the insulin receptor substrate-1, which explains reduced sensitivity and signal strength throughout the signaling network. Model simulations with inhibition of mTORC1 are comparable with experimental data on inhibition of mTORC1 using rapamycin in human adipocytes. We demonstrate the potential of the model for identification of drug targets, e.g. increasing the feedback restores insulin signaling, both at the cellular level and, using a multilevel model, at the whole body level. Our findings suggest that insulin resistance in an expanded adipose tissue results from cell growth restriction to prevent cell necrosis.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL1304160000\">MODEL1304160000</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(732, 2, 'BIOMD453 Bidkhori2012 - EGFR signalling in NSCLC', '<div class=\"dc:title\">Bidkhori2012 - EGFR signalling in NSCLC</div>\n            \n                <p>Created by The MathWorks, Inc. SimBiology tool, Version 3.3</p>\n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/23133538\" title=\"Access to this publication\">Modeling of tumor progression in NSCLC and intrinsic resistance to TKI in loss of PTEN expression.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Bidkhori G, Moeini A, Masoudi-Nejad A</div>\n                <div class=\"bibo:Journal\">PloS one [2012, 7(10):e48004]</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>EGFR signaling plays a very important role in NSCLC. It activates Ras/ERK, PI3K/Akt and STAT activation pathways. These are the main pathways for cell proliferation and survival. We have developed two mathematical models to relate to the different EGFR signaling in NSCLC and normal cells in the presence or absence of EGFR and PTEN mutations. The dynamics of downstream signaling pathways vary in the disease state and activation of some factors can be indicative of drug resistance. Our simulation denotes the effect of EGFR mutations and increased expression of certain factors in NSCLC EGFR signaling on each of the three pathways where levels of pERK, pSTAT and pAkt are increased. Over activation of ERK, Akt and STAT3 which are the main cell proliferation and survival factors act as promoting factors for tumor progression in NSCLC. In case of loss of PTEN, Akt activity level is considerably increased. Our simulation results show that in the presence of erlotinib, downstream factors i.e. pAkt, pSTAT3 and pERK are inhibited. However, in case of loss of PTEN expression in the presence of erlotinib, pAkt level would not decrease which demonstrates that these cells are resistant to erlotinib.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL1304020001\">MODEL1304020001</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02');
