(733, 2, 'BIOMD454 Smallbone2013 - Metabolic Control Analysis - Example 1', '<div class=\"dc:title\">Smallbone2013 - Metabolic Control Analysis - Example 1</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/arxiv/1305.6449\" title=\"Access to this publication\">Metabolic Control Analysis: Rereading Reder</a>\n                    </div>\n                <div class=\"bibo:authorList\">Kieran Smallbone</div>\n                <div class=\"bibo:Journal\">Quantitative Methods; Tue, 28 May 2013.</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>Metabolic control analysis is a biochemical formalism defined by Kacser and Burns in 1973, and given firm mathematical basis by Reder in 1988. The algorithm defined by Reder for calculating the control matrices is still used by software programs today, but is only valid for some biochemical models. We show that, with slight modification, the algorithm may be applied to all models.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL1305030000\">MODEL1305030000</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
