(736, 2, 'BIOMD459 Liebal2012 - B.subtilis post-transcriptional instability model', '\n            \n            . Liebal et al. (2012) have performed experiments in B.subtilis wild type and mutant straits to test and validate a mathematical model of the dynamics of sigma        <sup>B</sup>\n            activity. The following three models were constructed and their ability to fit the experimental data were tested. 1) Transcription inhibition model (MODEL1212180000), 2) sigma        <sup>B</sup>\n            proteolysis model (MODEL1302080000) and 3) Post-transcriptional instability model (MODEL1302080001). This model corresponds to the post-transcription instability model (MODEL1302080001).        </p>\n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/22511268\" title=\"Access to this publication\">Proteolysis of beta-galactosidase following SigmaB activation in Bacillus subtilis.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Liebal UW, Sappa PK, Millat T, Steil L, Homuth G, Vlker U, Wolkenhauer O.</div>\n                <div class=\"bibo:Journal\">2012 Jun;8(6):1806-14.</div>\n                <p>Abstract:</p>\n                \n                    </div>\n                </div>\n            \n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL1302080001\">MODEL1302080001</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative 