(737, 2, 'BIOMD460 Liebal2012 - B.subtilis sigB proteolysis model', '<div class=\"dc:title\">Liebal2012 - B.subtilis sigB proteolysis model</div>\n            \n            . Liebal et al. (2012) have performed experiments in B.subtilis wild type and mutant straits to test and validate a mathematical model of the dynamics of sigma        <sup>B</sup>\n            activity. The following three models were constructed and their ability to fit the experimental data were tested. 1) Transcription inhibition model (MODEL1212180000), 2) sigma        <sup>B</sup>\n            proteolysis model (MODEL1302080000) and 3) Post-transcriptional instability model (MODEL1302080001). This model corresponds to the sigma        <sup>B</sup>\n            proteolysis model (MODEL1302080000).        </p>\n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/22511268\" title=\"Access to this publication\">Proteolysis of beta-galactosidase following SigmaB activation in Bacillus subtilis.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Liebal UW, Sappa PK, Millat T, Steil L, Homuth G, Vlker U, Wolkenhauer O.</div>\n                <div class=\"bibo:Journal\">2012 Jun;8(6):1806-14.</div>\n                <p>Abstract:</p>\n                \n                    </div>\n                </div>\n            \n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL1302080000\">MODEL1302080000</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(738, 2, 'BIOMD461 Liebal2012 - B.subtilis transcription inhibition model', '\n            \n            . Liebal et al. (2012) have performed experiments in B.subtilis wild type and mutant straits to test and validate a mathematical model of the dynamics of sigma        <sup>B</sup>\n            activity. The following three models are constructed and their ability to fit the experimental data were tested. 1) Transcription inhibition model (MODEL1212180000), 2) sigma        <sup>B</sup>\n            proteolysis model (MODEL1302080000) and 3) Post-transcriptional instability model (MODEL1302080001). This model corresponds to the Transcription inhibition model (MODEL1212180000).        </p>\n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/22511268\" title=\"Access to this publication\">Proteolysis of beta-galactosidase following SigmaB activation in Bacillus subtilis.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Liebal UW, Sappa PK, Millat T, Steil L, Homuth G, Vlker U, Wolkenhauer O.</div>\n                <div class=\"bibo:Journal\">2012 Jun;8(6):1806-14.</div>\n                <p>Abstract:</p>\n                \n                    </div>\n                </div>\n            \n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL1212180000\">MODEL1212180000</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(739, 2, 'BIOMD462 Proctor2012 - Role of Amyloid-beta dimers in aggregation formation', '<div class=\"dc:title\">Proctor2012 - Amyloid-beta aggregation</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/22748062\" title=\"Access to this publication\">Aggregation, impaired degradation and immunization targeting of amyloid-beta dimers in Alzheimer\'s disease: a stochastic modelling approach.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Proctor CJ, Pienaar IS, Elson JL, Kirkwood TB</div>\n                <div class=\"bibo:Journal\">Molecular Neurodegeneration. 2012; 7:32</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>          <b>BACKGROUND:</b>\n              Alzheimer\'s disease (AD) is the most frequently diagnosed neurodegenerative disorder affecting humans, with advanced age being the most prominent risk factor for developing AD. Despite intense research efforts aimed at elucidating the precise molecular underpinnings of AD, a definitive answer is still lacking. In recent years, consensus has grown that dimerisation of the polypeptide amyloid-beta (A), particularly A??, plays a crucial role in the neuropathology that characterise AD-affected post-mortem brains, including the large-scale accumulation of fibrils, also referred to as senile plaques. This has led to the realistic hope that targeting A?? immunotherapeutically could drastically reduce plaque burden in the ageing brain, thus delaying AD onset or symptom progression. Stochastic modelling is a useful tool for increasing understanding of the processes underlying complex systems-affecting disorders such as AD, providing a rapid and inexpensive strategy for testing putative new therapies. In light of the tool\'s utility, we developed computer simulation models to examine A?? turnover and its aggregation in detail and to test the effect of immunization against A dimers.          </p>\n                    <p>          <b>RESULTS:</b>\n              Our model demonstrates for the first time that even a slight decrease in the clearance rate of A?? monomers is sufficient to increase the chance of dimers forming, which could act as instigators of protofibril and fibril formation, resulting in increased plaque levels. As the process is slow and levels of A? are normally low, stochastic effects are important. Our model predicts that reducing the rate of dimerisation leads to a significant reduction in plaque levels and delays onset of plaque formation. The model was used to test the effect of an antibody mediated immunological response. Our results showed that plaque levels were reduced compared to conditions where antibodies are not present.          </p>\n                    <p>          <b>CONCLUSION:</b>\n              Our model supports the current thinking that levels of dimers are important in initiating the aggregation process. Although substantial knowledge exists regarding the process, no therapeutic intervention is on offer that reliably decreases disease burden in AD patients. Computer modelling could serve as one of a number of tools to examine both the validity of reliable biomarkers and aid the discovery of successful intervention strategies.          </p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified by:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000462\">BIOMD0000000462</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource for published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or neighbouring rights to this encoded model have been dedicated to the public domain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(740, 2, 'BIOMD478 Besozzi2012 - Oscillatory regimes in the Ras/cAMP/PKA pathway in S.cerevisiae', '<div class=\"dc:title\">Besozzi2012 - Oscillatory regimes in the Ras/cAMP/PKA pathway in S.cerevisiae</div>\n            \n                <p>The model has been defined according to the stochastic formulation of chemical kinetics        <a href=\"http://identifiers.org/doi/10.1021/j100540a008\">[Gillespie DT, 1977]</a>\n            , which requires to specify the set of molecular species occurring in the pathway and their respective interactions, formally described as a set of biochemical reactions.        </p>\n                <p>The volume considered for this system is 30fL; this value can be used to convert the model into the deterministic formulation.</p>\n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/22818197\" title=\"Access to this publication\">The role of feedback control mechanisms on the establishment of oscillatory regimes in the Ras/cAMP/PKA pathway in S. cerevisiae.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Besozzi D, Cazzaniga P, Pescini D, Mauri G, Colombo S, Martegani E.</div>\n                <div class=\"bibo:Journal\">EURASIP J Bioinform Syst Biol. 2012 Jul 20;2012(1):10.</div>\n                <p>Abstract:</p>\n                \n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000478\">BIOMD0000000478</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(741, 2, 'BIOMD479 Croft2013 - GPCR-RGS interaction that compartmentalizes RGS activity', '<div class=\"dc:title\">Croft2013 - GPCR-RGS interaction that compartmentalizes RGS activity</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/23900842\" title=\"Access to this publication\">A physiologically required G protein-coupled receptor (GPCR)-regulator of G protein signaling (RGS) interaction that compartmentalizes RGS activity.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Croft W, Hill C, McCann E, Bond M, Esparza-Franco M, Bennett J, Rand D, Davey J, Ladds G.</div>\n                <div class=\"bibo:Journal\">J Biol Chem. 2013 Sep 20;288(38):27327-42.</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>G protein-coupled receptors (GPCRs) can interact with regulator of G protein signaling (RGS) proteins. However, the effects of such interactions on signal transduction and their physiological relevance have been largely undetermined. Ligand-bound GPCRs initiate by promoting exchange of GDP for GTP on the G? subunit of heterotrimeric G proteins. Signaling is terminated by hydrolysis of GTP to GDP through intrinsic GTPase activity of the G? subunit, a reaction catalyzed by RGS proteins. Using yeast as a tool to study GPCR signaling in isolation, we define an interaction between the cognate GPCR (Mam2) and RGS (Rgs1), mapping the interaction domains. This reaction tethers Rgs1 at the plasma membrane and is essential for physiological signaling response. In vivo quantitative data inform the development of a kinetic model of the GTPase cycle, which extends previous attempts by including GPCR-RGS interactions. In vivo and in silico data confirm that GPCR-RGS interactions can impose an additional layer of regulation through mediating RGS subcellular localization to compartmentalize RGS activity within a cell, thus highlighting their importance as potential targets to modulate GPCR signaling pathways.</p>\n                    </div>\n                </div>\n            <div class=\"bm:curation\">      <p>        <b>Author\'s comment on reproducing the plots:</b>\n                    <br/>\n            To reproduce dose-response plots in the publication, the model is simulated with 12 different ligand concentrations (see parameter Ligand_conc).        <br/>\n            For each ligand concentration, a single value corresponding to total amount of output must be obtained, by calculating the area under the curve of the trajectory of species z3, from time=0 to time=30.        <br/>\n            These total output values are then used to build a dose-response plot (authors used GraphPad Prism).        <br/>\n            Mutant strains are simulated with alternative parameter values or initial conditions specified in the Supplementary Material.        </p>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000479\">BIOMD0000000479</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
