(747, 2, 'BIOMD488 Proctor2013 - Effect of A? immunisation in Alzheimer\'s disease (deterministic version)', '<div class=\"dc:title\">Proctor2013 - Effect of A? immunisation\nin Alzheimer\'s disease (deterministic version)</div>\n\n  <p>Extension of a previously published stochastic model (designed\n  to examine some of the key pathways involved in the aggregation\n  of amyloid-beta (A?) and the micro-tubular binding protein\n  tau (\n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000286\">BIOMD0000000286</a>,\n  \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000462\">BIOMD0000000462</a>))\n  to include the main processes involved in passive and active\n  immunisation against A? and then to demonstrate the effects\n  of this intervention on soluble A?. This is the\n  deterministic version of the model, the stochastic version is \n  <a href=\"http://identifier.org/biomodels.db/BIOMD0000000634\">BIOMD0000000634</a>.\n  <br/></p>\n</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/24098635\" title=\"Access to this publication\">Investigating interventions\n    in Alzheimer\'s disease with computer simulation models.</a>\n  </div>\n  <div class=\"bibo:authorList\">Proctor CJ, Boche D, Gray DA, Nicoll\n  JA.</div>\n  <div class=\"bibo:Journal\">PLoS ONE 2013; 8(9): e73631</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Progress in the development of therapeutic interventions to\n    treat or slow the progression of Alzheimer\'s disease has been\n    hampered by lack of efficacy and unforeseen side effects in\n    human clinical trials. This setback highlights the need for new\n    approaches for pre-clinical testing of possible interventions.\n    Systems modelling is becoming increasingly recognised as a\n    valuable tool for investigating molecular and cellular\n    mechanisms involved in ageing and age-related diseases.\n    However, there is still a lack of awareness of modelling\n    approaches in many areas of biomedical research. We previously\n    developed a stochastic computer model to examine some of the\n    key pathways involved in the aggregation of amyloid-beta (A?)\n    and the micro-tubular binding protein tau. Here we show how we\n    extended this model to include the main processes involved in\n    passive and active immunisation against A? and then demonstrate\n    the effects of this intervention on soluble A?, plaques,\n    phosphorylated tau and tangles. The model predicts that\n    immunisation leads to clearance of plaques but only results in\n    small reductions in levels of soluble A?, phosphorylated tau\n    and tangles. The behaviour of this model is supported by\n    neuropathological observations in Alzheimer patients immunised\n    against A?. Since, soluble A?, phosphorylated tau and tangles\n    more closely correlate with cognitive decline than plaques, our\n    model suggests that immunotherapy against A? may not be\n    effective unless it is performed very early in the disease\n    process or combined with other therapies.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000488\">BIOMD0000000488</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(748, 2, 'BIOMD492 Pathak2013 - MAPK activation in response to various biotic stresses', '<div class=\"dc:title\">Pathak2013 - MAPK activation in response to various biotic stresses</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/23847397\" title=\"Access to this publication\">Modeling of the MAPK machinery activation in response to various abiotic and biotic stresses in plants by a system biology approach.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Pathak RK, Taj G, Pandey D, Arora S, Kumar A.</div>\n                <div class=\"bibo:Journal\">Bioinformation 2013; 9(9): 443-449</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>Mitogen-Activated Protein Kinases (MAPKs) cascade plays an important role in regulating plant growth and development, generating cellular responses to the extracellular stimuli. MAPKs cascade mainly consist of three sub-families i.e. mitogen-activated protein kinase kinase kinase (MAPKKK), mitogen-activated protein kinase kinase (MAPKK) and mitogen activated protein kinase (MAPK), several cascades of which are activated by various abiotic and biotic stresses. In this work we have modeled the holistic molecular mechanisms essential to MAPKs activation in response to several abiotic and biotic stresses through a system biology approach and performed its simulation studies. As extent of abiotic and biotic stresses goes on increasing, the process of cell division, cell growth and cell differentiation slow down in time dependent manner. The models developed depict the combinatorial and multicomponent signaling triggered in response to several abiotic and biotic factors. These models can be used to predict behavior of cells in event of various stresses depending on their time and exposure through activation of complex signaling cascades.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000492\">BIOMD0000000492</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(749, 2, 'BIOMD493 Schittler2010 - Cell fate of progenitor cells, osteoblasts or chondrocytes', '<div class=\"dc:title\">Schittler2010 - Cell fate of progenitor cells, osteoblasts or chondrocytes</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/21198133\" title=\"Access to this publication\">Cell differentiation modeled via a coupled two-switch regulatory network.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Schittler D, Hasenauer J, Allgwer F, Waldherr S.</div>\n                <div class=\"bibo:Journal\">Chaos 2010 Dec; 20(4): 045121</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>Mesenchymal stem cells can give rise to bone and other tissue cells, but their differentiation still escapes full control. In this paper we address this issue by mathematical modeling. We present a model for a genetic switch determining the cell fate of progenitor cells which can differentiate into osteoblasts (bone cells) or chondrocytes (cartilage cells). The model consists of two switch mechanisms and reproduces the experimentally observed three stable equilibrium states: a progenitor, an osteogenic, and a chondrogenic state. Conventionally, the loss of an intermediate (progenitor) state and the entailed attraction to one of two opposite (differentiated) states is modeled as a result of changing parameters. In our model in contrast, we achieve this by distributing the differentiation process to two functional switch parts acting in concert: one triggering differentiation and the other determining cell fate. Via stability and bifurcation analysis, we investigate the effects of biochemical stimuli associated with different system inputs. We employ our model to generate differentiation scenarios on the single cell as well as on the cell population level. The single cell scenarios allow to reconstruct the switching upon extrinsic signals, whereas the cell population scenarios provide a framework to identify the impact of intrinsic properties and the limiting factors for successful differentiation.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000493\">BIOMD0000000493</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(750, 2, 'BIOMD503 Messiha2013 - combined glycolysis and pentose phosphate pathway model', '<div class=\"dc:title\">Messiha2013 - combined glycolysis and pentose phosphate pathway model</div>\n        \n          <p>\n            <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000502\">BIOMD0000000502</a>\n            and        <a href=\"http://identifiers.org/biomodels.db/MODEL1303260018\">MODEL1303260018</a>\n            are combined to examine the response to oxidative stress.        </p>\n        </div>\n        <div class=\"dc:bibliographicCitation\">\n          <p>This model is described in the article:</p>\n          <div class=\"bibo:title\">\n            <a href=\"http://identifiers.org/doi/10.7287/peerj.preprints.146v2\" title=\"Access to this publication\">Enzyme characterisation and kinetic modelling of pentose phosphate pathway in yeast.</a>\n          </div>\n          <div class=\"bibo:authorList\">Hanan L. Messiha, Edward Kent, Naglis Malys, Kathleen M. Carroll, Pedro Mendes, Kieran Smallbone</div>\n          <div class=\"bibo:Journal\">PeerJ PrePrints 1:e146v2</div>\n          <p>Abstract:</p>\n          <div class=\"bibo:abstract\">\n            <p>We present the quantification and kinetic characterisation of the enzymes of the pentose phosphate pathway in Saccharomyces cerevisiae. The data are combined into a mathematical model that describes the dynamics of this system and allows for the predicting changes in metabolite concentrations and fluxes in response to perturbations. We use the model to study the response of yeast to a glucose pulse. We then combine the model with an existing glycolysis one to study the effect of oxidative stress on carbohydrate metabolism. The combination of these two models was made possible by the standardized enzyme kinetic experiments carried out in both studies. This work demonstrates the feasibility of constructing larger network models by merging smaller pathway models.</p>\n          </div>\n        </div>\n        <div class=\"dc:publisher\">\n          <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000503\">BIOMD0000000503</a>\n            .        </p>\n        <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n    </div>\n    <div class=\"dc:license\">\n      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain Dedication</a>\n            for more information.        </p>\n  </div>', 0, '2020-02-02'),
(751, 2, 'BIOMD504 Proctor2013 - Cartilage breakdown, interventions to reduce collagen release', '<div class=\"dc:title\">Proctor2013 - Cartilage breakdown, interventions to reduce collagen release</div>\n            \n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/24285357\" title=\"Access to this publication\">A computer simulation approach for assessing therapeutic intervention points to prevent cytokine-induced cartilage breakdown.</a>\n                    </div>\n                <div class=\"bibo:authorList\">Proctor CJ, Macdonald C, Milner JM, Rowan AD, Cawston TE.</div>\n                <div class=\"bibo:Journal\">Arthritis Rheum. 2013 Nov 27.</div>\n                <p>Abstract:</p>\n                \n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000504\">BIOMD0000000504</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(752, 2, 'BIOMD518 Smallbone2013 - Colon Crypt cycle - Version 2', '<div class=\"dc:title\">Smallbone2013 - Colon Crypt cycle - Version 2</div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/pubmed/[PMID]\" title=\"Access to this publication\">A mathematical model of the colon crypt capturing compositional dynamic interactions between cell types</a>\n                    </div>\n                <div class=\"bibo:authorList\">Kieran Smallbone, Bernard M. Corfe</div>\n                <div class=\"bibo:Journal\">Int J Exp Pathol. 2014 Feb;95(1):1-7.</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>Models of the development and early progression of colorectal cancer are based upon understanding the cycle of stem cell turnover, proliferation, differentiation and death. Existing crypt compartmental models feature a linear pathway of cell types, with little regulatory mechanism. Previous work has shown that there are perturbations in the enteroendocrine cell population of macroscopically normal crypts, a compartment not included in existing models. We show that existing models do not adequately recapitulate the dynamics of cell fate pathways in the crypt. We report the progressive development, iterative testing and fitting of a developed compartmental model with additional cell types, and which includes feedback mechanisms and cross-regulatory mechanisms between cell types. The fitting of the model to existing data sets suggests a need to invoke cross-talk between cell types as a feature of colon crypt cycle models.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/MODEL1306190002\">MODEL1306190002</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
