>11 March 2014: Vol. 7, Issue 316, p. ra23</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>Apoptosis in response to the ligand CD95L (also known as Fas ligand) is initiated by caspase-8, which is activated by dimerization and self-cleavage at death-inducing signaling complexes (DISCs). Previous work indicated that the degree of substrate cleavage by caspase-8 determines whether a cell dies or survives in response to a death stimulus. To determine how a death ligand stimulus is effectively translated into caspase-8 activity, we assessed this activity over time in single cells with compartmentalized probes that are cleaved by caspase-8 and used multiscale modeling to simultaneously describe single-cell and population data with an ensemble of single-cell models. We derived and experimentally validated a minimal model in which cleavage of caspase-8 in the enzymatic domain occurs in an interdimeric manner through interaction between DISCs, whereas prodomain cleavage sites are cleaved in an intradimeric manner within DISCs. Modeling indicated that sustained membrane-bound caspase-8 activity is followed by transient cytosolic activity, which can be interpreted as a molecular timer mechanism reflected by a limited lifetime of active caspase-8. The activation of caspase-8 by combined intra- and interdimeric cleavage ensures weak signaling at low concentrations of CD95L and strongly accelerated activation at higher ligand concentrations, thereby contributing to precise control of apoptosis.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000525\">BIOMD0000000525</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(758, 2, 'BIOMD526 Kallenberger2014 - CD95L induced apoptosis initiated by caspase-8, wild-type HeLa cells (cis/trans-cis/trans variant)', '<div class=\"dc:title\">Kallenberger2014 - CD95L induced apoptosis initiated by caspase-8, wild-type HeLa cells (cis/trans-cis/trans variant)</div>\n            \n                <p>There are four variants of the model (with [CD95L]=500ng/ml = 16.6nM), i) cistrans (in CD95-HeLa cells) [        <a href=\"http://identifiers.org/biomodels.db/MODEL1403050000\">MODEL1403050000</a>\n            ], ii) cistrans (in wild-type HeLa cells) [        <a href=\"http://identifiers.org/biomodels.db/MODEL1403050001\">MODEL1403050001</a>\n            ], iii) cistrans-cistrans (in CD95-HeLa cells) [        <a href=\"http://identifiers.org/biomodels.db/MODEL1403050002\">MODEL1403050002</a>\n            ], and iv) cistrans-cistrans (in wild-type HeLa cells) [        <a href=\"http://identifiers.org/biomodels.db/MODEL1403050003\">MODEL1403050003</a>\n            ].        </p>\n                <p>These model contain the equations for one \"average cell\" with median initial concentrations for CD95, FADD, p55, BID, PrNES_mCherry and PrER_mGFP. By integrating the model, it should be possible to obtain trajectories for PrER_mGFP, PrNES_mCherry, p43 and p18 similar as in Figure 4A (CD95-HeLa cells) and Figure 4B (wild-type HeLa cells).</p>\n                </div>\n            <div class=\"dc:bibliographicCitation\">      <p>This model is described in the article:</p>\n                <div class=\"bibo:title\">        <a href=\"http://identifiers.org/doi/10.1126/scisignal.2004738\" title=\"Access to this publication\">Intra- and Interdimeric Caspase-8 Self-Cleavage Controls Strength and Timing of CD95-Induced Apoptosis</a>\n                    </div>\n                <div class=\"bibo:authorList\">Stefan M. Kallenberger, Jol Beaudouin, Juliane Claus, Carmen Fischer, Peter K. Sorger, Stefan Legewie, and Roland Eils</div>\n                <div class=\"bibo:Journal\">11 March 2014: Vol. 7, Issue 316, p. ra23</div>\n                <p>Abstract:</p>\n                <div class=\"bibo:abstract\">        <p>Apoptosis in response to the ligand CD95L (also known as Fas ligand) is initiated by caspase-8, which is activated by dimerization and self-cleavage at death-inducing signaling complexes (DISCs). Previous work indicated that the degree of substrate cleavage by caspase-8 determines whether a cell dies or survives in response to a death stimulus. To determine how a death ligand stimulus is effectively translated into caspase-8 activity, we assessed this activity over time in single cells with compartmentalized probes that are cleaved by caspase-8 and used multiscale modeling to simultaneously describe single-cell and population data with an ensemble of single-cell models. We derived and experimentally validated a minimal model in which cleavage of caspase-8 in the enzymatic domain occurs in an interdimeric manner through interaction between DISCs, whereas prodomain cleavage sites are cleaved in an intradimeric manner within DISCs. Modeling indicated that sustained membrane-bound caspase-8 activity is followed by transient cytosolic activity, which can be interpreted as a molecular timer mechanism reflected by a limited lifetime of active caspase-8. The activation of caspase-8 by combined intra- and interdimeric cleavage ensures weak signaling at low concentrations of CD95L and strongly accelerated activation at higher ligand concentrations, thereby contributing to precise control of apoptosis.</p>\n                    </div>\n                </div>\n            <div class=\"dc:publisher\">      <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n            and identified\nby:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000526\">BIOMD0000000526</a>\n            .        </p>\n                <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\nfor published quantitative kinetic models</a>\n            .        </p>\n                </div>\n            <div class=\"dc:license\">      <p>To the extent possible under law, all copyright and related or\nneighbouring rights to this encoded model have been dedicated to the public\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\nDedication</a>\n            for more information.        </p>\n                </div>', 0, '2020-02-02'),
(759, 2, 'BIOMD541 Yugi2014 - Insulin induced signalling (PFKL phosphorylation) - model 2', '<div class=\"dc:title\">Yugi2014 - Insulin induced signalling (PFKL\nphosphorylation) - model 2</div>\n\n  <p>Insulin induces phosphorylation and activation of liver-type\n  phosphofructokinase 1, which thereby controls a key reaction in\n  glycolysis. This mechanism is revealed using the mathematical\n  model. In this model, the PFKL phosphorylation time courses are\n  calculation from the signalling pathway model developed by Kubata\n  et al. (2012) (\n  <a href=\"http://identifiers.org/biomodels.db/MODEL1204060000\">MODEL1204060000</a>\n  - Kubota2012_InsulinAction_AKTpathway).</p>\n  <p>\n  <b>Author\'s Note:</b> Katsuyuki Yugi thank Akira Funahashi (Keio\n  University, Japan) for his kind advice in converting the model\n  from MATLAB to SBML.</p>\n</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/25131207\" title=\"Access to this publication\">Reconstruction of insulin\n    signal flow from phosphoproteome and metabolome data.</a>\n  </div>\n  <div class=\"bibo:authorList\">Yugi K, Kubota H, Toyoshima Y,\n  Noguchi R, Kawata K, Komori Y, Uda S, Kunida K, Tomizawa Y,\n  Funato Y, Miki H, Matsumoto M, Nakayama KI, Kashikura K, Endo K,\n  Ikeda K, Soga T, Kuroda S.</div>\n  <div class=\"bibo:Journal\">Cell Rep 2014 Aug; 8(4):\n  1171-1183</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Cellular homeostasis is regulated by signals through\n    multiple molecular networks that include protein\n    phosphorylation and metabolites. However, where and when the\n    signal flows through a network and regulates homeostasis has\n    not been explored. We have developed a reconstruction method\n    for the signal flow based on time-course phosphoproteome and\n    metabolome data, using multiple databases, and have applied it\n    to acute action of insulin, an important hormone for metabolic\n    homeostasis. An insulin signal flows through a network, through\n    signaling pathways that involve 13 protein kinases, 26\n    phosphorylated metabolic enzymes, and 35 allosteric effectors,\n    resulting in quantitative changes in 44 metabolites. Analysis\n    of the network reveals that insulin induces phosphorylation and\n    activation of liver-type phosphofructokinase 1, thereby\n    controlling a key reaction in glycolysis. We thus provide a\n    versatile method of reconstruction of signal flow through the\n    network using phosphoproteome and metabolome data.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000541\">BIOMD0000000541</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(760, 2, 'BIOMD546 Miao2010 - Innate and adaptive immune responses to primary Influenza A Virus infection', '<div class=\"dc:title\">Miao2010 - Innate and adaptive immune\nresponses to primary Influenza A Virus infection</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/20410284\" title=\"Access to this publication\">Quantifying the early immune\n    response and adaptive immune response kinetics in mice infected\n    with influenza A virus.</a>\n  </div>\n  <div class=\"bibo:authorList\">Miao H, Hollenbaugh JA, Zand MS,\n  Holden-Wiltse J, Mosmann TR, Perelson AS, Wu H, Topham DJ.</div>\n  <div class=\"bibo:Journal\">J. Virol. 2010 Jul; 84(13):\n  6687-6698</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Seasonal and pandemic influenza A virus (IAV) continues to\n    be a public health threat. However, we lack a detailed and\n    quantitative understanding of the immune response kinetics to\n    IAV infection and which biological parameters most strongly\n    influence infection outcomes. To address these issues, we use\n    modeling approaches combined with experimental data to\n    quantitatively investigate the innate and adaptive immune\n    responses to primary IAV infection. Mathematical models were\n    developed to describe the dynamic interactions between target\n    (epithelial) cells, influenza virus, cytotoxic T lymphocytes\n    (CTLs), and virus-specific IgG and IgM. IAV and immune kinetic\n    parameters were estimated by fitting models to a large data set\n    obtained from primary H3N2 IAV infection of 340 mice. Prior to\n    a detectable virus-specific immune response (before day 5), the\n    estimated half-life of infected epithelial cells is\n    approximately 1.2 days, and the half-life of free infectious\n    IAV is approximately 4 h. During the adaptive immune response\n    (after day 5), the average half-life of infected epithelial\n    cells is approximately 0.5 days, and the average half-life of\n    free infectious virus is approximately 1.8 min. During the\n    adaptive phase, model fitting confirms that CD8(+) CTLs are\n    crucial for limiting infected cells, while virus-specific IgM\n    regulates free IAV levels. This may imply that CD4 T cells and\n    class-switched IgG antibodies are more relevant for generating\n    IAV-specific memory and preventing future infection via a more\n    rapid secondary immune response. Also, simulation studies were\n    performed to understand the relative contributions of\n    biological parameters to IAV clearance. This study provides a\n    basis to better understand and predict influenza virus\n    immunity.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000546\">BIOMD0000000546</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(761, 2, 'BIOMD560 Hui2016 - Age-related changes in articular cartilage', '<div class=\"dc:title\">Hui2014 - Age-related changes in articular\ncartilage</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/doi/doi:%2010.1136/annrheumdis-2014-206295\" title=\"Access to this publication\">Oxidative changes and\n    signalling pathways are pivotal in initiating age-related\n    changes in articular cartilage</a>\n  </div>\n  <div class=\"bibo:authorList\">Wang Hui1, David A Young1, Andrew D\n  Rowan1, Xin Xu2, Tim E Cawston1, Carole J Proctor1,3</div>\n  <div class=\"bibo:Journal\">Annals of the Rheumatic Diseases</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Objective: To use a computational approach to investigate\n    the cellular and extracellular matrix changes that occur with\n    age in the knee joints of mice. Methods: Knee joints from an\n    inbred C57/BL1/6 (ICRFa) mouse colony were harvested at\n    330?months of age. Sections were stained with H&amp;E,\n    Safranin-O, Picro-sirius red and antibodies to matrix\n    metalloproteinase-13 (MMP-13), nitrotyrosine, LC-3B, Bcl-2, and\n    cleaved type II collagen used for immunohistochemistry. Based\n    on this and other data from the literature, a computer\n    simulation model was built using the Systems Biology Markup\n    Language using an iterative approach of data analysis and\n    modelling. Individual parameters were subsequently altered to\n    assess their effect on the model. Results: A progressive loss\n    of cartilage matrix occurred with age. Nitrotyrosine, MMP-13\n    and anaplastic lymphoma kinase (ALK1) staining in cartilage\n    increased with age with a concomitant decrease in LC-3B and\n    Bcl-2. Stochastic simulations from the computational model\n    showed a good agreement with these data, once transforming\n    growth factor-? signalling via ALK1/ALK5 receptors was\n    included. Oxidative stress and the interleukin 1 pathway were\n    identified as key factors in driving the cartilage breakdown\n    associated with ageing. Conclusions: A progressive loss of\n    cartilage matrix and cellularity occurs with age. This is\n    accompanied with increased levels of oxidative stress,\n    apoptosis and MMP-13 and a decrease in chondrocyte autophagy.\n    These changes explain the marked predisposition of joints to\n    develop osteoarthritis with age. Computational modelling\n    provides useful insights into the underlying mechanisms\n    involved in age-related changes in musculoskeletal tissues.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000560\">BIOMD0000000560</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(762, 2, 'BIOMD566 Morris2008 - Fitting protein aggregation data via F-W 2-step mechanism', '<div class=\"dc:title\">Morris2009 - ?-Synuclein aggregation\nvariable temperature and pH</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/19101068\" title=\"Access to this publication\">Alpha-synuclein aggregation\n    variable temperature and variable pH kinetic data: a\n    re-analysis using the Finke-Watzky 2-step model of nucleation\n    and autocatalytic growth.</a>\n  </div>\n  <div class=\"bibo:authorList\">Morris AM, Finke RG.</div>\n  <div class=\"bibo:Journal\">Biophys. Chem. 2009 Mar; 140(1-3):\n  9-15</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>The aggregation of proteins is believed to be intimately\n    connected to many neurodegenerative disorders. We recently\n    reported an \"Ockham\'s razor\"/minimalistic approach to analyze\n    the kinetic data of protein aggregation using the Finke-Watzky\n    (F-W) 2-step model of nucleation (A-->B, rate constant k(1))\n    and autocatalytic growth (A+B-->2B, rate constant k(2)).\n    With that kinetic model we have analyzed 41 representative\n    protein aggregation data sets in two recent publications,\n    including amyloid beta, alpha-synuclein, polyglutamine, and\n    prion proteins (Morris, A. M., et al. (2008) Biochemistry 47,\n    2413-2427; Watzky, M. A., et al. (2008) Biochemistry 47,\n    10790-10800). Herein we use the F-W model to reanalyze protein\n    aggregation kinetic data obtained under the experimental\n    conditions of variable temperature or pH 2.0 to 8.5. We provide\n    the average nucleation (k(1)) and growth (k(2)) rate constants\n    and correlations with variable temperature or varying pH for\n    the protein alpha-synuclein. From the variable temperature\n    data, activation parameters DeltaG(double dagger),\n    DeltaH(double dagger), and DeltaS(double dagger) are provided\n    for nucleation and growth, and those values are compared to the\n    available parameters reported in the previous literature\n    determined using an empirical method. Our activation parameters\n    suggest that nucleation and growth are energetically similar\n    for alpha-synuclein aggregation (DeltaG(double\n    dagger)(nucleation)=23(3) kcal/mol; DeltaG(double\n    dagger)(growth)=22(1) kcal/mol at 37 degrees C). From the\n    variable pH data, the F-W analyses show a maximal k(1) value at\n    pH approximately 3, as well as minimal k(1) near the\n    isoelectric point (pI) of alpha-synuclein. Since solubility and\n    net charge are minimized at the pI, either or both of these\n    factors may be important in determining the kinetics of the\n    nucleation step. On the other hand, the k(2) values increase\n    with decreasing pH (i.e., do not appear to have a minimum or\n    maximum near the pI) which, when combined with the k(1) vs. pH\n    (and pI) data, suggest that solubility and charge are less\n    important factors for growth, and that charge is important in\n    the k(1), nucleation step of alpha-synuclein. The chemically\n    well-defined nucleation (k(1)) rate constants obtained from the\n    F-W analysis are, as expected, different than the 1/lag-time\n    empirical constants previously obtained. However, k(2)x[A](0)\n    (where k(2) is the rate constant for autocatalytic growth and\n    [A](0) is the initial protein concentration) is related to the\n    empirical constant, k(app) obtained previously. Overall, the\n    average nucleation and average growth rate constants for\n    alpha-synuclein aggregation as a function of pH and variable\n    temperature have been quantitated. Those values support the\n    previously suggested formation of a partially folded\n    intermediate that promotes aggregation under high temperature\n    or acidic conditions.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000566\">BIOMD0000000566</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(763, 2, 'BIOMD567 Morris2009 - ?-Synuclein aggregation variable temperature and pH', '<div class=\"dc:title\">Morris2008 - Fitting protein aggregation data\nvia F-W 2-step mechanism</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/18247636\" title=\"Access to this publication\">Fitting neurological protein\n    aggregation kinetic data via a 2-step, minimal/\"Ockham\'s razor\"\n    model: the Finke-Watzky mechanism of nucleation followed by\n    autocatalytic surface growth.</a>\n  </div>\n  <div class=\"bibo:authorList\">Morris AM, Watzky MA, Agar JN, Finke\n  RG.</div>\n  <div class=\"bibo:Journal\">Biochemistry 2008 Feb; 47(8):\n  2413-2427</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>The aggregation of proteins has been hypothesized to be an\n    underlying cause of many neurological disorders including\n    Alzheimer\'s, Parkinson\'s, and Huntington\'s diseases; protein\n    aggregation is also important to normal life function in cases\n    such as G to F-actin, glutamate dehydrogenase, and tubulin and\n    flagella formation. For this reason, the underlying mechanism\n    of protein aggregation, and accompanying kinetic models for\n    protein nucleation and growth (growth also being called\n    elongation, polymerization, or fibrillation in the literature),\n    have been investigated for more than 50 years. As a way to\n    concisely present the key prior literature in the protein\n    aggregation area, Table 1 in the main text summarizes 23 papers\n    by 10 groups of authors that provide 5 basic classes of\n    mechanisms for protein aggregation over the period from 1959 to\n    2007. However, and despite this major prior effort, still\n    lacking are both (i) anything approaching a consensus mechanism\n    (or mechanisms), and (ii) a generally useful, and thus widely\n    used, simplest/\"Ockham\'s razor\" kinetic model and associated\n    equations that can be routinely employed to analyze a broader\n    range of protein aggregation kinetic data. Herein we\n    demonstrate that the 1997 Finke-Watzky (F-W) 2-step mechanism\n    of slow continuous nucleation, A --> B (rate constant k1),\n    followed by typically fast, autocatalytic surface growth, A + B\n    --> 2B (rate constant k2), is able to quantitatively account\n    for the kinetic curves from all 14 representative data sets of\n    neurological protein aggregation found by a literature search\n    (the prion literature was largely excluded for the purposes of\n    this study in order provide some limit to the resultant\n    literature that was covered). The F-W model is able to\n    deconvolute the desired nucleation, k1, and growth, k2, rate\n    constants from those 14 data sets obtained by four different\n    physical methods, for three different proteins, and in nine\n    different labs. The fits are generally good, and in many cases\n    excellent, with R2 values >or=0.98 in all cases. As such,\n    this contribution is the current record of the widest set of\n    protein aggregation data best fit by what is also the simplest\n    model offered to date. Also provided is the mathematical\n    connection between the 1997 F-W 2-step mechanism and the 2000\n    3-step mechanism proposed by Sait and co-workers. In\n    particular, the kinetic equation for Sait\'s 3-step\n    mechanism is shown to be mathematically identical to the\n    earlier, 1997 2-step F-W mechanism under the 3 simplifying\n    assumptions Sait and co-workers used to derive their\n    kinetic equation. A list of the 3 main caveats/limitations of\n    the F-W kinetic model is provided, followed by the main\n    conclusions from this study as well as some needed future\n    experiments.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000567\">BIOMD0000000567</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
