(765, 2, 'BIOMD602 Stavrum2013 - Tryptophan Metabolism in Liver', '<div class=\"dc:title\">Stavrum2013 - Tryptophan Metabolism in\nLiver</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/24129579\" title=\"Access to this publication\">Model of tryptophan\n    metabolism, readily scalable using tissue-specific gene\n    expression data.</a>\n  </div>\n  <div class=\"bibo:authorList\">Stavrum AK, Heiland I, Schuster S,\n  Puntervoll P, Ziegler M.</div>\n  <div class=\"bibo:Journal\">J. Biol. Chem. 2013 Nov; 288(48):\n  34555-34566</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Tryptophan is utilized in various metabolic routes including\n    protein synthesis, serotonin, and melatonin synthesis and the\n    kynurenine pathway. Perturbations in these pathways have been\n    associated with neurodegenerative diseases and cancer. Here we\n    present a comprehensive kinetic model of the complex network of\n    human tryptophan metabolism based upon existing kinetic data\n    for all enzymatic conversions and transporters. By integrating\n    tissue-specific expression data, modeling tryptophan metabolism\n    in liver and brain returned intermediate metabolite\n    concentrations in the physiological range. Sensitivity and\n    metabolic control analyses identified expected key enzymes to\n    govern fluxes in the branches of the network. Combining\n    tissue-specific models revealed a considerable impact of the\n    kynurenine pathway in liver on the concentrations of\n    neuroactive derivatives in the brain. Moreover, using\n    expression data from a cancer study predicted metabolite\n    changes that resembled the experimental observations. We\n    conclude that the combination of the kinetic model with\n    expression data represents a powerful diagnostic tool to\n    predict alterations in tryptophan metabolism. The model is\n    readily scalable to include more tissues, thereby enabling\n    assessment of organismal tryptophan metabolism in health and\n    disease.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on\n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by:\n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000602\">BIOMD0000000602</a>.</p>\n  <p>To cite BioModels Database, please use:\n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to\n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(766, 2, 'BIOMD612 Proctor2016 - Circadian rhythm of PTH and the dynamics of signaling molecules on bone remodeling', '<div class=\"dc:title\">Proctor2016 - Circadian rhythm of PTH and the\ndynamics of signaling molecules on bone remodeling</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/27379013\" title=\"Access to this publication\">Simulated Interventions to\n    Ameliorate Age-Related Bone Loss Indicate the Importance of\n    Timing.</a>\n  </div>\n  <div class=\"bibo:authorList\">Proctor CJ, Gartland A.</div>\n  <div class=\"bibo:Journal\">Front Endocrinol (Lausanne) 2016; 7:\n  61</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Bone remodeling is the continuous process of bone resorption\n    by osteoclasts and bone formation by osteoblasts, in order to\n    maintain homeostasis. The activity of osteoclasts and\n    osteoblasts is regulated by a network of signaling pathways,\n    including Wnt, parathyroid hormone (PTH), RANK\n    ligand/osteoprotegrin, and TGF-?, in response to stimuli, such\n    as mechanical loading. During aging there is a gradual loss of\n    bone mass due to dysregulation of signaling pathways. This may\n    be due to a decline in physical activity with age and/or\n    changes in hormones and other signaling molecules. In\n    particular, hormones, such as PTH, have a circadian rhythm,\n    which may be disrupted in aging. Due to the complexity of the\n    molecular and cellular networks involved in bone remodeling,\n    several mathematical models have been proposed to aid\n    understanding of the processes involved. However, to date,\n    there are no models, which explicitly consider the effects of\n    mechanical loading, the circadian rhythm of PTH, and the\n    dynamics of signaling molecules on bone remodeling. Therefore,\n    we have constructed a network model of the system using a\n    modular approach, which will allow further modifications as\n    required in future research. The model was used to simulate the\n    effects of mechanical loading and also the effects of different\n    interventions, such as continuous or intermittent\n    administration of PTH. Our model predicts that the absence of\n    regular mechanical loading and/or an impaired PTH circadian\n    rhythm leads to a gradual decrease in bone mass over time,\n    which can be restored by simulated interventions and that the\n    effectiveness of some interventions may depend on their\n    timing.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000612\">BIOMD0000000612</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02');
