(767, 2, 'BIOMD634 Proctor2013 - Effect of A? immunisation in Alzheimer\'s disease (stochastic version)', '<div class=\"dc:title\">Proctor2013 - Effect of A? immunisation\nin Alzheimer\'s disease (stochastic version)</div>\nExtension of a previously published\nstochastic model (designed to examine some of the key pathways\ninvolved in the aggregation of amyloid-beta (A\n<span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small;\">?)</span>and\nthe micro-tubular binding protein tau (\n<a href=\"http://identifiers.org/biomodels.db/BIOMD0000000286\">BIOMD0000000286</a>,\n\n<a href=\"http://identifiers.org/biomodels.db/BIOMD0000000462\">BIOMD0000000462</a>))\nto include the main processes involved in passive and active\nimmunisation against A\n<span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small;\">?</span>\nand then to demonstrate the effects of this intervention on soluble\nA\n<span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: small;\">?.</span>This\nis the stochastic version of the model, the deterministic version\nis \n<a href=\"http://identifiers.org/biomodels.db/BIOMD0000000488\">BIOMD0000000488</a>.</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/24098635\" title=\"Access to this publication\">Investigating interventions\n    in Alzheimer\'s disease with computer simulation models.</a>\n  </div>\n  <div class=\"bibo:authorList\">Proctor CJ, Boche D, Gray DA, Nicoll\n  JA.</div>\n  <div class=\"bibo:Journal\">PLoS ONE 2013; 8(9): e73631</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Progress in the development of therapeutic interventions to\n    treat or slow the progression of Alzheimer\'s disease has been\n    hampered by lack of efficacy and unforeseen side effects in\n    human clinical trials. This setback highlights the need for new\n    approaches for pre-clinical testing of possible interventions.\n    Systems modelling is becoming increasingly recognised as a\n    valuable tool for investigating molecular and cellular\n    mechanisms involved in ageing and age-related diseases.\n    However, there is still a lack of awareness of modelling\n    approaches in many areas of biomedical research. We previously\n    developed a stochastic computer model to examine some of the\n    key pathways involved in the aggregation of amyloid-beta (A?)\n    and the micro-tubular binding protein tau. Here we show how we\n    extended this model to include the main processes involved in\n    passive and active immunisation against A? and then demonstrate\n    the effects of this intervention on soluble A?, plaques,\n    phosphorylated tau and tangles. The model predicts that\n    immunisation leads to clearance of plaques but only results in\n    small reductions in levels of soluble A?, phosphorylated tau\n    and tangles. The behaviour of this model is supported by\n    neuropathological observations in Alzheimer patients immunised\n    against A?. Since, soluble A?, phosphorylated tau and tangles\n    more closely correlate with cognitive decline than plaques, our\n    model suggests that immunotherapy against A? may not be\n    effective unless it is performed very early in the disease\n    process or combined with other therapies.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000634\">BIOMD0000000634</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(768, 2, 'BIOMD635 Nair2015 - Interaction between neuromodulators via GPCRs - Effect on cAMP/PKA signaling (D1 Neuron)', '<div class=\"dc:title\">Nair2015 - Interaction between\nneuromodulators via GPCRs - Effect on cAMP/PKA signaling (D1\nNeuron)</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/26468202\" title=\"Access to this publication\">Sensing Positive versus\n    Negative Reward Signals through Adenylyl Cyclase-Coupled GPCRs\n    in Direct and Indirect Pathway Striatal Medium Spiny\n    Neurons.</a>\n  </div>\n  <div class=\"bibo:authorList\">Nair AG, Gutierrez-Arenas O,\n  Eriksson O, Vincent P, Hellgren Kotaleski J.</div>\n  <div class=\"bibo:Journal\">J. Neurosci. 2015 Oct; 35(41):\n  14017-14030</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Transient changes in striatal dopamine (DA) concentration\n    are considered to encode a reward prediction error (RPE) in\n    reinforcement learning tasks. Often, a phasic DA change occurs\n    concomitantly with a dip in striatal acetylcholine (ACh),\n    whereas other neuromodulators, such as adenosine (Adn), change\n    slowly. There are abundant adenylyl cyclase (AC) coupled GPCRs\n    for these neuromodulators in striatal medium spiny neurons\n    (MSNs), which play important roles in plasticity. However,\n    little is known about the interaction between these\n    neuromodulators via GPCRs. The interaction between these\n    transient neuromodulator changes and the effect on cAMP/PKA\n    signaling via Golf- and Gi/o-coupled GPCR are studied here\n    using quantitative kinetic modeling. The simulations suggest\n    that, under basal conditions, cAMP/PKA signaling could be\n    significantly inhibited in D1R+ MSNs via ACh/M4R/Gi/o and an\n    ACh dip is required to gate a subset of D1R/Golf-dependent PKA\n    activation. Furthermore, the interaction between ACh dip and DA\n    peak, via D1R and M4R, is synergistic. In a similar fashion,\n    PKA signaling in D2+ MSNs is under basal inhibition via\n    D2R/Gi/o and a DA dip leads to a PKA increase by disinhibiting\n    A2aR/Golf, but D2+ MSNs could also respond to the DA peak via\n    other intracellular pathways. This study highlights the\n    similarity between the two types of MSNs in terms of high basal\n    AC inhibition by Gi/o and the importance of interactions\n    between Gi/o and Golf signaling, but at the same time predicts\n    differences between them with regard to the sign of RPE\n    responsible for PKA activation.Dopamine transients are\n    considered to carry reward-related signal in reinforcement\n    learning. An increase in dopamine concentration is associated\n    with an unexpected reward or salient stimuli, whereas a\n    decrease is produced by omission of an expected reward. Often\n    dopamine transients are accompanied by other neuromodulatory\n    signals, such as acetylcholine and adenosine. We highlight the\n    importance of interaction between acetylcholine, dopamine, and\n    adenosine signals via adenylyl-cyclase coupled GPCRs in shaping\n    the dopamine-dependent cAMP/PKA signaling in striatal neurons.\n    Specifically, a dopamine peak and an acetylcholine dip must\n    interact, via D1 and M4 receptor, and a dopamine dip must\n    interact with adenosine tone, via D2 and A2a receptor, in\n    direct and indirect pathway neurons, respectively, to have any\n    significant downstream PKA activation.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000635\">BIOMD0000000635</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(769, 2, 'BIOMD636 Nair2015 - Interaction between neuromodulators via GPCRs - Effect on cAMP/PKA signaling (D2 Neuron)', '<div class=\"dc:title\">Nair2015 - Interaction between\nneuromodulators via GPCRs - Effect on cAMP/PKA signaling (D2\nNeuron)</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/26468202\" title=\"Access to this publication\">Sensing Positive versus\n    Negative Reward Signals through Adenylyl Cyclase-Coupled GPCRs\n    in Direct and Indirect Pathway Striatal Medium Spiny\n    Neurons.</a>\n  </div>\n  <div class=\"bibo:authorList\">Nair AG, Gutierrez-Arenas O,\n  Eriksson O, Vincent P, Hellgren Kotaleski J.</div>\n  <div class=\"bibo:Journal\">J. Neurosci. 2015 Oct; 35(41):\n  14017-14030</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>Transient changes in striatal dopamine (DA) concentration\n    are considered to encode a reward prediction error (RPE) in\n    reinforcement learning tasks. Often, a phasic DA change occurs\n    concomitantly with a dip in striatal acetylcholine (ACh),\n    whereas other neuromodulators, such as adenosine (Adn), change\n    slowly. There are abundant adenylyl cyclase (AC) coupled GPCRs\n    for these neuromodulators in striatal medium spiny neurons\n    (MSNs), which play important roles in plasticity. However,\n    little is known about the interaction between these\n    neuromodulators via GPCRs. The interaction between these\n    transient neuromodulator changes and the effect on cAMP/PKA\n    signaling via Golf- and Gi/o-coupled GPCR are studied here\n    using quantitative kinetic modeling. The simulations suggest\n    that, under basal conditions, cAMP/PKA signaling could be\n    significantly inhibited in D1R+ MSNs via ACh/M4R/Gi/o and an\n    ACh dip is required to gate a subset of D1R/Golf-dependent PKA\n    activation. Furthermore, the interaction between ACh dip and DA\n    peak, via D1R and M4R, is synergistic. In a similar fashion,\n    PKA signaling in D2+ MSNs is under basal inhibition via\n    D2R/Gi/o and a DA dip leads to a PKA increase by disinhibiting\n    A2aR/Golf, but D2+ MSNs could also respond to the DA peak via\n    other intracellular pathways. This study highlights the\n    similarity between the two types of MSNs in terms of high basal\n    AC inhibition by Gi/o and the importance of interactions\n    between Gi/o and Golf signaling, but at the same time predicts\n    differences between them with regard to the sign of RPE\n    responsible for PKA activation.Dopamine transients are\n    considered to carry reward-related signal in reinforcement\n    learning. An increase in dopamine concentration is associated\n    with an unexpected reward or salient stimuli, whereas a\n    decrease is produced by omission of an expected reward. Often\n    dopamine transients are accompanied by other neuromodulatory\n    signals, such as acetylcholine and adenosine. We highlight the\n    importance of interaction between acetylcholine, dopamine, and\n    adenosine signals via adenylyl-cyclase coupled GPCRs in shaping\n    the dopamine-dependent cAMP/PKA signaling in striatal neurons.\n    Specifically, a dopamine peak and an acetylcholine dip must\n    interact, via D1 and M4 receptor, and a dopamine dip must\n    interact with adenosine tone, via D2 and A2a receptor, in\n    direct and indirect pathway neurons, respectively, to have any\n    significant downstream PKA activation.</p>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000636\">BIOMD0000000636</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(770, 2, 'BIOMD637 Bush2016 - Simplified Carrousel model of GPCR', '<div class=\"dc:title\">Bush2016 - Simplified Carrousel model of\nGPCR</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/28034910\" title=\"Access to this publication\">Yeast GPCR signaling\n    reflects the fraction of occupied receptors, not the\n    number.</a>\n  </div>\n  <div class=\"bibo:authorList\">Bush A, Vasen G, Constantinou A,\n  Dunayevich P, Patop IL, Blaustein M, Colman-Lerner A.</div>\n  <div class=\"bibo:Journal\">Mol. Syst. Biol. 2016 Dec; 12(12):\n  898</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>According to receptor theory, the effect of a ligand depends\n    on the amount of agonist-receptor complex. Therefore, changes\n    in receptor abundance should have quantitative effects.\n    However, the response to pheromone in Saccharomyces cerevisiae\n    is robust (unaltered) to increases or reductions in the\n    abundance of the G-protein-coupled receptor (GPCR), Ste2,\n    responding instead to the fraction of occupied receptor. We\n    found experimentally that this robustness originates during\n    G-protein activation. We developed a complete mathematical\n    model of this step, which suggested the ability to compute\n    fractional occupancy depends on the physical interaction\n    between the inhibitory regulator of G-protein signaling (RGS),\n    Sst2, and the receptor. Accordingly, replacing Sst2 by the\n    heterologous hsRGS4, incapable of interacting with the\n    receptor, abolished robustness. Conversely, forcing hsRGS4:Ste2\n    interaction restored robustness. Taken together with other\n    results of our work, we conclude that this GPCR pathway\n    computes fractional occupancy because ligand-bound GPCR-RGS\n    complexes stimulate signaling while unoccupied complexes\n    actively inhibit it. In eukaryotes, many RGSs bind to specific\n    GPCRs, suggesting these complexes with opposing activities also\n    detect fraction occupancy by a ratiometric measurement. Such\n    complexes operate as push-pull devices, which we have recently\n    described.</p>\n  </div>\n</div>\n<div class=\"bm:curation\">\n  <p style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; font-size: 11px; line-height: normal; font-family: Menlo; color: rgb(0, 0, 0);\">\n    <br/>\n  </p>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000637\">BIOMD0000000637</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
(771, 2, 'BIOMD638 Bush2016 - Extended Carrousel model of GPCR-RGS', '<div class=\"dc:title\">Bush2016 - Extended Carrousel model of\nGPCR-RGS</div>\n<div class=\"dc:bibliographicCitation\">\n  <p>This model is described in the article:</p>\n  <div class=\"bibo:title\">\n    <a href=\"http://identifiers.org/pubmed/28034910\" title=\"Access to this publication\">Yeast GPCR signaling\n    reflects the fraction of occupied receptors, not the\n    number.</a>\n  </div>\n  <div class=\"bibo:authorList\">Bush A, Vasen G, Constantinou A,\n  Dunayevich P, Patop IL, Blaustein M, Colman-Lerner A.</div>\n  <div class=\"bibo:Journal\">Mol. Syst. Biol. 2016 Dec; 12(12):\n  898</div>\n  <p>Abstract:</p>\n  <div class=\"bibo:abstract\">\n    <p>According to receptor theory, the effect of a ligand depends\n    on the amount of agonist-receptor complex. Therefore, changes\n    in receptor abundance should have quantitative effects.\n    However, the response to pheromone in Saccharomyces cerevisiae\n    is robust (unaltered) to increases or reductions in the\n    abundance of the G-protein-coupled receptor (GPCR), Ste2,\n    responding instead to the fraction of occupied receptor. We\n    found experimentally that this robustness originates during\n    G-protein activation. We developed a complete mathematical\n    model of this step, which suggested the ability to compute\n    fractional occupancy depends on the physical interaction\n    between the inhibitory regulator of G-protein signaling (RGS),\n    Sst2, and the receptor. Accordingly, replacing Sst2 by the\n    heterologous hsRGS4, incapable of interacting with the\n    receptor, abolished robustness. Conversely, forcing hsRGS4:Ste2\n    interaction restored robustness. Taken together with other\n    results of our work, we conclude that this GPCR pathway\n    computes fractional occupancy because ligand-bound GPCR-RGS\n    complexes stimulate signaling while unoccupied complexes\n    actively inhibit it. In eukaryotes, many RGSs bind to specific\n    GPCRs, suggesting these complexes with opposing activities also\n    detect fraction occupancy by a ratiometric measurement. Such\n    complexes operate as push-pull devices, which we have recently\n    described.</p>\n  </div>\n</div>\n<div class=\"bm:curation\">\n  <div>\n    <br/>\n  </div>\n</div>\n<div class=\"dc:publisher\">\n  <p>This model is hosted on \n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\n  and identified by: \n  <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000638\">BIOMD0000000638</a>.</p>\n  <p>To cite BioModels Database, please use: \n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\n  An enhanced, curated and annotated resource for published\n  quantitative kinetic models</a>.</p>\n</div>\n<div class=\"dc:license\">\n  <p>To the extent possible under law, all copyright and related or\n  neighbouring rights to this encoded model have been dedicated to\n  the public domain worldwide. Please refer to \n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\n  Public Domain Dedication</a> for more information.</p>\n</div>', 0, '2020-02-02'),
